(1, 'Se enciende caldera 1 a las 7:00 según los programado ', '2022-03-05 09:58:22', 'Luis Pérez (Técnico de Instrumentación)', 46, 'Observación Normal'),
(2, 'Debido a problemas que presento el tablero anteriormente, según lo informado por Benjamín Toloza los dos automáticos generales quedan deshabilitado esta orden fue dada por Gustavo Loira. \r\nEsto conlleva tener desenergizado los equipos correspondientes al casetón N°2.', '2022-03-05 10:54:19', 'Abel Torres (Técnico de Instrumentación)', 97, 'Observación Normal'),
(3, 'Debido al problema sucedido con el tablero H3T que se encuentra sin energía, las manejadoras de aire perteneciente al casetón N°2 quedaron con su paco de seguridad deshabilitado hasta que se pueda restablecer la energía en el tablero.', '2022-03-05 11:12:29', 'Abel Torres (Técnico de Instrumentación)', 100, 'Observación Normal'),
