(1293, 'Se apaga caldera según lo acordado, debido a que se tiene que hacer cambio con caldera N°2, Alexi Jara ordeno realizar el cambio.', '2022-04-08 07:18:56', 'Abel Torres (Técnico de Instrumentación)', 50, 'Forzado - Apagado'),
(1294, 'Se enciende caldera N°2 según lo programado, Alexi Jara del departamento de Climatización ordena el encendido.', '2022-04-08 07:19:27', 'Abel Torres (Técnico de Instrumentación)', 47, 'Observación Normal'),
(1295, 'Se fuerza el encendido de caldera por orden de Alexi Jara técnico del departamento clima, esta acción se realiza según lo programado por el equipo.', '2022-04-08 07:20:11', 'Abel Torres (Técnico de Instrumentación)', 46, 'Forzado - Encendido'),
(1296, 'Javier Beltrán solicita el encendido de caldera 1 a las 6:30 hrs y detener a las 9:00 hrs. Orden permanente  ', '2022-04-08 09:00:10', 'Luis Pérez (Técnico de Instrumentación)', 46, 'Observación Normal'),
(1297, 'Se fuerza apagado de inyección por solicitud de Javier Beltrán, ya que se encuentra un aroma a humo en el exterior el cual estaba siendo ingresado a los recintos.', '2022-04-08 09:56:46', 'Luis Pérez (Técnico de Instrumentación)', 241, 'Forzado - Apagado'),
(1298, 'Se vuelve a la normalidad luego de forzado del VIN, ya que en el exterior se encontraba un aroma a humo el cual estaba siendo inyectado desde el exterior hasta el interior de los recintos ', '2022-04-08 11:00:31', 'Luis Pérez (Técnico de Instrumentación)', 241, 'Observación Normal'),
(1299, 'Se vuelve a la normalidad luego de forzado apagado del VIN, ya que en el exterior se encontraba un aroma a humo el cual estaba siendo inyectado desde el exterior hasta el interior de los recintos.\r\ncabe señalar que la única variable forzada en la UMA es la modulación del VIN al 80% y según el conocimiento que tengo, este forzado se debe que en el display del VIN se mostraba alarma de sobre corriente ', '2022-04-08 11:16:34', 'Luis Pérez (Técnico de Instrumentación)', 242, 'Observación Normal'),
(1300, 'Se detiene el equipo por orden de Javier Beltrán.', '2022-04-08 10:21:12', 'Luis Pérez (Técnico de Instrumentación)', 1, 'Forzado - Apagado'),
(1301, 'Se enciende equipo por solicitud de Javier Beltrán a las 10:22', '2022-04-08 11:27:17', 'Luis Pérez (Técnico de Instrumentación)', 2, 'Forzado - Encendido'),
(1302, 'Se detiene caldera a las 10:45 por solicitud de Lizandro Varela, ya que la temperatura exterior aun era demasiado fría.', '2022-04-08 11:29:28', 'Luis Pérez (Técnico de Instrumentación)', 46, 'Forzado - Apagado'),
(1303, 'Se enciende equipo de acuerdo a lo hablado con jefatura Lizandro Varela, ya que la temperatura exterior era demasiado fría para encenderla durante la mañana (encendido 10:47)', '2022-04-08 11:32:35', 'Luis Pérez (Técnico de Instrumentación)', 233, 'Forzado - Encendido'),
(1304, 'Se vuelve a la normalidad luego de forzado apagado del VIN, ya que en el exterior se encontraba un aroma a humo el cual estaba siendo inyectado desde el exterior hasta el interior de los recintos.', '2022-04-08 11:33:28', 'Luis Pérez (Técnico de Instrumentación)', 261, 'Observación Normal'),
(1305, 'Se vuelve a la normalidad luego de forzado apagado del VIN, ya que en el exterior se encontraba un aroma a humo el cual estaba siendo inyectado desde el exterior hasta el interior de los recintos.', '2022-04-08 11:33:43', 'Luis Pérez (Técnico de Instrumentación)', 265, 'Observación Normal'),
(1306, 'Se vuelve a la normalidad luego de forzado apagado del VIN, ya que en el exterior se encontraba un aroma a humo el cual estaba siendo inyectado desde el exterior hasta el interior de los recintos.', '2022-04-08 11:37:13', 'Luis Pérez (Técnico de Instrumentación)', 264, 'Observación Normal'),
(1307, 'Se vuelve a la normalidad luego de forzarlas a apagado, ya que en el exterior se encontraba un aroma a humo el cual estaba siendo inyectado desde el exterior hasta el interior de los recintos.', '2022-04-08 11:39:55', 'Luis Pérez (Técnico de Instrumentación)', 104, 'Observación Normal'),
