(1353, 'Durante la rutina de visualización por las pantallas grafica del sistema BMS, se percato de una alarma en la bomba de riego, la cual se le pidió a Alexi Jara técnico de turno del departamento de climatización si el podía dirigirse al lugar y verificar en terreno la situación de las bombas, en lo que informo sobre una alarma de bajo nivel en el estanque (se verifico directamente el nivel en el estanque y claramente era lo que se reflejaba en el tablero), también se percato que estaba en funcionamiento una válvula del sistema (según lo que salía en el tablero de riego).\nEsta es toda la información que se pudo rescatar según control centralizado y el departamento de climatización que visualizo el tablero que estaba en terreno, se le dará aviso a los encargados para verificar la causas de la alarma.', '2022-04-10 11:50:32', 'Abel Torres (Técnico de Instrumentación)', 414, 'Observación Normal'),
