(1599, 'Válvula de calor, estaba siempre al 100% en terreno y no respondía a BMS, de forma manual se dejaba en 0% y volvía  al 100% y se cortó el paso del agua caliente de la UMA y la válvula automática paso a 0% , se abrió el paso de agua caliente y se mantuvo en 0%, se forzó la válvula desde BMS al 100% y respondió correctamente pero luego no respondió a la orden de cerrarse al 0% desde el BMS, se cerró nuevamente el paso de agua caliente en terreno y automáticamente bajo a 0%.\r\nActualmente la UMA se encuentra funcionando automáticamente.\r\nNO MANIPULAR VALVULA DE CALOR DESDE EL BMS.', '2022-04-19 04:35:24', 'Shai Santibañez (Técnico de Instrumentación)', 211, 'Modo Automatico'),
(1600, 'se dejo su VIN al 75% y el VEX al 100% ya que con estos valores los recintos tienen una correcta extracción y inyección, esto se hizo en coordinación con Claudio Cárcamo en terreno.', '2022-04-19 04:36:10', 'Shai Santibañez (Técnico de Instrumentación)', 211, 'Forzado - Variables'),
