(2345, 'Se deja forzado la modulación del VIN por ordenes de Alexi Jara técnico del departamento de climatización, \r\nesta decisión fue tomada ya que se tenia que regular el flujo en los pasillos de administración (Piso 1 / sector G), se tuvo que realizar un ajuste desde la UMA; ya que el flujo era demasiado en los difusores de inyección y en terreno no se podían regular como corresponden; cabe mencionar que al tener un flujo mayor esto producía un ruido muy molesto. Como solución se realizaron los cambios en los parámetros a raíz de esto el sonido pudo disminuir y la cantidad de pascales que entrega los difusores de inyección se redujo un poco, pero estos parámetros cambiados son momentáneo hasta encontrar una mejor solución.', '2022-05-02 07:18:00', 'Abel Torres (Técnico de Instrumentación)', 242, 'Forzado - Variables'),
