(2473, '10:55hrs Se confirma alarma de incendio en sector SAMU, se trata de un  detector de humo ubicado en residencia M-2-31, dicha alarma seria o se categorizaría como falsa alarma.\r\nEste se alarma debido a que personal de SACYR se encontraba trabajando en el sector.\r\nEste modulo o detector de humo se dejaría desactivado, para que personal pueda seguir trabajando sin problemas ni confusiones.\r\nCabe recalcar, que en pantalla BMS indica un sector el cual no seria y estaría erróneo, siendo este el S01.11.', '2022-05-05 19:03:46', 'Eduardo Muñoz Vera (Técnico de Instrumentación)', 479, 'Observación Normal'),
(2474, 'Al revisar la pantalla grafica de iluminación en el piso 7, se noto que el alumbrado general estaba deshabilitado, la cual se procedió a informarle al eléctrico Benjamín Toloza, según la información entrega fue que el magnetotérmico se encontraba caído, la cual procedió a habilitarlo y dejarlo operativo.', '2022-05-05 22:39:35', 'Abel Torres (Técnico de Instrumentación)', 480, 'Observación Normal'),
