(3218, 'Se fuerza el encendido del equipo por ordenes de Matías Gutiérrez profesional de apoyo del departamento industrial, esto seria para bajar el nivel del estanque.', '2022-06-13 14:49:26', 'Abel Torres (Técnico de Instrumentación)', 470, 'Forzado - Encendido'),
(3219, 'Se deja apagado desde control el circuito A14 de iluminación Exterior 2, debido a conexión tránsfuga tomada a un foco exterior (alumbrado de jardín) por parte de guardias ubicados en la caseta del portón 2, esta orden fue dada por parte de Benjamín Toloza técnico de turno del departamento eléctrico, la cual ya habia comentado la situación y esa conexión no debería de estar.', '2022-06-13 16:18:53', 'Administracion SDO (Administrador)', 519, 'Observación Normal'),
(3220, 'Gustavo Loira jefe del departamento eléctrico, informo que la debido a que la empresa Depperk termino de realizar el mantenimiento en el generador quedando en modo automático y sin alarma.', '2022-06-13 16:46:30', 'Abel Torres (Técnico de Instrumentación)', 395, 'Observación Normal'),
(3221, 'Se fuerza el apagado de equipo por ordenes de Alexis Jara técnico del departamento de climatizacion, este apagado fue tardío debido a que la temperatura de paneles solare no alcanzo a llegar a su set point adecuado.', '2022-06-13 19:38:04', 'Abel Torres (Técnico de Instrumentación)', 46, 'Forzado - Apagado'),
(3222, 'Se fuerza el apagado del sistema de riego, esto fue debido a que Alexis Jara técnico del departamento de climatizacion informo sobre una ruptura de un aspersor cerca de sala de bomba, infraestructura esta al tanto de su situación.', '2022-06-13 20:10:38', 'Abel Torres (Técnico de Instrumentación)', 470, 'Forzado - Apagado'),
