INSERT INTO `observaciones_solicitudes` (`idObservaSolicitudes`, `detalleObservaSolicitudes`, `fechaObservaSolicitudes`, `tipoObservaSolicitudes`, `creadorObservaSolicitudes`, `idSolicitud`) VALUES
(1, 'Se genera Solicitud de Soporte con Folio N° \" SS-1-132549 \" para Departamento de Instrumentación con Categoria \" Otro (Especificar en Detalle) \" y con el siguiente detalle: \n\nEstimado.\r\n\r\nFavor de indicar a quien estimes conveniente, la siguiente información respecto a solicitud de adecuación estructurar 97-M, enviada y aprobada por  Pía Escobar que detalla:\r\n\r\n\"Se solicita en bodega de equipos P-5-21 desactivar y modificar puerta de acceso con huella a puerta libre acceso. Eliminar control de huella e imán, para que la puerta se pueda manipular sin problemas. Esto es necesario debido a que será adaptada a una sala de atención de recién nacidos.\"\r\n\r\nHago llegar por correo la adecuación. \r\n\r\n\r\n\r\n', '2022-07-05 15:30:02', 'Creación de Solicitud de Soporte', 'Jorge Cantillano', 1),
(2, 'Se ha asignado a Lizandro Varela (Jefe del Departamento) de Instrumentación para Revisión de esta Solicitud', '2022-07-05 15:31:03', 'Asignación de Personal', 'Alejandro Cantillano (Administrador)', 1),
(3, 'Lizandro Varela ( Jefe de Instrumentación ) ha finalizado la Solicitud de Soporte # SS-1-132549 .', '2022-08-23 14:30:38', 'Finalización de Solicitud', 'Lizandro Varela ( Jefe de Instrumentación )', 1);
INSERT INTO `ordenes_trabajos` (`idOrden`, `folioOrden`, `nomOrden`, `fechaOrden`, `nomSolicitante`, `nomTecnicoRecepcionador`, `idDepartamento`, `idSubDepartamento`, `servicioOrden`, `recintoOrden`, `pmaOrden`, `coordenadasOrden`, `detalleTrabajo`, `comentariosTrabajos`, `recepcionistaOrden`, `ejecutorOrden`, `autorizadorOrden`) VALUES
(1, 'HBQP-OT-I-1', 'Orden de Trabajo: HBQP-OT-I-1 - 23-02-2022', '2022-02-23 11:58:55', 'Constanza Olavarría', 'Shai Santibañez', 1, 0, 12, 'Oficina Control de Gestión', 'G-1-55', 'EF/19-20', 'Se realiza charla para responder dudas sobre el control de acceso al personal de la unidad gestión de la información', 'Charla realizada con éxito y sin problemas ya que todas las personas aclararon sus dudas', 'Constanza Olavarría (Gestión de la información)', 'Shai Santibañez (Control Centralizado)', 'Isaac Pérez (Control Centralizado)'),
(2, 'HBQP-OT-I-2', 'Orden de Trabajo: HBQP-OT-I-2 - 23-02-2022', '2022-02-23 12:11:59', 'María Paz Ojeda', 'Shai Santibañez', 1, 0, 12, 'Oficina Control de Gestión', 'G-1-55', 'EF/19-20', 'Se realiza charla para responder dudas sobre el control de acceso al personal de la unidad gestión de la información', 'Charla realizada con éxito y sin problemas ya que todas las personas aclararon sus dudas', 'María Paz Ojeda (Gestión de la información)', 'Shai Santibañez (Control Centralizado)', 'Isaac Pérez (Control Centralizado)'),
(3, 'HBQP-OT-I-3', 'Orden de Trabajo: HBQP-OT-I-3 - 23-02-2022', '2022-02-23 12:15:03', 'Luz María Tapia', 'Shai Santibañez', 1, 0, 12, 'Oficina Control de Gestión', 'G-1-55', 'EF/19-20', 'Se realiza charla para responder dudas sobre el control de acceso al personal de la unidad gestión de la información', 'Charla realizada con éxito y sin problemas ya que todas las personas aclararon sus dudas', 'Luz María Tapia (Gestión de la información)', 'Shai Santibañez (Control Centralizado)', 'Isaac Pérez (Control Centralizado)'),
(4, 'HBQP-OT-I-4', 'Orden de Trabajo: HBQP-OT-I-4 - 23-02-2022', '2022-02-23 12:20:06', 'Natasha González Pived', 'Shai Santibañez', 1, 0, 12, 'Oficina Control de Gestión', 'G-1-55', 'EF/19-20', 'Se realiza charla para responder dudas sobre el control de acceso al personal de la unidad gestión de la información', 'Charla realizada con éxito y sin problemas ya que todas las personas aclararon sus dudas', 'Natasha González Pived (Gestión de la información)', 'Shai Santibañez (Control Centralizado)', 'Isaac Pérez (Control Centralizado)'),
(5, 'HBQP-OT-I-5', 'Orden de Trabajo: HBQP-OT-I-5 - 23-02-2022', '2022-02-23 12:35:17', 'Ivonne Ortiz', 'Shai Santibañez', 1, 0, 12, 'Oficina Control de Gestión', 'G-1-55', 'EF/19-20', 'Se realiza charla para responder dudas sobre el control de acceso al personal de la unidad gestión de la información', 'Charla realizada con éxito y sin problemas ya que todas las personas aclararon sus dudas', 'Ivonne Ortiz (Control de Gestión)', 'Shai Santibañez (Control Centralizado)', 'Isaac Pérez (Control Centralizado)'),
(23, 'HBQP-RT-I-23', 'Orden de Trabajo: HBQP-RT-I-23 - 19-05-2022', '2022-05-19 17:21:42', 'Jorge Cantillano', 'Jaime Estay ( Tecnico de Instrumentación )', 1, 0, 13, 'Oficina Procura', 'G-1-40', 'DE/18', 'Se realiza la respectiva revisión en terreno para verificar el funcionamiento de la VAV-1-214.\r\nComo segunda instancia, se realizaron las mediciones correspondientes (Alimentación del equipo, Temperatura del recinto, Humedad del recinto y comunicación con el termostato). Al verificar que las mediciones correspondían, se procedió a realizar el cambio del termostato para descartar el mal funcionamiento de este.\r\nAl percatarnos que el termostato no era el problema, como solución se realizo el cambio de la placa del controlador, se extrajo la placa del controlador de la VAV-6-6 (Estación de enfermería, Zona O, Piso 6) dejando este sector sin el funcionamiento del controlador.\r\n\r\nAl instalar la placa en el controlador que se ubica en el recinto G-1-40  se verifico el correcto funcionamiento y las correspondientes temperaturas que están por proyecto, es decir,  20 a 24°C .', '', NULL, NULL, NULL),
(24, 'HBQP-RT-I-24', 'Orden de Trabajo: HBQP-RT-I-24 - 18-07-2022', '2022-07-18 12:48:20', 'Andrea Muñoz Nuñez', 'Shai Santibáñez Osses', 1, 0, 14, 'Abastecimiento Central', 'G-S1-7(2) Y G-S1-7(1)', 'DE/16-18', 'G1-S1-7(2) Se realiza apreté del magnético del control de acceso, ya que este se encontraba suelto y esto provocaba que la puerta quedara abierta en reiteradas veces.\r\nG1-S1-7(1)Se realiza ajuste de la base del magnético, ya que este se encontraba descuadrado y provocaba que la puerta no cerrara de manera correcta y por ende el led indicador del estado siempre se encontraba en rojo.', '', 'Andrea muñoz nuñez (abastecimiento)', 'shai Santibáñez y jaime estay (control centralizado)', 'lizandro varela (control centralizado)'),
(25, 'HBQP-RT-I-25', 'Orden de Trabajo: HBQP-RT-I-25 - 03-08-2022', '2022-08-03 09:30:53', 'Eduardo Estay', 'Jaime Estay Jorquera', 1, 0, 13, 'Oficina de Partes', 'G-1-12', 'C/15-16', '-Se verifico las puertas disponibles de la UCA (Unidad Control de Acceso).\r\n-Se Verifico el cableado disponible', '', NULL, NULL, NULL),
(26, 'HBQP-RT-I-26', 'Orden de Trabajo: HBQP-RT-I-26 - 04-08-2022', '2022-08-03 10:02:32', 'Eduardo Estay', 'Jaime Estay Jorquera', 1, 0, 15, 'Oficina de Partes', 'G-1-12', 'C/15-16', 'Dada a la Solicitud se realizo:\r\n\r\n- Revisión de la disponibilidad de puertas en la UCA (Unidad Control de Acceso).\r\n- Verificación de la disponibilidad de Cable (Botonera).\r\n- Modificación de Cableado en UCA (Unidad Control de Acceso.\r\n- Prueba del biométrico Conectado directamente la UCA.\r\n- Prueba del biométrico Conectado con extensión de botonera.\r\n- Instalación del soporte de biométrico.\r\n- Pruebas de continuidad y instalación del Biométrico en el recinto.\r\n- Instalación Final en Control de Acceso.', 'La instalación de este Biométrico tiene como fin aumentar la seguridad en el recinto de la Oficina de partes, ya que al tener un botón de apertura, este acceso era utilizado de mala forma con respecto al uso pensado por la unidad.\n\nEl equipo queda operativo, luego de realizar modificaciones en el cableado de la Unidad de control de acceso y una actualización completa del software.(Realizando pruebas para su correcto funcionamiento)', NULL, NULL, NULL),
(27, 'HBQP-RT-I-27', 'Orden de Trabajo: HBQP-RT-I-27 - 03-08-2022', '2022-08-03 10:12:23', 'pIA ESCOBAR', 'Jaime Estay Jorquera', 1, 0, 16, 'Bodega de Equipos', 'P-5-21', 'VW/14-15', 'Se Realizaron los siguientes trabajos:\r\n\r\n-Se verifico las puertas correspondientes a la UCA (Unidad Control de Acceso).\r\n-Se dejo sin alimentación Biométrico, Magnético, Botonera.\r\n-Se retiraron los equipos del recinto', '', 'abc', 'def', 'ghi');
