INSERT INTO `reportes_generales` (`idReporte`, `nomReporte`, `turnoReporte`, `fechaReporte`, `folioReporte`, `nomEncargadoTurno`, `nomFuncionariosTurno`, `nomEncargadoTurnoAnterior`, `tareasControlCentralizado`, `tareasInstalaciones`, `tareasEquiposIndustriales`, `tareasIncendiosCombustibles`, `tareasDeteccionElectrica`, `tareasInfraestructura`, `pendientesCoordinacion`) VALUES
(1, 'Reporte General de Eventos - Dia - 15-02-2022', 'Dia', '2022-02-15 19:27:16', 'HBQP-RGE-D-1', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra', 'Abel Torres', 'durante jornada de trabajo se encontraron múltiples incongruencias en el sistema las cuales serán acusadas y enviadas a gestión documental como post venta esperando de esta manera una pronta respuesta y solución al problema.', 'El día de hoy se cuenta con el apoyo de Francisco Salazar para los trabajos a realizar durante la jornada', '', '', 'Con colega del departamento eléctrico Matías añasco, se ven circuitos de alumbrado del exterior, exactamente en el tablero L1Aa donde encontramos problemas con el selector \"16\" donde este y según lo informado por colega se encuentra con una de sus patas rotas impidiendo el rotar completamente de su eje a automático', '', 'se dejan los siguientes pendientes a solicitud de jefatura; revisar los permisos de Fabián córdoba y de ser posible darle los mismos  accesos que a Gustavo Loira,  además de tomar las medidas solicitadas en los correos entregados.'),
(2, 'Reporte General de Eventos - Noche - 16-02-2022', 'Noche', '2022-02-16 09:00:28', 'HBQP-RGE-N-2', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', 'No se reportan eventos durante el Turno.', 'No se reportan eventos durante el Turno.', 'No se reportan eventos durante el Turno.', 'En el transcurso de la noche se presentaron 2 alarmas de supervisión en la central de incendio, las cuales fueron verificadas en terreno con los técnicos de turno. Con esto se llego a la conclusión de restablecer el sistema ya que estas eran falsas alarmas  y no afectarían con el funcionamiento del hospital.', 'En el transcurso de la noche se detecto la caída del magneto térmico General del tablero LOAa, afectando toda la iluminación del exterior 1 (entrada principal, sala cuna, UCI Psiquiátrica ).El técnico de turno tomo las medidas pertinentes dejando el alumbrado nuevamente en servicio.', '', 'Se deja informado el tema de los estanques de combustible , ya que el estanque 1 esta llegando a su mínimo, en caso que no realice el cambio de estanque ,avisar al jefe del departamento industrial.'),
(3, 'Reporte General de Eventos - Dia - 16-02-2022', 'Dia', '2022-02-16 17:23:07', 'HBQP-RGE-D-3', 'Shai Santibañez', 'Francisco Salazar, Claudio Carcamo, Benjamin Vergara', 'Jaime Estay', 'no se presentaron acontecimiento en el área de control centralizado.', 'no se  presentaron acontecimientos en el área de climatización', 'no se presentaron acontecimiento en el área de equipos industriales', 'se presentaron 2 alarmas de incendio que dejaron paralizados los ascensores un breve momento.', 'no se presentaron acontecimientos en el área de equipos industriales', '', 'no se deja ningún pendiente'),
(4, 'Reporte General de Eventos - Noche - 17-02-2022', 'Noche', '2022-02-17 08:00:18', 'HBQP-RGE-N-4', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra', 'Shai Santibañez', '', 'Al efectuarse la revisión de UMAS la UMA-S1-4A advierte de caída de su térmico en el VEX, esto se le da a conocer  a Cristopher y a Matías quienes se encaminan a su ubicación y verifican el estado de esta. Al confirmarse la falla la cual fue por una sobre corriente se procede a forzar el apagado de la UMA quedando esta a espera de chequeo.  \r\nSe informa a Cristopher que  bombas BCAS de agua caliente sanitaria se encuentran con una baja presión, por lo que se apaga caldera 2 para iniciar un llenado de línea.', '', 'Guardia notifica de alarma de supervisión en el sistema, la cual se confirma y se envía información de esta a jefatura correspondiente', 'En el transcurso del turno Cristopher comunica por radio que exterior 2 SAMU se encuentra con las iluminarias apagadas, esto se le hace saber a Matías quien al hacer una revisión al tablero informa de caída del termomagnético, normalizando este y notificando de su funcionamiento', '', 'El apartado de combustible señala que el estanque n°1 de calderas se encuentra cerca de su nivel mínimo, por lo que se espera se este pendiente de que este haga el cambio correspondiente al estanque n°2, tanto en grafica como en terreno .'),
(5, 'Reporte General de Eventos - Dia - 17-02-2022', 'Dia', '2022-02-17 20:09:50', 'HBQP-RGE-D-5', 'Abel Torres', 'Alexis Jara, Benjamín Toloza', 'Luis Perez', 'Eduard Brito de la Empresa DAC Control, junto a Felipe Opazo de la Empresa Sacyr, trabajaron en la barrera de salida del estacionamiento ubicado en Patio de Carga, ya que anteriormente se había realizado un Postventa debido a mal funcionamiento. Esta barrera quedara en modo Prueba para verificar si presenta algún problema a futuro.', 'El Encargado de Climatización ordeno apagar todas las UMAS correspondientes a Nivel 3 y Nivel 7, debido a que se registro un incendio forestal cercano al hospital. Esto fue ordenado para evitar que los equipos no inyectaran el humo al interior del hospital. Volverán a funcionar cuando el ambiente sea el adecuado.', '', '', '', '', 'Se deja pendiente Conceder los permiso correspondiente a funcionario de Hospitalización domiciliaria que se registro durante el dia, También volver a encender uMAS del nivel 3 y 7 que se encuentran apagada por causa de humo en el ambiente.'),
(6, 'Reporte General de Eventos - Noche - 18-02-2022', 'Noche', '2022-02-18 07:55:00', 'HBQP-RGE-N-6', 'Shai Santibañez', 'Francisco Salazar, Claudio Carcamo, Benjamin Vergara', 'Abel Torres', 'No se presentaron acontecimiento en Control centralizado.', 'No se presentaron acontecimientos en Climatización.', 'No se presentaron acontecimientos en equipos industriales.', 'Durante el turno de noche presento una alarma de incendio que se activo reiteradas veces en el sector  de laboratorio, pero se logro solucionar con las instrucciones que nos entrego Don Guillermo Hidalgo Jefe de equipos industriales. esto no afecto al funcionamiento del hospital.', 'No se presentaron acontecimientos en instalación electrica.', '', 'No se deja pendientes a compañero de turno de día, solo se le informa sobre los sucesos de la noche.'),
(7, 'Reporte General de Eventos - Dia - 18-02-2022', 'Dia', '2022-02-18 20:27:19', 'HBQP-RGE-D-7', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Shai Santibañez', 'Durante el turno  , se conto con el apoyo del técnico Luis Pérez.', 'Detención de una UMA por orden del técnico de turno Matías Gutiérrez (Clima), el motivo es una alarma sobrecorriente, la detención de este equipo, dejaría sin climatización el siguiente recinto:  área mesas y cafetería piso 1.\r\nEste equipo se mantendrá apagado hasta nuevo aviso.', '', 'Se realizo llenado del estanque 1 de combustible (Calderas).\r\nEn el transcurso del día se presento reiteradas veces una alarma de supervisión, la cual fue verificada y confirmada ya que todas eran falsas alarmas.', '', '', 'Se deja pendiente habilitar los permisos de areas comunes del hospital al funcionario: Magallanes Nahmias.(Subdirección Medica) y para Doctora Aravena de acuerdo a lo solicitado por correo. \r\nSe coordino con el técnico Abel torres, llamar a encargado de incendio en el caso que una alarma de supervisión se active reiteradamente.'),
(8, 'Reporte General de Eventos - Noche - 19-02-2022', 'Noche', '2022-02-19 08:15:50', 'HBQP-RGE-N-8', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', '', '', 'Se registra una leve baja presión en tableros de la sala bomba PCI, monitoreando durante la noche y haciendo rondas por si se presentaba algún problema, las rondas salieron positivas sin encontrar algún problema de filtración.', 'Se detectan alarmas de supervisión en la central de incendio, fueron comunicadas y confirmadas sin registro de alguna anomalía  en los sectores la cual se indicaban dicha alarma.\r\n\r\nSe registro alarma de incendio en pasillo TH en el piso 2, la cual al revisar se percato que se encontraba un equipo de incendio (modulo de aspiración) con alarma, la solución que se tomo fue resetear el equipo para que volviera a la normalidad y rearmar sistema, no se registraron problemas en los alrededores del recinto.', '', '', ''),
(9, 'Reporte General de Eventos - Dia - 19-02-2022', 'Dia', '2022-02-19 19:26:31', 'HBQP-RGE-D-9', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', '', 'Durante el turno de hoy el Técnico de turno en clima informa, que el dia de hoy, se Efectuaría una Fumigación en los Casetones ubicados en el piso -1, por lo que solicitan detener uMAS que se encuentran en el sector. luego de la Fumigación, se vuelve a normalizar  el estado de las uMAS. cabe señalar, que para este turno se conto con claudio Cárcamo como apoyo para departamento clima', '', '', 'Para este tuno, se conto con el apoyo de Benjamín vergara del departamento Eléctrico para trabajos en adecuaciones a salas a entregar a funcionarios que se trasladaran eventualmente al Hospital.', '', 'Realizar las solicitudes señaladas en los correos entregados por colega.'),
(10, 'Reporte General de Eventos - Noche - 20-02-2022', 'Noche', '2022-02-20 08:12:42', 'HBQP-RGE-N-10', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', '', 'En el transcurso de la mañana (7 am) se intento dar partida a la caldera 1 (chapa) agua caliente ,  no Respondía  al encendido desde control Centralizado. Como resultado se hablo con el Técnico de Climatización (Matías Gutiérrez) y se tomo la Decisión de dejarla apagada hasta nuevo aviso.', '', 'En el Transcurso de la noche se presentaron 3 alarmas de Supervisión, las Cuales fueron verificadas y confirmadas, ya que todas se trataban de falsas Alarmas.', '', '', ''),
(11, 'Reporte General de Eventos - Dia - 20-02-2022', 'Dia', '2022-02-20 19:53:04', 'HBQP-RGE-D-11', 'Shai Santibañez', 'Francisco Salazar, Claudio Carcamo, Benjamin Vergara', 'Jaime Estay', 'No se reportan Eventos durante el Turno trabajado.', 'No se reportan Eventos durante el Turno trabajado.', 'No se reportan Eventos durante el Turno trabajado.', 'Se presento una alarma de Supervisión que no afecto al funcionamiento del establecimiento.', 'No se reportan Eventos durante el Turno trabajado.', '', 'Se le deja de pendiente a compañero revisión de informe creado en el turno.'),
(12, 'Reporte General de Eventos - Noche - 21-02-2022', 'Noche', '2022-02-21 08:01:03', 'HBQP-RGE-N-12', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Shai Santibañez', '', 'Durante el turno de hoy Técnico de clima informa de alarma de bloqueo en caldera 2, la cual se detiene y se deja en Observación.', '', '', '', '', 'Revisar en detalles de lectura que el recuadro, \"temperatura de Casetones\" indique la temperatura de forma correcta'),
(13, 'Reporte General de Eventos - Dia - 21-02-2022', 'Dia', '2022-02-21 20:02:37', 'HBQP-RGE-D-13', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', '', 'Se registro durante el día que el CHILLER 3 presento alarma quedando totalmente apagado desde control, Clima según lo informado no se intervino en ningún momento dejándolo solo fuera de servicio, en estos momento solo se dejo funcionando el CHILLER 2 hasta nuevo aviso.', '', 'Se registro una alarma de supervisión en los pasillos hacia pabellón la cual fue informada y confirmada, esta alarma  se presento debido a los trabajos que se encontraban realizando cerca del lugar.', '', '', 'Se deja pendiente darle los permisos a personal ingresado durante el día solo los comunes, también se deja informado sobre la situación de CHILLER y la revisión del FC ubicado en las oficina de Gestión Documental.'),
(14, 'Reporte General de Eventos - Noche - 22-02-2022', 'Noche', '2022-02-22 08:05:36', 'HBQP-RGE-N-14', 'Shai Santibañez', 'Francisco Salazar, Claudio Carcamo, Benjamin Vergara', 'Abel Torres', 'Durante la madrugada del turno de noche se presto apoyo al departamento de TICS durante la caida a nivel regional de internet, la situación se normalizo y no afecto al funcionamiento del establecimiento.', 'No se presentaron acontecimientos durante el turno trabajado', 'No se presentaron acontecimientos durante el turno trabajado', 'No se presentaron acontecimientos durante el turno trabajado', 'No se presentaron acontecimientos durante el turno trabajado.', '', 'Se le informa al colega sobre los sucesos del turno de la noche\r\nno se le deja ningún pendiente.'),
(15, 'Reporte General de Eventos - Dia - 22-02-2022', 'Dia', '2022-02-22 21:43:57', 'HBQP-RGE-D-15', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Shai Santibañez', 'Durante el turno, se conto con el apoyo del técnico Luis Pérez. \r\nCaída de los controladores de las Umas (Casetón 5) , gracias a esto no se tiene control y comunicación de las Umas.\r\nUMA: Unidad Manejadora de Aire', '', 'En el transcurso de la tarde (Alejandro Cantillano) da aviso sobre sonidos en el ascensor (Núcleo A8).\r\nSe confirma que se encuentran atrapadas 2 personas entre el piso 2 y 3, las cuales se encontraban presionando el botón para llamar, dicha llamada en la sala CCTV  no se detecto.\r\nCon esto se procedió a llamar al encargado del departamento industrial(Guillermo Hidalgo), para poder realizar la maniobra de rescate, en este transcurso se logro tener comunicación con las personas atrapadas para tranquilizarlas y dar la información de las medidas a tomar.\r\nUna vez el encargado del departamento en el hospital (junto a los técnicos de turno), se comenzó con la maniobra de rescate, la cual se realizo de buena forma , logrando rescatar a las personas abriendo las puertas en el piso 1.Luego de consultar sobre su estado y terminar el proceso , se realizo una llamada al numero de emergencia para dejar registro del suceso quedando en numero de registro N°64053', 'En el transcurso del día se presento una alarma de incendio, en el sector de alimentación, esta fue verificada y restablecida ya que se trataba de una falta alarma, por una activación de un sensor de humo ,ya que se encontraban trabajando en el sector.', 'En el transcurso del día de detecto la caída de una fase en el tablero H3U.\r\nDejando fuero los controladores del Casetón (5) .', '', 'Se deja pendiente la creación de los nuevos manuales de usuario para los distintos programas de control centralizado.\r\nSe deja pendiente buscar una posible solución a la falta de una fase del tablero eléctrico H3U, ya que este esta dejando sin alimentación los controladores de las UMAS del casetón 5.'),
(16, 'Reporte General de Eventos - Noche - 23-02-2022', 'Noche', '2022-02-23 08:48:10', 'HBQP-RGE-N-16', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', 'Se soluciono problema con fase en el tablero H3U y la consecuencia fue que los contralores volvieran a encender y estuviéramos con comunicación de los equipos de climatización.', '', '', '', '', '', ''),
(17, 'Reporte General de Eventos - Dia - 23-02-2022', 'Dia', '2022-02-23 20:02:02', 'HBQP-RGE-D-17', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', 'En el turno de hoy se conto con el apoyo de Shai Santibáñez en control centralizado.', '', 'Se informa que personal del hospital queda atrapado en ascensor A8, por lo que se procede a realizar las maniobras de rescate pertinentes y a llamar al numero señalado en los ascensores. (numero de reporte 64067)', 'Durante el turno de hoy, se notifico de una alarma de incendio en sala de servidores. Se activa la aspiración del FM200 por trabajos en el área y Don Guillermo reinicia el sistema al cerciorarse de que esta fuese una falsa alarma.', 'Durante el turno de hoy, se notifica la falta de energía en enchufes en sedile y en H-1-30, lo cual se le hace saber al técnico de turno en el área eléctrica, quien al revisar tableros notifica de caída de automático, procede a revisar la zona para ver si es que se encuentra gente trabajando en el lugar, y al  no encontrar a nadie, normaliza los tableros.', '', ''),
(18, 'Reporte General de Eventos - Noche - 24-02-2022', 'Noche', '2022-02-24 08:57:20', 'HBQP-RGE-N-18', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', '', '', '', 'En el transcurso de la noche se presento una alarma de baja presión en la bomba 2 de combustible (Calderas), esta se informa al encargado del departamento para que tome las medidas necesarias .', '', '', 'Se deja pendiente el monitoreo de la bomba de combustible 2 (calderas), ya que en el transcurso de la noche se presento una alarma de baja presión.'),
(19, 'Reporte General de Eventos - Dia - 24-02-2022', 'Dia', '2022-02-24 19:59:49', 'HBQP-RGE-D-19', 'Shai Santibañez', 'Francisco Salazar, Claudio Carcamo, Benjamin Vergara', 'Jaime Estay', 'Jaime estay dejo encargado avisar a Jefe de departamento  Industrial Guillermo Hidalgo que en panel de control centralizado bomba 2 de combustible caldera presenta alarma de baja presión , al cual este se le da aviso durante la mañana y en la tarde Don Victor Fierro entrega información de que el sistema se encuentra sin aire (presión) y es por eso que esta activa la alarma pero no es nada perjudicial para el sistema.', 'En instalaciones Térmicas caldera N°1 volvio a estar operativa y en climatización 4 UMAS que no estaban operativas ahora lo estan de manera correcta', 'No se presentaron acontecimientos en equipos industriales', 'No se presentaron acontecimientos en detección de incendio.', 'No se presentaron acontecimientos en instalaciones electricas', '', 'Se deja pendiente para compañero de turno de noche encender caldera N°1  a las 07:00 AM y que se apague a las 8:30 AM\r\ny monitorear durante la noche las UMAS que quedaron operativas.'),
(20, 'Reporte General de Eventos - Noche - 25-02-2022', 'Noche', '2022-02-25 08:11:39', 'HBQP-RGE-N-20', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Shai Santibañez', '', 'Durante el turno de hoy, el sistema notifica de alarma en VIN de UMA-3-11, lo que se le hace saber por radio a técnico de clima, quien solicita forzar a apagado la UMA hasta nuevo aviso.\nTécnico de clima informa de alarma en el evaporador del Chiller 2, por lo que se procede a apagar hasta nuevo aviso.', '', 'Durante el turno de hoy, guardia informa de alarma de supervisión en el sistema, a lo cual y según las instrucciones dadas se confirma y se hace saber a encargado del departamento.', '', '', 'Se deja como tarea, detener caldera 1 a las 8:30 según lo solicitado por encargado del turno anterior.'),
(21, 'Reporte General de Eventos - Dia - 25-02-2022', 'Dia', '2022-02-25 19:21:08', 'HBQP-RGE-D-21', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', '', 'Según las alarmas causadas en los anteriores turnos, referente al CHILLER 2 y 3, los técnicos de  climatización con control centralizado realizaron pruebas de funcionamiento en los equipos. Según lo informado, todos los equipos, tanto de central frio como central térmica, quedan operativos para su optimo funcionamiento.', '', '', '', '', 'Se dejan pendiente sobre trabajos de instalación de nomenclatura PMA en los recintos que se encuentran con sistema de seguridad electrónica, también se informa que este sábado 26 de febrero se realizara un corte general por parte de una empresa externa.'),
(22, 'Reporte General de Eventos - Noche - 26-02-2022', 'Noche', '2022-02-26 07:54:09', 'HBQP-RGE-N-22', 'Shai Santibañez', 'Francisco Salazar, Claudio Carcamo, Benjamin Vergara', 'Abel Torres', 'No se presentaron acontecimientos durante el turno trabajado', 'No se presentaron acontecimientos durante el turno trabajado', 'No se presentaron acontecimientos durante el turno trabajado', 'No se presentaron acontecimientos durante el turno trabajado', 'No se presentaron acontecimientos durante el turno trabajado', '', 'Se colocan los PMA del piso -1, 1 , 2 , 3 y 5 solamente faltando el piso 4 y 6 que se deja como pendiente  a compañero del turno entrante y se le comunica sobre el el corte general que se realizara.'),
(23, 'Reporte General de Eventos - Dia - 26-02-2022', 'Dia', '2022-02-26 22:00:18', 'HBQP-RGE-D-23', 'Jaime Estay', 'Joaquin Vicencio, Benjamin Carvajal', 'Shai Santibañez', 'En el transcurso de la mañana, junto con las pruebas de los generadores, se presento la caída de UCAS (Unidad de Control de Acceso) y cámaras en el sector de Sala Cuna. A los 10 minutos se volvió a la normalidad.\r\n\r\nEn el transcurso de la tarde se presento la caída del BOS05P2, el cual deja sin comunicación con equipos de climatización en el Sector del Casino/Piso 2.', '', 'En el transcurso de la tarde, se realizo un llamado al número de emergencia de los ascensores, informando sobre el ascensor NUCLEO A5, el cual esta presentando problemas con su puerta, ya que esta abre y cierra por si sola.', 'En el transcurso del día se presentaron 3 alarmas de supervisión, las cuales fueron verificadas y rearmadas, ya que estas se trataban de falsas alarmas y no afectarían con el funcionamiento del hospital.', 'En el transcurso del día se realizo pruebas con los generadores. Se ha realizado el cambio con éxito, funcionando con los generadores 1, 2 y 3 con un lapsus de 7 segundos entre el corte y la partida de los generadores.\r\n\r\nEn el transcurso de la tarde se realizo un intento de normalizar, pero un sector del hospital quedo sin alimentación, él cual fue solucionado a los minutos.\r\n\r\nInforme en especifico será realizado por el encargado del Departamento Eléctrico.', '', 'Se deja pendiente el pegado de la nomenclatura de las puertas con control de acceso en los pisos 4 y 5. Se avisa al técnico de turno (Abel Torres) sobre recibir al encargado de la reparación de los ascensores.'),
(24, 'Reporte General de Eventos - Noche - 27-02-2022', 'Noche', '2022-02-27 08:36:46', 'HBQP-RGE-N-24', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', 'Se realiza pendientes dejado por colega del turno anterior  sobre la continuidad de salas, Mamparas, bodegas, etc. de los pisos 4 y 5 que contengan Seguridad electrónica.\r\n\r\nSe informa que aun permanecen deshabilitados una cantidad aproximada de 50 equipos como consecuencia de los trabajos en generadores realizado el sábado pasado 26 de febrero del 2022.', '', 'Se recibe a Omar Aranda técnico de los ascensores debido a problema con puerta del núcleo A5-1 en piso 3, fue informado por Jaime Estay.\r\nSe dejo solucionado el problema quedando totalmente operativo.', '', '', '', 'Se deja pendiente la continuidad de identificación de los sectores que se encuentran con seguridad electrónica.'),
(25, 'Reporte General de Eventos - Dia - 27-02-2022', 'Dia', '2022-02-27 19:56:09', 'HBQP-RGE-D-25', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', 'Durante todo el turno, ECBOOS continua descomunicado.', 'Durante el turno de hoy, se detiene Chiller 3 debido a que su torre de enfriamiento estaba funcionando de manera irregular.', '', 'Durante el turno de hoy, se confirman alarmas de supervisión y se le informa a la jefatura correspondiente.', '', '', 'Se dejan como trabajos a realizar los pendientes dados por jefatura.'),
(26, 'Reporte General de Eventos - Noche - 28-02-2022', 'Noche', '2022-02-28 09:46:02', 'HBQP-RGE-N-26', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', '', '', '', 'En el transcurso de la noche se presentaron 2 alarmas de supervisión, las cuales fueron verificadas y confirmadas, ya es estas se trataban de falsas alarmas y no afectarían con el funcionamiento del hospital.', '', '', 'Se deja pendiente el avance del pegado de las nomenclaturas (PMA) de las puertas que cuenten con control de acceso. \r\nPiso 2,1 y -1.'),
(27, 'Reporte General de Eventos - Dia - 28-02-2022', 'Dia', '2022-02-28 19:55:48', 'HBQP-RGE-D-27', 'Shai Santibañez', 'Francisco Salazar, Claudio Carcamo, Benjamin Vergara', 'Jaime Estay', 'Se y activo la acta de activación de tarjeta para dejar registro de las personas ingresadas con su credencial al sistema.', 'No se presentaron acontecimientos en el turno trabajado', 'No se presentaron acontecimientos en el turno trabajado', 'No se presentaron acontecimientos en el turno trabajado', 'No se presentaron acontecimientos en el turno trabajado', '', 'Se deja pendiente dar accesos a las personas ingresadas durante la jornada del día en pegar los pmas faltantes en sus correspondiente puerta.'),
(28, 'Reporte General de Eventos - Noche - 01-03-2022', 'Noche', '2022-03-01 08:59:40', 'HBQP-RGE-N-28', 'Jaime Estay', 'Matías Añazco, Cristopher Saavedra', 'Shai Santibañez', 'En el transcurso de la noche se cargaron los permisos de control de acceso a las siguientes personas: Alejandra cabello, Henry Pardo , según lo acordado con el técnico del turno anterior', '', '', 'En el transcurso de la noche se presunto una alarma de supervisión, esta fue verificada y restablecida ya que no afectaría con el funcionamiento del hospital.', '', '', 'Se deja pendiente al técnico de turno , el avance del pegado de los PMA, de las puertas que cuenten con control de acceso en el piso 1.'),
(29, 'Reporte General de Eventos - Dia - 01-03-2022', 'Dia', '2022-03-01 20:56:23', 'HBQP-RGE-D-29', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', '', '', '', 'Se registra alarma de incendio en sector 2.5 servicio de laboratorio y medicina transfusional, se le da aviso a Karla Jeldres para solucionar la alarma.', '', '', 'Se deja pendiente dar los permisos correspondiente a las personas ingresadas durante el turno de día, también se deja informado sobre la apertura y el cerrado del portón N°5.'),
(30, 'Reporte General de Eventos - Noche - 02-03-2022', 'Noche', '2022-03-02 08:41:19', 'HBQP-RGE-N-30', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', 'No se presentaron acontecimientos en el turno trabajado', 'Durante la jornada del turno de noche se realizaron pruebas con las calderas:\r\n\r\n- Caldera N°1: Funciono sin problema alguno.\r\n- Caldera N°2: Se encendió y su temperatura no supero los 30°C por lo cual se apago.\r\n- Caldera N°3: No se encendió\r\n- Caldera N°4: Se encendió y su temperatura no supero los 30°c por lo cual se apago.\r\n- Caldera N°5: Se encendió y se encuentra funcionando con normalidad\r\n\r\nCaldera N°1: Se mantiene encendida hasta las 9am del día 02-03-2022.\r\n\r\nCaldera N°5 se mantiene en monitoreo durante la jornada laboral.\r\n\r\nSe apago VEX-S1-5X por sonidos raros en su motor.', 'No se presentaron acontecimientos en el turno trabajado', 'No se presentaron acontecimientos en el turno trabajado', 'No se presentaron acontecimientos en el turno trabajado', '', 'Se deja como pendiente a compañero de turno apagar caldera N°1 a las 09:00 y mantener en monitoreo la caldera N°5 durante la jornada laboral junto con la UMA-3-7 que esta inyectando temperatura exterior.'),
(31, 'Reporte General de Eventos - Dia - 02-03-2022', 'Dia', '2022-03-02 21:55:35', 'HBQP-RGE-D-31', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Shai Santibañez', '', 'Durante el transcurso de la tarde se informo sobre un olor a quemado en el sector de imagenología, con esto se tomo la decisión de forzar apagado las UMAS que alimentan ese sector (UMA-imagenología y UMA-3-7).\r\n\r\nAlarma de baja presión en las bombas de combustible de las calderas.', 'En el transcurso de tarde se detecto una alarma de baja presión en las bombas de combustible, se deja aviso al turno entrante para que tome las medidas necesarias en el caso que las calderas presentan problemas.', 'Durante la jornada de la tarde se presento una alarma de incendio en el sector 3.3  (consulta y procedimiento infantil, piso 3).\r\nesta alarma fue verificada en terreno y confirmada, ya que se trataba de una falsa alarma y esta no afectaría con el funcionamiento del hospital.', 'En el transcurso del día se informo sobre la falta de iluminación en el sector de auditorio, se converso con el técnico del departamento eléctrico y este informa sobre la falta de una Fase en el tablero que alimenta ese sector.\r\nSe llego a la conclusión de solucionar el problema en el turno entrante para poder realizar un apagado de los equipos, en el caso que sea necesario', '', 'Se deja pendiente tener el monitoreo de las UMAS de imagenología y terminar los informes de control de acceso de los distintos departamentos.\r\nA la vez tener un monitoreo de las calderas con sus bombas de combustible ya que esa presenta una alarma de baja presión.\r\nSe deja encargado informar al turno entrante sobre el estado del tablero del sector auditorio ya que en el transcurso de su turno realizaran trabajos.  \r\nSe deja pendiente encender caldera 1 a las 7am en el caso que no presentaran problemas las bombas de combustible en el transcurso de la noche.'),
(32, 'Reporte General de Eventos - Noche - 03-03-2022', 'Noche', '2022-03-03 09:36:23', 'HBQP-RGE-N-32', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', 'Durante el turno se registro un sonido extraño parecido a una explosión, los guardias dan aviso que también percibieron este sonido, se procedió a revisar todo el hospital tantos servicios como equipo para descartar algún problema al interior.\r\n\r\nDespués de varias horas en rondas no se encontró el motivo del sonido extraño que se percato.', '', '', 'Se detecto una alarma de incendio en el sector 2.3 en los servicio de laboratorio, endoscopia y gastroenterología, se verifico en terreno y se trataba de un dámper incendio en el ducto de extracción de la UMA-S1-31A se procedió a rearmar el sistema ya que no se encontraba nada anormal.\r\n\r\nEl modulo fue deshabilitado debido a que se encontraba alarmando constantemente para su revisión en el turno entrante.', '', '', 'Se deja informado sobre los malos olor en sector imagenología, también se da aviso sobre el dámper de incendio deshabilitado y también el monitoreo de las calderas ya que presentaban problema con la bomba 2 de expansión de petróleo'),
(33, 'Reporte General de Eventos - Dia - 03-03-2022', 'Dia', '2022-03-03 21:04:05', 'HBQP-RGE-D-33', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra', 'Abel Torres', '', '', '', 'Durante el tuno de hoy, el guardia notifica de alarma de incendio, donde se le hace saber a los encargados del área quienes acuden al lugar y después de revisar la zona se normaliza la situación debido a que esta fue una falsa alarma.', 'Durante el turno de hoy, se realiza un corte de energía debido a adecuaciones funcionales lo que conllevó a una perdida de energía en reloj control y en los ascensores, solo funcionando A4', '', ''),
(34, 'Reporte General de Eventos - Noche - 04-03-2022', 'Noche', '2022-03-04 09:45:56', 'HBQP-RGE-N-34', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', 'Caída de la comunicación en control centralizado, por caída de data center. \r\nlogrando reestablecer la comunicación a los 20 minutos.', 'Detención del chiller 2, ya que presento una alarma de supervisión visualizada desde control y el técnico de turno Matías Gutiérrez (Climatización), ordena encendido de chiller 3', '', '', 'En el transcurso de la tarde se presentaron cortes de energía por trabajos realizados con los ductos de barra, con esto se presentaron problemas en sectores que no deberían estar relacionados al área de trabajo.\r\n\r\nTablero H0T y sector del pasillo segundo piso se encuentran sin energía.', '', 'Se deja pendiente el monitoreo del data center. y de los tableros que en el transcurso del día se deberían normalizar.'),
(36, 'Reporte General de Eventos - Dia - 04-03-2022', 'Dia', '2022-03-04 20:36:21', 'HBQP-RGE-D-36', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Jaime Estay', 'Corte de energía que afecto visualización de parámetros en el panel de control centralizado, el corte se produjo a las 11:24 y la energía volvió a las 11:40, normalizando la situación completa a las 12:30.', 'Se apago Chiller N°3 y Caldera N°5 por precaución y al volver a encenderlos bombas BAES no funcionan con su lógica correspondiente a lo cual se fuerzan ( BAES1 , BAES 2R  BAES 2.1 , BAES 3R Y BAES 4) y se vuelven a automático nuevamente para que estas retomen la lógica correspondiente.', 'Se realiza llenado del tanque N°1, este se encontraba al 16% y al rellenarse este se dejo en 34%.', 'No se presento ningún acontecimiento en el turno trabajado', 'Se presento corte de energía durante la jornada de la mañana (11:24) y a las 11:40 volvió la energía normalizando la situación completa a las 12:30', '', 'Se deja pendiente darle acceso a los funcionarios ingresados durante la jornada laboral, monitorear calderas, chillers y UPS durante el turno de noche y realizar el trabajo que dejo Isaac Pérez. cabe recalcar que UPS deben monitorearse cada una hora.'),
(37, 'Reporte General de Eventos - Noche - 05-03-2022', 'Noche', '2022-03-05 09:29:00', 'HBQP-RGE-N-37', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra', 'Shai Santibañez', 'Durante el turno de hoy, se realizan tareas encomendadas del turno anterior y se finalizan sin ningún problema', 'Durante el turno de hoy, como consecuencia de falta de energía en tablero H3T, UMAS de los casetones T y J se encuentran fuera de servicio.', '', '', 'Durante el turno de hoy, el tablero H3T se encuentra sin energía, afectando el funcionamiento de algunos equipos, entre estos las UMAS de los casetones T y J, y en consecuencia estos equipos se encontraron fuera de servicio durante el turno', '', ''),
(38, 'Reporte General de Eventos - Dia - 05-03-2022', 'Dia', '2022-03-05 11:38:42', 'HBQP-RGE-D-38', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', 'Según lo informado en el turno anterior  se registro que el tablero H3T se encontraba sin energía, a causa de este problema se presentaron las caídas de los siguientes controladores.\r\nECB-600-790 de la UMA-3-21, ECB-600-791 de la UMA-3-6, ECB-300-794 de la UMA-3-14A, ECB-400-793 de la UMA-3-12A, ECB-600-796 de la UMA-3-6A, ECB-600-795 de la UMA-3-51, ECB-300-792 de la UMA-3-1, ECB-600-800 de la UMA-3-16J, ECB-600-799 de la UMA-3-16A, ECB-600-801 de la UMA-3-16B, ECB-600-798 de la UMA-3-16H, ECB-600-802 de la UMA-3-16C, ECB-600-807 de la UMA-3-16E, ECB-600-804 de la UMA-3-16F, ECB-600-803 de la UMA-3-16D, ECB-600-805 de la UMA-3-16G, ECB-300-806 de la UMA-3-16I,\r\nTambién se registro la caída de controladores en los tableros de DAC Control que son los ECB-300-913B, ECB-400-919, ECB-400-918, ECB-300-913A, ECB-400-917, ECB-400-916, ECB-400-915, ECB-400-914 y ECB-400-913. \r\nEn total se registro la perdida de señal de 25 controladores debido a la falta de energía.', 'Se dejan las UMAS del casetón N°2 con su paco de seguridad desactivado ya que se encuentra el tablero sin energía, esto fue por prevención del departamento de clima.\r\n\r\nEsto quedara así hasta que se vuelva a normalizar la energía en el tablero.\r\n\r\nCalderas queda inhabilitadas debido a que el estanque de expansión no se encuentra funcionando como corresponde además el display en terreno se encuentra con alarma, esto seguirá así hasta que se solucione el problema con el estanque de expansión.\r\n\r\nEquipos del casetón N°1 no se encuentra con energía y se mantendrán apagada hasta encontrarle una solución.', '', 'Se presenta alarma en display de combustible en terreno y la bomba de expansión N°2 se encontraba con 0 de presión, debido a esto se hizo el apagado de calderas.', 'Debido que en el turno anterior el tablero H3T presento problemas con la energía el departamento eléctrico tomo la decisión  de dejar los automáticos generales cortados.\r\n\r\nEsto quedara fuera hasta cuando se encuentre una solución.', '', 'Se deja pendiente observar analizadores de red y UPS durante la noche, también se deja informado sobre la apertura del portón N°5 a las 8:00 de la mañana.'),
(39, 'Reporte General de Eventos - Noche - 06-03-2022', 'Noche', '2022-03-06 08:04:42', 'HBQP-RGE-N-39', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', 'No se presentaron acontecimientos en el turno trabajado.', 'Durante la noche Clima estuvo monitoreando las temperaturas de bodega Farmacos.', 'En la revisión de criogénico que se realiza se encontró que este se encontraba 202.0 PSI a las 1:49 AM a lo cual se le da aviso a don Guillermo Hidalgo jefe de departamento industrial y da la instrucción y supervisión de manera virtual para poder \"despichar el criogénico\", el cual se normalizo a las 2:25 AM y quedo con una presión de 177.6 PSI', 'No se presentaron acontecimientos en el turno trabajado.', 'Se llevo a cabo la revisión y comparación detallada de la información que muestran los analizadores de red en panel de control centralizado y terreno.', '', ''),
(40, 'Reporte General de Eventos - Dia - 06-03-2022', 'Dia', '2022-03-06 19:59:41', 'HBQP-RGE-D-40', 'Jaime Estay', 'Matias Gutierrez  , Benjamin Carvajal', 'Shai Santibañez', '', '', '', '', '', '', 'Se deja pendiente avanzar con levantamiento de las alarmas de los controladores en Control centralizado.'),
(41, 'Reporte General de Eventos - Noche - 07-03-2022', 'Noche', '2022-03-07 07:55:30', 'HBQP-RGE-N-41', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', '', '', '', '', '', '', 'Se realizo levantamiento de alarmas en BMS.\r\nSe deja informado que el portón N°3 se debe empezar abrir a las 7:00 y luego cerrar a las 9:00 debido que se encuentra sin energía ya que el tablero H0T se encuentra presentando problemas.\r\n\r\nEsta acción se  debe realizar hasta volver a regular el tablero H0T.'),
(42, 'Reporte General de Eventos - Dia - 07-03-2022', 'Dia', '2022-03-07 20:00:02', 'HBQP-RGE-D-42', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', 'Durante el turno de hoy, la red ENTEL sufrió una caída impidiéndonos establecer una conexión con el servidor. lo cual se soluciono a la hora después.', '', '', '', '', '', 'Dar permisos a nuevo profesional de apoyo del Departamento Industria(Equipos menores)'),
(43, 'Reporte General de Eventos - Noche - 07-03-2022', 'Noche', '2022-03-07 22:25:17', 'HBQP-RGE-N-43', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', 'Se Ingresaron los permisos de Teare Martínez(Industrial) , como se dejo pendiente en  el turno anterior.', '', '', '', '', '', 'Se deja pendiente cerrar el portón 3 a las 9AM.'),
(44, 'Reporte General de Eventos - Dia - 08-03-2022', 'Dia', '2022-03-08 19:34:27', 'HBQP-RGE-D-44', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Jaime Estay', 'Se ingresaron al sistema 5 personas y se llevaron a cabo pruebas de control en el segundo piso sector D odontología.', 'Se detuvieron BAES  que impulsan agua fría hacia el subterráneo y tercer piso del edificio por  desagüe por parte de la empresa STI\r\n( Baes 1, Baes 1R, Baes 2, Baes 2R y Baes 2.1  )', 'Se quedaron personas atrapadas en el ascensor A4-2 entre el piso 1 y 2 a la hora de almuerzo don Guillermo Hidalgo informa que ascensor A4-2 queda fuera de servicio de momento ( 65074 Número de reporte ascensor)', '', '', '', 'Se deja como pendiente al turno de noche:\r\nOtorgar accesos solicitados a las personas ingresadas durante el día\r\nque toda la iluminaria del edificio funcione con canal horario en especial iluminaria sector D piso 2'),
(45, 'Reporte General de Eventos - Noche - 09-03-2022', 'Noche', '2022-03-09 07:37:03', 'HBQP-RGE-N-45', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Shai Santibañez', 'Se le conceden los accesos solicitados a personal ingresado al sistema durante el turno día', '', '', '', '', '', ''),
(46, 'Reporte General de Eventos - Dia - 09-03-2022', 'Dia', '2022-03-09 10:43:44', 'HBQP-RGE-D-46', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', 'Luego de restablecer la energía en el tablero H3T se procedió a realizar el levantamiento de los automáticos la cual los 8 controladores que se encuentra en el tablero TCC H3T no se volvieron a colocar en funcionamiento debido a que no se encuentra llegando un voltaje adecuado.\r\nLos equipos de climatización se encuentra sin comunicación, ya se realizo un post venta por el problema presentado.\r\n\r\ncabe mencionar que al tener fuera de servicio los controladores del TCC también dejan sin energía y sin comunicación a los controladores independiente de cada manejadora de aire.', 'Clima informo que los encargado de la empresa STI realizaron el llenado de la linea del subterránea y piso N°3, Quedando en completo funcionamiento el sistema central frio.\r\nLas bombas que fueron forzadas pasaron a su estado automático quedando en funcionamiento la recirculación de agua.\r\n\r\nSegún lo informado por parte de climatización STI hizo la revisión de la manejadora de aire 3-11, según lo informado por parte de personal STI la manejadora de aire quedo sin válvula motorizada debido a que no se sabe el problema de sus altas temperaturas.\r\nEl día de mañana informaron que se dedicaran a revisar dicha manejadora y esto conlleva a presunto desarme.\r\n\r\nContinúan los equipos de climatización del techo mecánico 4 con su paco de seguridad cortado debido a problemas con controladores.', '', '', 'Continua fuera el tablero H0T según lo informado por parte de departamento eléctrico.\r\n\r\nSe volvió a energizar el tablero H3T quedando con la barra 8 en funcionamiento.', '', 'Se deja pendiente dar los permisos a las 2 personas que se converso con Lizandro Varela y Rafael Mendoza, también se deja realizar el trabajo dejado por Isaac.'),
(47, 'Reporte General de Eventos - Noche - 10-03-2022', 'Noche', '2022-03-10 07:32:03', 'HBQP-RGE-N-47', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', '', 'Se estuvieron revisando las temperaturas de fármacos durante la noche.\r\nse detecto temperatura alta en la UMA-3-36B y se realizo purgado y aun así no bajo la temperatura.\r\nse reviso las temperaturas de casino  y se activaron los termostatos .', 'Se reviso el criogénico durante la jornada de la noche y este se encontraba a 208.3 PSI se despicho con autorización de Don Guillermo Hidalgo Jefe de equipos industriales y este quedo en 178.6 PSI.', '', 'Se siguió con el levantamiento de tableros del edificio,  solo falta piso 1 y -1', '', 'Se realizo durante la noche que dejo Isaac Pérez y se le dieron accesos a las personas solicitadas.\r\nse deja como pendiente revisar UMA-3-36B.\r\ny monitorear temperaturas de casino.'),
(48, 'Reporte General de Eventos - Dia - 10-03-2022', 'Dia', '2022-03-10 21:06:07', 'HBQP-RGE-D-48', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Shai Santibañez', 'Se reestablece comunicación con los controladores del casetón T , ya que se levanto tablero eléctrico que afectaba ese punto.', 'Se normaliza equipos de clima (UMAS, VEX), Del casetón T .\r\nUMAS: UNIDAD MANEJADORA DE AIRE.', '', '', 'Se restablece H3T por trabajos realizados de Sacyr (Felipe Opazo).\r\n\r\nSe realiza maniobra de cambio de ducto de barra en el sector del ascensor A6 Y A12.', '', 'Se deja pendiente conceder permisos solicitados por vía correo . (Víctor salidas, Víctor Meneses, Karla Jeldres).\r\nSe deja pendiente avanzar con levantamiento de los puntos y alarmas.(Modbus)'),
(49, 'Reporte General de Eventos - Noche - 10-03-2022', 'Noche', '2022-03-10 21:48:15', 'HBQP-RGE-N-49', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', '', 'Se encienden las UMAS del casetón 2 ya que anteriormente habia sido apagadas por precaución debido a que se estaban realizando los cambios de ducto barra.\r\ntambién se vuelve a normalizar las UMAS del casetón 1 debido a que anteriormente se encontraban con su variador de frecuencia sin energía.\r\ncabe mencionar que los equipos encendidos se encuentran funcionando en un correcto estado.', 'Se vuelve a dejar operativo los ascensores del núcleo A7-1 / A7-2 y los del núcleo A8-1 / A8-2 por parte de Guillermo Hidalgo.\r\nLos ascensores del núcleo A14, A16, A15 y B16 quedan fuera de servicio hasta el siguiente día que se volverán a habilitar.', '', 'Se termina de realizar el cambio de los ductos de barra quedando todos los tableros normalizados, no se presento alguna anomalía durante el cambio.\r\n\r\nEl tablero HOT vuelve a estar con energía, debido a esto se pudo restableció el sistema de iluminación y barreara de estacionamiento.', '', ''),
(50, 'Reporte General de Eventos - Dia - 11-03-2022', 'Dia', '2022-03-11 19:58:01', 'HBQP-RGE-D-50', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Luis Perez', '', '', '', '', '', '', 'Se dejan tareas a realizar por parte de jefatura.\r\nSe deja como pendiente dar accesos comunes a personal ingresado durante el turno.'),
(51, 'Reporte General de Eventos - Noche - 12-03-2022', 'Noche', '2022-03-12 08:08:26', 'HBQP-RGE-N-51', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', '', '', '', '', '', '', 'Se deja pendiente con continuar con levantamiento de clima en los pisos 1, 2 y 3'),
(52, 'Reporte General de Eventos - Dia - 12-03-2022', 'Dia', '2022-03-12 18:25:53', 'HBQP-RGE-D-52', 'Shai Santibañez', 'Francisco Salazar, Claudio Carcamo, Bejamin Vergara', 'Jaime Estay', 'durante la jornada se siguió avanzando con las pruebas de VAV y VIGA FRÍA del segundo piso y tercero.', '', '', '', '', '', 'se deja como pendiente:\r\nRealizar los Trabajos que dejo Isaac Pérez\r\nRevisar cámaras de estacionamiento para ver quien forzó la corta fuego al lado del ascensor A12 en el piso -1\r\nterminar revisión de VAV del sector D del piso 1.'),
(53, 'Reporte General de Eventos - Noche - 13-03-2022', 'Noche', '2022-03-13 08:03:02', 'HBQP-RGE-N-53', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Shai Santibañez', '', '', '', '', '', '', ''),
(54, 'Reporte General de Eventos - Dia - 13-03-2022', 'Dia', '2022-03-13 15:33:49', 'HBQP-RGE-D-54', 'Abel Torres', 'Benjamín Toloza, Alexis Jara Y Apoyo Jaime Estay', 'Luis Perez', 'Se vuelven a dejar en comunicación los siguientes controladores de los equipos de clima.\r\nVAV-1-54, VAV-1-57, VAV-1-60, VAV-1-62, VAV-1-61, VF-1-52, VF-1-53, VF-1-57, VF-1-58,VF-1-45, VF-1-47, VF-1-49, VF-1-54, VF-1-55, VF-1-56, VF-1-59, VF-1-46, VF-1-48 y VF-1-51, dejando en total funcionamiento los equipo y así realizar las pruebas desde control.\r\nEl controlador de la VF-1-41 no se encuentra funcionando, se hicieron las mediciones correspondiente y se registro que se encontraba llegando un voltaje de 220 al equipo y aun así no logro encender.', '', '', '', '', '', 'Se deja pendiente avanzar con levantamiento de climatizacion/Control del piso 2.'),
(55, 'Reporte General de Eventos - Noche - 14-03-2022', 'Noche', '2022-03-14 06:54:14', 'HBQP-RGE-N-55', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', 'Se continuo con el revisado de VAV y VIGA FRÍA en la zona D del tercer piso', '', 'Se hizo revisado de la presión del Criogénico y este se encontraba con 199.9 PSI y se le notifico a Don Guillermo Hidalgo Jefe de equipos industriales y este autorizo al despiche del Criogénico, Claudio Cárcamo técnico de climatización realizo  el despiche este quedo con 178.4 PSI.', '', '', '', 'Se realizo los trabajos pedidos por Isaac Pérez.\r\nse deja como pendiente seguir con revisión de VAV y VIGA FRÍA DEL TERCER PISO.'),
(56, 'Reporte General de Eventos - Dia - 14-03-2022', 'Dia', '2022-03-14 20:16:11', 'HBQP-RGE-D-56', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Shai Santibañez', '', 'Se vuelve a dejar en funcionamiento UMA-1-4 Y UMA-2-27 , Dejando con climatización Sector de Auditorio.', '', '', '', '', 'Se deja pendiente los siguientes puntos.\r\n- Revisar funcionamiento del portón 3 y 4\r\n- Monitorear BCPSS 1 (Forzar según lógica de funcionamiento ).\r\n- Revisar Hallazgos.\r\n-Revisar iluminación Piso 3.\r\n- Dar accesos a Personal según lo solicitado en el turno de día.'),
(57, 'Reporte General de Eventos - Noche - 15-03-2022', 'Noche', '2022-03-15 03:38:41', 'HBQP-RGE-N-57', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', '', 'Se registra alarma por flujo evaporador en el chiller N°3, se dio el aviso al departamento de clima ordenando el apagado del equipo.\r\nAntes de encender el equipo se realizo el llenado de linea y quedando en funcionamiento el chiller N°1.', '', '', '', '', ''),
(58, 'Reporte General de Eventos - Dia - 15-03-2022', 'Dia', '2022-03-15 21:02:49', 'HBQP-RGE-D-58', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', '', 'Durante el tuno de hoy, se informa a técnico de climatización de detención de CHILLER 1, el cual durante monitoreo se detiene de forma independiente. Técnico de turno señala en terreno que esta detención se debe a que el quipo se encuentra en alarma de evaporador, por lo que se detiene y se investiga motivo.', '', '', 'Durante turno de hoy, se realiza una revisión de motores en los portones 5 y 2 por parte de empresa externa', '', ''),
(59, 'Reporte General de Eventos - Noche - 16-03-2022', 'Noche', '2022-03-16 04:54:37', 'HBQP-RGE-N-59', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', '', '', '', '', '', '', 'Se deja pendiente el encendido de la caldera Con menos hora Operativa (Central Térmica).\r\nSe deja pendiente encender Bomba BCPSS 1 según su lógica ya que esta no responde al encendido.\r\n- Monitorear temperatura hacia manifold del chiller ,que no baje de 6,5°C, para evitar falla por evaporador.');
INSERT INTO `reportes_generales` (`idReporte`, `nomReporte`, `turnoReporte`, `fechaReporte`, `folioReporte`, `nomEncargadoTurno`, `nomFuncionariosTurno`, `nomEncargadoTurnoAnterior`, `tareasControlCentralizado`, `tareasInstalaciones`, `tareasEquiposIndustriales`, `tareasIncendiosCombustibles`, `tareasDeteccionElectrica`, `tareasInfraestructura`, `pendientesCoordinacion`) VALUES
(60, 'Reporte General de Eventos - Dia - 16-03-2022', 'Dia', '2022-03-16 18:51:00', 'HBQP-RGE-D-60', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Jaime Estay', '3 personas se registraron en el control de acceso durante la jornada del día', 'Chiller N°1 se detuvo por alarma en el flujo de evaporación pero se logro regularizar la situación y este se encuentra funcionando correctamente\r\nse realizo purgado de UMA-3-36B por Claudio Cárcamo.\r\n.', 'Persona se quedo atrapada en el ascensor A82 en el piso 1 pero se logro regularizar la situación ya que se encontraba técnico de tysen en el hospital, ascensor A82 quedo operativo.', '', '', '', 'Se deja como pendiente monitorear constantemente el chiller N°1 ya que este presento falla durante la mañana\r\ndar accesos a las personas ingresadas durante la jornada \r\ny revisar accesos de los servicios que Isaac Pérez reenvió al correo de sala de control y sacar los pantallazos correspondientes a los fancoil del edificio.'),
(61, 'Reporte General de Eventos - Noche - 16-03-2022', 'Noche', '2022-03-16 22:19:05', 'HBQP-RGE-N-61', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Shai Santibañez', 'Durante turno de hoy, se informa por parte de técnico de clima que, puerta de bodega compactador se encontraba abierta completamente y con cajas como obstrucción para evitar el cierre de esta.\r\nSe terminan trabajos dejados por turno anterior.', 'Durante el tuno de hoy, Chiller 1 sobrepaso el mínimo de temperatura informado para su detención, por lo que se procede a detener múltiples veces durante el turno (Actualmente se encuentra en funcionamiento)  .', '', '', 'Durante el turno de hoy, automático de balizas P7 se encontraba caído por motivos desconocidos, se levanta el automático debido a su necesidad de uso durante turno noche.', '', 'Se deja como pendiente:\r\nRevisar motivo de caída de automático de balizas.\r\nMonitoreo constante de funcionamiento correcto de Chiller (Temperatura hacia manifold A.F. Sobre los 6,5°C, de ser menor, detener equipo hasta que la temperatura de este aumente)\r\nDetener caldera 1 a las 9:00 AM'),
(63, 'Reporte General de Eventos - Dia - 17-03-2022', 'Dia', '2022-03-17 16:46:27', 'HBQP-RGE-D-63', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', '', 'Debido a la alta humedad que se encontraba en los recintos de pabellón, se conversó con el departamento de clima y se llegó a un acuerdo de apagar los equipos (UMAS), esto se llevó a cabo después de registrar que las salas quirúrgicas se encontraban con humedad muy elevadas y así no perjudicar los equipos que se encontraban al interior.\r\n\r\nSe forzó el apagado los apagados de las UMAS, los sectores que se forzó el apagado es el casetón 6 y 5 además de todos los equipos del piso 7, debido a que se registró un incendio alrededor del recinto, esta maniobra se realizó en coordinación del departamento de clima para que no se inyectara el humo hacia el interior.', '', '', 'Se informo por parte del departamento eléctrico sobre el apagado de los automáticos en los tableros H3R y H1A.', '', 'Se deja pendiente el monitoreo del chiller durante la noche, monitorear temperaturas de la UMA-3-36B debido a que se realizo la purga, conceder los permisos a las personas ingresadas durante el día, hacer pruebas de las UMAS pabellón para verificar su lógica de funcionamiento y también volver a encender todas las UMAS que fueron forzada debido al incendio que se registró.'),
(64, 'Reporte General de Eventos - Noche - 18-03-2022', 'Noche', '2022-03-18 07:10:57', 'HBQP-RGE-N-64', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', 'Se dieron los accesos correspondientes a las personas ingresadas durante la jornada del día\r\nse realizaron pruebas en UMAS de pabellón, las cuales no mostraron ningún cambio a comparación con las pruebas realizadas anteriormente.\r\nse encendieron UMAS que fueron apagadas por incendio que se detecto en la ciudad.\r\nse mantuvo en monitoreo constante Chiller N°1 y UMA-3-36B.', 'Se encontró una leve fuga de aire en el entretecho de UPC adulto en el piso 2 sector H, de la CW-2-5 es de donde proviene el aire', 'Se reviso presión de criogénico y se encontraba a 196.1 PSI, no se purgo.', 'Se activaron dos alarmas de supervisión que no afectaron en el funcionamiento del hospital.', '', '', 'Se deja como pendiente:\r\nabrir portón N°5 a las 9 AM\r\napagar caldera N°5 a las 9 AM\r\nMonitorear Constantemente Chiller  en funcionamiento.'),
(65, 'Reporte General de Eventos - Dia - 18-03-2022', 'Dia', '2022-03-18 19:49:19', 'HBQP-RGE-D-65', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Shai Santibañez', '', 'En el trascurso del día se realizan pruebas con Umas de pabellones con SyD, finalizando estas, se apagan UMAS de Pabellón por problemas con el funcionamiento de la lógica, esta decisión fue tomada por encargados del departamento de control Centralizado', '', '', '', '', 'Se deja pendiente dar accesos a personal de las siguientes unidades:\r\nUnidad GES (3)\r\nUnidad de Personal (1)\r\nOIRS (3)\r\nCalidad y Seguridad Paciente (2)\r\nOrientación (2)\r\nComercialización (2)\r\nadmisión y archivos (2).\r\n-Revisar 2 Memorándum (31)(87)\r\n-Avanzar con levantamiento de controladores.\r\n-Monitorear temperatura del Chiller'),
(66, 'Reporte General de Eventos - Noche - 19-03-2022', 'Noche', '2022-03-19 07:30:02', 'HBQP-RGE-N-66', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', '', 'Se realizo un purgado en la UMA-3-36B debido a que presento altas temperaturas, esta acción se hizo para retirar el aire de la linea.\r\nAl realizar la purga no se registro aire en el sistema la cual nuevamente sus temperaturas se mantienen, este equipo quedara en observación durante los dias.', '', '', '', '', '- Ir monitoreando el funcionamiento del CHILLER 1 y su torre de enfriamiento \r\n- Apagar Caldera N°1 a las 9:00 de la mañana\r\n- Avanzar levantamiento de controladores (Isaac)\r\n- Monitorear temperaturas de la UMA-3-36B'),
(67, 'Reporte General de Eventos - Dia - 19-03-2022', 'Dia', '2022-03-19 18:17:40', 'HBQP-RGE-D-67', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra', 'Abel Torres', '', '', '', 'Durante el turno de hoy, guardia notifica en dos ocasiones sobre alarma de incendio, a lo cual estas se originarían debido a que el detector de humo reaccionaba con el polvo levantado al esparcir el liquido al fumigar.', 'Durante el turno de hoy, se realizaron trabajos con SACYR,  que corresponderían a ajustar el plugin al ducto de barra. Se finalizan trabajos sin problemas los cuales se continuaran durante la próxima semana', '', 'Se deja como pendiente \r\n*Monitorear Chiller 1 \r\n*Realizar avance en trabajo pendiente solicitado por jefatura.'),
(68, 'Reporte General de Eventos - Noche - 20-03-2022', 'Noche', '2022-03-20 08:15:22', 'HBQP-RGE-N-68', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', '', '', '', '', '', '', 'Se deja pendiente avanzar con levantamiento  de puntos por controlador y monitorear temperaturas del chiller.'),
(69, 'Reporte General de Eventos - Dia - 20-03-2022', 'Dia', '2022-03-20 19:48:23', 'HBQP-RGE-D-69', 'Abel Torres', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Jaime Estay', '', '', '', '', '', '', '-Monitoreo de Chiller\r\n-Continuación de levantamiento controladores'),
(70, 'Reporte General de Eventos - Noche - 21-03-2022', 'Noche', '2022-03-21 07:58:34', 'HBQP-RGE-N-70', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', '', 'Durante turno de hoy, se presentan irregularidades en temperatura de Chiller 1, este llegando a una temperatura de 5,5°C hacia Manifold en los datos integrados del Chiller vistos en BMS.', '', '', '', '', 'Se dejan como pendientes. \r\nMonitorear Chiller 1\r\nAvanzar en levantamiento'),
(71, 'Reporte General de Eventos - Dia - 21-03-2022', 'Dia', '2022-03-21 16:18:59', 'HBQP-RGE-D-71', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', '', 'Al encenderse el chiller N°3 la bomba del evaporador BAEP-3R mostro alarma en el estado térmico, debido a esto se realizo el apagado inmediatamente del equipo, quedando su estado en manual. El equipo quedara fuera de servicio hasta nuevo aviso.\r\n\r\nTambién se registro que al encender la caldera N°3, se percato de una alarma en el la bomba BCAP-1 que va hacia cadera, debido a esto se realizo el apagado del equipo, quedando con su selector en manual.\r\nEl equipo quedara fuera de servicio hasta nuevo aviso.\r\n\r\nSe dejan forzadas apagada todas las BCAS, debido a que continuaban encendidas siendo que las calderas se encontraban deshabilitadas, las pruebas correspondientes se hicieron junto clima y se tomo la decisión de dejarlas forzada apag|ada.', '', '', '', '', '- Monitorear temperaturas de la UMA-3-36B.\r\n- Monitorear Chiller 2 durante el turno.\r\n- Avanzar el levantamiento de los controladores.\r\n- Navegación en los sistemas de BMS.\r\n- Monitoreo de UMAS que alimentan a consultas medicas.\r\n- Dar permisos a las personas ingresadas durante el día.\r\n- Dar permisos a Tamara Venegas (industrial) los mismos permisos que Karla Jeldres.\r\n- Revisión de iluminaria para ahorro de energía.'),
(72, 'Reporte General de Eventos - Noche - 22-03-2022', 'Noche', '2022-03-22 06:36:07', 'HBQP-RGE-N-72', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', 'Se otorgaron los accesos correspondientes a las personas ingresadas durante la jornada del día 21/03/22', 'Se enciende Caldera n°1 Y Caldera n°4  a las 07:00 AM según lo acordado con Clima.', '', 'se presentaron 3 alarmas de supervisión en distintos pisos, que no afectaron al funcionamiento del establecimiento.', '', '', 'Tareas Realizadas:\r\nMonitoreo de temperaturas de UMA-3-36B\r\nMonitoreo constante durante la noche al Chiller N°2\r\nSe avanzo con el levantamiento de Controladores.\r\nSe otorgaron los accesos correspondientes.\r\nSe reviso luminaria de solo algunos sectores del piso 1 (G,I,D,E,F y K)\r\nSE DEJA COMO PENDIENTE:\r\nMonitoreo constante a las UMAS de consultas medicas.'),
(73, 'Reporte General de Eventos - Dia - 22-03-2022', 'Dia', '2022-03-22 11:12:24', 'HBQP-RGE-D-73', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Shai Santibañez', '', 'A las 12:25 por motivos de falla en las 2 bombas de combustible se tomo la decisión por el departamento de clima , de detener las calderas por el transcurso del día.', 'Se realizaron pruebas en sistema de bombas de combustible las cuales presentaron una alarma a las 12:25 , con esto informado al departamento se tomo la decisión de dejar sin calderas por el día.', '', 'Se activa Magneto térmico del tablero H1Q afectando Todo el sector D del piso 1, se vuelve a normalizar a corto tiempo con el departamento eléctrico.', '', 'Se deja pendiente ingresar a personal de:\r\nLicitaciones \r\nComercialización \r\ndental\r\nC Y S Pacientes \r\nConsultorio especialidades.\r\nSe deja pendiente encender caldera N°1 Y N°4 a las 7:00 Am \r\nSe deja pendiente apagar bomba BCPSS 1 según su lógica, ya que esta no se detiene por si sola .'),
(74, 'Reporte General de Eventos - Noche - 23-03-2022', 'Noche', '2022-03-23 07:37:59', 'HBQP-RGE-N-74', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', '', 'Durante la noche se presento alarma en chiller N°2, la alarma que presento fue flujo evaporador según el comunicado por parte del departamento de clima. El equipo quedara fuera y solo se dejo en funcionamiento el chiller N°1 que se debe estar constantemente en monitoreo\r\n\r\nAl prender la caldera N°4 clima informo que se presento un paro por bloqueo en el quemador de dicha caldera, esto fue debido a que no se encontraba realizando la combustión como corresponde. A los minutos después se prendió la caldera N°2 pero nuevamente presento el mismo paro que la anterior, debido a esto las calderas de climatización quedaran fuera de servicio hasta que se solucione el problema de combustión.', '', '', '', '', '- Apagar caldera N°1 a las 9:00.\r\n- Monitorear panel de combustible.\r\n- Monitorear Chiller\r\n- Monitoreo de UMAS consulta medica.'),
(75, 'Reporte General de Eventos - Dia - 23-03-2022', 'Dia', '2022-03-23 10:21:32', 'HBQP-RGE-D-75', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', 'Durante turno de hoy, se apaga servidor debido a trabajos de limpieza realizados por tics en el servidor, lo que conlleva a una perdida de BMS durante alrededor de una media hora, ya que el sistema se apaga a las 18:34 y se reestablece a las 19:07.', 'Durante turno de hoy, se detiene Chiller 1 para realizar un purgado en piso 7 en conjuntos personal de STI', '', '', '', '', 'Se deja como pendiente \r\nDar accesos a personal registrado en el sistema el día de hoy.\r\nDar accesos a personal de Tics de acuerdo a lo enviado.'),
(76, 'Reporte General de Eventos - Dia - 24-03-2022', 'Dia', '2022-03-24 13:51:37', 'HBQP-RGE-D-76', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Jaime Estay', '', 'Durante la jornada de la mañana la caldera N°5 presento temperaturas bajas a lo que clima decidió tomar la acción de apagarla.\r\nse dejan forzadas apagadas todas la bombas de central térmica durante la jornada de la mañana por trabajos eléctricos\r\ncaldera N°5 queda operativa hasta nuevo aviso.', 'llego personal de tysen a trabajar en ascensor A7-2', '', '', '', 'dar los accesos correspondientes a las personas ingresadas durante la jornada.\r\ndar accesos comunes a técnicos de tysen.\r\ncontinuar levantamiento controladores.\r\ncambiar caldera N°5 por caldera N°2 al cambio de turno'),
(77, 'Reporte General de Eventos - Noche - 25-03-2022', 'Noche', '2022-03-25 07:26:21', 'HBQP-RGE-N-77', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Shai Santibañez', 'Durante turno de hoy, se dan accesos solicitados dejados como pendientes para turno noche', 'Durante turno de hoy, Caldera 1 al momento de encender, informa técnico de clima que esta presenta falla de bloqueo. \r\nTécnico actúa reseteando caldera para normalizar su funcionamiento.', '', '', '', '', 'Se deja como pendiente detener caldera 1 a las 9:00'),
(78, 'Reporte General de Eventos - Dia - 25-03-2022', 'Dia', '2022-03-25 10:11:29', 'HBQP-RGE-D-78', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', '', '', '', 'El estanque N°1 mostro alarma por bajo nivel de combustible, se informo al departamento industrial y se realizo el cambio de formal manual al estanque N°2 que se encontraba en 71%.\r\nEl estanque N°1 queda fuera de servicio hasta que se realice su llenado.', '', '', '- Levantamiento Controladores\r\n- Encendido de calderas a las 7:00\r\n- Trabajo de Lizandro.'),
(79, 'Reporte General de Eventos - Noche - 26-03-2022', 'Noche', '2022-03-26 06:14:13', 'HBQP-RGE-N-79', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', 'se le dieron los accesos correspondientes a las personas ingresadas durante el día.', 'se revisaron VAV del sector H en conjunto con clima.', '', 'durante todo el turno se presento una alarma de supervisión no relevante para el normal funcionamiento del establecimiento.', '', '', 'monitorear Chiller N°1 y caldera N°5\r\nmonitorear UMAS de consultas medicas\r\napagar caldera N°1 a las 09:00 AM\r\nabrir portón N°5 a las 09:00 AM'),
(80, 'Reporte General de Eventos - Dia - 26-03-2022', 'Dia', '2022-03-26 12:16:51', 'HBQP-RGE-D-80', 'Jaime Estay', 'Matias Gutierrez , Benjamin Carvajal', 'Shai Santibañez', 'A las 16', 'Se detiene toda, Climatización, central térmica, paneles solares, central de frio ya que se realizaran pruebas en el transcurso del día con los grupos de generadores.', '', '', 'Se realizaron pruebas con SACYR/DIPERK , sobre los grupos de generadores .', '', 'Se deja pendiente encender caldera 1 y monitorear equipos de climatización que hoy fueron apagados por el corte.'),
(81, 'Reporte General de Eventos - Noche - 27-03-2022', 'Noche', '2022-03-27 08:07:44', 'HBQP-RGE-N-81', 'Abel Torres', 'Alexis Jara', 'Jaime Estay', '', 'Según lo informado por parte del dep. clima los equipos de central térmica (Calderas) quedaran fuera de servicio, debido a que se registraron problemas en las bomba de expansión.\r\n\r\nSe registro alarma en inyección de la UMA-3-26 y quedara apagada, también se encuentra con alarma la inyección de la UMA-7-42 que se encontrara apagada.', '', 'Durante el turno se registro una alarma de baja presión en la bomba de expansión en panel de combustible, la presión que se llego a registrar fue de 0,86 bar. Debido a esto el departamento de clima dio la orden de apagar calderas y dejarlas fuera de servicio hasta que se solucione dicho problema.', '', '', '- Volver a su estado automático los equipos que se encuentran forzado encendido.'),
(82, 'Reporte General de Eventos - Dia - 27-03-2022', 'Dia', '2022-03-27 20:05:30', 'HBQP-RGE-D-82', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', '', '', '', 'Durante turno de hoy, se presenta una alarma de incendio en los ejes  H-1-21 P1 Zone Z191 S. Rayo Osteopulmonar en Fm200', '', '', 'Se deja como pendiente avanzar en EXEL canal horario'),
(83, 'Reporte General de Eventos - Noche - 28-03-2022', 'Noche', '2022-03-28 08:29:50', 'HBQP-RGE-N-83', 'Jaime Estay', 'Matias Gutierrez , Benjamin Carvajal', 'Luis Perez', '', '', '', 'En el transcurso de la mañana se presunto una alarma de incendio en el sector de imagenología (Sector 1.19), esta alarma fue verificada y rearmada en terreno ya que no presentaba un problema para el funcionamiento del hospital.', 'Se modifico el canal horario de  todo el hospital el cual fue plasmado en un levantamiento.', '', 'Se deja pendiente Abrir portón 5 a la hora correspondiente, tener un monitoreo de las temperaturas del chiller y gestionar normalización sobre la baja presión de combustible.'),
(84, 'Reporte General de Eventos - Dia - 28-03-2022', 'Dia', '2022-03-28 09:08:40', 'HBQP-RGE-D-84', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Jaime Estay', 'Se termino la revisión de luminaria y VAV en el sector C del piso 2 (laboratorio)\r\nSe ingresaron 5 personas al sistema durante la jornada.', 'Javier Beltrán informa que chiller N°2 no se encuentra operativo, por aceite bajo en su sistema\r\nyUMA-3-26  UMA-7-42 vuelven a estar operativas, ya no presentan alarma de alta corriente en sus respectivos VIN', '', 'Javier Beltrán encargado de departamento de clima informa que se soluciono la alarma de baja presión en las bombas de expansión de combustible de las calderas.', '', '', 'Se deja como pendiente:\r\nOtorgar los accesos correspondientes a las personas ingresadas durante la jornada.(5)\r\nAl cambio de turno para funcionamiento de caldera N°2 y hacer funcionar caldera N°5\r\nEncender Caldera N°1 a las 07:00 AM\r\nMonitoreo Constante de Chiller N°1'),
(85, 'Reporte General de Eventos - Noche - 29-03-2022', 'Noche', '2022-03-29 06:35:25', 'HBQP-RGE-N-85', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Shai Santibañez', 'Se finaliza trabajo pendiente dejado por jefatura (Dejar en Exel sector y PMA acorde a alumbrado de los distintos Pisos)', '', '', 'Durante turno de hoy, Se confirma nuevamente problema de mantenimiento en sensor de humo ubicado en casetón 5 según BMS, sector 3.9 y 3.10 ejes H/8, cabe señalar que dicho problema se ha presentado a menudo en el sistema y aun no se ha llegado a una solución.', '', '', 'Se deja como pendiente detener caldera 1 a las 9:00 según lo programado'),
(86, 'Reporte General de Eventos - Dia - 29-03-2022', 'Dia', '2022-03-29 19:27:41', 'HBQP-RGE-D-86', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', '', '', '', '', '', '', '- Apagado de bomba paneles solares (BCPSS1).\r\n- Monitoreo de central frio y central térmica.\r\n- Revisa iluminarias del recinto.\r\n- Conceder permisos a personal ingresado durante el día.'),
(87, 'Reporte General de Eventos - Noche - 30-03-2022', 'Noche', '2022-03-30 06:28:55', 'HBQP-RGE-N-87', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', 'Se otorgaron los accesos correspondientes a la persona ingresada durante la jornada del día.\r\nSe trabajo junto con clima para lograr flujo y extracción en los recintos del sector D del segundo piso.\r\nSe avanzo en la revisión de analizadores de Red.', 'Durante la noche se realizaron pruebas con la UMA-S1-31A para lograr conseguir flujo en los recintos D-2-35 y D-2-34 lo cual se logro dejando algunos parámetros de la UMA forzados, cabe destacar que durante el proceso de pruebas, en la primera prueba que fue forzar el VIN y  VEX de la UMA los difusores del sector D soltaron mucho polvo lo que provoco una alarma de incendio pero que se regularizo a la brevedad, después de ir tomando flujo y tanteando los parámetros se logro que estos recintos cuenten con flujo y extracción correspondiente.', '', 'Se produjo una alarma de incendio en el sector D del segundo Piso debido a las pruebas que se realizaron durante la noche con la UMA-S1-31A\r\nHOSPITAL CENTRAL 3 HOSPITAL QUILLOTA M/11 Sala Espera Piso 2 Zone Z031.', '', '', 'Monitorear UMA-S1-31A como se comporta con los parámetros forzados.\r\nApagar Caldera N°1 a las 9:00AM\r\nAbrir Portón N°5 a las 09:00AM'),
(88, 'Reporte General de Eventos - Dia - 30-03-2022', 'Dia', '2022-03-30 19:06:25', 'HBQP-RGE-D-88', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Shai Santibañez', '', '', '', '', '', '', 'Se deja pendiente Monitorear circuito del Chiller 1 ya que en el transcurso del día se realizaron modificaciones en el set de su Torre de enfriamiento.\r\nAvanzar con el pegado de los PMA restantes en el Piso 1.\r\nAccesos a personal de finanzas y contabilidad, Hospitalización domiciliaria.'),
(89, 'Reporte General de Eventos - Noche - 31-03-2022', 'Noche', '2022-03-31 07:48:00', 'HBQP-RGE-N-89', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', '', '', '', '', '', '', '- Monitoreo a grafica de central frio, debido a los cambios de set que se realizaron en la torre.\r\n- Monitoreo a panel de combustible, ya que el estanque 2 se encuentra con poco porcentaje de combustible.\r\n- Apagado de la caldera N°1 a las 9:00 de la mañana.\r\n- Encendido de la BCPSS panel solar cuando la temperatura exterior sea de 12°C\r\n- Apertura de portón N°5 según lo acordado.'),
(90, 'Reporte General de Eventos - Dia - 31-03-2022', 'Dia', '2022-03-31 14:03:44', 'HBQP-RGE-D-90', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', '', '', '', 'Durante turno de hoy, Se confirma nuevamente problema de mantenimiento en sensor de\r\nhumo ubicado en casetón 5 según BMS, sector 3.9 y 3.10 ejes H/8, cabe señalar que dicho\r\nproblema se ha presentado a menudo en el sistema y aun no se ha llegado a una solución', '', '', 'Se dejan como pendientes:\r\n-Revisar funcionamiento de UMA-S1-36 \r\n-Dar accesos correspondientes a personas ingresadas el turno de hoy \r\n-Pegar los PMA en los recintos correspondientes (Isaac Pérez)\r\n-En turno día trabajar con bomba BCPSS-1R hasta que esta llegue a las 1000 horas.'),
(91, 'Reporte General de Eventos - Noche - 01-04-2022', 'Noche', '2022-04-01 05:30:52', 'HBQP-RGE-N-91', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', 'En el transcurso de la noche se presento la caída de controladores en el sector del Casetón G Y H (Piso 3)se verifico en terreno y los equipos siguen en funcionamiento pero sin comunicación.', '', '', '', '', '', 'Se deja pendiente apagar caldera 1 y realizar el cambio a caldera numero 5 a las 07:00 AM.\r\nEncender bomba BCPSS-1R hasta que el horómetro llegue a 1000 horas.\r\nPegar PMA faltantes del Piso 1 / samu.'),
(92, 'Reporte General de Eventos - Dia - 01-04-2022', 'Dia', '2022-04-01 18:04:42', 'HBQP-RGE-D-92', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Jaime Estay', 'Se mantuvo un constante monitoreo de los equipos críticos ya que el día de hoy se realizaron pruebas de sincronismo de los generadores N°1, N°2 y N°3, en la cual no se presento ningún problema en las pantallas graficas de control centralizado.', 'Como protocolo de cuidado de los equipos de climatización antes de la prueba de los generadores, los equipos se apagaron desde control centralizado y luego personal de clima fue colocando la parada de selector paco seguridad en estado deshabilitado, esto con el fin de proteger de una mejor manera los equipos de climatización.', '', '', 'El día de hoy se hizo una prueba de sincronismo generadores a las 17:00hrs, en la cual se encendieron los generadores N°1, N°2 y N°3, los cuales no presentaron ningún problema a la hora de realizar la prueba.', '', 'Se deja como pendiente:\r\nDar los accesos correspondientes a las personas ingresadas durante el día.\r\nMonitoreo constante de los equipos críticos, esto con el fin de estar atento si presentan algún cambio o alarma debido a las pruebas de los generadores realizadas hoy.\r\nRealizar el cambio de caldera en el cambio de turno de la mañana.'),
(93, 'Reporte General de Eventos - Noche - 02-04-2022', 'Noche', '2022-04-02 06:34:31', 'HBQP-RGE-N-93', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Shai Santibañez', 'Se conceden accesos comunes a personal ingresado durante turno anterior.', '', '', 'Durante turno de hoy, Se confirma nuevamente problema de mantenimiento en sensor de\r\nhumo ubicado en casetón 5 según BMS, sector 3.9 y 3.10 ejes H/8, cabe señalar que dicho\r\nproblema se ha presentado a menudo en el sistema y aun no se ha llegado a una solución.\r\nSe detiene caldera 5 debido a que ambos tanques de combustible se encuentran con bajo nivel.', '', '', 'Terminar de revisar los FC del piso -1 \r\nMantener monitoreo de Chiller 1'),
(94, 'Reporte General de Eventos - Dia - 02-04-2022', 'Dia', '2022-04-02 20:11:09', 'HBQP-RGE-D-94', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', 'Los controladores de los equipos de clima fc-s1-07, fc-s1-56, fc-s1-10, fc-s1-11, fc-s1-12, fc-s1-02, fc-s1-01,fc-s1-55A, fc-s1-04 y fc-s1-42 queda en total comunicación con control centralizado.', 'Los equipos de climatización fc-s1-07, fc-s1-56, fc-s1-10, fc-s1-11, fc-s1-12, fc-s1-02, fc-s1-01,fc-s1-55A, fc-s1-04 y fc-s1-42 se dejaron en funcionamiento en conjunto con Alexis Jara del departamento clima.', '', 'Durante el turno se realizo el llenado de los tanque N°1 y N°2 de combustible, la cual quedaron en un 45% el N°1 el tanque N°2 quedo en 63% de combustible.', '', '', '- Cambio de las caldera N°2 a la N°5.\r\n- Encendido de caldera N°1'),
(95, 'Reporte General de Eventos - Noche - 02-04-2022', 'Noche', '2022-04-02 22:09:02', 'HBQP-RGE-N-95', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', 'Se finalizo la revisión de los analizadores de red, la revisión fue en conjunto con Benjamín Vergara técnico de departamento eléctrico.\r\nSe realizo el cambio de hora de manera manual en el BMS, ya que no lo hizo por si solo, cabe destacar que los computadores de control centralizado realizaron el cambio de hora de manera automática.\r\nEl enchufe del reloj control nuevo se encuentra tomado del circuito 6 del tablero H1K.\r\nCámaras de seguridad no realizaron cambio de hora, se le da aviso a Rubén Riveros de departamento de tics vía mensaje de texto y responde que el día lunes se vera el cambio de hora de las cámaras de seguridad.', '', '', 'Una hora antes del cambio de hora en la central de incendio se activo una alarma de los relojes de control de la entrada la cual decía lo siguiente:\r\nProblema- El reloj de la puerta de entrada y el reloj del cliente son significativamente di.\r\nEsta alarma se produjo por que el enchufe del reloj nuevo esta tomado del circuito 6 del tablero H1K el cual estaba con canal horario, esto produjo que el reloj se apagara, se soluciono dejando forzado el  circuito N°6 del tablero H1k.', '', '', 'Se deja como pendiente:\r\nApagar Caldera N°1 a las 09:00 AM\r\nMonitoreo Constante de Chiller y UMAS.'),
(96, 'Reporte General de Eventos - Dia - 03-04-2022', 'Dia', '2022-04-03 18:20:14', 'HBQP-RGE-D-96', 'Jaime Estay', 'Matias Gutierrez (clima), Joaquin Vicencio(industrial) , Benjamin Carvajal(electricidad).', 'Shai Santibañez', 'Se normaliza Hora en programa de control de acceso , pero aun no se logra normalizar hora en cámaras.\r\nSegún lo acordado con el turno anterior se conversara con TICS para dar una solución.', 'Se normalizan equipos de clima que se encontraban apagados ya que no toman canal horario.', '', '', '', '', 'Se deja pendiente realizar cambio de caldera N°5  a N°2 y encender caldera N°1.\r\nRealizar una revisión del levantamiento de salas eléctricas y Comunicaciones.'),
(97, 'Reporte General de Eventos - Noche - 04-04-2022', 'Noche', '2022-04-04 07:26:22', 'HBQP-RGE-N-97', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', 'Durante el turno se registro que los equipos de clima se encuentran con su controlador deshabilitado, estos equipos son las VAV-1-214, VF-1-57, VF-1-41, VAV-2-157, VAV-2-154, VAV-2-155, VAV-2-156, VAV-2-91 y VF-5-14/141, estos equipos todavía no se registran en terreno la cual no se sabe si su controlador se encuentra dañado.', '', '', '', '', '', '- Monitorear equipos de clima que alimentan consulta medica.\r\n- Apagado de caldera N°1 a las 9:00.\r\n- Revisión de controladores que se encuentran deshabilitados.'),
(98, 'Reporte General de Eventos - Dia - 04-04-2022', 'Dia', '2022-04-04 19:18:24', 'HBQP-RGE-D-98', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', '', 'Durante turno de hoy se hicieron pruebas de funcionamiento en CHILLER 2, por lo que se estuvo intercambiando el uso de este con el CHILLER 1 hasta que se deja finalmente el CHILLER 2 en funcionamiento', '', '', '', '', 'Se deja como pendientes \r\n*Revisar torres de enfriamiento en BMS(hallazgo)\r\n*Dar accesos a personal ingresado durante turno día, además de gestionar una tarjeta para los 2 nuevos miembros de control centralizado\r\n*Revisar canal horario de todo el hospital.'),
(99, 'Reporte General de Eventos - Noche - 05-04-2022', 'Noche', '2022-04-05 05:48:59', 'HBQP-RGE-N-99', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', '', '', '', '', '', '', '-Se deja pendiente rellenar levantamiento de las salas de comunicación y eléctricas del edificio. \r\n-Apagar la caldera N°1 a las 9:00 AM\r\n- Encender la Bomba BCPSS R1 cuando corresponda según su lógica y realizar el cambio si esta llega a superar las 1000 horas (Horómetro).\r\n-Abrir el Portón N°5 a las 9:00 horas.'),
(100, 'Reporte General de Eventos - Dia - 05-04-2022', 'Dia', '2022-04-05 15:45:01', 'HBQP-RGE-D-100', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Jaime Estay', 'Se ingresaron 9 personas al sistema de control de acceso durante la jornada del día.\r\nSe presentaron múltiples caída del sistema BMS debido a trabajos realizador por tics a las 17:03 PM en el rack RH2F.', 'Se realizo el purgado del sistema en el piso 7.\r\nSe relleno el sistema de aceite de Chiller N°2.', 'Don Guillermo Hidalgo Jefe de departamento industrial informa que se debe estar atento al utilizar el ascensor A6, ya que este esta presentando falla ( código de falla: 67446).', '', '', '', 'Se deja como pendiente: \r\nDar los accesos Correspondientes a las personas ingresadas durante el día .\r\nMonitoreo de Chiller N°2 .\r\nEncender Caldera N°1 a las 7AM.'),
(101, 'Reporte General de Eventos - Noche - 06-04-2022', 'Noche', '2022-04-06 00:37:16', 'HBQP-RGE-N-101', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Shai Santibañez', 'Durante turno de hoy, sistema de BMS alarma sobre caída del controlador principal BOS05P2, como consecuencia de esta caída se perdió comunicación con la mitad del 2do piso; siendo las zonas afectadas las D-E-F-K-I-N y J. Recordar que con la caída del controlador se pierde gobernanza con TODO equipo que se encuentre manejado y visualizado por control centralizado y este ubicado en dichas zonas\r\nGuardias notifican de que portón 1 (acceso O\'Higgins) se encuentra con problemas, al revisarlo en conjunto con los técnicos nos percatamos de que este a la mitad de su recorrido comienza a  moverse hacia fuera del eje con el engranaje piñón, por lo que se decide que este quede a medio abrir para de esta forma evitar que este se salga del engranaje generando un mayor problema', '', 'Durante turno de hoy, técnico de ascensores Víctor Jaramillo santana de empresa TKE ingresa al hospital a realizar mantención a ascensores A6-2 y A4-2 ya que estos presentaron problemas durante turno anterior por lo que se solicito una revisión a estos por parte de la jefatura correspondiente. \r\nAl revisar los ascensores, técnico notifica de que los problemas presentes en estos se debían a su bajo voltaje presente en la serie de seguridad, midiendo en el A4 20v y en A6 19v por lo que la lógica de los ascensores detectaba esta falta de voltaje como un falla o un problema de seguridad produciendo el mal accionar de estos.', '', 'Durante turno de hoy, se perdió gobernanza sobre las iluminarias en las zonas D-E-F-K-I-N y J dejando las iluminarias encendidas, por lo que se toma la decisión de apagar los circuitos de alumbrado desde el tablero correspondiente a dichas zonas para un ahorro energético.', '', 'Detener caldera 1 a las 9:00'),
(102, 'Reporte General de Eventos - Dia - 06-04-2022', 'Dia', '2022-04-06 20:02:57', 'HBQP-RGE-D-102', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', '', '', '', '', '', '', '- Conceder permisos a personal ingresado durante el día.\r\n- Cambiar set retorno de todas las UMAS a 22.0°C.\r\n- Monitoreo de panel combustible.'),
(103, 'Reporte General de Eventos - Noche - 07-04-2022', 'Noche', '2022-04-07 00:44:38', 'HBQP-RGE-N-103', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', 'Se cambiaron los valores de los set de retorno de las UMAS a  22°C\r\nSe otorgaron los accesos correspondientes a las personas ingresadas durante la jornada.', 'Se presento un problema con la caldera N°1 la cual no respondía las ordenes desde control. Al verificar en control que no tenia alarma, se verifico en terreno y Claudio Cárcamo, técnico de climatización, dio aviso que el térmico de la BCAP-5, se encontraba habilitado. Claudio Cárcamo realizo la prueba de subir el térmico por ordenes de Javier Beltrán Jefe de departamento de Climatización y la caldera respondió positivamente. Actualmente, se encuentra funcionando con normalidad.\r\nSe presento un paro por alarma del Chiller N°2, el cual se encontraba funcionando, Javier Beltrán Jefe de Climatización da la orden de encender Chiller N°1.', '', '', '', '', 'Se deja como pendiente:\r\nMonitoreo del Chiller N°1\r\nMonitoreo de Calderas N°1 y 5\r\nMonitoreo de temperaturas de consultas medicas.'),
(104, 'Reporte General de Eventos - Dia - 07-04-2022', 'Dia', '2022-04-07 10:57:57', 'HBQP-RGE-D-104', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Shai Santibañez', 'En el transcurso de la mañana se produjo la caída del ECBOS02P1, con esto dejando sin comunicación de los equipos de (Clima, Iluminación)de las siguientes zonas del edificio: B,C,G,H,I.\r\nLa duración de esta caída fue de 56 min y fue reestablecido con ayuda de departamento eléctrico y control centralizado.', '', '', 'Durante el transcurso de la mañana se realizo  el llenado del los tanque de combustible 1 y 2 (Calderas), con una medición de :TANQUE 1 (26%) Y TANQUE 2 (27%) ,finalizando el llenado con Tanque 1 (87%) y Tanque 2 (93%).', 'En el transcurso de la mañana se detecto un pluggin suelto, el cual afecto directamente con la alimentación del ECBOS02P1(controlador maestro).\r\nEl departamento eléctrico, comenzó con el trabajo del apretado de pluggin, dejando solucionado el problema.\r\nTablero afectado (H1U, BARRA 2,Fase S).', '', 'Se deja pendiente:\r\n-Cerrar portón 5.\r\n-Apagar Bomba BCPSS-1 según su lógica de funcionamiento.\r\n-Comunicar sobre el protocolo de ECBOS al turno entrante.\r\n-Avanzar con levantamiento de listado de equipos.'),
(105, 'Reporte General de Eventos - Dia - 07-04-2022', 'Dia', '2022-04-07 19:06:23', 'HBQP-RGE-D-105', 'Luis Pérez', 'Matías Gutiérrez , Joaquín Vicencio , Benjamín Carvajal', 'Jaime Estay', 'Hoy realice reemplazo de turno a Jaime Estay desde las 14:00 hrs. hasta las 20:00 hrs.\r\n\r\nDurante turno de hoy,  se apaga el servidor ya que se ejecutarían trabajos en Data Center, esto provoco una caída del sistema de BMS, control de acceso y CCTV', 'Durante turno de hoy, se detienen equipos de climatización, entre ellos Chiller y caldera en funcionamiento ya que al apagar el servidor se perdería la visualización y el control sobre estos.', '', 'Durante el turno de hoy, se realiza llenado del los tanque de combustible 3 y 4\r\n(Generadores), con una medición de termino 69% tanque 4 y 68% tanque 3', '', '', '*Dar los accesos correspondientes a las personas ingresadas \r\n*Continuar levantamiento (Isaac)\r\n*Terminar el encendido de equipos de climatización\r\n*Cerrar portón 5 \r\n*Encender caldera 1 a las 7:00'),
(106, 'Reporte General de Eventos - Noche - 08-04-2022', 'Noche', '2022-04-08 07:12:04', 'HBQP-RGE-N-106', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', 'Debido al corte que se realizo en el ducto de barra se registro la caída del BOS06P3, la cual se perdió total comunicación de los equipos que se encuentran conectados al controlador maestro, luego de restablecer la energía se demoro aproximadamente 10 minutos en volver la comunicación y control de los equipos, luego de eso el BOS se encuentra funcionando como corresponde.', '', '', '', 'Durante el turno se registro cortes de energía constantemente en la sala de control, se le dio aviso al eléctrico de turno Benjamín Toloza para verificar la causa de los cortes, se verifico que los generadores no estuvieran funcionando la cual estaban deshabilitados, el eléctrico de turno informo que realizaría un seguimiento para verificar el problema ya que en el pasillo también se encontraban las luces realizando destellos sucesivamente, la cual encontró el problema en un plugin del ducto barra 3. Informo que iba a realizar un corte para hacer el apretado del plugin (fue autorizado por Gustavo Loira jefe del departamento eléctrico) esto según lo comentado solo afectaría iluminaria y enchufes de poder pero se verifico que se encontrara todo bien en sala de control y data center la cual no se perjudico ninguno de los dos recinto. La maniobra duro aproximadamente 10 minutos y después de eso no se presentaron problemas.', '', '- Se deja pendiente el apagado de la caldera N°1 a las 9:00.'),
(107, 'Reporte General de Eventos - Dia - 08-04-2022', 'Dia', '2022-04-08 19:36:11', 'HBQP-RGE-D-107', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', '', 'Durante turno de hoy, caldera 2  presenta alarma de bloqueo, durante revisión nos percatamos que esta se debió a  una baja presión en bombas de agua caliente, por lo que se procede a realizar llenado y a normalizar funcionamiento de la caldera 2', '', '', '', '', '*Dar los accesos correspondientes a personal ingresado durante turno día'),
(108, 'Reporte General de Eventos - Noche - 09-04-2022', 'Noche', '2022-04-09 07:42:22', 'HBQP-RGE-N-108', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', '', '', '', '', '', '', 'Se deja pendiente:\r\n-abrir el portón 5\r\n-Apagar caldera 1  las 9:00 AM.\r\n-Encender bomba BCPSS-1 según su lógica.\r\n-avanzar con levantamiento del listado de equipos.'),
(109, 'Reporte General de Eventos - Dia - 09-04-2022', 'Dia', '2022-04-09 10:11:33', 'HBQP-RGE-D-109', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Jaime Estay', 'Se detectan durante la jornada múltiples caídas de equipos FC en el subterráneo, estos equipos pierden conexión y vuelven a los minutos, si el problema persiste se la dará aviso a departamento TICS el día lunes.', 'Durante la Jornada de la mañana personal de turno de climatización, llevo a cabo la limpieza de la Torre N°2, a lo cual se dejo en funcionamiento el Chiller N°1, el cual tuvo alarma por evaporador.\r\nSe encuentra en funcionamiento el Chiller N°2.', '', '', '', '', 'Se deja como pendiente:\r\nRevisión Fc del piso -1\r\nRevisión biométrico ascensor A12 del tercer piso.'),
(110, 'Reporte General de Eventos - Noche - 10-04-2022', 'Noche', '2022-04-10 07:46:30', 'HBQP-RGE-N-110', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Shai Santibañez', 'Se detectan durante la jornada múltiples caídas de equipos FC en el subterráneo, estos\r\nequipos pierden conexión y vuelven a los minutos, si el problema persiste se la dará aviso a\r\ndepartamento TICS el día lunes.', '', '', '', 'Al entrar al turno, magnetotérmico del P7 se encuentra alarmado, esto se le informa a técnico del departamento eléctrico, quien al normalizar el tablero comunica que este problema puede ocurrir  por una baliza la cual se encuentra quemada.', '', 'Se deja como pendiente \r\n*Detener funcionamiento de caldera 1, según el horario acordado (09:00)\r\n*Revisar biométrico A12 P3 ya que no lee huella'),
(111, 'Reporte General de Eventos - Dia - 10-04-2022', 'Dia', '2022-04-10 11:54:08', 'HBQP-RGE-D-111', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', '', '', 'Durante la rutina de visualización por las pantallas grafica del sistema BMS, se percato de una alarma en las tres bomba de riego, la cual se le pidió a Alexi Jara técnico de turno del departamento de climatización si el podía dirigirse al lugar y verificar en terreno la situación de las bombas, en lo que informo sobre una alarma de bajo nivel en el estanque de riego y el de incendio (se verifico directamente el nivel del estanque y claramente era lo que se reflejaba en el tablero), también se percato que estaba en funcionamiento una válvula del sistema (según lo que salía en el tablero de riego).\r\nEsta es toda la información que se pudo rescatar según control centralizado y el departamento de climatización que visualizo el tablero que estaba en terreno, se le dará aviso a los encargados para verificar la causas de la alarma.\r\n\r\nA las 12:09  se llamo a Guillermo Hidalgo encargado del departamento industrial y se encuentra en conocimiento de la situación, la cual se contactara con personal de incendio Víctor Fierro para comenzar la maniobra de llenado de los estanque riego e incendio.\r\n\r\n19:35 se termino el llenado del estanque de riego e incendio la cual quedo casi al nivel según lo indicado.', '', '', '', '- Ver tema de alarma en bomba de riego y levantar automáticos.\r\n- Encendido de caldera 1.\r\n- Revisión de umas que se encuentran climatizando los sectores donde ya hay funcionarios.'),
(112, 'Reporte General de Eventos - Noche - 10-04-2022', 'Noche', '2022-04-10 22:52:58', 'HBQP-RGE-N-112', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', 'Se realizo la revisión de VAV, del sector G del 2 Piso, en compañía de Claudio Cárcamo, técnico de Climatización.\r\nEn la revisión se encontró en el entre el entre techo un paquete de galletas y huellas de ratones.', '', '', 'Se Deshabilito un modulo de supervisión ( HOSPITAL SUBT-1 FALLA FUENTE EJE R-13 Zone Z900), ya que al confirmar la supervisión, este se activa y desactiva reiteradas veces.', '', '', 'Se deja como pendiente:\r\nDar aviso a Don Víctor Fierro, encargardo de departamento de incendio, sobre el modulo deshabilitado en central de incendio.\r\nAbrir portón N°5 a las 09:00\r\nApagar Caldera N°1 a las 09:00\r\nMonitoreo de UMAS de consultas medicas.'),
(113, 'Reporte General de Eventos - Dia - 11-04-2022', 'Dia', '2022-04-11 19:00:00', 'HBQP-RGE-D-113', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Shai Santibañez', '', '', '', '', '', '', 'Se deja pendiente:\r\n-Monitoreo de recintos de consultas medicas.\r\n-Encender caldera 1 a las 6:30 AM.\r\n-Dar accesos a personal ingresado durante la jordana.'),
(114, 'Reporte General de Eventos - Noche - 12-04-2022', 'Noche', '2022-04-12 02:05:22', 'HBQP-RGE-N-114', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', '', 'Se detuvo caldera 5 por orden de Alexi Jara técnico del departamento de climatización, debido que arrojo alarma por bloqueo del quemador, esto es debido a que el sistema de combustible se encontraba con una presión de 0.81 bar. El encargado del departamento de clima mencionado anteriormente informo que reinicio la alarma para verificar si volvía a mostrar el mismo bloqueo, efectivamente la alarma se volvió a presentar entonces se tomo la decisión de apagar el equipo y no realizar el cambio entre caldera N°5 a la N°2 y tampoco encender la N°1. Esto conlleva a tener un clima poco adecuado en los sectores donde se encuentran funcionarios realizando su jornada laboral.', 'Al visualizar las pantallas de alarma habia una en especifica donde alertaba algo fuera de lo normal en el sistema de riego, se dio aviso a los demás técnicos de turno (Benjamín Toloza y Alexi Jara) para verificar si se trataba de un sobre nivel en el estanque, al dirigirse a terreno se encontraba abierta la válvula de llenado hacia el estanque de riego, la cual días anteriores habían informado que la pera de nivel no estaba mandando la señal para cortar el flujo de agua que entraba al estanque y esto producía sobre nivel en el estanque. Los automáticos de las 3 bombas de riego se encontraban deshabilitados y junto a los demás colegas ya mencionados se procedió habilitarlos para que hubiera una recirculación de agua ya que se encontraba realizando un llenado en el sistema de riego, a causas de esto se reviso directamente en los jardines que estuviera funcionando y al llegar al sector cerca de sala cuna se visualizo que un aspersor habia saltado saliendo un chorro de agua constantemente, debido a esto se procedió a deshabilitar las bombas (con su automáticos abajo) y cerrar las válvulas de llenado hacia el estanque, todo esto se realizo por motivos de precaución debido a la información entregada días anteriores.', 'Se detecto una baja presión en el estaque de expansión la cual indicaba 0.81 bar (según pantalla grafica de control), al revisar en terreno este sistema se encontraba con alarma de derrame, la cual se reviso para verificar que no hubiera alguna fuga en un sector, pero se descarto esa opción ya que se encontró una especie de sensor la cual hace el cambio entre la alarma de derrame y el estado normal, se desconocen los motivos la cual se activo ese sensor.\r\nCalderas a pesar de todo quedaran fuera de servicio ya que el sistema no es confiable para volverlas a encender ,Alexi Jara informo que mantener los equipos deshabilitados por el momento hasta que se solucione, esta decisión se tomo para proteger los equipos de climatización y así no tener daños mayores.', '', '', '- Dar solución a sistema de combustible para así volver a encender calderas para climatizar lugares donde se encuentran los funcionarios.\r\n- Monitoreo de temperaturas en UMAS que alimentan a los servicios que se encuentran funcionando debido al apagado de calderas la temperatura disminuyo.\r\n- Dar aviso a Alejandro Saavedra sobre aspersor que salto durante el turno de noche.'),
(115, 'Reporte General de Eventos - Dia - 12-04-2022', 'Dia', '2022-04-12 18:05:21', 'HBQP-RGE-D-115', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', '', 'Durante turno de hoy, caldera numero 2 presenta alarma de bloqueo, por lo que esta se detiene para su revisión. \r\nEl funcionamiento de este se normaliza al no detectar mayores problemas en su +\r\nSe habla con Don Lizandro Varela sobre funcionamiento de bombas de agua caliente (BCAS) ya que estas no realizan la rotación correspondiente de su funcionamiento de acuerdo a la lógica, por lo que se fuerza el apagado de la bomba con mas uso según el horómetro, para que de esta manera el funcionamiento de la bomba cambie a la secundaria.\r\nSe detiene todo el sistema de agua fría, esto ordenado por Don Javier Beltrán y hablado con Don Lizandro Varela', '', '', '', '', 'Se deja como pendiente \r\n*Terminar de dar los accesos a Jonathan Quiroga \r\n*Revisar las fichas enviadas el día de hoy y así dar los accesos a las personas correspondientes\r\n*Dar accesos correspondientes a personal ingresado el día de hoy \r\n*Revisar accesos intercom'),
(116, 'Reporte General de Eventos - Noche - 13-04-2022', 'Noche', '2022-04-13 07:13:10', 'HBQP-RGE-N-116', 'Abel Torres', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', '', '', '', '', '', '', '- Apagar caldera N°1.\r\n- Monitoreo de UMAS, que se encuentren inyectando una temperatura adecuada y agradable.');
INSERT INTO `reportes_generales` (`idReporte`, `nomReporte`, `turnoReporte`, `fechaReporte`, `folioReporte`, `nomEncargadoTurno`, `nomFuncionariosTurno`, `nomEncargadoTurnoAnterior`, `tareasControlCentralizado`, `tareasInstalaciones`, `tareasEquiposIndustriales`, `tareasIncendiosCombustibles`, `tareasDeteccionElectrica`, `tareasInfraestructura`, `pendientesCoordinacion`) VALUES
(117, 'Reporte General de Eventos - Dia - 13-04-2022', 'Dia', '2022-04-13 12:31:30', 'HBQP-RGE-D-117', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', 'Javier Beltrán, Jefe de Climatización, da las siguientes instrucciones:\r\nSe van a bajar las temperaturas de todos los fancoil a 19°C, después de detener el Chiller N°2 a las 18:00  hasta las 06:30, también después de detener Chiller, mantener en funcionamiento Baes 1,2,3 y 3r hasta las 19:30 y volver a encenderlas de las 03:00 hasta la 04:00, todo el sistema queda funcionando en automático, a las 06:30, estás instrucciones están previamente conversadas con Lizandro Varela, Jefe de control centralizado.', '', '', '', '', '', 'Se deja como pendiente:\r\nDar los accesos correspondientes a las personas ingresadas durante la jornada y revisar los accesos de las demás unidades.\r\nRealizar los historiales de UMAS de pabellón, orden dada por Isaac Pérez, Profesional de Control Centralizado.\r\nEncender Baes 1,2,3 y 3R desde las 03:00 hasta las 04:00, encender Chiller N°2 a las 6:30(todo queda en automático), esto fue conversado previamente entre los Jefes de la unidad de Control Centralizado (Lizandro Varela) y la unidad de Climatización (Javier Beltrán)'),
(118, 'Reporte General de Eventos - Noche - 14-04-2022', 'Noche', '2022-04-14 06:52:27', 'HBQP-RGE-N-118', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Shai Santibañez', 'Durante el turno de hoy, el sistema alarma de múltiples caídas durante el transcurso de la noche de ECB400 y ECB600 todos estos del controlador ECBOS6P3.', '', '', 'Durante turno de hoy, Se confirma nuevamente problema de mantenimiento en sensor de\r\nhumo ubicado en casetón 1, sector 3.9 y 3.10 ejes H/8, cabe señalar que dicho\r\nproblema se ha presentado a menudo en el sistema y aun no se ha llegado a una solución', '', '', ''),
(119, 'Reporte General de Eventos - Dia - 14-04-2022', 'Dia', '2022-04-14 19:15:34', 'HBQP-RGE-D-119', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', 'Por orden de Lizandro Varela Jefe de control centralizado, se deja informado que se debe revisar en todos los turnos de noche la climatización de todos los sectores que se encuentra funcionarios realizando sus labores, además se avisa que el día lunes llega personal de consulta medica en el piso N°2.', 'Durante el turno Alexi Jara técnico de turno del departamento climatizacion informó que la caldera N°2 se encontraba detenida en terreno, esto fue debido a que se encontraba bloqueado el quemador, la cual el técnico mencionado anteriormente realizó el reseteo de la alarma y quedo totalmente operativa.', 'Durante el día se realizaron trabajos en estanque criogénico, la cual según lo que informo Guillermo Hidalgo jefe de equipo industriales indura habia realizado un vacío de oxigeno liquido la cual se aprovecho de verificar el funcionamiento de la alarma, la cual se dejo con su automático deshabilitado ya que el sonido que emitía era demasiado molesto.\r\nToda esta información fue dada por parte de Guillermo Hidalgo jefe de equipos industriales.', 'Durante el día se realizó el cambio de tanque de combustible, ya que el N°1 se encontraba con 23% de carga así que Víctor Fierro realizó la maniobra desde terreno quedando con el tanque N°2 de combustible, además como información la carga de combustible será realizada el día miércoles 20 de Abril según la información que entregó Víctor Fierro.', '', '', '- Dar permisos a personal ingresado en el turno de día.\r\n- Encendido de caldera N°1 con canal horario(solo para ver si funciona) .\r\n- Encendido de Chiller a las 6:30.'),
(120, 'Reporte General de Eventos - Noche - 15-04-2022', 'Noche', '2022-04-15 04:30:08', 'HBQP-RGE-N-120', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', '*Se revisa durante el turno de noche los recintos de la zona E, del segundo piso,  que no contaban con extracción en conjunto con Claudio Cárcamo, técnico de climatización.\r\n*Guardias del Portón N°5 dan aviso de aspersor roto.', '', '', 'Se activo alarma de incendio en BMS, mientras que en central onix solo mostro alarma de supervisión de dámper(HOSPITAL SUBT-1 MONITOREO DAMPER EJE X,6 Zone Z900) .\r\nSe activo alarma de Detector, Dampers, Puertas y Luces en el sector S01.1 en BMS, También los ascensores se fueron al Piso -1\r\nLa razón de alarma fue que señoritas de la empresa de aseo INGESAN, no colocaron filtro a la aspiradora mientras trabajaban en el sector mencionado, produciendo mucho polvo y que se activaran los sensores.', '', '', 'Monitoreo de Consultas medicas.\r\nApagar Caldera N°1 a las 09:00.\r\nAbrir Portón N°5 a las 09:00.'),
(121, 'Reporte General de Eventos - Dia - 15-04-2022', 'Dia', '2022-04-15 20:39:55', 'HBQP-RGE-D-121', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Shai Santibañez', '', '', '', '', '', '', 'Se deja pendiente:\r\nel encendido de los equipos de climatización.\r\nmonitorear equipos de consultas medicas.\r\nAvanzar con levantamiento de Sala eléctrica y comunicaciones.'),
(122, 'Reporte General de Eventos - Noche - 16-04-2022', 'Noche', '2022-04-16 07:56:10', 'HBQP-RGE-N-122', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', '', '', '', '', '', 'Durante el turno de día los guardias dieron el aviso sobre un forzado en las reja que da hacia caletera, en un lapso de la noche se fue a revisar y claramente era como lo indicaban la reja se encontraba abierta(doblada para ser más especifico), se procedió a sacar fotos y dar aviso a los superiores para solucionar el problema.', '- Verificar que caldera 1 se apague con el canal horario.'),
(123, 'Reporte General de Eventos - Dia - 16-04-2022', 'Dia', '2022-04-16 19:25:22', 'HBQP-RGE-D-123', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', '', 'Durante turno de hoy, caldera 2 presenta alarma de bloqueo, por lo que se revisan las presiones y se realiza llenado de línea ya que estas estaban con una baja presión.\r\nSe finaliza aseo en techo mecánico 4 y se realiza durante termino de turno en casetón 1', '', '', '', '', 'Encender chiller y Ip4 a las 6:30am según lo acordado'),
(124, 'Reporte General de Eventos - Noche - 17-04-2022', 'Noche', '2022-04-17 07:11:54', 'HBQP-RGE-N-124', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', '', '', '', '', '', '', 'Se deja pendiente:\r\nApagar caldera 1 a las 9:00 AM \r\nMonitorear temperaturas de consultas medicas.\r\nAvanzar con creación de pantalla graficas.\r\nEncender Bomba de Paneles solares según su lógica.'),
(125, 'Reporte General de Eventos - Dia - 17-04-2022', 'Dia', '2022-04-17 13:28:45', 'HBQP-RGE-D-125', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Jaime Estay', '', '', '', '', '', '', 'Se deja como pendiente:\r\n- Monitoreo de UMAS, que se encuentren inyectando una temperatura adecuada y agradable. (Ordenes dadas, por Lizandro Varela, Jefe de Control Centralizado).\r\n-Avanzar con creación de pantalla graficas.\r\n-Revisar accesos de personal, (orden dada por Isaac Pérez).\r\n-Encender Bombas Baes (1,2,2.1 y3) de 03:00 a 04:00'),
(126, 'Reporte General de Eventos - Noche - 18-04-2022', 'Noche', '2022-04-18 06:56:42', 'HBQP-RGE-N-126', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Shai Santibañez', 'Durante turno, guardias notifican sobre problema en circuito de riego ubicado en el exterior del hospital, donde al revisar nos percatamos que a este le hacia falta el aspersor generando que saliera el agua de forma descontrolada mojando en gran parte la calle.', 'Durante turno, se realiza aseo en sala de calderas lo que se finaliza sin problemas.\r\nUMAS durante el turno noche no reciben alimentación de agua caliente, esto se verifica en terreno.', 'Durante turno, se realizo una revisión al E. Criogénico, donde el manómetro de oxigeno indicaba que este se encontraba en 0 bar, esto se le notifica a la jefatura correspondiente.', '', '', '', ''),
(127, 'Reporte General de Eventos - Dia - 18-04-2022', 'Dia', '2022-04-18 18:56:07', 'HBQP-RGE-D-127', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', '', 'Según la información entregada por el departamento de climatización la válvula calor en terreno se encontraba al 100% mientras tanto en control centralizado estaba modulada al 0%, el comunicado que dio Javier Beltrán (jefatura del departamento climatización) fue que la válvula estaba dañada y se dejo forzada a 0% desde terreno.', '', '', '', '', '- Realizar trabajos dejados por Isaac Pérez. \r\n- Encender caldera 1 según lo programado.\r\n- Revisión de UMAS donde se encuentran funcionarios en el hospital.'),
(128, 'Reporte General de Eventos - Noche - 18-04-2022', 'Noche', '2022-04-18 22:09:54', 'HBQP-RGE-N-128', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', 'Se encendieron las 10 UMAS de pabellón, se verifico su funcionamiento en terreno con Francisco Salazar, técnico de Climatización.\r\nSe reviso la UMA-S1-31A en conjunto con Claudio Cárcamo, técnico de Climatización.', 'En revisión de UMA-S1-31A se encuentra lo siguiente:\r\nVálvula de calor, estaba siempre al 100% en terreno y no respondía a BMS, de forma manual se dejaba en 0% y volvía al 100% y se cortó el paso del agua caliente de la UMA y la válvula automáticamente paso a 0% , se abrió el paso de agua caliente y se mantuvo en 0%, se forzó la válvula desde BMS al 100% y respondió correctamente pero luego no respondió a la orden de cerrarse al 0% desde el BMS, se cerró nuevamente el paso de agua caliente en terreno y automáticamente bajo a 0%.\r\nActualmente la UMA se encuentra funcionando automáticamente.', '', '', '', '', 'Se deja como pendiente:\r\nMonitoreo UMA-S1-31A.\r\nMonitoreo de las 10 UMAS de pabellón.'),
(129, 'Reporte General de Eventos - Dia - 19-04-2022', 'Dia', '2022-04-19 13:39:33', 'HBQP-RGE-D-129', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Shai Santibañez', '', '', '', '', '', '', 'Se deja pendiente :\r\n-Cambiar los set point de pabellón.\r\n-Apagar Bomba BCPSS-1R'),
(130, 'Reporte General de Eventos - Dia - 19-04-2022', 'Dia', '2022-04-19 19:33:40', 'HBQP-RGE-D-130', 'Luis Pérez', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Jaime Estay', 'Se recibe turno a partir de las 14:00hrs.', 'Durante turno, personal de aseo industrial realiza sus funciones en el área de sala de bombas hasta las 23hrs, luego entrando al siguiente turno que estarían aseando la misma área.', '', 'Durante turno de hoy, se presenta una alarma de incendio, personal acude al lugar he informa que se debe a una falsa alarma provocada debido a que un menor acciona la palanca de alarma de incendio, esto se normaliza a los minutos y se visualiza por cámaras el recinto consultas medicas infantil por si se llegara a repetir el incidente', '', '', 'A las 00:00hrs exportar todos los gráficos en formato CSV y luego traspasarlos a la carpeta compartida.(Isaac)'),
(131, 'Reporte General de Eventos - Noche - 20-04-2022', 'Noche', '2022-04-20 05:50:22', 'HBQP-RGE-N-131', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', '', '', '', 'En lo relevante a detección incendio se registro que se encontraba activada una palanca a las afuera de una sala de comunicaciones (RH0B), y al entrar se percato que el modulo FM200 se encontraba activado, se reviso la zona para verificar que no sucediera algo relevante y se procedió a resetear el equipo. Cabe mencionar que en las pantalla de control centralizado y Onix Work no hubo alguna alarma sobre la situación solo se percato cuando se transitaba por el pasillo.\r\n\r\nSe realizo la revisión de combustible en terreno, debido a que en control centralizado indicaba un porcentaje de 22.0 a lo que en terreno este indicaba 3000 litros (tanque 1), esta revisión se realizo para determinar la continuidad de funcionamiento en calderas y así no sufrieran algún daño mayor.', '', 'Durante el turno se registro que un aspersor habia saltado, este esta ubicado en la entrada principal del hospital.\r\nCuando se fue a verificar la causa se encontró que el tubo PVC que sostiene el aspersor estaba roto, la cual se desconocen sus causas de ruptura, se reviso al rededor del lugar y no se pudo encontrar el aspersor ni la pieza faltante del tubo PVC. La solución que se dio fue cambiar el sector del riego para que así el agua no saliera constantemente hacia la calle.', '- Revisión de los tanque de combustible debido a bajo porcentaje de nivel.\r\n- Detener caldera N°1 a las 9:00.\r\n- Revisión de Fc-S1-06 en abastecimiento.'),
(132, 'Reporte General de Eventos - Dia - 20-04-2022', 'Dia', '2022-04-20 11:37:13', 'HBQP-RGE-D-132', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', '', '', 'Durante turno, Francisco Arenas (Puesta en marcha) comunica vía telefónica que ascensor A7 se encuentra fuera de servicio. esto se le hace saber a técnico de asesores Marcos torres, el cual durante su revisión notifica que problema se debió a tiempo de apertura de la puerta; esto quieres decir que la falla se produjo debido a que se obstruyo el cierre de esta durante mucho tiempo produciendo en consecuencia la falla del ascensor', '', '', '', '*A las 00:00hrs exportar todos los gráficos en formato CSV y luego traspasarlos a la carpeta\r\ncompartida.(Isaac)\r\n*Crear gráficos de Generadores'),
(133, 'Reporte General de Eventos - Noche - 21-04-2022', 'Noche', '2022-04-21 07:08:02', 'HBQP-RGE-N-133', 'Abel Torres', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', 'Durante el turno se regularizo el apagado de las iluminarias exteriores la cual quedaron con su canal horario modificado, solo faltaría modificar y encontrar una hora clave para el encendido en la tarde. Este canal horario que se esta designando no se tiene que volver a modificar ya que la hora que se encuentran es la correcta para su apagado.', 'Se encendió caldera N°1 desde control centralizado, la cual después de varios minutos desde que se dio la orden de encendido no se obtuvo alguna respuesta de dicha acción, se le informo al técnico de turno Matías Gutiérrez del departamento climatización para su revisión desde terreno a lo que informo que se encontraba un automático deshabilitado la cual pertenecía a unas de las bombas BCAS. Luego informo sobre el levantamiento de este automático y nuevamente se volvió a encender sin ningún problema.\r\n\r\nSobre la caldera N°5 se registro un demora constante para poder llegar a su temperatura pick o adecuada, según la información que entrego Matías Gutiérrez puede que las bajas temperaturas que se están presentando y la demora de su calentado sean por la gran cantidad de agua que hay en el sistema. Además cabe mencionar que se mantuvo varias horas apagada la caldera.', '', '', '', '', '- Revisión y visualización de calderas y combustible.\r\n- Modificación de canal horario en los exteriores N°1 y N°2.\r\n- Revisiones de temperaturas en las UMAS, ya que las calderas no se encuentran mucho tiempo en funcionamiento  y esto se puede ver reflejado en pocas temperaturas de los recintos.'),
(134, 'Reporte General de Eventos - Dia - 21-04-2022', 'Dia', '2022-04-21 14:51:35', 'HBQP-RGE-D-134', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', 'Durante la Jornada se presento un Corte energético en el sector C del segundo piso, por trabajos realizados en el Tablero H2T, este corte genero Caída de Control de acceso en ese mismo sector (UCA 03, 04 Y 05) y de los equipos de Climatización del sector C del tercer Piso.', '', '', 'Durante la jornada se presentaron dos alarmas de incendio, en el piso 4 y el -1, las cuales resultaron ser falsa alarma y no afectaron en el funcionamiento del establecimiento.', '', '', 'Se deja como pendiente:\r\nRealizar los trabajos dados por Isaac Pérez.\r\nDar y revisar los accesos correspondientes de la jornada, ordenes dadas por Lizandro Varela, Jefe de Control Centralizado.\r\nTener las UMAS  de consultas medicas a temperatura agradable, ordenes dadas por Lizandro Varela, Jefe de Control Centralizado.\r\nRealizar toma de temperatura y humedad de pabellones, en conjunto con clima, esto fue conversado con Lizandro Varela, Jefe de Control Centralizado y Javier Beltrán Jefe de Climatización.'),
(135, 'Reporte General de Eventos - Noche - 22-04-2022', 'Noche', '2022-04-22 07:39:34', 'HBQP-RGE-N-135', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', '', 'Durante turno, caldera numero 2 presenta paro por bloqueo, a lo que se hacen las revisiones correspondientes y se encuentra una falta de presión en agua por lo que se hace el llenado pertinente.\r\nDurante revisión, caldera numero 2 presenta una filtración en la parte posterior por lo que se apaga y en consecuencia se decide no encender ninguno de estos equipos.', 'Durante turno, al revisar en BMS la pantalla grafica de correo neumático, esta alarma de falla general en zona 03 a lo que se hace una revisión en sala de correo neumático. (Se desconoce motivo de falla)', '', '', 'Durante turno, al momento de hacer ingreso al hospital Cristopher Saavedra informa de que frente a caseta de guardias numero 4 en la isla se encuentra aspersor roto.', ''),
(136, 'Reporte General de Eventos - Dia - 22-04-2022', 'Dia', '2022-04-22 08:36:04', 'HBQP-RGE-D-136', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', '', '', 'Jorge Cantillano informo que los estanque de incendio y riego se encontraban vacío, la cual minutos después  Guillermo Hidalgo dio aviso a Alexi Jara para dar apoyo en la maniobra de llenado, cabe mencionar que en las pantallas de BMS no se alarmo ningún sistema de bajo nivel en los estanques.\r\n\r\nSe deja informado que el llenado de los dos estanque se inicio aproximadamente 17:40 lo que significa que durante la noche se tendría que terminar el llenado de los dos estanque.', 'Según lo que se visualizo en las pantallas de BMS se realizo el cambio de tanque combustible y se dejo en funcionamiento el tanque N°2, la cual no se informo de esta acción a personal de control centralizado.\r\n\r\nSegún la información que entrego Alexi Jara técnico del dep. climatización, la siguiente carga de combustible que se realizara ser el día Martes 26 de abril.', '', 'Alejandro Saavedra dio la orden de apagar el sistema de riego desde el panel en control centralizado, debido a que los estanque se encuentran vacíos.', '- Estar en conocimiento sobre el llenado de estanque incendio y riego.\r\n- Avanzar con el pegado de PMA en salas eléctricas y comunicaciones.\r\n- Volver hacer una revisión de iluminaria en sala de espera, esto estaría ubicado en consultas medica.\r\n- Dar los accesos correspondiente a las personas ingresada durante el turno día que son:\r\nConsultorio de especialidades = 1                                         Pediatría = 1\r\nUnidad de gestión del paciente = 1                                       Unidad de Tics = 1\r\nSDGC = 1                                                                                            Odontología =   11\r\nUnidad de cirugía = 1                                                                   Total = 17 personas ingresadas.\r\n- Verificar luces encendidas en el edificio.'),
(137, 'Reporte General de Eventos - Noche - 23-04-2022', 'Noche', '2022-04-23 00:01:04', 'HBQP-RGE-N-137', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Abel Torres', 'Se otorgaron los accesos correspondientes a las personas ingresadas durante la jornada laboral\r\nSe avanzo con el pegado de los PMA  de salas eléctricas y comunicaciones, se termino todo el piso 1', '', 'A las 21:56 Don Guillermo Hidalgo se acerca al Hospital para verificar el estado de los estanques de agua a lo cual dijo que estos estarían llenos para lo jornada de la mañana.\r\n23:59  los estanques se llenan, el llenado se detuvo de manera automática y Claudio Cárcamo, Técnico de Climatización, corta válvula que alimenta la red de incendio, estas ordenes las dio Guillermo Hidalgo mediante vía telefónica.', '', 'Benjamín Vergara, técnico de departamento eléctrico informa lo siguiente sobre el alumbrado de consultas medicas:\r\nAlumbrado Sala de Espera Consultas Médicas pertenece al Cto. A18 (Selector N°18) el cual no se refleja en panel de Control centralizado y no al Cto. A17 según plano del Tablero H1S, circuito A18 queda en automático.', '', 'Se deja como pendiente:\r\nMonitoreo UMAS de pabellón y Consultas medicas.'),
(138, 'Reporte General de Eventos - Dia - 23-04-2022', 'Dia', '2022-04-23 11:25:10', 'HBQP-RGE-D-138', 'Jaime Estay', 'Matías Gutiérrez , Joaquín Vicencio , Benjamín Carvajal', 'Shai Santibáñez', '', '', '9:30 AM Guillermo Hidalgo (Encargado departamento de Equipos Industriales), avisa sobre maniobra que se realizará en la central de Oxigeno, tras recibir llamado del Hospital San Martin por la falta de Tubos de oxigeno.\r\n\r\nSe retiraron del la central de oxigeno 10 Tubos, dejando anotado sus respectivos códigos para su futura reposición. \r\n\r\nCódigos: KB10AK9 - JB64VBS - JG31NMN - JF26LR2 - JF93EKF - JE93ELD - KBO2UUK - JF29UXZ - KQ55WRQ - JD44FCY.', 'Se detectaron 2 alarmas de incendio en el Sector de Anatomía patológica B/9 Trabajo limpio (PMA B-2-11) y el el pasillo de esta misma (Sensor de Humo).\r\n\r\nFue una falsa alarma ya que en terreno se encontraban personal de Sacyr Realizando trabajos.\r\n\r\nAl momento de rearmar el sistema en terreno, Técnicos de turno se dieron cuenta que panel de incendio no se encontraba con alarma/sonando.', '', '', 'Se deja pendiente:\r\nEncender la caldera 1.\r\nMonitorear temperaturas de Consultas Medicas\r\nMonitorear Equipos de central de frio y térmica.\r\nMonitorear Nivel de estanque de riego.'),
(139, 'Reporte General de Eventos - Noche - 24-04-2022', 'Noche', '2022-04-24 07:20:05', 'HBQP-RGE-N-139', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', '', '', '', 'Se reviso durante la noche el estanque de incendio la cual se encontraba llenando para llegar a su limite, el llenado esta siendo con poca agua y durante la noche no se alcanzo a realizar completamente el llenado, debido a esto se tendrá que seguir monitoreando para prevenir un sobre nivel.', '', '', '- Apagar caldera N°1 según lo programado.\r\n- Monitorear los estanque de incendio/riego ya que se encuentran en proceso de llenado.\r\n- Monitorear pantallas grafica de combustible debido a que el estanque N°2 se encuentra disminuyendo.'),
(140, 'Reporte General de Eventos - Dia - 24-04-2022', 'Dia', '2022-04-24 16:18:36', 'HBQP-RGE-D-140', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', '', '', '', '', 'Durante turno, Tablero de alumbrado H0T (Exterior 2) alarma sobre caída de magnetotérmico en BMS a lo que se envía al técnico del departamento eléctrico (Matías Añazco) a normalizar la situación debido a la necesidad de iluminación en la zona. \r\nEn el tablero se encontraban todos los circuitos arriba menos el A12 ya que ese circuito suele hacer corto circuito; posiblemente la caída del magnetotérmico se debió que se haya subido este circuito, arrojando como consecuencia la alarma al BMS.', '', ''),
(142, 'Reporte General de Eventos - Noche - 25-04-2022', 'Noche', '2022-04-25 14:10:25', 'HBQP-RGE-N-142', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', '', '', '', '', '-Durante el turno se produjo una fuga y por motivos de prevención se tomaros las siguientes medidas:\r\nDes habilitar los siguientes selectores : \r\n\r\nF40-F41-F42 Del tablero H1H\r\nA21-A22-A23-A24-A25 Del tablero H1H.\r\n\r\n-El retiro de un foto embutido el cual fue afectado por la fuga.\r\n-El retiro de un enchufe el cual fue afectado por la fuga.', 'Durante la jornada se informó a control centralizado sobre una fuga de agua en el sector de urgencias, Técnicos de turno se dirigieron al lugar y se detectó en el recinto J-2-78 el inicio de la Fuga.\n Se trataba de una llave, la cual se encontraba filtrando a una gran velocidad, y afectando los siguientes recintos. Parto-Integral (Piso 2), Urgencia (Piso 1) y estacionamiento (Piso-1). Se cerro la llave de paso y se comenzó con la limpieza de los recintos.\nComo observación cabe destacar que una vez dentro del recinto para normalizar la situación se encontraron un par de herramientas al costado de la llave.\n', 'Como pendiente se deja el apagado de la caldera 1 , monitoreos de los estanques de combustible , y revisar temperaturas de Consultas medicas.'),
(143, 'Reporte General de Eventos - Dia - 25-04-2022', 'Dia', '2022-04-25 14:19:26', 'HBQP-RGE-D-143', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara', 'Jaime Estay', 'Durante el cambio de ducto de barras se detectaron múltiples alarmas en BMS por caídas de equipos de climatización, pero retomaron al normalizar la situación.\r\nactualmente se encuentran las siguientes alarmas:\r\nHS61_ADR_DUCTO7\r\nHS61_ADR_DUCTO8\r\nES_VEX_3_20', 'Durante la jornada se realizo la legionela en boilers de paneles solares, hasta el termino del turno, todavía no se termina con esta, mañana se continuara con esta.', '', 'Se produce una alarma de incendio durante la jornada trabajada en el sector S01.13, detector y luces, por trabajos de telefónica, Víctor fierro, encargado de departamento de incendio confirma que es falsa alarma vía radio.', 'Durante la jornada se realizaron cambio de ductos de barra en el bloque del ascensor A12, el cual se termino a las 19:42, el cual activo UPS de data center y boto equipos de climatización  del primer piso al tercero el cual retomaron sin problemas al hacer el cambio de ducto.', '', 'Se deja como pendiente:\r\nRevisar todos los formatos y accesos, orden dada por Lizandro Varela y Isaac Pérez, Jefe y Profesional de Control Centralizado.\r\nDar los accesos de personal ingresado durante la jornada\r\nEncender UMAS del piso 7 que fueron apagadas durante el cambio de ducto\r\naveriguar las siguiente alarmas que se produjeron después del cambio de ducto:\r\nHS61_ADR_DUCTO7\r\nHS61_ADR_DUCTO8\r\nES_VEX_3_20'),
(144, 'Reporte General de Eventos - Noche - 26-04-2022', 'Noche', '2022-04-26 05:27:50', 'HBQP-RGE-N-144', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Shai Santibañez', 'Durante turno, se pierde conexión remota con el servidor y esta vuelve de forma intermitente, además de que el sistema alarma de perdida de conexión con las UCAS siendo las caídas la; 2/4/8/11/18/19/21/24/27 estas del piso 1 y las 33 y 34 del S1.\r\nEl estado de las UCAS ya se encuentra normalizado volviendo estas por si solas.', '', 'Durante turno, llaveras informan que ascensor A9 se encuentra fuera de servicio, se esperara a la llegada de personal correspondiente para informar sobre el problema.\r\nTambién se informa que el A10 presenta problemas ya que no enciende su luz interior. \r\nNumero de reporte A9:69007\r\nNumero de reporte A10:69008', '', 'Durante turno, se reviso analizador de red HS61_ADR_Ducto 7 y 8 ya que sistema arroja alarma sobre estos. Durante revisión de Matías añasco (Técnico eléctrico) informa que alarma se debe a que los fusibles encargados de alimentar los analizadores se encuentran conectados al ducto que se encuentra sin energía.', '', ''),
(145, 'Reporte General de Eventos - Dia - 26-04-2022', 'Dia', '2022-04-26 11:57:03', 'HBQP-RGE-D-145', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', 'Se cierra la conexión del servidor BMS por ordenes de Jorge Cantillano, la cual solo se ocupara solo el browser hasta nuevo aviso por parte de jefatura.', '', '', 'Durante el turno se realizo la carga de combustible en los dos tanque, la cual ahora su nivel esta en 8900 LTS (terreno) e 77% desde BMS, este seria el tanque N°2. El tanque N°1 quedo en 9600 LTS (terreno) e 78% desde BMS.', '', 'Se deja en observación las filtraciones ocurrida e informadas por el personal del hospital.\r\nG-1-17 - se trataría de una filtración de agua por el marco de la ventana la cual fue revisada por Lizandro Varela y será derivada a infraestructura.\r\nD-2-35 - se trataría de una filtración por un tubo sanitario pero al informarle a infraestructura avisaron que ya habían realizado un post venta.\r\nEstacionamiento - Hugo Vargas informo sobre una gotera en los pilares H17, la cual fue revisada por Yorgo Casimis y se trataba de una gotera que venia de un tubo sanitario.\r\nF-1-14 (Cafetería) - Isamar informa sobre una filtración ubicada en unos de los pilares de cafetería, Eduardo Muñoz se dirigió a terreno y se trataba de una pequeña gota que bajaba desde el techo.\r\nSala de calderas - Alexi Jara informa sobre una filtración de agua dentro de sala calderas, Se procedió apoyar y se trataba de un codo que se salio del tubo PBC la cual baja el agua de', '- Revisar las iluminaria de terreno la cual se tiene que identificar las que se mantienen apagadas y las que se mantienen encendidas.\r\n- Visualización de la pantalla grafica PEALL (solamente si se registra lluvias)\r\n- Realizar descarga de tendencia esta son ordenes de Isaac Pérez.\r\n- Revisión del hospital por presuntas filtraciones de agua por causas de la lluvia, son ordenes de Lizandro Varela'),
(146, 'Reporte General de Eventos - Noche - 26-04-2022', 'Noche', '2022-04-27 00:31:35', 'HBQP-RGE-N-146', 'Nicolas Droguett Hormazabal', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara, Shai Santibáñez', 'Abel Torres', 'Se le otorgaron los accesos correspondientes al personal ingresado durante la jornada\r\nEn ronda al edificio, desde el sector de parto integral, se visualiza por la ventana que da hacia el portón N°2, que el guardia no se encuentra en la caseta, se verifico en terreno, esto ocurrió a las  2:55 AM.', 'En la revisión de climatización de los recintos médicos, se afirma que estos cuentan con una temperatura adecuada para su uso, dicha temperatura oscila entre los 20 y 22°C.', 'Se revisó nivel de estanque en PEALL-4 por motivos de alarma de máximo funcionamiento en bombas 1 y 2, se determinó que PEALL-5 y PEALL-4 seguirá en funcionamiento automático, debido que en terreno el estanque no se encontraba a nivel máximo.', 'No se presentan problemas técnicos con los estanques de combustible durante el turno trabajados. \r\nNivel de los tanques\r\nCalderas:\r\nTanque 1: 72%\r\nTanque 2: 77%', 'Benjamín Vergara, Técnico de Departamento Eléctrico, decidió dejar deshabilitar circuito n°16  de balizas del piso 7, ya que este provocaba corto circuito.', 'Se indagó en aviso de fuga de agua en residencia SAMU, piso 2. Se revisó en terreno y se colocaron sacos con arena, formando una barrera para impedir el paso del agua, además en sector de bombas de paneles solares, se colocaron bolsas de basura y arena en forma de \"dique\" para evitar que se siga filtrando agua hacia las residencias de samu, esta actividad se realizó en conjunto con Lisandro Varela y Jorge Cantillano.\r\nSe dejó un tarro de basura en pasillo de edificio energético en el Piso 1 para contener filtración y que no filtrara a las residencias de Samu y a los equipos eléctricos.\r\nFiltración de aguas frente a pilar H17, informado por Benjamín Vergara.', 'Se deja como pendiente:\r\nMonitorear UMAS de consultas medicas.\r\nDar aviso a personal  tyssen sobre ascensor A1 que se encuentra fuera de servicio.'),
(147, 'Reporte General de Eventos - Noche - 27-04-2022', 'Noche', '2022-04-27 09:39:48', 'HBQP-RGE-N-147', 'Yorgo Casimis', 'Isaac Perez', 'Jaime Estay', '1', '2', '', '', '', '', ''),
(148, 'Reporte General de Eventos - Dia - 27-04-2022', 'Dia', '2022-04-27 19:04:33', 'HBQP-RGE-D-148', 'Jaime Estay', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Shai Santibañez', '', '', '', '', '', '', ''),
(149, 'Reporte General de Eventos - Noche - 28-04-2022', 'Noche', '2022-04-28 07:55:52', 'HBQP-RGE-N-149', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Jaime Estay', '', 'Se encendieron dos calderas de clima en simultaneo durante la noche, esto fue debido a las bajas temperaturas que se registraron en las UMAS y los recintos del hospital.\r\n\r\nLas calderas en funcionamiento son la N°5 y N°4.', '', '', '', '', '- Monitorear las siguientes UMAS:\r\nS1-32                  3-5\r\n3-26A                  3-20A\r\n3-26                     3-5A\r\n3-13                     3-6\r\n3-23\r\nEstas UMAS se tienes que revisar debido a que presentaron bajas temperaturas durante la noche a pesar de que se encuentran dos calderas de climatización en funcionamiento.'),
(150, 'Reporte General de Eventos - Dia - 28-04-2022', 'Dia', '2022-04-28 19:23:17', 'HBQP-RGE-D-150', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', '', 'Durante turno, Se realizan pruebas de funcionamiento del IP3 con chiller 1, las cuales resultan sin ningún problema.', '', 'Durante turno, personal de telefónica realiza revisión de los nodos de incendio a lo cual no se encuentran mayores problemas además de algunas alarmas arrojadas por el sistema por la misma revisión.', 'Durante turno, se realiza corte de energía en tablero H1K para realizar trabajos con SACYR, hasta el momento no se ha reestablecido la energía y se espera se normalice antes de las 20:00 o pasada esta hora.', '', 'Se deja como pendiente.\r\n*A las 01:00 am sacar pantallazo a caudal consumido y niveles de estanques\r\n*Exportar tendencias (.csv) en tiempo yesterday (28/04)\r\n*Verificar el estado del tablero H1K'),
(151, 'Reporte General de Eventos - Noche - 28-04-2022', 'Noche', '2022-04-28 23:23:38', 'HBQP-RGE-N-151', 'Abel Torres', 'Matias Gutierrez , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', '', '', '', '', '20:30 Se terminaron de realizar los trabajos en el tablero H1K, la cual no se presento un problema al restablecer la energía, según la información entregada por Gustavo Loira los trabajos que se encontraban realizando serian por problema en transformadores.\r\nTambién informo que el día de mañana 29/04 harían un arreglo a las posiciones de los cables pero no iba ser necesario cortar la energía del tablero.', 'Matías Gutiérrez informa sobre una alarma en el tablero de riego, la cual al revisar el estanque se encontraba con sobre nivel. Solo informo y no manipulo nada y solo se pasara la información a los encargados.', '- Apagar la caldera 1.\r\n- Revisar UMAS de los sectores que se encuentran funcionarios.'),
(152, 'Reporte General de Eventos - Dia - 29-04-2022', 'Dia', '2022-04-29 11:54:53', 'HBQP-RGE-D-152', 'Shai Santibañez', 'Francisco Salazar,  Claudio Cárcamo,  Benjamín Vergara, Nicolás Droguett', 'Abel Torres', 'Se eliminó del sistema de accesos a Julia Figueroa de  HBQP y Jaime Núñez de SDO, debido a que ya no prestan servicios al hospital.', '- Se realizó cambio de funcionamiento de Caldera 5 a Caldera 3, por pruebas. Actualmente Caldera 3 se encuentra en funcionamiento.', 'Se registra una alarma en Zona 2 del Correo Neumático. Don Guillermo, encargado del departamento industrial, informa que ya se comunicó con la empresa encargada y ellos solucionarán el problema el día Lunes 2 de Mayo.', '', '', '', '- Excel de encendido y apagado de Calderas desde el 1ro de Enero, órdenes dadas por Lizandro  Varela.\r\n- Trabajos en BMS dados por Isaac Pérez.\r\n- Otorgar accesos al personal ingresado al sistema durante la jornada.'),
(153, 'Reporte General de Eventos - Noche - 30-04-2022', 'Noche', '2022-04-30 07:14:13', 'HBQP-RGE-N-153', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Shai Santibañez', '', 'Durante turno, se detiene Chiller 3 debido a que bomba BAC-3R presenta alarma térmica, se realiza la detención del chiller desde control para que se detengan las bombas de a cuerdo a la lógica  de funcionamiento. \r\nAl revisar la bomba esta presenta los cables de alimentación con quemaduras por lo que se deja el equipo detenido y se enciende Chiller 2 ya que Chiller 1 también presenta quemadura en los cables de su bomba (BAC-1/BAEP-1). \r\nSe detiene caldera 3 ya que el manómetro del estanque de expansión presenta saltos repentinos en la presión (inestable llama).', '', 'Durante turno, al revisar el estanque de expansión del sistema de combustible de calderas, no presenta aire en la membrana provocando de esta forma una subida y bajada de presión.', '', '', 'Se deja como pendiente \r\n*Revisar con personal de incendio y combustible problema en estanque de expansión\r\n*Avanzar en levantamiento CCTV'),
(154, 'Reporte General de Eventos - Dia - 30-04-2022', 'Dia', '2022-04-30 10:32:45', 'HBQP-RGE-D-154', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', '', 'Como consecuencia de lo ocurrido durante el turno de noche con las bombas del sistema central frio, se realizó la revisión nuevamente de la bomba BAC-3R junto al personal del departamento Electricidad Benjamín Toloza y con Alexi Jara personal del departamento climatización, la cual el diagnostico entregado por Benjamín Toloza fue el siguiente:\r\n\"Evidentemente la bomba BAC-3R generó un corto circuito, sus bordes de conexión a la bobina se sulfataron y uno al parecer explotó (V2), a consecuencia de esto otros cables se derritieron por el calor, siendo los de los bornes V1-W1- tierra y el mismo V2\".\r\nlas medias tomadas para esta situación fue que el guarda motor de la bomba BAC-3-R quedó activado, se dejó el automático deshabilitado y también su selector en posición 0, esto conlleva a dejar fuera de servicio el funcionamiento del Chiller 3 hasta que se dé una solución al problema causado en la bomba de condensación.\r\nA raíz de este problema los técnicos del departamento eléctrico y climatización realizaran una revisión de energía en las bombas BAC-1, BAC-2, BAEP-1, BAEP-2 y BAEP-3R para así determinar si es seguro el funcionamiento de los equipos que todavía se encuentran en servicio.', '', 'Se vuelve hacer una revisión del sistema combustible, la cual claramente se registraba una presión intermitente en los manómetros desde terreno y desde control centralizado (Esto se realizó junto a Alexi Jara técnico del departamento clima quien autorizó al encendido de las calderas para verificar el sistema de combustible), al revisar el estanque de expansión se registró que este estaba con una presión de 0 [bar], debido a esto la presión era intermitente en el sistema, se llamó a personal de industrial Víctor Fierro para darle una solución al problema. Queda a la espera la presencia del personal industrial.\r\n\r\nPersonal de industrial Guillermo Hidalgo junto a Víctor Fierro se hicieron presente para solucionar el problema con la presión en el sistema de combustible, en la cual realizaron el llenado de aire con un bombín al estanque de expansión dejando operativo el sistema, se mantendrá en observación en caso de cualquier situación anómala.\r\n\r\nSe presentó una alarma de problema-cortocircuito en la OnixWork, se trataría de un módulo de aspiración ubicado en pasillo del piso N°2 servicio laboratorio (sector 2.4 – ejes F/8), y se procedió ir al lugar junto a Alexi Jara técnico del departamento climatización. Al llegar al recinto, se encontró sonando una alarma en el módulo de aspiración, cabe mencionar que una de las cajas que tenía todo el circuito del sistema incendio se encontraba apertura y al revisar se pudo notar que el tornillo que sostenía la tapa estaba dañado; también se encontró que un tubo que iba a la caja del circuito estaba desacoplado, se verificó que no hubiera algo extraño y se procedió a realizar nuevamente el acoplado a su sistema correspondiente. Luego de la revisión del recinto y al no encontrar algo fuera de lo normal se procedió a resetear el sistema para que vuelva a su completo funcionamiento, la cual no volvió a presentarse la misma alarma.', '', 'Mediante un llamado telefónico del personal de SAMU, se informó sobre una gotera en uno de sus recintos; se procedió ir a verificar la filtración que habían mencionado, al llegar se trataría de la misma kitchenette que anteriormente ya se habían informado sobre el mismo problema. No se pudo realizar ninguna maniobra debido a que no se tiene un registro concreto de donde se origina la filtración de agua, pero si se le dará nuevamente el aviso al personal de infraestructura para así dar una solución concreta al problema que se presenta en el recinto, cabe mencionar que infraestructura ya se encuentra en conocimiento de la situación ya que anteriormente había sucedido el mismo problema.\r\n\r\nAlejandro Saavedra realizó el apagado del sistema de riego, la acción realizada fue desde el panel de riego ubicado en control centralizado; según la información entrega esta decisión fue tomada debido a que los jardines se encontraban húmedos por el sistema frontal registrado días anteriores, el sistema quedará apagado hasta que él determine lo contrario.', '- Dar los permisos a Litzi Villalon personal de consultorio de especialidades ya que no fueron dado todos los permisos en el turno anterior. Esta orden fue dada por Yorgo Casimis.\r\n- Dar los permisos a los nuevos funcionarios que se encuentra realizando los cuartos turno.\r\n- Monitorear el sistema de combustible.'),
(155, 'Reporte General de Eventos - Noche - 01-05-2022', 'Noche', '2022-05-01 06:13:15', 'HBQP-RGE-N-155', 'Shai Santibañez', 'Francisco Salazar,  Nicolás Manríquez,  Benjamín Vergara, Nicolás Droguett', 'Abel Torres', 'En conjunto con departamento de climatización y departamento eléctrico se revisaron en terreno las Vigas Frías que se encuentran descomunicadas (VF-1-41, VF-1-57 y VF-1-59). Benjamín Vergara, técnico de depto. eléctrico, realizó las mediciones correspondientes en los equipos para verificar si los equipos se encontraban energizados, al comprobar que el equipo tenía energía, se concluyó que los controladores de estas Vigas Frías se encuentran con fallas.', 'Durante el turno trabajado no se presentaron acontecimientos en los equipos de climatización.\r\nEquipos en funcionamiento: Chiller 2, Caldera 5 y Caldera 1 (Apagar Caldera 1 a las 9:00 AM)', '', 'Durante el turno trabajado no se presentaron problemas en el estanque de expansión de las calderas, se mantuvieron los parámetros normales.\r\n- Niveles de tanque de calderas:\r\nTanque 1: 26%\r\nTanque 2: 77%', '', '', '- Apagar Caldera N°1 a las 9:00 AM.\r\n- Mantener monitoreo de UMA\'s en consultas médicas\r\n- Mantener en observación presión del tanque de expansión de combustible de calderas, debido a que en turno anterior este presentó problemas.'),
(156, 'Reporte General de Eventos - Dia - 01-05-2022', 'Dia', '2022-05-01 19:32:44', 'HBQP-RGE-D-156', 'Eduardo Muñoz Vera', 'Claudio Carcamo , Joaquin Vicencio , Benjamin Carvajal', 'Shai Santibañez', 'No se reportan Eventos Relevantes durante el Turno trabajado.', 'No se reportan Eventos Relevantes durante el Turno trabajado.', 'No se reportan Eventos Relevantes durante el Turno trabajado.', 'No se reportan Eventos Relevantes durante el Turno trabajado.', 'No se reportan Eventos Relevantes durante el Turno trabajado.', 'No se reportan Eventos Relevantes durante el Turno trabajado.', '- Mantener monitoreo de UMA\'s en consultas médicas\r\n- Mantener en observación presión del tanque de expansión de combustible de calderas,\r\ndebido a que en turno anterior este presentó problemas.'),
(157, 'Reporte General de Eventos - Noche - 02-05-2022', 'Noche', '2022-05-02 07:20:20', 'HBQP-RGE-N-157', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Eduardo Muñoz', '', 'Se deja forzado la modulación del VIN en la UMA-3-11 por ordenes de Alexi Jara técnico del departamento de climatización, \r\nesta decisión fue tomada ya que se tenia que regular el flujo en los pasillos de administración (Piso 1 / sector G), se tuvo que realizar un ajuste desde la UMA; ya que el flujo era demasiado en los difusores de inyección y en terreno no se podían regular como corresponden; cabe mencionar que al tener un flujo mayor esto producía un ruido muy molesto. Como solución se realizaron los cambios en los parámetros a raíz de esto el sonido pudo disminuir y la cantidad de pascales que entrega los difusores de inyección se redujo un poco, pero estos parámetros cambiados son momentáneo hasta encontrar una mejor solución.\r\n\r\nSe visualizaron varias UMAS que registraban bajas temperaturas de inyección e extracción, cabe mencionar que  caldera se mantuvo operativa durante toda la noche la cual se desconoce los motivos de su baja temperatura, Las UMAS que registran pocas temperaturas son:\r\nUMA-3-1\r\nUMA-3-6\r\nUMA-3-5\r\nUMA-3-5A\r\nUMA-3-13\r\nUMA-3-14\r\nUMA-3-20A\r\nUMA-3-23\r\nUMA-3-26\r\nUMA-3-26A\r\nSe tiene que realizar pruebas de funcionamiento para verificar si se encuentra todo correcto.', '', '', '', '', '- Informar a colega entrante de noche sobre darse los permisos que corresponde.\r\n- Apagado de la caldera N°1.\r\n- Monitoreo de sistema combustible\r\n- Monitoreo de temperaturas en las UMAS.\r\n- Revisar UMAS ya que se encuentran con pocas temperaturas y se desconocen los motivos.\r\nUMA-3-1        \r\nUMA-3-6\r\nUMA-3-5\r\nUMA-3-5A\r\nUMA-3-13\r\nUMA-3-14\r\nUMA-3-20A\r\nUMA-3-23\r\nUMA-3-26\r\nUMA-3-26A\r\nEstas UMAS son las que se encuentra con pocas temperaturas.'),
(158, 'Reporte General de Eventos - Dia - 02-05-2022', 'Dia', '2022-05-02 09:10:56', 'HBQP-RGE-D-158', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra,', 'Abel Torres', '', 'Durante turno, se realizan mediciones de temperatura a bomba Bac 2 con cámara termográfica, en donde el borner de conexionado de esta arroja una temperatura sobre los 100°C.', 'Durante turno, puerta de la entrada principal (chiflonera)  presenta un desencaje de su riel no permitiendo su cierre, con los técnicos, esta se levanta para posicionar nuevamente la puerta en su riel y de esta forma permitir el cerrado de la puerta.', 'Durante turno, se realiza cambio de funcionamiento en tanque de combustible ya que tanque número 1 cuenta con un nivel del 14% dejando en funcionamiento tanque numero 2.', '', '', 'Se deja como pendiente:\r\n*Realizar el encendido del Chiller 2 durante una hora. \r\n*Crear historiales para el set point de temperatura de las UMAS'),
(159, 'Reporte General de Eventos - Noche - 03-05-2022', 'Noche', '2022-05-03 03:53:18', 'HBQP-RGE-N-159', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal', 'Luis Perez', '', '', '', '', '', '', '*Realizar el apagado del Chiller 2 junto a IP4\r\n*Realizar el apagado de caldera número 1.'),
(160, 'Reporte General de Eventos - Dia - 03-05-2022', 'Dia', '2022-05-03 17:39:27', 'HBQP-RGE-D-160', 'Nicolas Droguett Hormazabal', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Shai Santibáñez.', 'Eduardo Muñoz', 'Se perdió la comunicación con equipos de climatización en segundo piso, sector C (Laboratorio). Equipo de la empresa IMK se encontraba realizando trabajos en el sector. Personal de control centralizado se dirigió al lugar y normalizó el sistema. La protección diferencial se encontraba en activación, dejando des-energizado el sistema.', 'Debido a problemas de temperatura en borneras, se tuvo que detener Chiller 2 y dejar en operación Chiller 1 por órdenes de Javier Beltrán, jefe de depto. de Climatización. Durante la tarde, Chiller 1 comenzó con los mismos problemas de temperatura, en consecuencia se deja inhabilitado el equipo. Por mandato de Javier Beltrán, Chiller 1 se deja operativo a las 20:00Hrs, con monitoreo periódico cada 1 hora.', 'No se presentan problemas técnicos  durante el turno trabajado.', 'No se presentan problemas técnicos con los estanques de combustible durante el turno\r\ntrabajados.\r\nNivel de los tanques\r\nCalderas:\r\nTanque 1: 11%\r\nTanque 2: 62%', 'No se presentan problemas técnicos  durante el turno trabajado.', '', '- Creación de pantallas gráficas, trabajo acordado con Isaac, profesional de Control Centralizado.\r\n- Encendido de Chiller 1 con supervisión cada 1 hora, posible alza de temperatura en Bornera Bac1 y Baep1.'),
(161, 'Reporte General de Eventos - Noche - 04-05-2022', 'Noche', '2022-05-04 05:29:29', 'HBQP-RGE-N-161', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Shai Santibañez', '', '', 'Durante turno, se alarma estanque de sentina ya que este se encontraba en el nivel 3 de agua, por lo que se informa a  Dilhan Saavedra técnico de industrial quien al revisar informa que esto se debe a que bombas de sentina se encontraban en estado manual, y debido a esto las bombas no se encontraban realizando su funcionamiento normal.', 'Durante turno, al revisar el estanque de expansión del sistema de combustible de calderas, no\r\npresenta aire en la membrana por lo que se le realiza llenado de aire mediante bombín para el cuidado del equipo.', '', '', '');
INSERT INTO `reportes_generales` (`idReporte`, `nomReporte`, `turnoReporte`, `fechaReporte`, `folioReporte`, `nomEncargadoTurno`, `nomFuncionariosTurno`, `nomEncargadoTurnoAnterior`, `tareasControlCentralizado`, `tareasInstalaciones`, `tareasEquiposIndustriales`, `tareasIncendiosCombustibles`, `tareasDeteccionElectrica`, `tareasInfraestructura`, `pendientesCoordinacion`) VALUES
(162, 'Reporte General de Eventos - Dia - 04-05-2022', 'Dia', '2022-05-04 12:39:51', 'HBQP-RGE-D-162', 'Abel Torres', 'Benjamín Toloza, Alexis Jara', 'Luis Perez', '', 'Durante el turno se registraron un aumento constante de temperaturas en las bombas del chiller 1 (BAC-1), durante el día se fue monitoreando el equipo, también se tuvo que realizar apagados y encendidos. Las temperaturas que se registraron durante el día fueron: 08:26 registro una temperatura de 129°C la cual fue la primera detención en el equipo, después de volver a encender el equipo se dejo un par de hora en funcionamiento y a las 12:28 de la tarde cuando nuevamente se tomo la medición de temperatura registro una de 119°C, al raíz de esto Javier Beltrán tomo la decisión de detener el equipo y esperar a que su temperatura bajara. Ya durante la tarde se volvió a colocar en funcionamiento pero Alexi Jara informo que esta a los 5 minutos de su encendido registro una temperatura de 109°C esta medición se realizo a las 15:16 horas, luego de las temperaturas que se registraron Javier Beltrán ordeno a detener el chiller.\r\nA causas de estas alzas de temperaturas en tan poco tiempo Javier Beltrán junto a los técnico (Alexi Jara, Claudio Cárcamo dep. Climatización, Benjamín Toloza dep. Eléctrico y el técnico de control) se realizo un protocolo para verificar el funcionamiento del chiller durante la noche.', '', 'Funcionario Matías Gutiérrez (Encargado del departamento Incendio) informa que se activo una alarma de incendio en el piso 6 sector 6.2, al verificar en las pantallas de control centralizado se registro que se habían activado Dámper, Luces y palanca. La cual se trataría de una falsa alarma ya que Matías Gutiérrez junto a Oscar Santander revisaron el sector y no se encontró algo fuera de lugar. En la sala CCTV mostraba una alarma de sobre flujo era totalmente distinto a lo que mostraba control centralizado, las causas de esta alarma fue que se activo un modulo de flujo de agua, esto fue por que en la sala de incendio se abrió una válvula; debido a esto comenzó a bajar la presión y empezó a funcionar la bomba eléctrica y las presiones aumentaron en el sistema, esta información fue entregada por Matías Gutiérrez encargado del departamento eléctrico.', '', '', 'Protocolo chiller\r\n- Desde las 18:00 hasta las 21:00 el equipo se mantendrá apagado.\r\n- A las 21:00 se tiene que hacer una revisión a las sala de comunicaciones, la cual si las temperaturas se encuentran entre 23°c o superior la puerta se tiene que mantener abierta y se debe coordinar con control para monitorear atreves de cámaras alrededor del recinto.\r\n- Luego a las 22:00 se deben poner a recircular el agua encendiendo las BAES y esto debe durar hasta las 00:00.\r\n- A las 1:00 de la mañana se debe de poner en servicio el chiller 2 y luego se debe esperar 15 minutos aproximadamente y los técnicos de turno del departamento eléctrico e climatización tienen que tomar la temperatura en la BAC-2/BAEP-2.\r\nSi las temperaturas exceden mas de lo normal control centralizado debe de estar atento para una parada del equipo y no se vuelve a encender hasta la mañana del turno, pero si se tiene que tener un control de las temperaturas en la sala de comunicaciones.\r\nEn el caso de que las temperaturas no aumente y se mantengan durante la noche el equipo se tiene que dejar en funcionamiento pero si se deben realizar las mediciones cada 30 minutos.\r\n- Se deja pendiente continuar con las pantallas graficas realizadas en el turno anterior esta orden fue dada por Isaac Pérez.\r\n- Dar los accesos a los funcionarios ingresados durante el turno.\r\n- Dar los permisos a Javiera Rubio, Patricia Sepúlveda y Philippe Pons, estos acceso son determinados por Lizandro Varela Jefe de control centralizado.'),
(163, 'Reporte General de Eventos - Noche - 05-05-2022', 'Noche', '2022-05-05 06:30:27', 'HBQP-RGE-N-163', 'Nicolas Droguett Hormazabal', 'Luis Pérez, Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales.', 'Abel Torres', 'Se detectó falla del sensor de huella dactilar para el acceso del ascensor A12 en Piso 3. Se realizó investigación para determinar la posible falla del sistema, concluyendo con la verificación en la Unidad de Control de Acceso correspondiente a \"UCA-05-P3\". Se efectuó un reinicio del sistema, obteniendo la normalización y correcto funcionamiento del sensor biométrico.', 'Según lo acordado con Javier Beltrán, jefe de Dpto. de Climatización, en conjunto con Nicolás Manríquez, Técnico de Dpto. de Climatización, se realizó el arranque del equipo Chiller 2 a las 1:00AM. Se mantuvo en observación las borneras de las bombas \"BAC_2\" y \"BAES_2\" debido al reiterado aumento de temperatura en los últimos días, llevando a cabo mediciones termográficas periódicamente cada 15 minutos, obteniendo temperaturas que iban en aumento acorde avanzaba el tiempo. Luego que Chiller 2 se mantuvo en funcionamiento durante un poco más de 2 horas, la temperatura en bornera de \"BAES_2\" rondaba los 57°C, mientras que en \"BAC_2\" superaba los 100°C. Es por esto que, por órdenes de Javier Beltrán, se decidió mantener Chiller 2 en detención hasta el próximo turno.', 'No se presentan problemas técnicos durante el turno trabajado.', 'No se presentan problemas técnicos con los estanques de combustible durante el turno\r\ntrabajados.\r\nNivel de los tanques en Calderas al terminar turno:\r\n- Tanque 1: 18%\r\n- Tanque 2: 46%', 'Benjamín Vergara, Técnico de Dpto. Eléctrico, realizó el retiro de 2 iluminarias que se encontraban en mal estado debido a la situación climatológica del 26 de Abril, dicha acción se realizó en Medicina Ambulatoria en Piso 3.', 'Fuga de agua detectada frente a sala eléctrica a un costado de RAC RH3C, Piso 3. Se indagó la situación y se detectó que la fuga provenía de un baño del 4to Piso, cuya ubicación corresponde a PMA \"P-4-21\", es por esto que se decidió mantener cerrada la llave de paso que se encontraba dentro del mismo baño.', '- Continuación de trabajos en relación a pantallas gráficas de las UMA\'s.'),
(164, 'Reporte General de Eventos - Dia - 05-05-2022', 'Dia', '2022-05-05 18:50:00', 'HBQP-RGE-D-164', 'Eduardo Muñoz Vera', 'Claudio Carcamo , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', '', 'Durante la jornada se realizaron constantes pruebas con Chiller 2 por ordenes de Don Javier Beltrán.', '', '10:55hrs Se confirma alarma de incendio en sector SAMU, se trata de un detector de humo ubicado en residencia M-2-31, dicha alarma seria o se categorizaría como falsa alarma.\r\nEste se alarma debido a que personal de SACYR se encontraba trabajando en el sector.\r\nEste modulo o detector de humo se dejaría desactivado, para que personal pueda seguir trabajando sin problemas ni confusiones.\r\nCabe recalcar, que en pantalla BMS indica un sector el cual no seria y estaría erróneo, siendo este el S01.11.', '', '', ''),
(165, 'Reporte General de Eventos - Noche - 06-05-2022', 'Noche', '2022-05-06 07:17:48', 'HBQP-RGE-N-165', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Eduardo Muñoz', '', 'Durante el turno Alexis Jara técnico del departamento climatización, informo sobre el VIN-S1-1X que se encontraba apagado (este equipo seria uno de los  que se encuentra inyectando a la sala de compresores); la cual al revisar las pantallas del BMS en control centralizado este equipo se encontraría forzado encendido; según lo conversado con el técnico de climatización ya mencionado este estaría con una nomenclatura repetida, la cual el que se encontraba apagado no se logra tener una gobernanza por parte de control provocando que el encendido solo se manual desde terreno. La información entregada por parte de Alexi Jara y Benjamín Toloza fue que al tratar de encender el equipo desde el tablero este produjo una caída del automático, Alexi Jara decidió realizar la revisión del equipo y encontró que la conexión en la bornera del motor era defectuosa. Debido a esto el técnico informo sobre la situación del equipo y en la situación en que quedo (su selector paco deshabilitado y el automático abajo) por parte de el dejara informado el hallazgo a su jefatura correspondiente, por parte de control se tiene que verificar la integración del equipo en BMS.', '', '', '', '', '- Apagar caldera N°1 según lo programado.\r\n- Revisión de UMAS.'),
(166, 'Reporte General de Eventos - Dia - 06-05-2022', 'Dia', '2022-05-06 12:49:10', 'HBQP-RGE-D-166', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Abel Torres', '', '', '', 'Durante turno, se realiza llenado de combustible en tanque 1 y 2 de combustible en lo horarios de 8:16 (inicio) a 8:40 (termino) quedando el tanque 1 con un nivel de 65% y el tanque 2 con 75%', 'Se soluciona alarma de des comunicación que afectaba a bombas de agua potable, sentina, riego, PEALL y PEAS. \r\nSe levanto interruptor S1 del tablero TGBT1 el cual se encontraba abajo por trabajos en las cercanías con respecto a puntos de red y enchufes.', '', 'Se deja como pendiente el terminar de crear carpetas de pantallas graficas con los respectivos nombres.'),
(167, 'Reporte General de Eventos - Noche - 07-05-2022', 'Noche', '2022-05-07 06:38:21', 'HBQP-RGE-N-167', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal', 'Luis Perez', '', '', '', '-Tanque 1 al 62% \r\n-Tanque 2 al 61%', '', '', '-Se deja como pendiente, seguir con trabajos en BMS sobre pantallas graficas; dejado por don Isaac Pérez\r\n-Apagara caldera 1 a las 9:30'),
(168, 'Reporte General de Eventos - Dia - 07-05-2022', 'Dia', '2022-05-07 14:05:43', 'HBQP-RGE-D-168', 'Nicolas Droguett Hormazabal', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales.', 'Eduardo Muñoz', '', '', 'Filtración de agua en equipo instalado por la empresa Tecnigen reportada por la señorita Diana Romero, encargada de llaves en piso 2. El problema se situaba en Laboratorio Clínico, en piso 2. Se inspeccionó en terreno y se descubrió que mangueras de equipo se encontraban mal conectadas, personal de industrial se dirigió al lugar y se realizó aviso a la empresa Tecnigen para su posterior reparación. Equipo quedó en observación durante el turno y no se reportaron fugas.', 'Alarma de incendio suena constantemente y personal del Depto. Industrial se dirige al lugar a revisar. Esto se originó en el Piso -1, en pasillo TH saliendo a patio de carga. Abraham, Técnico de Dpto. Industrial procedió a revisar y silenciar equipo.\r\n\r\nNo se presentan problemas técnicos con los estanques de combustible durante el turno\r\ntrabajados.\r\nNivel de los tanques en Calderas al terminar turno:\r\n- Tanque 1: 65%\r\n- Tanque 2: 55%', '', 'Gotera reportada por guardia en subterráneo, en sector pilar 3C. Se inspeccionó y se determinó que fuga proviene de uno de los baños del 1er piso que corresponden al PMA B1-2-27. Reporte de gotera ya se habia realizado con anterioridad por Jaime Estay, Técnico de Control Centralizado.', '- Gestionar los accesos correspondientes al personal faltante.'),
(169, 'Reporte General de Eventos - Noche - 08-05-2022', 'Noche', '2022-05-08 07:38:06', 'HBQP-RGE-N-169', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Nicolás Droguett', '', 'Durante turno, se detiene el chiller 1 debido a que el cableado de alimentación en la bornera de BAEP_1 presenta una temperatura  de 125°C y según lo acorado se realiza la detención hasta que baje la temperatura de la bomba para luego volver a poner en uso el equipo.\r\nSe entrega turno con chiller 1 encendido.', 'Durante turno, programa visualizador de ascensores no muestra el posicionamiento de los siguientes ascensores: A3, A11, A15. \r\nCabe señalar que estos ascensores se encuentran en funcionamiento.', 'No se presentan problemas técnicos con los estanques de combustible durante el turno\r\ntrabajado.\r\nNivel de los tanques en Calderas al terminar turno:\r\n- Tanque 1: 69%\r\n- Tanque 2: 49% \r\nNivel de los tanques en Generadores al terminar turno:\r\n- Tanque 4: 73%\r\n- Tanque 3: 71%', '', '', ''),
(170, 'Reporte General de Eventos - Dia - 08-05-2022', 'Dia', '2022-05-08 20:03:55', 'HBQP-RGE-D-170', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Luis Perez', 'Durante la revisión de las pantallas BMS, se percato que la UMA-7-44 y la UMA-7-39 se encontraban midiendo una cantidad de 0,1 a 0,3 pascales en su VEX y este se encontraba encendido, se fue a revisar a terreno junto a Alexi Jara técnico del departamento climatización y se encontró que las conexiones de mangueras se encontraban bien, por el diagnostico entregado por el técnico de clima fue que el VEX se encontraba funcionando como corresponde y no se encontraba alguna fallas por parte de ellos. Cabe mencionar que se desconocen los motivos la cual el sensor se encuentra indicando esa presión de pascales.', '', '', '', '', '', ''),
(171, 'Reporte General de Eventos - Noche - 09-05-2022', 'Noche', '2022-05-09 06:20:50', 'HBQP-RGE-N-171', 'Nicolas Droguett Hormazabal', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Shai Santibáñez.', 'Abel Torres', 'Durante la jornada se realizó actualización y revisión del control de acceso.\r\n(Cambio de nombres de puertas, revisión de funcionamiento del biométrico y magnético.)', 'Durante el turno trabajado se mantiene en observación bombas BAEP_1 Y BAC_1, correspondientes a Chiller 1. Las temperaturas no sobrepasan los 150°C. Último registro informado a las 6:50AM por Nicolás Manríquez, Técnico de Dpto. de Climatización, corresponde a:\r\n- BAEP_1: 122°C.\r\n- BAC_1: 76.3°c .', '', 'No se reportaron problemas técnicos durante el turno trabajado. Al término del turno se indican lo siguientes niveles de combustible:\r\n- Tanque 1: 64%\r\n- Tanque 2: 33%\r\nActualmente se encuentra en uso el Tanque 2.', 'No se reportaron problemas técnicos durante el turno trabajado.', '', '- Monitorear temperaturas de UMAS  de consultas médicas.\r\n- Coordinar apagado de Caldera N°1 con personal de Clima correspondiente al turno.'),
(172, 'Reporte General de Eventos - Dia - 09-05-2022', 'Dia', '2022-05-09 10:50:26', 'HBQP-RGE-D-172', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal', 'Shai Santibañez', '', '- 9:30 Se apaga caldera 1 según lo programado con el departamento de Clima\r\n- Se apaga caldera 5 por orden de Claudio Cárcamo técnico de turno del departamento de climatización, por motivo de carga de presión en estanque de expansión.\r\n- Se fuerza al 0% ya que esta estaría invertida', '- Guillermo Hidalgo, da aviso sobre llamado Tyssen en ascensor 7 A1 (Número de reporte 70069)', '- Se silencia modulo de luz Strobe, ya que este suena en reiteradas ocasiones, determinando que este estaría en con un mal funcionamiento, Piso S1/ S.01.1\r\n- Se trata de un detector de humo en sector SAMU piso 2, fuera de la residencia M-2-32;  se encuentran trabajando en el pasillo y en la residencia, además el detector se encontraba expuesto, a lo cual Matías Gutiérrez encargado de incendios deja deshabilitado el modulo hasta que dichos trabajos se den por finalizados.\r\n- Alarma en sector 1.19 se trata de un modulo de aspiración; al momento de \"rearmar\" el sistema, los ascensores se atascan en el piso 1, haciendo esto que no pueda volver a su funcionamiento normal, para solucionar esto, se tuvo que reconfirmar la alarma para poder volver a la normalidad el funcionamiento de los ascensores.', '', '', '- Se deja como pendiente, dar permisos a sala de bombas a don Fabian Córdova del departamento eléctrico \r\n- Revisión de permisos de la SDO\r\n- Monitorear UMA-3-13'),
(173, 'Reporte General de Eventos - Noche - 10-05-2022', 'Noche', '2022-05-10 07:05:47', 'HBQP-RGE-N-173', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Eduardo Muñoz', '', 'Se reviso durante la noche la UMA-3-13 junto a Alexi Jara técnico del departamento de clima, ya que este equipo se encontraba presentando problemas con temperaturas; al hacerle la revisión en terreno por parte del técnico de turno del departamento clima; se encontró que la válvula se encontraba mal instalada ya que cuando control le daba su modulación a 0% esta giraba en un sentido contrario. Según la información entregada por técnico de clima ya mencionado esta habría sido arreglada, pero igual se le tiene que mantener una visualización constante para verificar su aumento de temperatura.', '', '', '', '', '- Apagado de caldera 1.\r\n- Monitoreo de la UMA-3-13, ya que esta se encuentra presentando bajas temperaturas.\r\n- Monitoreo de sistema de combustible.\r\n- Revisión de la UMA-3-26 y 3-26A, ya que se encuentran con bajas temperaturas, esto debe de ser coordinado con el departamento climatizacion.'),
(174, 'Reporte General de Eventos - Dia - 10-05-2022', 'Dia', '2022-05-10 18:39:52', 'HBQP-RGE-D-174', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Abel Torres', '', 'Durante el turno de hoy, Chiller 1 presenta alarma por lo que se detiene y luego se fuerza el apagado desde control para realizar la detención de las bombas según la lógica de funcionamiento, no se encuentra la posible falla del equipo por lo que este de deja en observación y se enciende Chiller 2.', 'Durante la tarde del turno de hoy, se presentan 2 ascensores con fallas: \r\nsiendo estos el A1 el cual se encuentra detenido con las puertas abiertas en el piso 2 en estado EP, el segundo siendo el B16 que sus puertas se encuentran con falla abriendo y cerrando. \r\nNúmero de reporte \r\nA1 : 70188\r\nB16 : 70189', 'Se entrega turno con los tanques de combustible en estos porcentajes;\r\ntanque 1 :63%\r\ntanque 2 :15%\r\ntanque 3 :68%\r\ntanque 4 :69%', '', 'Durante la mañana del turno de hoy, una camioneta Ford blanca, hace ingreso al estacionamiento por el sector de patio de carga donde el guardia le realiza la apertura de la barrera, y al momento de hacer ingreso, impacta el soporte de descanso de la barrera sacándolo de su eje y dejándolo en el suelo donde mientras avanzaba pasa sobre el. \r\nSituación reportada por Cynthia Maldonado de la unidad de Logística.', ''),
(175, 'Reporte General de Eventos - Noche - 10-05-2022', 'Noche', '2022-05-10 21:56:53', 'HBQP-RGE-N-175', 'Eduardo Muñoz Vera', 'Claudio Cárcamo , Joaquín Vicencio , Benjamín Carvajal', 'Luis Perez', '', '- Al realizar revisión de UMAS, se encuentra UMA-S1-4A con VIN y VEX alarmados, por lo cual se hace el comunicado a personal de clima quien se acerca a dicha UMA, se realiza un reinicio de la UMA; junto con Claudio Cárcamo (Técnico de turno del departamento de Clima), se llega a la conclusión de que este estaría alarmado por un exceso de temperatura, ya que estaría con 32° C de temperatura y sobre corriente , estando esta con su modulación en Válvula de calor en un 100%(En automático) y Válvula de frio en un 0%(automático), estas se dejan forzadas al 100% Válvula de frio y  0% Válvula de calor, estas se dejarían en dicho estado para revisión dentro de la jornada, cabe recalcar que las salas que alimenta dicha UMA, se necesitarían con una temperatura inferior a lo común, ya que estas se necesitarían levemente mas frías por reuniones en recintos(VAV-1-65 y VAV-1-67).\r\n- VIN y VEX de UMA-S1-4A se dejan con una modulación del 70% por sospechas de sobre corriente.', '', '- Al monitorear estanque 2 se observa bajo nivel de combustible, quedando este con un 14%, me comunico con Joaquín Vicencio (Técnico de turno del departamento Industrial) y Claudio Cárcamo (Técnico de turno del departamento de Clima), quienes en conjunto realizan el cambio de estaque 2 a estanque 1.\r\n-Nivel estanque N°1 : 57%\r\n-Nivel estanque N°2 : 16%', '- En conjunto con Benjamín Carvajal (Técnico de turno del departamento eléctrico), se realiza reseteo de sensores de luminosidad del sector E.', '', '- Realizar apagado de caldera número 1 según lo coordinado por técnico de turno.\r\n- Biométrico (Solo huella) ascensor A12, se encuentra con un mal funcionamiento.\r\n- Monitoreo de UMA-S1-4A'),
(176, 'Reporte General de Eventos - Dia - 11-05-2022', 'Dia', '2022-05-11 18:10:24', 'HBQP-RGE-D-176', 'Shai Santibañez', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett', 'Eduardo Muñoz', '', 'Durante el turno trabajado se mantiene en observación bombas BAEP_2 Y BAC_2,\r\ncorrespondientes a Chiller 2. Las temperaturas no sobrepasan los 150°C. Último registro\r\ninformado a las 7:44PM por Nicolás Manríquez, Técnico de Dpto. de Climatización,\r\ncorresponde a:\r\n- BAEP_2: 88.9°C.\r\n- BAC_2: 100°c .', '', 'Se activa alarma de incendio en BMS en sector S01.5 en la cual se activaron los siguientes equipos: detectores, dámper, luces y puertas, Matías Gutiérrez Profesional de departamento de incendio confirma la falsa alarma, la cual no afecto en el funcionamiento del establecimiento.\r\n\r\nNo se reportaron problemas técnicos durante el turno trabajado. Al término del turno se\r\nindican lo siguientes niveles de combustible:\r\n- Tanque 1: 52%\r\n- Tanque 2: 16%\r\nActualmente se encuentra en uso el Tanque  1.', '', 'Se presentó una fuga en el baño de emergencias (I-1-7) la cual fue controlada por personal de SDO y Empresa de aseo, esta fuga no afectó en el funcionamiento del establecimiento.', '- Realizar permisos de accesos a las personas correspondientes, orden dada por Lizandro Varela, jefe de Dpto. Control Centralizado.\r\n- Nueva orden de aperturado de puertas: En el piso -1, 1, 2 y 3, de los recintos entregados solo se les dará acceso si la persona solicitante coordinó esto previamente con el encargado del área o que Control Centralizado esté en conocimiento, previamente enviado por correo o conversado con personal encargado correspondiente. Accesos en los pisos 4, 5 y 6, se realizarán con normalidad.\r\n-Monitoreo de UMAS de consultas medicas.'),
(177, 'Reporte General de Eventos - Noche - 12-05-2022', 'Noche', '2022-05-12 06:41:13', 'HBQP-RGE-N-177', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Shai Santibañez', '', 'Durante turno, técnico de climatización Cristopher Saavedra comunica que bomba BCAS-3 presenta extraños sonidos, por lo que se fuerza el apagado de esta y se mantiene también en manual apagado.\r\nSistema alarma sobre altas temperaturas en sala CGBT por lo que se realiza una revisión a los equipos de climatización y se encuentra al VEX-1-1 apagado por el guarda motor, debido a la altas temperaturas se le realiza una rápida revisión y al no encontrar problemas se normaliza su funcionamiento.', '', '', '', '', 'Se deja como pendiente mantener en observación el VEX-1-1 debido al problema encontrado con este.'),
(178, 'Reporte General de Eventos - Dia - 12-05-2022', 'Dia', '2022-05-12 08:15:30', 'HBQP-RGE-D-178', 'Eduardo Muñoz Vera', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Luis Perez', '', '-11:30 Se fuerza el encendido del equipo por ordenes de Alexi Jara técnico del departamento de climatización, esta orden orden fue ya que algunos recintos se encontraban con pocas temperaturas.\r\n-11:03 POR ORDENES DE DON LIZANDRO VARELA EN CONVERSACION CON VICTOR FIERRO, LA CALDERA DE CHAPA VA A TRABAJAR HASTA QUE SE DETERMINE LA TEMPERATURA AMBIENTE.\r\nESTO QUIERE DECIR, QUE SE PUEDA TRABAJAR Y CALENTAR EL AGUA SOLO CON PANELES SOLARES.\r\nCUALQUIER DUDA CONSULTAR A DON LIZANDRO', '', '', '', '', '- Revisión de UMA\'s S1-32 y 3-24\r\n- Revisión de presión en bombas BCAS\r\n- leer caldera 1\r\n- Dar accesos correspondientes\r\n- Revisión de cámara N° 38 (Por si hay fugas)'),
(179, 'Reporte General de Eventos - Noche - 13-05-2022', 'Noche', '2022-05-13 07:06:24', 'HBQP-RGE-N-179', 'Shai Santibañez', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Eduardo Muñoz', 'Durante el turno trabajado, se presentó Personal de Supervisión de Guardias de Seguridad a las 00:17Hrs aproximadamente, identificándose como Juan López y Eliseo Gutiérrez. Equipo Técnico de Control Centralizado realizó compañía a sala de seguridad para realizar inspección y supervisión de trabajos de personal de SSVT\r\nA las 7AM se fue a realizar la  apertura del portón n°5 según lo acordado e instrucciones dadas por Lizandro Varela, a lo cual a llegar en el punto no se encontraba personal de guardias.', 'Durante el turno trabajado se mantiene en observación bombas BAEP_2 Y BAC_2,\r\ncorrespondientes a Chiller 2. Las temperaturas no sobrepasan los 150°C. Último registro\r\ninformado a las 07:08AM por Nicolás Manríquez, Técnico de Dpto. de Climatización,\r\ncorresponde a:\r\n- BAEP_2: 82.6 °C.\r\n- BAC_2:  103°c .', 'No se presentaron problemas técnicos durante el turno trabajado.', 'No se reportaron problemas técnicos durante el turno trabajado. Al término del turno se\r\nindican lo siguientes niveles de combustible:\r\n- Tanque 1: 27%\r\n- Tanque 2: 14%\r\nSe verifica en terreno Tanque 2 y se indica que cuenta con un 20% de combustible', 'No se presentaron problemas técnicos durante el turno trabajado.', 'Tras trabajos de Sacyr realizados en subterráneo a la salida de Taller de Especialidades el día de ayer, 12 de Mayo del 2022. Técnico de turno correspondiente al día antes mencionado, informó que se presentó una filtración de agua en dicho lugar, por lo cual se mantuvo en observación y monitoreo constante sin obtención de fugas.', ''),
(180, 'Reporte General de Eventos - Dia - 13-05-2022', 'Dia', '2022-05-13 08:37:52', 'HBQP-RGE-D-180', 'Eduardo Muñoz Vera', 'Claudio Cárcamo , Joaquín Vicencio , Benjamín Carvajal', 'Nicolás Droguett', '', '', '- 10:35 Se acerca Benjamín Carvajal quien nos comunica que habría ascensores los cuales estarían botando aceite.\r\n- Se nos informa que ascensor A4 tendría problemas, se dirige personal del departamento de industrial quien nos confirma, a lo cual se procede a revisión de cámaras, en las cuales se puede ver a personal de la empresa de mudanzas, quienes lo golpean con un carro de transporte.\r\nDon Guillermo hace el respectivo llamado a TYSEN.\r\nEl numero de reporte del ascensor seria el 70404.', '- 8:05 Se comienza la carga de combustible, con un porcentaje de 24% en estanque 1 y 16% en estanque 2.\r\n- 8:25 Se finaliza carga de combustibles, con un porcentaje de 68% en estanque 1 y 62% en estanque 2.\r\n- 10:30 Se confirma alarma en sector 1.19, se trataba de un \'\'Modulo Central RP\'\', pero en terreno seria distinto, ya que se identificaría como un modulo de aspiración.\r\nEsta alarma se identificaría como \" Falsa Alarma\"', '- Se recibe llamado desde oficina de partes quienes nos informan que estarian sin \"luz\"(G-1-12/G-1-13/G-1-17), se le informa al Tecnico de turno Benjamín Carvajal, quien se dirige a los recintos correspondientes quien soluciona los problemas presentes en dichas salas , dejando así operativas nuevamente las salas(Esto seria a las 12:00).', '', ''),
(181, 'Reporte General de Eventos - Noche - 14-05-2022', 'Noche', '2022-05-14 00:09:24', 'HBQP-RGE-N-181', 'Shai Santibañez', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Eduardo Muñoz', 'Guardia de sala cctv da aviso mediante llamada telefónica, que personal de empresa de mantenimiento de ascensores se encuentra en la entrada, se le notifica a don Guillermo Hidalgo y autoriza la acción e informa que el técnico viene a evaluar el estado del ascensor y si es que se puede reparar ahora, todo esto será con supervisión de personal de equipo industriales del turno (Alejandro Saavedra Y Javier Arancibia)\r\nSe otorgaron los accesos correspondientes a las personas ingresadas durante la jornada.', 'Se realizaron pruebas con las UMAS (3-26A, 3-26 Y 3-13)con Alexis Jara en las cuales no se llego a ningún resultado de aumento de temperatura.', '', '', 'Durante el turno Benjamín Toloza técnico del departamento eléctrico, informo\r\nque se habría desaparecido uno un foco de jardín la cual fueron cortados sus claves, esta ubicación seria frente a la caseta N°5, se desconocen los motivos de la cual se desapareció.', '', 'Realizar pruebas con las UMAS (3-26A, 3-26 Y 3-13), por si se encuentra algún otro problema no visto durante el turno de noche.'),
(182, 'Reporte General de Eventos - Dia - 14-05-2022', 'Dia', '2022-05-14 18:35:26', 'HBQP-RGE-D-182', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Shai Santibañez', 'Durante turno de hoy, se informa de 3 puertas en  las cuales el control de acceso (lector de huella) no funciona de manera correcta. \r\nSe normaliza el funcionamiento del control de acceso en la puerta del A12 piso 3, faltando normalizar el techo mecánico N°1 y el N°4.', 'Durante turno, Cristopher Saavedra técnico de climatización, informa que Javier Beltrán jefatura del departamento de climatización solicita  mantener el encendido de las calderas N°4 y N°3 hasta el día lunes.', '', '', 'Durante el turno de hoy, empresa ICEBEN ingeniería realiza cambio de motor en portón N°5, empresa se retira  las 15:00 horas dejando el portón en funcionamiento solo en estado manual, continuando para el día de mañana Domingo 15 de mayo con los trabajos pendientes en dicho portón. \r\nEmpresa realiza entrega de dos llaves para el cambio de funcionamiento MANUAL-AUTOMATICO y AUTOMATICO-MANUAL, llaves las cuales son entregadas a Control Centralizado siendo una guardada en el escritorio de la jefatura Don Lizandro Varela y la otra guardada para el uso de los técnicos.', '', 'Se deja como pendiente: \r\nMantener en funcionamiento Caldera N°4 y N°3 según lo ordenado por Javier Beltrán jefatura del departamento de climatización\r\nInformar al turno siguiente (Día) sobre la continuidad de los trabajos en el portón N°5\r\nNormalizar el funcionamiento de los lectores de huella en los techos mecánicos N°1 y N°4'),
(183, 'Reporte General de Eventos - Noche - 15-05-2022', 'Noche', '2022-05-15 06:54:04', 'HBQP-RGE-N-183', 'Eduardo Muñoz Vera', 'Claudio Carcamo , Joaquin Vicencio , Benjamin Carvajal', 'Luis Perez', '', '-Se detiene caldera N°3 ya que estaría funcionando con bajas temperaturas, haciendo que ciertas UMA\'s estén con un funcionamiento no optimo, a raíz de esto se decide encender caldera N°5.\r\n-Se enciende caldera N°1 según lo programado', '', '', '', '', ''),
(184, 'Reporte General de Eventos - Dia - 15-05-2022', 'Dia', '2022-05-15 20:02:40', 'HBQP-RGE-D-184', 'Nicolas Droguett Hormazabal', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Shai Santibáñez.', 'Eduardo Muñoz', '', 'Durante el turno trabajado se mantiene en observación bombas BAEP_2 Y BAC_2, correspondientes a Chiller 2. Las temperaturas no sobrepasan los 150°C. Último registro informado a las 19:20Hrs por Nicolás Manríquez, Técnico de Dpto. de Climatización, corresponde a:\r\n- BAEP_2: 93.1°C.\r\n- BAC_2: 101°C.', '', 'No se reportaron problemas técnicos durante el turno trabajado. Al término del turno se indican lo siguientes niveles de combustible:\r\n- Tanque 1: 31%\r\n- Tanque 2: 62%\r\nActualmente se encuentra en uso el Tanque 1.', 'No se reportaron problemas técnicos durante el turno trabajado.', '', '- Supervisión de trabajos en Portón N°5, a la hora de la entrega del turno, empresas ICEBEN ING. Y JASH, continúan con trabajos en el lugar.\r\n- Climatizar recinto de Consultas Médicas.\r\n- Revisar accesos faltantes a personas correspondientes.'),
(185, 'Reporte General de Eventos - Noche - 16-05-2022', 'Noche', '2022-05-16 07:18:43', 'HBQP-RGE-N-185', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Shai Santibañez', '', '', '', '', 'Durante el turno de hoy, se revisa VEX-1-1 ya que se alarmaría la sala CGBT (Edificio energético) por altas temperaturas, dicho VEX se encontraría con el guarda motor activado y al verificar el amperaje de la alimentación este resulta ser de 1.9A aproximadamente en las 3 fases. Al revisar otro VEX que funcionaba sin ningún problema, la alimentación arroja en las tres fases 1.0A aproximadamente por lo que se da entender que el problema del VEX-1-1 se debe al alto amperaje que recibe y como consecuencia es que salta la protección del motor.\r\nSe retira la empresa ICEBEN al las 21:00 horas aproximadamente informando que continuaran los trabajos el día de hoy Lunes 16.\r\nGuardias informan que portón N°1 presenta problemas ya que este no cierra con el control ni con pulsador dentro de la caseta de los guardias, se revisa el pulsador dentro de la caseta de los guardias ya que no se pudo abrir la carcasa del motor y al momento de abrir el pulsador y presionarlo el portón comienza a abrir; no se encontró el motivo del problema por lo que se deja en observación en caso de que pase algo similar.', '', ''),
(186, 'Reporte General de Eventos - Dia - 16-05-2022', 'Dia', '2022-05-16 11:39:22', 'HBQP-RGE-D-186', 'Eduardo Muñoz Vera', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Luis Perez', '-Se realizan trabajos en circuitos de respaldo 7-8 y en circuitos de fuerza 54, 55 y 56, estos trabajos serian hechos por la empresa MyK Ing. Eléctrica y servicios integrales, quienes en dichos trabajos nos dejarían sin UCA\'s en piso 4 y 6(Esto seria momentáneamente), al termino de sus trabajos se reestablecerían dichas UCA\'s.\r\n- En trabajos realizados durante el día se haría una mala maniobra y este nos dejaría sin UCA-01-P6 y sin cámaras en Piso 6.', '-Se realizan pruebas con chillers 1 y 2 además de sus respectivo IP3, se hacen estas pruebas para revisar si su lógica se cumplía.\r\n-Se realiza apagado de calderas, por llenado de tanque de expansión.', 'Nivel de estanques \r\n- Tanque 1 19%\r\n- Tanque 2 64%', '', '- Benjamín Toloza trabajaría en circuito H6B haciendo mantención.', '', '- Pendientes dejado por Isaac'),
(187, 'Reporte General de Eventos - Noche - 17-05-2022', 'Noche', '2022-05-17 07:12:03', 'HBQP-RGE-N-187', 'Shai Santibañez', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Eduardo Muñoz', '', 'Durante el turno trabajado se mantiene en observación bombas BAEP_1 Y BAC_1, correspondientes a Chiller 1. Las temperaturas no sobrepasan los 150°C. Último registro informado a las 7:36AM por Nicolás Manríquez, Técnico de Dpto. de Climatización, corresponde a:\r\n- BAEP_1: 123°C.\r\n- BAC_1: 83.6°C', 'No se presentaron problemas técnicos durante el turno trabajado.', 'Por motivos de bajo combustible, se reporta una baja de presión en sistema, por lo cual se decide en conjunto con el Dpto. Industrial mantener apagada las Calderas 1, 4 y 5 para el cambio de uso de Tanque. Se mantiene a la espera la orden del Dpto. Industrial para el encendido de las calderas correspondientes.\r\nAl término del turno se indican lo siguientes niveles de combustible:\r\n- Tanque 1: 11%\r\n- Tanque 2: 63%\r\nActualmente se encuentra en uso el Tanque 2.', 'No se presentaron problemas técnicos durante el turno trabajado.', 'No se presentaron problemas técnicos durante el turno trabajado.', '- Esperar orden de Dpto. Industrial para el encendido de las calderas correspondientes.'),
(188, 'Reporte General de Eventos - Dia - 17-05-2022', 'Dia', '2022-05-17 13:37:10', 'HBQP-RGE-D-188', 'Eduardo Muñoz Vera', 'Claudio Cárcamo , Joaquín Vicencio , Benjamín Carvajal', 'Shai Santibañez', '- En la jornada de hoy, se nos presenta una situación un tanto problemática ya que nos dejaría sin control de cámaras, sin UCA\'s y sin servidor remoto, las explicaciones correspondientes a dicho inconveniente se encontrarían en el apartado de electricidad.', '-Se detiene equipo por orden de Claudio Cárcamo (Técnico de clima), quien nos informa que este equipo estaría con ruidos extraños, asumiendo que este se encontraría dañado. Claudio Cárcamo se acercaría a la oficina a informar que este en definitiva estaría dementado de su eje, por ende se dejara apagado hasta nuevo aviso.', '', '-11:47 Se produce una alarma de incendio ya que se activa modulo de aspiración,  debido a que Don Fabian(Encargado del departamento de Electricidad) en conjunto de la empres M y K, estarían trabajando en el 4° piso en una instalación de enchufes debido a este trabajo se origina un levantamiento de polvo que provocaría la activación del modulo de aspiración.\r\nMatías Gutiérrez se dirige al lugar, quien se percata que dicho modulo estaría desprotegido y con una gran cantidad de polvo, Matías hace la gestión de cubrir el modulo, haciendo que el modulo no tenga problemas nuevamente.\r\nAl momento de alarma los ascensores no bajarían al piso 1, si no que seguirían funcionando en su estado normal, sin embargo al momento de realizar el rearmado del sistema, los ascensores esta vez si bajarían al piso 1, haciendo que tengamos que rearmar el sistema 2 veces.', '-En la jornada de hoy, TICS nos pide que nos comuniquemos con departamento de electricidad, para el des energizado de una sala(PMA C-3-3), en lo cual hacemos la gestión y entregamos la información a nuestro compañero de electricidad Benjamín Carvajal, quien procede a la revisión de los circuitos; este revisaría los planos eléctricos, los cuales no corresponderían a lo que habría en terreno.\r\nAl momento de des energizar el circuito, este correspondería a el Rack RH3A, se nos deja en des comunicación unos momentos, hasta que se vuelve a levantar el circuito cortado anteriormente haciendo que todo volviera a la normalidad.', '', '- Realizar levantamientos de Termostatos en los pisos: -1, 1, 2, 3 (Orden dejada por Don Lizandro Varela)\r\n- Seguir con tareas pendientes dejadas por Isaac Pérez'),
(189, 'Reporte General de Eventos - Noche - 18-05-2022', 'Noche', '2022-05-18 07:07:48', 'HBQP-RGE-N-189', 'Nicolas Droguett Hormazabal', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Eduardo Muñoz', 'No se reportaron problemas técnicos durante el turno trabajado.', 'No se reportaron problemas técnicos durante el turno trabajado.', 'No se reportaron problemas técnicos durante el turno trabajado.', 'No se reportaron problemas técnicos durante el turno trabajado. Al término del turno se indican lo siguientes niveles de combustible:\r\n- Tanque 1: 13%\r\n- Tanque 2: 41%\r\nActualmente se encuentra en uso el Tanque 2.', 'No se reportaron problemas técnicos durante el turno trabajado.', 'Fuga de agua reportada con anterioridad en subterráneo en sector pilar C3, continúa durante la noche. Se da aviso a Alejandro Saavedra, de Dpto. de Infraestructura.', '- Evaluar continuación de trabajo correspondiente al levantamiento de termostatos ubicados en pisos -1, 1, 2 y 3 durante turno de Día.\r\n- Mantener en observación UMA-3-13 por bajas temperaturas.\r\n- Continuar con trabajos en BMS entregados por Isaac Pérez, jefe de Dpto. de Control Centralizado.'),
(190, 'Reporte General de Eventos - Dia - 18-05-2022', 'Dia', '2022-05-18 08:45:22', 'HBQP-RGE-D-190', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Nicolás Droguett', 'Durante el turno de hoy, se cierran de forma manual sin posibilidad de abrir la salida 2 y 3 del subterráneo hacía sala cuna, esto ordenado por jefatura Lizandro Varela.', 'Durante el turno de hoy, se fuerza el apagado del Chiller 1 para que se detengan las bombas según la lógica de funcionamiento, ya que el equipo se detiene debido a una alarma en el evaporador, se revisa el equipo y no se encuentra motivo de la falla, por lo que esta se deja detenida y se enciende el Chiller 2.', 'Durante el turno de hoy, se detienen las bombas de riego de forma manual, ya que estas no se detenían mojando de forma exagerada el sector de SAMU junto a la cancha.', 'Durante el turno de hoy, se realiza medición en terreno de tanques de combustible en los cuales se arrojo la siguiente medición:\r\n-tanque 1: 1000 lt \r\n-tanque 2: 4800 lt\r\nmedición desde control:\r\n-tanque 1: 10%\r\n-tanque 2: 39%', 'Durante el turno de hoy, se corta la energía en el Piso 5 para instalación de enchufes en el área, afectando la iluminación, y el control de distintos equipos de climatización, todo esto debido a que el corte de energía des energizo el controlador maestro ECBOS7P5.', '', ''),
(191, 'Reporte General de Eventos - Noche - 19-05-2022', 'Noche', '2022-05-19 06:31:02', 'HBQP-RGE-N-191', 'Eduardo Muñoz Vera', 'Claudio Cárcamo , Joaquín Vicencio , Benjamín Carvajal', 'Luis Perez', '- Se otorgan los permisos correspondientes a las distintas personas, las cuales habrían venido a activar sus credenciales correspondientes durante la jornada mañana/tarde.', '- Se realizan pruebas de los termostatos ubicados en el piso -1, en conjunto con Claudio Cárcamo (Técnico de turno del departamento de Clima), se deja registro de las pruebas con su información correspondiente.\r\n- Se realiza revisión de UMA´s para la jornada, en esta revisión nos percatamos de algunas salas con bajas temperaturas, por ende se realizan forzados en las válvulas de calor correspondiste, estas UMA´s serian: UMA-S1-31A, UMA-S1-31D, UMA-S1-32, las cuales volverán a su estado automático una vez alcanzada la temperatura ideal.\r\n- Al momento de realizar encendido de caldera 1, esta no funcionaria, se conversa con técnico de turno con quien se llega a la conclusión de que esta caldera habría perdido la lógica, por este suceso se realiza el forzado de BCAS5 para el encendido de dicha caldera, al realizar esta acción se podría apreciar que esta si volvería a su funcionamiento correspondiente, por ende BCAS5 se dejaría en automático para no interferir en su funcionamiento habitual.', '- El guardia de CCTV nos informaría de una gotera ubicada en el Piso -1, a lo cual Joaquín Vicencio (Técnico del departamento Industria) acudiría a dicho lugar para su revisión, quien informaría a su jefatura para una solución correspondiente, esta gotera se ubicaría en el pilar C3, por entrada de vehículos ubicado en patio de carga.', '- Durante el turno se nos informa de una alarma de incendio, dicha alarma seria un modulo de aspiración ubicado en el Piso 1 Sector 1.12, en conjunto de Joaquín Vicencio (Técnico del departamento Industria), se confirmaría la falsa alarma y se rearmaría el sistema, cabe recalcar que este modulo de aspiración se activaría por suciedad en el mismo, Joaquín daría a conocer esto a su jefatura para una posterior solución o mantención correspondiente .\r\n- Porcentaje de los tanques de combustible :\r\nTanque 1: 14%\r\nTanque 2: 26%\r\nTanque 3: 67%\r\nTanque 4: 69%\r\n- Se realiza encendido de caldera N°1, esta orden seria dada por Claudio Cárcamo, para el uso de Agua caliente durante la jornada del día de hoy.', '- Al iniciar jornada se nos informa que las luces del 1° piso estarían apagadas, según canal horario estas deberían estar prendidas, por ende se adelanta canal horario a las 6:30.', '', '- Realizar apagado de caldera N°1 según lo coordinado con Don Lizandro Varela (Jefe del departamento de Control Centralizado)\r\n- Realizar desforzado de UMA\'s antes mencionadas.'),
(192, 'Reporte General de Eventos - Dia - 19-05-2022', 'Dia', '2022-05-19 19:50:56', 'HBQP-RGE-D-192', 'Nicolas Droguett Hormazabal', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Shai Santibáñez.', 'Eduardo Muñoz', '', '', '', 'Durante el turno trabajado, se realizo carga de combustible en los tanques de caldera, al terminar la jornada los porcentajes son los siguientes:\r\n- Tanque 1: 54%\r\n- Tanque 2: 69%\r\nActualmente se encuentra en uso el Tanque 2.', '', '', 'Se deja como pendiente:\r\nVerificar alumbrado exterior si se apaga a las 07:00 AM, órdenes dadas por Lizandro Varela, Jefe de Control Centralizado\r\nDar los accesos correspondientes a las personas ingresadas durante la jornada del día, órdenes dadas por Lizandro Varela, Jefe de Control Centralizado\r\nRevisión de recintos de UMA-S1-10, ya que esta durante la jornada presento problemas con sus temperaturas, por falta de aislación térmica en sus ductos\r\ntrabajo a realizar con la UMA-S1-10: a las 04:00AM colocar válvula de calor al 100%, para luego para luego a las 4:30AM tomar temperaturas en terreno con la cámara termográfica, verificar comportamiento de temperaturas desde BMS y Terreno, también el comportamiento del equipo (UMA), órdenes dadas por Lizandro Varela, Jefe de Control Centralizado\r\nContinuar con levantamiento de Termostatos, órdenes dadas por Lizandro Varela, Jefe de Control Centralizado'),
(193, 'Reporte General de Eventos - Noche - 20-05-2022', 'Noche', '2022-05-20 06:48:37', 'HBQP-RGE-N-193', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Shai Santibañez', '', 'Durante el turno de hoy, se realiza una medición de temperatura al ducto de la UMA-S1-10, ya que durante turno anterior informan que esta presento problemas al momento de climatizar los recintos por falta de aislación térmica, durante la revisión se presenta una perdida de un aproximado de casi 15°C  (inyección) esto medido desde el subterráneo a una hora aproximada de las 4:40 am. Desde BMS en control centralizado se presenta inyección de 40°C aproximadamente, cabe señalar que la válvula de calor se encontraba forzada desde el turno anterior y aun así, al momento de tomar mediciones de temperatura desde la sala de espera de consulta medica en el piso 1, se informa que la sensación térmica era fría.', '', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 52%\r\n-tanque 2: 59%\r\nGENERADORES:\r\n-tanque 4: 69%\r\n-tanque 3: 67%', 'Durante el turno de hoy, técnico del departamento eléctrico Matías Añazco informa que realizara un corte de energía en el tablero H6D para realizar mantenimiento a este. Se finaliza el trabajo sin ningún problema y se normaliza el funcionamiento del tablero.', '', ''),
(194, 'Reporte General de Eventos - Dia - 20-05-2022', 'Dia', '2022-05-20 12:05:06', 'HBQP-RGE-D-194', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Luis Perez', '', 'Durante el turno el chiller 2 registro paro de supervisión por alarma de flujo evaporador, esto se debió ya que las presiones en el sistema eran mínimas la cual produjo esta alarma, se volvió a encender el chiller 1 pero al realizar llenado en el sistema de central frio este no subía su presión la cual era dudoso, se realizo una ronda por la mayor parte del hospital para descartar una posible filtración en los ductos de clima a lo que no se llego a encontrar nada fuera de lo normal. Alexi Jara determino detener los CHILLER y se realizara una supervisión respecto a lo acontecido.', '', '', 'Durante el turno Fabian Córdoba informo que realizara trabajos en el sector C del servicio laboratorio/medicina transfusional, según lo entregado realizaron un corte general que incluye los tableros de alumbrado, fuerza y computación. Según el trabajo que se realizo fue un cambio de automático en el tablero, este trabajo termino sin ningún inconveniente.', '', '- Dar permisos a personal de consultorio especialidades según planilla enviada durante el día, por ordenes de Lizandro Varela.\r\n- Dar permisos de mamparas servicio salud mental a Kiara Jofre y Valentina Rubilar, por ordenes de Lizandro Varela.\r\n- Avanzar el levantamiento de termostatos, ordenes de Lizandro Varela\r\n- Dar acceso a persona ingresada durante el día.\r\n- Revisar UMAS de consulta medica.');
INSERT INTO `reportes_generales` (`idReporte`, `nomReporte`, `turnoReporte`, `fechaReporte`, `folioReporte`, `nomEncargadoTurno`, `nomFuncionariosTurno`, `nomEncargadoTurnoAnterior`, `tareasControlCentralizado`, `tareasInstalaciones`, `tareasEquiposIndustriales`, `tareasIncendiosCombustibles`, `tareasDeteccionElectrica`, `tareasInfraestructura`, `pendientesCoordinacion`) VALUES
(195, 'Reporte General de Eventos - Noche - 21-05-2022', 'Noche', '2022-05-21 06:39:10', 'HBQP-RGE-N-195', 'Shai Santibañez', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Abel Torres', 'Se le otorgaron accesos a personal de Consultorio de Especialidades y Gestión Documental. Se realizó avance en levantamiento de termostatos, finalizando sector E y H del primer piso.', 'Al iniciar el turno,  Nicolás Manríquez con ayuda de Alexis Jara, Técnicos de Dpto. de Climatización, realizaron purga en sistema de agua fría en el séptimo piso, debido a que en turno anterior Chiller 2 presentó un paro de supervisión por presiones bajas en el sistema. Al finalizar la purga, Nicolás Manríquez informa encender chiller 2 por ordenes de Javier Beltrán, Jefe de Dpto. de Climatización, notificadas por vía telefónica. Transcurridos 15 minutos de normal funcionamiento del Chiller 2, ocurre un Tripeo en el equipo, a lo cual Nicolás Manríquez solicita encender Chiller 1, en consecuencia de esto, las bombas BAES 2 y BAES 2.1 comenzaron a funcionar a su máxima capacidad, al rededor de los 1455 [rpm], motivo por el cual, Nicolás Manríquez, solicita forzar el apagado de BAES 2.1 y BAES 2 para realizar purga en el sistema y liberar presión. Al iniciar nuevamente las bombas BAES 2 Y BAES 2.1, estas continuaron trabajando a máxima capacidad, por ello, Nicolás Manríquez recibe instrucciones de Javier Beltrán por vía telefónica, para realizar apagado de equipos de Central de Frío e ir a purgar al séptimo piso y continuar liberando presión. Después de realizar dicha acción, Nicolás Manríquez solicita encender Chiller 1, funcionando normalmente por 5 min aproximadamente, se observó que las bombas BAES 2 y BAES 2.1 continuaban funcionando a su máxima capacidad. En consecuencia de lo anterior, Nicolás Manríquez, da la orden de detener el sistema de central frio por precaución, cabe destacar que manómetro analógico en terreno marcaba 5.2 [bar] y el manómetro digital tanto en terreno como en BMS marca 2.3 [bar].\r\nJavier Beltrán informa a Nicolás Manríquez que en la jornada del lunes se arreglará el problema de Chiller N2.\r\nSe realizaron revisiones en Consultorios Médicos de 1er, 2do y 3er piso. Obteniendo las siguientes temperaturas:\r\n\r\n- 1er piso Sala de Espera: 37,4°C correspondientes a UMA-S1-10.\r\n- 1er piso Pasillos: 38,3°C correspondientes a UMA-S1-9.\r\n- 2do piso Sala de Espera: 22,4°C correspondientes a UMA-S1-31B. VIN se encuentra detenida por obstrucción en filtros.\r\n- 2do piso Pasillos y Sala de Espera: 37,8°C correspondientes a UMA-S1-31D.\r\n- 3er piso Sala de Espera: 47,2°C correspondientes a UMA-S1-36.\r\n- 3er piso Pasillos: 43,3°C correspondientes a UMA-S1-33.', '', 'No se presentaron inconvenientes durante el turno trabajado, al terminar la jornada los porcentajes son los siguientes:\r\n- Tanque 1: 54%\r\n- Tanque 2: 47%\r\nActualmente se encuentra en uso el Tanque 2.', '', '', 'Monitoreo UMAS de consultas medicas.'),
(196, 'Reporte General de Eventos - Dia - 21-05-2022', 'Dia', '2022-05-21 17:48:55', 'HBQP-RGE-D-196', 'Jaime Estay', 'Claudio Carcamo , Joaquin Vicencio , Benjamin Carvajal', 'Shai Santibañez', 'Técnico de Control Eduardo Muñoz realizo entrega de turno en el transcurso de la mañana por problemas de salud.', 'Durante la jordana se realizo el encendido del Chiller 1 (Con sus bombas Baes 2-2R y 2.1 forzadas con una modulación al 80%), \r\nSe realizado el encendido ya que Sector de farmacia y medicamentos se encontraban con temperaturas de 27 y 24 °C respectivamente.', '', '', '', '', 'Se deja pendiente avanzar con levantamiento del estado de los Termostatos del Piso 5 y 6.\r\nEncender y apagar equipos de central térmica , según lo acordado con el departamento de climatizacion.\r\nMonitorear temperaturas de los recintos ocupados.\r\nSe deja pendiente configurar la Hora de las Cámaras de Piso 2 y Piso -1.'),
(197, 'Reporte General de Eventos - Noche - 22-05-2022', 'Noche', '2022-05-22 07:19:23', 'HBQP-RGE-N-197', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Jaime Estay', '', 'Durante la mañana al encender caldera N°1 como es de costumbre, esta habría presentado problemas en su encendido, la cual se le informo al técnico de turno del departamento climatizacion Alexi Jara para verificar su problema de encendido, se trataría del automático de las bombas BCAP 5 que se encontraba abajo, a lo que procedió a restablecer el sistema y el funcionamiento de la caldera logro funcionar como corresponde.', '', '', '', '', ''),
(198, 'Reporte General de Eventos - Dia - 22-05-2022', 'Dia', '2022-05-22 19:41:59', 'HBQP-RGE-D-198', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Abel Torres', '', '', 'Durante el turno de hoy, ascensor A8 se encuentra fuera de servicio por lo que se llama a la empresa encargada de la mantención a los ascensores quienes informan su llegada durante el transcurso del día. \r\n\r\nN° de reporte: 71045\r\n\r\nAscensor queda normalizado e informa que falla se debió al bloqueo de la polea limitadora la cual alinea el ascensor.', 'Nivel de combustible al entregar turno\r\nCALDERA:                                         \r\n-tanque 1: 52%   5000lt\r\n-tanque 2: 27%   3400lt\r\nGENERADORES:\r\n-tanque 4: 73%\r\n-tanque 3: 71%', '', '', 'Se deja como pendiente:\r\n-Terminar el levantamiento de los termostatos'),
(199, 'Reporte General de Eventos - Noche - 23-05-2022', 'Noche', '2022-05-23 03:43:01', 'HBQP-RGE-N-199', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal', 'Luis Perez', '- Se realizan monitores de las pantallas graficas\r\n- Se avanza en creación de pantallas graficas y de tendencias', '- Se realiza encendido de Caldera N°1, para la jornada del día de hoy', '', '', '- Se realizan revisiones en los ductos de barra, en estas revisiones se revisarían específicamente los plugin, esta acción fue realizada por Benjamín Carvajal (técnico del departamento eléctrico) y Joaquín Vicencio (técnico del departamento industrial), los trabajos realizados se tratarían de apretar los plugin, los tableros trabajados fueron: H0R, H0S, H0A, H1A, H1Q, H1S, H2X, H2V, HS33, H0P, H1O, H2T, H3Q, H1M, H2R, H3P.', '', ''),
(200, 'Reporte General de Eventos - Dia - 23-05-2022', 'Dia', '2022-05-23 19:41:39', 'HBQP-RGE-D-200', 'Shai Santibañez', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Eduardo Muñoz', '', 'Durante el turno trabajado, Chiller N°2 se normaliza el termomagnético,  pero todavía no esta operativo, información dada por Nicolás Manríquez, técnico de Climatización.', '', 'No se presentaron inconvenientes durante el turno trabajado, al terminar la jornada los\r\nporcentajes son los siguientes:\r\n- Tanque 1: 49%\r\n- Tanque 2: 17%\r\nActualmente se encuentra en uso el Tanque 1.', '', '', 'Se deja como pendiente:\r\nOrdenar escritorios de los PC, Orden dada por Lizandro Varela, encargado de Control Centralizado.\r\nVerificar el encendido y apagado de las luces exteriores e interiores del recinto, Orden dada por Lizandro Varela, encargado de Control Centralizado.\r\nMonitorear y tener a 22°C los recintos de consultas medicas para la mañana del día 24-05-2022, Orden dada por Lizandro Varela, encargado de Control Centralizado.\r\nMonitoreo del Chiller N°1, Orden dada por Lizandro Varela, encargado de Control Centralizado.\r\nOtorgar Permisos a las personas ingresadas durante la jornada del día y Revisar y verificar permisos de personal de SDO, Orden dada por Lizandro Varela, encargado de Control Centralizado.'),
(201, 'Reporte General de Eventos - Noche - 24-05-2022', 'Noche', '2022-05-24 07:15:50', 'HBQP-RGE-N-201', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Shai Santibáñez', '', '', '', 'Nivel de combustible al entregar turno\r\nCALDERA:                                         \r\n-tanque 1: 41%   4000lt     Al finalizar el turno se estima un consumo de 600lt (4600lt medida tomada a las 20:07 horas)\r\n-tanque 2: 16%   2200lt\r\nGENERADORES:\r\n-tanque 4: 73%\r\n-tanque 3: 72%', '', '', ''),
(202, 'Reporte General de Eventos - Dia - 24-05-2022', 'Dia', '2022-05-24 18:57:09', 'HBQP-RGE-D-202', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Luis Perez', '', 'Durante el turno personal de empresa STI realizo trabajos en sala de bomba específicamente boiler, estos trabajos fueron debido a una fuga que se encontraba en el sistema, según la información entregada por Claudio Cárcamo técnico del departamento de climatizacion fue que la empresa dejo en pausa los trabajos y volverán a retomar el día jueves 26 de mayo, debido a esto las bombas BRACS-1 y 1R no se pueden encender por ningún motivo, la cual permanecerán forzadas desde control centralizado, también no se puede encender las BCC-2 y 2R. Para el encendido de la caldera N°1 solo se puede utilizar las siguientes bombas BCC-1 o 1R y las BRACS-2 y 2R, el boiler 6 quedara fuera de servicio. Esta condición durara hasta que el personal de STI termine de realizar los trabajos correspondiente y departamento de climatizacion tiene que dar la información correspondiente.', '', 'Según información entregada por Matías Gutiérrez  la carga de combustible se realizara el día de mañana 24 de mayo del 2022, la cual esta información solo fue de palabra y no se ha reportado algún correo correspondiente a la posible carga de combustible.', '', '', '- Se tiene que realizar el cerrado de todas las puertas del hospital y luego hacer una actualización completa de todo el sistema de control acceso, esta orden fue dada por Lizandro Varela.\r\n- Se tiene que sacar foto de los permisos que poseen el personal de infraestructura y respaldar esta información con correo a jefatura, luego dar permisos según correo enviado por Lizandro Varela.\r\n- Dar permisos a las personas ingresadas durante el turno.\r\n- Los permisos de las llaveras se tiene que revisar los PMA según hoja dejada por Cinthia Maldonado, pero por mientras solo se debe dar los accesos comunes, cualquier duda o consulta con algunas puertas se conversara el día de mañana con jefatura.'),
(203, 'Reporte General de Eventos - Noche - 25-05-2022', 'Noche', '2022-05-25 07:28:55', 'HBQP-RGE-N-203', 'Nicolas Droguett Hormazabal', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Shai Santibáñez.', 'Abel Torres', 'Se realizó revisión de puertas en terreno, comparando funcionamiento en Sistema de Control de Accesos se comprobó que puerta RH1A Y BD D-15-UPC-P1 correspondientes a UCA-02-P1 y UCA-27-P1 respectivamente, no tenían correcto funcionamiento. Puertas mencionadas se encontraban abiertas en Sistema, sin embargo, en terreno se encontraban cerradas.\r\nEn revisión de sistema se encontró que en sala técnica T8 su última apertura fue a las 14:00Hrs, considerando que  el horario de salida es a las 17:00hrs, lo que causo cierta inquietud en equipo de Control Centralizado de turno, debido a que esa puerta es concurrida por personal de infraestructura, a lo que se acudió a su revisión, en la cual se encontró que el magnético y el control de acceso de esa puerta se encuentra fallando, magnético no acoplando de manera correcta, abriéndose de manera fácil y no cerrando, en consecuencia, no arroja ninguna alarma en el sistema de control de acceso.', 'Se realizó revisión en recintos de sala de espera en consultas médicas, en conjunto con Nicolás Manríquez, Técnico de turno del Dpto. de Climatización. Se efectuó medición con cámara termográfica en flujo de inyección de las salas, obteniendo temperaturas no ideales en sala de espera en piso 1,  el equipo encargado de la climatización del lugar antes mencionado corresponde a la UMA S1-10. Se mantendrá en observación.', '', 'No se presentaron inconvenientes durante el turno trabajado, al terminar la jornada los\r\nporcentajes son los siguientes:\r\n- Tanque 1: 29%\r\n- Tanque 2: 15%\r\nActualmente se encuentra en uso el Tanque 1.', '', '', '- Mantener en observación recintos de consultas medicas y UMA S1-10.\r\n- Realizar individualizado de grupos de puertas en Sistema de Control de Accesos. Mamparas las cuales están indicadas en documento entregado a Eduardo Muñoz.'),
(204, 'Reporte General de Eventos - Dia - 25-05-2022', 'Dia', '2022-05-25 09:49:32', 'HBQP-RGE-D-204', 'Eduardo Muñoz Vera', 'Claudio Cárcamo , Joaquín Vicencio , Benjamín Carvajal', 'Shai Santibañez', '- Al momento de realizar pruebas con las UMA\'s, en conjunto de Claudio Cárcamo (Técnico de Climatizacion), nos daríamos cuenta de que la UMA-3-16G estaría con un mal funcionamiento, ya que en dichas pruebas esta se apagaría en terreno, pero sin embargo desde Control Centralizado esta seguiría trabajando.\r\n-Se deja forzada UMA-3-36B, esta acción se realiza por orden de Claudio Cárcamo, se llega a esta decisión a razón de que esta habría perdido la lógica y no reaccionaria a por inercia.\r\n- Se deja detenía UMA-3-1 y VEX-S1-2, esto se deja así por trabajos de esterilización, esta orden fue dada por Don Lizandro Varela.', '- Se realiza apagado momentáneo de VEX-3-6, VEX-3-7, VEX-3-10, VEX-3-25B, VEX-3-24, VEX-3-24B, VEX-3-25, VEX-3-16, VEX-3-2, VEX-3-2, VEX-3-1, VEX-3-30, esta acción se realiza por orden de Claudio Cárcamo (técnico de climatización), se hace revisión de las correas de dicha VEX.\r\n- Se realiza apagado momentáneo de UMA-3-25A, UMA-3-11, UMA-3-12,UMA\'s-3-16-A,B,C,D,E,F,G,H,I,J, UMA-3-2, UMA-3-14B, UMA-3-36B, UMA-3-30, UMA-3-08, UMA-3-31, UMA-3-26A, UMA-3-26A, UMA-3-26, UMA-3-13, esta acción se realiza por orden de Claudio Cárcamo (técnico de climatización), se hace la revisión de filtros\r\n- Se detiene VEX-3-25 hasta nuevo aviso, esta orden es dada por Don Javier Beltrán, ya que se descubriría que las respectivas correas de dicha VEX estarán cortadas.\r\n- Se realiza el cambio de modulación en torre 2, esta acción se realiza por orden de Don Javier Beltrán, quien nos ordena forzar al 100% dicha torre, se nos ordena esto por altas temperaturas en esta torre.\r\n- Se deja como observación estado de la válvula motorizada de la UMA-S1-36, a continuación se adjuntan imágenes relacionadas.', '', '-Se realiza carga de combustible, al inicio de esta carga tendríamos como referencia 29% de combustible en el tanque 1  y  15% de combustible en el tanque 2, al final de la carga quedarían con 65% de combustible en tanque 1 y 67% en tanque 2, pero este ultimo estaría censando mal esta ultima, ya que en terreno tendría 80% y en control 67%.', '', '-Se deja temporalmente fuera de servicio la entrada la cual estaría a un costado del patio de carga, esto se deja así por orden de Don Luis Andrade(Encargado del departamento de Infraestructura), ya que esta estaría con pintura fresca.', ''),
(205, 'Reporte General de Eventos - Noche - 26-05-2022', 'Noche', '2022-05-26 07:01:01', 'HBQP-RGE-N-205', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Eduardo Muñoz', '', 'Durante el turno se percato el que el chiller N°1 habría arrojado una alarma de flujo evaporador, el técnico del departamento de climatizacion Alexi Jara informo sobre lo sucedido la cual se dejaría inhabilitado y solo continuaría el chiller N°2 que ya se encontraba en funcionamiento anteriormente. (Se deja fotos del ultimo pick que tuvo hacia la torre 1)', '', '', '', 'Alexi Jara técnico del departamento de climatizacion informo sobre una alarma en panel de riego ubicado en sala de bomba, la cual a realizar la revisión de los estanques estos estarían con sobre nivel tanto el de riego como el de incendio, Alexi Jara procedió a cerrar el llenado y también informo que las bombas de riego se encontrarían con su automático deshabilitado y se desconocen un motivo la cual fueron deshabilitadas. Las bombas de riego quedaron con su automático habilitado pero no quedaron en funcionamiento.', '-Monitorear UMA-3-31 y la 3-30 que alimentan anatomía patología.\r\n- Monitorear VEX-3-28A, 3-28 y 3-30.\r\n- Estar pendiente de climatizacion en anatomía  patológica ya que seremi hará su visita.\r\n- Monitorear UMA-3-14.\r\n- Monitorear UMA-S1-33 que alimenta sala de espera en consulta medica tercer piso.'),
(206, 'Reporte General de Eventos - Dia - 26-05-2022', 'Dia', '2022-05-26 19:27:52', 'HBQP-RGE-D-206', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Abel Torres', 'Durante el turno de hoy, el grupo de puertas ubicado en la UCA-1-P0 dejo de responder al momento de querer hacer la apertura de la puerta dejando inutilizable los biométricos, se intento solucionar el problema pero no se logra llegar a una solución.', 'Durante el turno de hoy, se realiza mantenimiento a distintos equipos de climatizacion y se encuentran problemas en el VEX-S1-3X  el cual se deja detenido ya que las correas de este están apunto de cortarse y el VIN-1-4 que se encuentra con sus correas cortadas.\r\nSe realiza mantenimiento en el casetón 1/2/3 y el 5 del sub 1, además de los VEX, VIN y EX en el estacionamiento.', '', 'Nivel de combustible al entregar turno\r\nCALDERA:                                         \r\n-tanque 1: 48%   4200lt     \r\n-tanque 2: 70%   8000lt\r\nGENERADORES:\r\n-tanque 4: 70%\r\n-tanque 3: 68%', '', '', 'Se deja como pendiente:\r\n-Descargar y ordenar las solicitudes de acceso en carpetas por servicio, esto ordenado por jefatura Lizandro Varela \r\n-Buscar circuito de la UCA-01 y botarlo para de esta forma reiniciar la UCA\r\n-Abrir puertas de entrada de farmacia P0 a las 6:30 am (dejar siempre abierta)'),
(207, 'Reporte General de Eventos - Noche - 27-05-2022', 'Noche', '2022-05-27 08:07:38', 'HBQP-RGE-N-207', 'Eduardo Muñoz Vera', 'claudio Cárcamo , Joaquín Vicencio , Benjamín Carvajal', 'Luis Perez', '', 'Se realiza revisión de VAVs de los recintos en los cuales se estaría ocupando, los recintos con bajas temperaturas se fueron a revisar y se soluciono.', '', '', '', '', ''),
(208, 'Reporte General de Eventos - Dia - 27-05-2022', 'Dia', '2022-05-27 19:36:06', 'HBQP-RGE-D-208', 'Shai Santibañez', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Eduardo Muñoz', 'Durante la Jornada de la Mañana, se presento mutiles Caídas en el sistema de Control de accesos, debido a trabajos de empresas contratistas de departamento de TICS, cabe mencionar que estas caídas no afectaron en el funcionamiento del control de acceso, ya que el sistema volvía al instante.', '', '', 'No se presentaron inconvenientes durante el turno trabajado, al terminar la jornada los\r\nporcentajes son los siguientes:\r\n- Tanque 1: 28%\r\n- Tanque 2: 68%\r\nActualmente se encuentra en uso el Tanque 1.', '', '', 'Se deja como pendiente:\r\nOtorgar los accesos correspondientes, ordenes dadas por Lizandro Varela, Jefe de Control Centralizado.\r\nRealizar post ventas de termostatos del piso 1, ordenes dadas por Lizandro Varela, Jefe de Control Centralizado.\r\nRealizar trabajo de BMS , orden dada por Isaac Pérez, Profesional de Control Centralizado.\r\nRevisar permisos de Unidad de Pabellón, orden dada por Yorgo Casimis, Profesional de Control Centralizado.\r\nReplicar información de empresas y personal que trabajara el fin de semana y otorgar a la señorita Cynthia Maldonado la tarjeta de su personal de aseo.'),
(209, 'Reporte General de Eventos - Noche - 28-05-2022', 'Noche', '2022-05-28 07:26:52', 'HBQP-RGE-N-209', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Shai Santibañez', '', '', 'Durante el turno de hoy, Cristopher Saavedra de climatizacion durante ronda a sala de bombas para tomar parámetros, encuentra un charco de agua que llega hasta la entrada de sala bombas junto al criogénico, llama a personal de EEII para apoyo y durante la revisión encuentran que el origen del agua se debió a un rebalse de la piscina de riego, se encienden las bombas las cuales se encontraban apagadas y se abre la válvulas de bola la cual estaba cerrada, esto se hace con el fin de disminuir el nivel de agua de la piscina de riego.', 'Durante el turno de hoy, se realiza cambio de aspiración de tanque 1 a tanque 2 de calderas (combustible).\r\nNivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 21% 1600lt\r\n-tanque 2: 65% 8000lt\r\nGENERADORES:\r\n-tanque 4: 72%\r\n-tanque 3: 70%', '', '', ''),
(210, 'Reporte General de Eventos - Dia - 28-05-2022', 'Dia', '2022-05-28 19:25:43', 'HBQP-RGE-D-210', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Luis Perez', '', 'Se deja como información que los siguientes equipos quedaran inhabilitado debido a que presentaron problemas de funcionamiento.\r\nVEX-7-53: Este equipo quedara fuera de servicio debido a que sus correas se encontraban cortada impidiendo un correcto funcionamiento, esto quedara así hasta que se se le instale una correa nueva.\r\nVEX-7-49: Este equipo quedo inhabilitado debido a que al revisar sus correa esta estaba propensa a cortarse, así que se tomo la decisión de dejarlo fuera para evitar daños mayores.\r\nVEX-7-51: Este equipo al igual que el anterior también se dejo inoperativo debido a sus correas propensa a cortarse.', '', '', '', '', ''),
(211, 'Reporte General de Eventos - Noche - 29-05-2022', 'Noche', '2022-05-29 07:29:31', 'HBQP-RGE-N-211', 'Shai Santibañez', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Abel Torres', 'Se realizaron trabajos pendientes dados por Lizandro Varela y Isaac Pérez, a lo cual se llego al termino del Trabajo dado Por Lizandro Varela, Jefe de Control Centralizado y un avance en el trabajo dado por Isaac Pérez, Profesional de Control Centralizado.', '', '', 'No se presentaron inconvenientes durante el turno trabajado, al terminar la jornada los\r\nporcentajes son los siguientes:\r\n- Tanque 1: 19%\r\n- Tanque 2: 44%\r\nActualmente se encuentra en uso el Tanque 2.', '', '', 'Revisión de documentación de trabajo finalizado, dado por Lizandro Varela, Jefe de Control Centralizado'),
(212, 'Reporte General de Eventos - Dia - 29-05-2022', 'Dia', '2022-05-29 19:55:17', 'HBQP-RGE-D-212', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal', 'Shai Santibañez', '- Se terminan trabajos dejados por Isaac Pérez', '- VEX-S1-5X Se deja en Forzado apagado por orden de Claudio Cárcamo (Técnico del departamento de climatizacion)\r\n- Caldera 1 Se detiene caldera por orden de Claudio Cárcamo técnico de climatizacion.', '', '- Niveles de combustible en el turno:\r\ntanque 1: 21%\r\ntanque 2: 37%', '', '', ''),
(213, 'Reporte General de Eventos - Noche - 30-05-2022', 'Noche', '2022-05-30 07:27:54', 'HBQP-RGE-N-213', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Eduardo Muñoz', '', '', '', '', '', '', '- Se tiene que monitorear la UMA-S1-35, S1-10 y 3-12, debido a problemas de temperatura además revisión de todas las UMAS que alimentas unidades ya en funcionamiento.\r\n- Continuar informando sobre las bajas temperaturas que se encuentran en las UMA-3-26A, 3-26 y 3-13.'),
(214, 'Reporte General de Eventos - Dia - 30-05-2022', 'Dia', '2022-05-30 19:17:34', 'HBQP-RGE-D-214', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Abel Torres', '', 'Durante el turno de hoy, empresa montes burgos realiza aseo a los chiller 1, 2, 3 y 4 además de verificación eléctrica (Se realizara mantención mecánica para el día de mañana 31 de mayo). \r\nPersonal de STI realiza soldadura a boiler con fuga, siendo este el N°6 y N°3.', 'Durante el turno de hoy, notifican que personal se queda atrapado en el ascensor A5-1 nivel P3. Este hecho se reporta a la empresa encargada de la mantención a los ascensores siendo el numero del reporte el siguiente: N° 71667 (Persona logra salir sin problemas).\r\nPersonal de sala CCTV da a conocer que alguien se encuentra atrapado en ascensor A4 nivel -1. Persona logra salir a salvo y sin mayores problemas que un susto, esta maniobra se realizo en conjunto con personal de incendio, EEII y el técnico de asesores Marcos Torres quien se encontraba en el hospital revisando la falla del ascensor A5.', 'Durante el turno de hoy, informan sobre alarma de incendio en sector 1.18 (SAMU). Se activa sensor de humo por lo que se arroja en el sistema una alarma de incendio (solo en central de incendio), durante revisión no se encuentran mayores problemas, por lo que alarma se adjudica a falla del equipo y se deja en observación.', 'Durante el turno de hoy, magnetotérmico de alumbrado general y automático de balizas tienen una caída, por lo que se vuelve normalizar el automático luego de realizar la respectiva revisión.', '', 'Se deja como pendiente \r\n-Realizar trabajo dejado por Isaac Pérez.'),
(215, 'Reporte General de Eventos - Noche - 31-05-2022', 'Noche', '2022-05-31 07:26:31', 'HBQP-RGE-N-215', 'Eduardo Muñoz Vera', 'Claudio Cárcamo , Joaquín Vicencio , Benjamín Carvajal', 'Luis Perez', '- Se terminan trabajos encomendados por Isaac Pérez.\r\n- Se otorgan permisos correspondientes', '- Se enciende caldera 1 para la jornada del día', '', '- Se hace cambio de Tanque 2 al 1 sus porcentajes serian de:\r\nTanque 1: 18% desde control y en terreno 1.200 litros \r\nTanque 2: 7% desde control y en terreno 1.100 litros', '', '', '- Apagar caldera 1 según lo acordado con Don Lizandro Varela\r\n- Realizar apertura de válvulas 263 y 265.'),
(216, 'Reporte General de Eventos - Dia - 31-05-2022', 'Dia', '2022-05-31 19:24:05', 'HBQP-RGE-D-216', 'Shai Santibañez', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Eduardo Muñoz', '', '', '', 'Se realizó recarga de combustible de 10.000 LT las 14:19 el día de hoy.\r\nNiveles de combustibles:\r\n- Tanque 1: 61%\r\n- Tanque 2: 49%\r\nActualmente en funcionamiento: Tanque 1.', '', 'Fuga de agua ocurrida en subterráneo, área de este esterilización. Personal de Infraestructura se dirigió al lugar de los hechos solucionando el problema realizando corte de válvula en sistema de agua.', '- Realizar trabajo de BMS dado por Isaac Pérez, Profesional de apoyo de Control Centralizado.\r\n- Realizar completado de carpeta de solicitud de accesos, escanear permisos que no se encuentren de manera digital. Orden dada por Lizandro Varela, Jefe de Control Centralizado.\r\n- Revisar permisos de Egon de la Guarda y Felipe Pavés, corroborar que se encuentren con los permisos que les correspondan.\r\n- Otorgar permisos a Laura Molina, personal nuevo de Logística.'),
(217, 'Reporte General de Eventos - Noche - 01-06-2022', 'Noche', '2022-06-01 07:33:12', 'HBQP-RGE-N-217', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Shai Santibañez', '', 'Durante el turno de hoy, se produce una fuga de agua del boiler AA-1 la cual se logra visualizar desde cámaras, por lo que se cierran todas las válvulas y se genera una des-comunicación del boiler para de esta forma evitar que se siga alimentando agua a este y poder despichar el boiler con facilidad.', '', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 51% 4000lt       \r\n-tanque 2: 50% 6000lt\r\nGENERADORES:\r\n-tanque 4: 72%\r\n-tanque 3:69%', '', '', ''),
(218, 'Reporte General de Eventos - Dia - 01-06-2022', 'Dia', '2022-06-01 19:49:24', 'HBQP-RGE-D-218', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Luis Perez', '', 'Durante el turno se registro una alarma de flujo evaporador 05 en el chiller 2, la cual el técnico de turno del departamento de climatizacion Alexis Jara tomo la decisión de dejarlo con su alarma y poner en marcha el chiller 1.\r\nlas temperaturas antes de su apagado son:\r\nTemperatura impulsión condensador= 24.21°C 09:15 hrs\r\nTemperatura impulsión evaporador= 8,35°C 09:15 hrs\r\nTemperatura retorno condensador= 23,19°C 09:15 hrs\r\nTemperatura retorno evaporador= 7,68°C\r\nEstas serian las ultimas temperatura que registro el chiller 2 según los historiales de control centralizado.\r\n\r\nPara conocimiento El VEX-3-28A( 3-27) está con un consumo de 3.7 A, lo cual indica en el contactor que tiene un máximo de 3.1 A. Puede ser que lo que suponía era cierto, que presente un sobre consumo y se active el relé térmico. Destacar que esté VEX corresponde a la sala de autopsias del sector anatomía patológica B-2-9, bloque B. En terreno se abre el VEX y indica que el consumo máximo es de 3.9 A, lo que se llega con personal eléctrico a la conclusión que hay que cambiar el contactor por uno de mayor capacidad. Esta información fue entregada por parte de Alexi Jara técnico del departamento de climatizacion y Benjamín Toloza técnico del departamento eléctrico.\r\n\r\nDurante el turno se registro nuevamente una fisura en el boiler AA-1, la cual el departamento de climatizacion realizo las acciones correspondiente y se dará aviso sobre lo acontecido.\r\n\r\nDebido al problema sucedido con el boiler, caldera 1 se mantendrá encendida hasta la 17:00 hrs aproximadamente, pero esto igual se debe coordinar con el departamento de clima, paneles solares se mantendrá apagado apagado por lo acontecido en los boiler, pero igual hay que consultar al dep. climatizacion para verificar si esta fisura fue reparada.', 'Alejandro Cantillano informo sobre problemas en el ascensor A11-2 la cual se encontraba con un mensaje de EP y también estaba con desnivel, se le dio aviso al encargado y se realizaran la gestión para su solución.', '', '', '', '- Dar permisos a personas ingresada durante el día\r\n- Revisión de climatizacion, iluminación y industrial en las unidades de medicina transfusional, laboratorio y anatomía patológica por ordenes de Lizandro Varela jefe de control centralizado, esto es debido a que se realizara la visita de seremi a estos recintos.'),
(219, 'Reporte General de Eventos - Noche - 02-06-2022', 'Noche', '2022-06-02 07:19:06', 'HBQP-RGE-N-219', 'Nicolas Droguett Hormazabal', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Shai Santibáñez.', 'Abel Torres', 'Se comenzó con el levantamiento correspondiente a la identificación de circuitos en tableros de distribución que intervengan la alimentación de las Unidades de Control de Acceso (UCA). Se registró que, en Tablero \"H1F\" ubicado en piso 1, el circuito \"S43\" no correspondía según lo estipulado en planos eléctricos, al realizar corte en disyuntor, este comprometió la alimentación en Rack \"RH1E\", el cual no estaba estipulado su des-energización.', 'En conjunto con Nicolás Manríquez, Técnico del Dpto. de Climatización, se mantuvo en observación Boiler AA1 debido a fugas presentadas en el lugar.', '', 'No se presentaron inconvenientes durante el turno trabajado, al terminar la jornada los porcentajes son los siguientes:\r\n- Tanque 1: 25%\r\n- Tanque 2: 50%\r\nActualmente se encuentra en uso el Tanque 1.', 'Durante el turno de Noche personal se percata que balizas del 7mo Piso no se encuentran encendidas, esto se produjo debido a los cortos circuito reportados anteriormente en los días de lluvia, Benjamín Vergara técnico del departamento eléctrico decide dejarlas apagadas desde el selector, el cual corresponde al N°16.', '', '- Mantener en observación recintos de medicina Transfusional, Laboratorio y Anatomía Patológica, verificar que las temperaturas sean las adecuadas.\r\n- Dar continuación de trabajos sobre levantamiento de UCA\'s y su circuito correspondiente a Técnico de turno de noche.'),
(220, 'Reporte General de Eventos - Dia - 02-06-2022', 'Dia', '2022-06-02 10:14:47', 'HBQP-RGE-D-220', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal', 'Shai Santibañez', '', '-Las siguientes válvulas son puestas e automático: BRACS 1, BRACS 1R, BRACS 2, BRACS 2R, esta acción se realiza por orden e Claudio Cárcamo, esto se hace por trabajos en el  boiler 1.\r\n-Se modifica el set de extracción, este pasaría de 116Pa a 150Pa y el Set de Inyección pasaría desde 108Pa a 160Pa, esta orden seria dada por Don Víctor Fierro, estos parámetros corresponderían a la UMA-3-26, la cual se modificaría desde control.\r\n-Se modifica el Set de Inyección pasaría desde 274Pa a 250Pa, esta orden seria dada por Don Víctor Fierro, estos parámetros corresponderían a la UMA-3-13, la cual se modificaría desde control.\r\n-Se modifica el VEX de la UMA-3-2 por orden de Víctor Fierro, esta acción se realizaría ya que los recintos que alimenta esta UMA estarían fríos, cabe recalcar que estos deberían estar temperados por la visita de seremi.', '-Durante la jornada de hoy, la empresa Indura estaría realizando trabajos en los compresores de esterilización, el encargado de acompañarlos seria Joaquín Vicencio (Técnico del departamento de industrial).', '- Durante la jornada diurna, se observarían demasiadas alarmas de supervisión y de problema, por dicha situación se le haría saber al encargado de incendio sobre este problema, quien nos informa sobre los trabajos de la empresa E.S.F.E. Systems, estos estarían limpiando los módulos haciendo esto que se alarmen.\r\n- Se confirma alarma de incendio, esta se activaría por trabajos realizados por TICS, se realizan las maniobras correspondientes apoyando al departamento Industrial. Cabe recalcar que los ascensores no realizarían el descenso correspondiente.\r\n- Se realiza cambio en tanque 1 quedando con un 15% (según lo que marca en control) y en tanque 2 (el cual esta operativo) un 48% desde control.', '', '', ''),
(221, 'Reporte General de Eventos - Noche - 03-06-2022', 'Noche', '2022-06-03 07:38:35', 'HBQP-RGE-N-221', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Eduardo Muñoz', '', '', '', '', 'Durante el turno se registro la caída del magnetotérmico del exterior 1, la cual Benjamín Toloza técnico del departamento eléctrico se dirigió al lugar y entrego el diagnostico sobre lo sucedido \"Interruptor general de alumbrado exterior 1 L1Aa, se encuentra nuevamente operativo, al revisar el tablero y no ver mayores problemas mas que el circuito K11 - AEX11, la cual lleva tiempo fuera de funcionamiento\". La caída del magnetotérmico no causo problemas mayores y se pudo reestablecer fácilmente.\r\n\r\nTambién se deja informado que Benjamín Toloza técnico del departamento eléctrico, dejo de manera manual el circuito AEV1-A16 perteneciente a las balizas de seguridad como medida de prevención por los antecedentes previos de cortocircuito que se han generado cuando se registran precipitaciones.\r\n\r\nDurante el turno Benjamín Toloza técnico del departamento eléctrico, nuevamente informo que se habría desaparecido uno un foco de jardín la cual fueron cortados sus claves y estos quedaron energizados, esta ubicación seria frente a la caseta N°5, se desconocen los motivos de la cual se desapareció pero ya se encuentra reportado por el departamento eléctrico.', '', ''),
(222, 'Reporte General de Eventos - Dia - 03-06-2022', 'Dia', '2022-06-03 19:55:09', 'HBQP-RGE-D-222', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Abel Torres', '', '', 'Durante el turno de hoy, empresa de mantención a ascensores realizan revisión al ascensor A4-1 ya que este estaba filtrando agua por iluminaria, el ascensor A8 que se habia quedado fuera de servicio con las puertas abiertas y al realizar las mantenciones correspondientes se produce una falla de comunicación del software de los ascensores dejando des comunicado el núcleo A11 y el A12 y fuera de servicio el A7-1 y el A4-1.', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 12% 800lt\r\n-tanque 2: 30% 3800lt\r\nGENERADORES:\r\n-tanque 4: 70%\r\n-tanque 3: 65%', '', '', 'Se deja como pendiente:\r\n-Continuar levantamiento dejado por Isaac Pérez profesional de Control Centralizado \r\n-Realizar revisión de equipos forzados en plataforma de C.C'),
(223, 'Reporte General de Eventos - Noche - 03-06-2022', 'Noche', '2022-06-03 21:23:09', 'HBQP-RGE-N-223', 'Eduardo Muñoz Vera', 'Claudio Cárcamo , Joaquín Vicencio , Benjamín Carvajal', 'Luis Perez', '-Se realizan trabajos encomendados por Isaac Pérez\r\n-Se realizan trabajos en BMS', '-Se realiza encendido de caldera, por orden de Claudio Cárcamo (Técnico del departamento de clima) para la jornada del día.', '- Técnico de Tyssen realiza el arreglo de ascensor A7-2.\r\n- Joaquín Vicencio en conjunto de Abraham hacen limpieza en tanques de dosificación de cloro', '-Niveles de Combustible:\r\nTanque 1: 12% desde Control \r\nTanque 2: 23% desde Control', '', '', '-Realizar apagado de Caldera 1'),
(224, 'Reporte General de Eventos - Dia - 04-06-2022', 'Dia', '2022-06-04 19:56:57', 'HBQP-RGE-D-224', 'Shai Santibañez', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Eduardo Muñoz', '', '', 'Se regulo el Nivel de las PEALL-4 junto con personal de equipos industriales, ya que estás se activaban constantemente.', 'No se presentaron inconvenientes durante el turno trabajado, al terminar la jornada los\r\nporcentajes son los siguientes:\r\n- Tanque 1: 12%\r\n- Tanque 2: 14%\r\nActualmente se encuentra en uso el Tanque 2.', '', '', 'Se dejar como pendiente:\r\nRealizar trabajo de BMS dado por Isaac Pérez, profesional de apoyo de Control Centralizado.'),
(225, 'Reporte General de Eventos - Noche - 05-06-2022', 'Noche', '2022-06-05 07:45:24', 'HBQP-RGE-N-225', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Shai Santibañez', 'Durante el turno de hoy, se entregan llaves a Cristopher Saavedra técnico de climatizacion para realizar las rondas por las salas de comunicación, quien informa que al momento de abrir una mampara, la llave 436 del piso 2 sector de odontología se queda atrapada en esta y no logra poder recuperarla.', '', '', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 17% 800lt\r\n-tanque 2: 10% 1400lt\r\nGENERADORES:\r\n-tanque 4: 73%\r\n-tanque 3: 71%', '', '', 'Se dejar como pendiente:\r\nRealizar trabajo de BMS dado por Isaac Pérez, profesional de apoyo de Control Centralizado.'),
(226, 'Reporte General de Eventos - Dia - 05-06-2022', 'Dia', '2022-06-05 19:42:45', 'HBQP-RGE-D-226', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Joaquin Vicencio', 'Luis Perez', '', '', 'Guillermo Hidalgo informo que el día viernes 03/06 se habían empezado a realizar unas pruebas de hermeticidad en el sistema de gases clínico, a lo cual el día sábado y domingo el mismo jefe del departamento industrial Guillermo Hidalgo comento que desde el pabellón N°2 hasta el N°10 se encontrarían con fuga en gases medicinal, debido a esto se realiza monitoreo por parte de dicho departamento hasta encontrar el problema de la fuga. Estas pruebas terminaran el día lunes 06/06.', 'Durante el turno se termina con 17% de combustible en el tanque N°1 y 9,0% en el tanque N°2, cabe señalar que los equipo de central térmica permanecieron apagado durante el día y solo se estuvo trabajando con paneles solares, esto es debido a que se realizo un ahorro de combustible por en caso de emergencia y además climatizar los servicios en la mañana del día lunes.', '', '', ''),
(227, 'Reporte General de Eventos - Noche - 06-06-2022', 'Noche', '2022-06-06 07:04:47', 'HBQP-RGE-N-227', 'Shai Santibañez', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Abel Torres', '- Se realizó avance de trabajos en BMS sobre recopilación de rutas de temperatura ambiente a equipos correspondientes. Se consideraron VAV, VF, CVV y FC.\r\n- Revisión en su totalidad de Unidades Manejadoras de Aire (UMA), se recopiló información indicando filtros que se encuentran sucios. Se identificó un total de 25 UMA\'s con filtros sucios, 6 correspondientes al Subterráneo y 19 al piso 3.', '', '', 'Problemas al identificar el nivel de combustible, se presenta variación e incongruencia con respecto a lo visualizado en BMS y medición realizada en terreno. Al finalizar la jornada, los porcentajes en los niveles de tanques de combustibles son los siguientes:\r\n- Tanque 1: Visualización en BMS 17%, Medición en terreno: 800[L].\r\n- Tanque 2: Visualización en BMS 8%, Medición en terreno: 1300[L].\r\nActualmente se encuentra en uso el Tanque 2.', '', '', '- Mantener en observación niveles en Tanques de Combustible, por motivos de variación entre lo visualizado en BMS y la medición realizada en terreno. Cabe mencionar que el combustible se encuentra en un nivel bajo al finalizar el turno.\r\n- Continuación de trabajos en BMS establecidos por Isaac Pérez, Profesional de Apoyo en Control Centralizado.'),
(228, 'Reporte General de Eventos - Dia - 06-06-2022', 'Dia', '2022-06-06 17:34:54', 'HBQP-RGE-D-228', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal', 'Shai Santibañez', '', '-11:17 Durante la jornada de hoy nos daríamos cuenta de que Chiller 1 se habría detenido, esto se daría por una alarma de flujo en evaporador, se le informa a personal de clima, quienes arreglarían dicho problema o alarma, quedando este sin problemas hasta el momento siendo las 18:00.\r\n-12:38 Se realiza el apagado de Caldera 5, ya que estaría con una constante alarma de baja presión en tanque de combustibles, a raíz de esto se opta por encender Caldera 4 quedando esta sin problema alguno y funcionando correctamente hasta el momento.', '-En la jornada de hoy el ascensor A1-2  se encuentra abierto en el piso 1 fuera de servicio, se realiza llamado a la empresa Tyssen con numero de reporte 72242.', '-Se realiza la carga de combustible en la jornada de hoy, esto seria a las 13:00. Los parámetros de combustible serian:\r\nTanque 1: en el comienzo de la carga este tendría un 16%, pero sin embargo este en terreno tendría un 8% es decir 800 Litros, al final de la carga este quedaría con 61% desde BMS y en terreno 6.000 Litros(Siendo esta medición mas exacta que la de BMS )\r\nTanque 2: en el comienzo de la carga este tendría un 0%, pero sin embargo este en terreno tendría un 9% es decir 900 Litros, al final de la carga este quedaría con 45% desde BMS y en terreno 5.800 Litros(Siendo esta medición mas exacta que la de BMS )', '-Don Gustavo Loira nos informa de un perno suelto en paneles solares, Don Gustavo enviaría a Benjamín Carvajal (Técnico del departamento eléctrico) para realizar el arreglo, Benjamín se daría cuenta de que este estaría colgando y le dan la orden de de quitar el panel, pero para realizar esta acción se debe quitar la manga de viento, al sacarla se darían cuenta que no tan solo el panel estaría colgando sino que también tendría cortado un cable, además de tener que sacar el foco, dichos equipos se llevarían a su correspondiente taller para una posterior reparación.', '-Claudio Cárcamo nos informa sobre una puerta dañada ubicada en farmacia y consultas medicas 1° piso hacia sector E.', ''),
(229, 'Reporte General de Eventos - Noche - 07-06-2022', 'Noche', '2022-06-07 08:06:26', 'HBQP-RGE-N-229', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Eduardo Muñoz', '', '', '', 'Combustible el estanque N°1 se encuentra con 60% y el N°2 se encuentra con 33%, estos datos se registraron al termino de turno y se encuentran 3 calderas en funcionamiento 2 de climatizacion y una de agua sanitaria.', '', '', ''),
(230, 'Reporte General de Eventos - Dia - 07-06-2022', 'Dia', '2022-06-07 19:18:04', 'HBQP-RGE-D-230', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Abel Torres', '', 'Durante el turno de hoy, Víctor Juica de  STI realiza un calafateado al boiler de agua AA-6.', '', 'Durante el turno de hoy, se activan 2 falsas alarmas de incendio, en las cuales una ocurrió en segundo piso, sector 2.6 (cuidados intensivos) UPC ADULTO a las 12:06.\r\nEsta alarma se genero debido a la mantención de los detectores de humo, que al volver a habilitar el detector luego de la mantención, este se activo detectando una alarma de incendio generando así la falsa alarma, y el segundo, que se activa una alarma de incendio en sala de ecomotografia H-1-19 en el piso 1, se alarma el FM 200 pero se desconoce el motivo de la activación de la alarma (se rearma el sistema al confirmar que es falsa alarma).\r\n\r\nNivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 59% 5800lt\r\n-tanque 2: 27% 3600lt\r\nGENERADORES:\r\n-tanque 4: 73%\r\n-tanque 3: 72%', '', '', 'Se deja como pendiente:\r\n-Realizar historial de bombas de agua caliente y agua fría, realizando de forma especifica los historiales del estado térmico, estado del selector y del variador de frecuencia (darle al historial un tiempo de 15 minutos y dejarle 500 puntos).'),
(231, 'Reporte General de Eventos - Noche - 08-06-2022', 'Noche', '2022-06-08 03:41:25', 'HBQP-RGE-N-231', 'Eduardo Muñoz Vera', 'Claudio Cárcamo , Joaquín Vicencio , Benjamín Carvajal', 'Luis Perez', '-Se entregan los permisos correspondientes a las personas ingresadas en la jornada anterior.\r\n-Se realizan trabajos en BMS, estos trabajos se realizan por orden de Isaac Pérez.', '-Claudio Cárcamo realiza revisión en VEX-S1-5 y VIN-S1-6X, esto se realiza ya que mañana tendríamos visitas de la Seremi De Salud en el área de REAS.\r\n-Se realiza el cambio de Caldera 3 a Caldera 5 por orden de Claudio Cárcamo.\r\n-Se realiza encendido de caldera 1, por orden de Claudio Cárcamo (Técnico del departamento de clima) para la jornada del día.', '', '', '-Benjamín Carvajal realiza revisión de la parte eléctrica en REAS, esto se realiza ya que mañana tendríamos visitas de la Seremi De Salud en el área de REAS.', '-En el momento de revisar el área de RAES, nos percatamos que faltataria una  gatera en dicha área.', '-Avisar a Infraestructura lo escrito en el reporte.'),
(232, 'Reporte General de Eventos - Dia - 08-06-2022', 'Dia', '2022-06-08 20:13:04', 'HBQP-RGE-D-232', 'Shai Santibañez', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Eduardo Muñoz', '', 'Durante el turno de hoy personal de Climatización y encargado de especialidades Jorge Cantillano, trabajaron durante toda la jornada en la UMA-3-1  que alimenta recintos de esterilización, los cuales se encontraban con mucha humedad, a la entrega de turno todavía se sigue trabajando en la UMA-3-1.', 'Se reporto que el ascensor A14 a las 08:24 se encontraba fuera de servicio, se le da aviso a personal de departamento industrial, los cuales se contactan con Tyssen, con el número de reporte: 72362.\r\nVíctor Jaramillo de Tyssen deja operativo el ascensor A14 a las 15:35.', '', '', '', 'Se deja como pendiente:\r\nDar los accesos a personal Ingresado durante la Jornada, orden dada por Lizandro Varela, Jefe de Control Centralizado.\r\nCerrar todas las puertas del Hospital con control de acceso y realizar una actualización del sistema, orden dada por Lizandro Varela, Jefe de Control Centralizado.'),
(233, 'Reporte General de Eventos - Noche - 09-06-2022', 'Noche', '2022-06-09 08:20:59', 'HBQP-RGE-N-233', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Shai Santibañez', 'Durante el turno de hoy, se realiza una actualización a las puertas de los distintos recintos según lo ordenado por la jefatura, al momento de acceder personal del hospital a las distintas puertas que fueron actualizadas, ellos no pudieron acceder debido a un problema ocurrido durante la actualización que impide el correcto funcionamiento de los biométricos.', 'Durante el turno de hoy, se limpian difusores en despacho de esterilización y el pasillo ya que estos contaban con plumavit, además se restringe una manga de inyección para ver si de esta forma aumenta el flujo en los recintos I-S1-18 y en el I-S1-24 .', '', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 53% 4600lt nivel de combustible al entregar (nivel tomado a las 20:35 tanque 1 5200lt/tanque 2 2200lt\r\n-tanque 2: 14% 2200lt el turno\r\nGENERADORES:\r\n-tanque 4: 68%\r\n-tanque 3: 66%', '', '', ''),
(234, 'Reporte General de Eventos - Dia - 10-06-2022', 'Dia', '2022-06-10 01:31:37', 'HBQP-RGE-D-234', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Luis Perez', '', '', '', '', 'Se registra la caída del magnetotérmico del piso 5 sector N, se le informa a Benjamín Toloza técnico del departamento eléctrico para una revisión al problema, al no encontrar nada fuera de lo normal se vuelve a reestablecer la energía quedando totalmente operativa la iluminaria.', '', 'Otorgar accesos a personal ingresado durante la jornada.\r\nRevisar formato enviado anteriormente y dar los accesos correspondientes.'),
(235, 'Reporte General de Eventos - Noche - 10-06-2022', 'Noche', '2022-06-10 06:56:55', 'HBQP-RGE-N-235', 'Nicolas Droguett Hormazabal', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Shai Santibáñez.', 'Abel Torres', 'Se realizó revisión en las Unidades Manejadoras de Aire (UMA) correspondientes a Pabellones, verificando funcionamiento de termostatos en terreno. Se encontró que puertas de los pabellones 7, 8 y 10 están con problemas en la apertura y el cerrado, dejando un espacio entre puertas liberando presión del recinto. También los termostatos de los pabellones 2, 3 y los 3 correspondientes a Parto Integral no están en funcionamiento.', '', '', 'No se presentaron inconvenientes durante el turno trabajado, al terminar la jornada los porcentajes en tanques de combustible son los siguientes:\r\n- Tanque 1: 76%\r\n- Tanque 2: 59%\r\nActualmente se encuentra en uso el Tanque 1.', '', '', '');
INSERT INTO `reportes_generales` (`idReporte`, `nomReporte`, `turnoReporte`, `fechaReporte`, `folioReporte`, `nomEncargadoTurno`, `nomFuncionariosTurno`, `nomEncargadoTurnoAnterior`, `tareasControlCentralizado`, `tareasInstalaciones`, `tareasEquiposIndustriales`, `tareasIncendiosCombustibles`, `tareasDeteccionElectrica`, `tareasInfraestructura`, `pendientesCoordinacion`) VALUES
(236, 'Reporte General de Eventos - Dia - 10-06-2022', 'Dia', '2022-06-10 20:11:17', 'HBQP-RGE-D-236', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal', 'Shai Santibañez', '', 'UMA-S1-4A por alarma, el variador de frecuencia es muy pequeño para el motor, el variador es de 2,2kw y el motor es de 7 kw.', '', '', '', '', ''),
(237, 'Reporte General de Eventos - Noche - 11-06-2022', 'Noche', '2022-06-11 08:02:28', 'HBQP-RGE-N-237', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Eduardo Muñoz', '', 'Durante el turno se presento una alarma de flujo evaporador 005 en chiller N°1, la cual se tuvo que colocar nuevamente en servicio debido a que chiller N°2 se encuentra en mantención y el N°3 se encuentra con problemas en su bomba. El equipo se mantendrá en servicio pero se tiene que monitorear constantemente en caso que arroje nuevamente una alarma.', '', 'Nivel de combustible.\r\nTanque 1: 62% Control centralizado, 6000 litros en terreno.\r\nTanque 2: 31% Control centralizado, 7600 litros en terreno.\r\nSe encuentran 4 calderas en funcionamiento.', '', '', ''),
(238, 'Reporte General de Eventos - Dia - 11-06-2022', 'Dia', '2022-06-11 19:51:40', 'HBQP-RGE-D-238', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Abel Torres', '', 'Durante el turno de hoy, se realiza limpieza en la torre de enfriamiento N°2, este trabajo fue realizado por la empresa Montes burgos con supervisión de Cristopher Saavedra técnico de climatizacion', '', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 56% 5000lt nivel de combustible al entregar el turno (nivel tomado en la mañana tanque 1 6000lt/tanque 2 7200lt)\r\n-tanque 2: 59% 7200lt                                                           \r\nGENERADORES:\r\n-tanque 4: 70%\r\n-tanque 3: 67%', '', '', ''),
(239, 'Reporte General de Eventos - Noche - 12-06-2022', 'Noche', '2022-06-12 08:14:01', 'HBQP-RGE-N-239', 'Eduardo Muñoz Vera', 'Claudio Cárcamo , Joaquín Vicencio , Benjamín Carvajal', 'Luis Perez', '', '-Se realizan pruebas en UMA\'s de Pabellones, en conjunto de Claudio Cárcamo.\r\n-Se realiza encendido de Caldera N°1', '', '', '', '', ''),
(240, 'Reporte General de Eventos - Dia - 12-06-2022', 'Dia', '2022-06-12 19:48:19', 'HBQP-RGE-D-240', 'Shai Santibañez', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Eduardo Muñoz', 'Durante la jornada se avanzo en la creación de alarmas de VAV del piso 1, también se realizo avances en manual de l sistema BMS.', '', '', 'No se presentaron inconvenientes durante el turno trabajado, al terminar la jornada los\r\nporcentajes en tanques de combustible son los siguientes:\r\n- Tanque 1: 38%\r\n- Tanque 2: 60%\r\nActualmente se encuentra en uso el Tanque 1.', '', '', 'Descargar tendencias de UMAS Pabellón\r\nRevisar temperaturas de pabellón, comparar terreno con BMS'),
(241, 'Reporte General de Eventos - Noche - 13-06-2022', 'Noche', '2022-06-13 08:14:24', 'HBQP-RGE-N-241', 'Luis Pérez', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Shai Santibañez', '', '', '', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 28% 2600lt nivel de combustible al entregar el turno.\r\n-tanque 2: 59% 7400lt\r\nGENERADORES:\r\n-tanque 4: 71%\r\n-tanque 3: 69%', '', '', ''),
(242, 'Reporte General de Eventos - Dia - 13-06-2022', 'Dia', '2022-06-13 19:34:55', 'HBQP-RGE-D-242', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Luis Perez', '', '', 'Durante el turno reportaron sobre una fuga de aceite en el ascensor A3-1, esta gotera se habría producido debido a que el equipo poseía mucho lubricante, el técnico que verifico su funcionamiento comento que el ascensor quedaría funcionando sin ningún problema y Marcos Torres tendrá que verificar la cantidad de aceite que posee el equipo.', 'Al terminar el turno los estanque quedaron con 20% Tanque 1 y 59% el Tanque 2, la cual en estos momento se encuentra operativo el N°2, además Matías Gutiérrez informo que el día de mañana se realizaría la carga de combustible.', '', '', '- Revisar accesos a personal de unidad de la mujer según planilla enviada.\r\n- Realizar orden en la plataforma y ver equipos que se encuentran forzados.'),
(243, 'Reporte General de Eventos - Noche - 14-06-2022', 'Noche', '2022-06-14 08:00:52', 'HBQP-RGE-N-243', 'Shai Santibañez', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Abel Torres', '- Se realizó avance en orden de equipos en sistema de bitácoras.\r\n- Continuación de trabajos en BMS.', '', '', 'No se presentaron inconvenientes durante el turno trabajado, al terminar la jornada los\r\nporcentajes en tanques de combustible son los siguientes:\r\n- Tanque 1: 25%\r\n- Tanque 2: 53%\r\nActualmente se encuentra en uso el Tanque 2.', '', '', '- Continuar con el orden de equipos en sistema de bitácoras.'),
(244, 'Reporte General de Eventos - Dia - 14-06-2022', 'Dia', '2022-06-14 19:51:58', 'HBQP-RGE-D-244', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal', 'Shai Santibañez', '-Durante el turno de hoy, tuvimos una perdida de las UCA\'s que estarían en el RH2F, estas volverían a su posterioridad', '-Se realizan pruebas en Chiller 1, por ende se apaga durante 15 minutos, luego de esto Claudio Cárcamo da la orden de realizar el encendido nuevamente \r\n-Se realiza el apagado de Caldera 1 ya que los paneles solares tendrían una T° adecuada para su funcionamiento.', '', '-Se realiza carga de combustible, en tanque 1 se cargarían 7.000L y en tanque 2 se cargarían 3.000L', '', '', '-Terminar trabajos dejados por Isaac Pérez.'),
(245, 'Reporte General de Eventos - Noche - 15-06-2022', 'Noche', '2022-06-15 08:12:55', 'HBQP-RGE-N-245', 'Abel Torres', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Eduardo Muñoz', '', '', '', 'Nivel de combustible al termino de turno.\r\nTanque 1  83% en control centralizado y 8500 Lts en terreno.\r\nTanque 2 65% en control centralizado y 8400 Lts en terreno.\r\nSe encuentran en funcionamiento 4 calderas, 3 de climatizacion y 1 de agua sanitaria.', '', '', ''),
(246, 'Reporte General de Eventos - Dia - 15-06-2022', 'Dia', '2022-06-15 18:52:52', 'HBQP-RGE-D-246', 'Luis Pérez', 'Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Abel Torres', 'Durante el turno de hoy, se produce una caída en algunas de las UCA (Unidad Control Acceso) del piso -1, siendo estas de la UCA 9 a la UCA 13, estando des comunicadas aproximadamente unos 10 minutos debido a trabajos realizados por funcionarios de TICs.\r\nAproximadamente a las 19:38, se produce una des comunicación con el Data Center, al revisar en terreno se encuentra que este esta trabajando de forma normal al igual que las UPS, las cuales no se encontraban en funcionamiento, se reintenta establecer conexión de forma remota sin ninguna solución, a lo que se procede a llamar a la jefatura don Lizandro Varela el cual al comprobar los equipos procede a llamar Rubén Riveros (Profesional de TICS) quien en conjunto a Don Lizandro y técnico de turno Benjamín Carvajal del departamento eléctrico, revisan el rack RH3A el cual se encontraba des energizado ya que el enchufe de alimentación se encontraba desenchufado ya que habrían tirado herramientas sobre este y al conectarlo se volvería a establecer la conexión remota con el Data Center.', 'Durante el turno de hoy, empresa externa Montes Burgos, realiza una verificación de todos los dámper ubicados en el piso -1 / 1 y 2, también retiran los filtros, bolsas y G4 de la UMA-3-13', 'Durante el turno de hoy, ascensor A9-2 presenta problemas para realizar la apertura de las puertas en el piso N°3, por lo que este se deja apagado para que de esta forma no lo sigan usando.\r\nN° de reporte: 72876', 'Durante el turno de hoy, se alarma múltiples veces el FM200 N°8 piso 1, sector de imagenología sala mamografía H-1-20, a lo que se llama a técnico de empresa E.S.F.E para que revise el motivo de la falsa alarma en el FM200.', 'Durante el turno de hoy, se realiza mantención al generador N°3 con supervisión de profesional de apoyo Fabian Córdova junto a empresa DYMER y al finalizar se realiza prueba de funcionamiento del equipo en vacío por 5 minutos, información dada por Fabián córdoba profesional de apoyo departamento eléctrico.', '', 'Se deja como pendiente realizar trabajo dejado por profesional de apoyo Isaac Pérez y otorgar accesos correspondientes a personal ingresado al sistema el día de hoy'),
(247, 'Reporte General de Eventos - Noche - 16-06-2022', 'Noche', '2022-06-16 06:22:59', 'HBQP-RGE-N-247', 'Eduardo Muñoz Vera', 'Claudio Cárcamo , Joaquín Vicencio , Benjamín Carvajal', 'Luis Perez', '-Se otorgan permisos correspondientes a las personas ingresadas durante el turno anterior.\r\n-Se avanza en trabajos dejados por Isaac Pérez.', '-Durante el turno de hoy, se nos informa de ruidos raros en sector -1, en conjunto de Claudio Cárcamo se realiza la revisión correspondiente, se trataría de un ducto de aire el cual tendría los seguros sueltos, por ende Claudio realiza su ajuste correspondiente. Este ducto estaría alimentado por el VIN-S1-4, el cual se apago para la revisión de falla antes mencionada, este se dejaría en funcionamiento igualmente ya que pertenecería a el recinto de Farmacia según lo informado por Claudio.\r\n-Se realiza el encendido de Caldera 1 por orden de Claudio Cárcamo.', '-Joaquín Vicencio realiza el retiro de extintores en piso 3 y 2, esta orden fue dada por Don Guillermo para su posterior recarga y mantención.', '-', '', '', ''),
(248, 'Reporte General de Eventos - Dia - 16-06-2022', 'Dia', '2022-06-16 18:43:30', 'HBQP-RGE-D-248', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Eduardo Muñoz', '17:33 Se detecta caída de UCAS 18-19 Y 20 del piso 2 pertenecientes al rack RH2C, se comunica con Rubén Riveros, Profesional de departamento de tics a lo que confirma que el desconecto ya que se encuentra trabajando en dicho rack. Al terminar trabajos Rubén Riveros regresa todo el sistema a la normalidad.', 'Víctor Fierro Profesional de apoyo se acerca a Control Centralizado para solucionar el problema de las bajas temperaturas en las UMAS del sector C del tercer piso, dejando los siguientes equipos con forzados de sus válvulas de calor y frio para poder regular la circulación de agua caliente:\r\nUMA-3-30\r\nUMA-3-08\r\nUMA-3-31\r\nUMA-3-25A\r\nUMA-3-25\r\nUMA-3-24\r\nUMA-3-12\r\nUMA-3-11\r\nUMA-3-23A\r\nUMA-3-14\r\nUMA-3-29\r\nUMA-3-22\r\nUMA-3-3A\r\nUMA-3-23\r\nCabe recalcar que la modulación de sus válvulas no afectaron en las temperaturas de los recintos.', '', 'No se presentaron inconvenientes durante el turno trabajado, al terminar la jornada los\r\nporcentajes en tanques de combustible son los siguientes:\r\n- Tanque 1: 84%\r\n- Tanque 2: 45%\r\nActualmente se encuentra en uso el Tanque 2.', '', '', 'Revisar y otorgar los accesos de las personas ingresadas durante la jornada, orden dada por Lizandro Varela, Jefe de Control Centralizado.\r\nMantener monitoreo de UMAS con válvulas forzadas por Víctor Fierro, Profesional de apoyo del departamento de Climatización, para que no afecte los recintos de dichas UMAS.\r\nClimatizar recintos de Consultas medicas para la siguiente jornada.\r\nRevisión de listado de equipos forzados que se encuentran en color gris(ultimas paginas del listado),  Orden dada por Yorgo Casimis, Profesional de apoyo de Control Centralizado.\r\nRevisión Puertas de imagenología.'),
(249, 'Reporte General de Eventos - Noche - 17-06-2022', 'Noche', '2022-06-17 07:43:53', 'HBQP-RGE-N-249', 'Luis Pérez Bernal', 'Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Shai Santibañez', 'Durante el turno de hoy, se realizan múltiples desconexiones de UCAS, afectando de esta forma el control de acceso y la visualización de las cámaras, esta desconexión duro aproximadamente 5 mnts produciéndose 2 veces, la primera a las 2:35 am y la segunda a las 5:30 am (en las imágenes se vera la cantidad y las UCAS desconectadas de los distintos pisos).', '', 'Durante el turno de hoy, técnico de asesores vienen a revisar el ascensor A11-2 ya que se habia realizado un reporte por este mismo durante el turno día, al revisar informa que ascensor presenta un problema con su sensor de peso lo que en consecuencia se bloquea el ascensor, informan que vendrán durante el transcurso del día ya que necesitan volver a programar el sensor en cada uno de los pisos.', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 84% 8300lt nivel de combustible al entregar el turno. (tanque 1:8300 tanque 2:5000 nivel tomado al comienzo del turno)\r\n-tanque 2: 34% 4600lt                                                                                         \r\nGENERADORES:\r\n-tanque 4: 71%\r\n-tanque 3: 69%', '', '', ''),
(250, 'Reporte General de Eventos - Dia - 17-06-2022', 'Dia', '2022-06-17 20:03:55', 'HBQP-RGE-D-250', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Luis Pérez', '', '', 'En el turno de día se reparo los ascensores A3-1 y A11-2 esta información fue entregada por Matías Gutiérrez, además el ascensor A8-2 empezó a presentar falla en su puerta que se aperturada y cerraba constantemente, la cual se le informo al personal correspondiente y vendrán durante la noche el N° de reporte es 73009.', 'Se realizo la carga de combustible en los dos tanques de combustible quedando\r\nTanque 1 = 95% desde control centralizado.\r\nTanque 2 = 93% desde control centralizado.\r\nCabe mencionar que durante el día se mantuvieron en servicio 3 calderas de climatizacion.', '', '', '- Dar accesos correspondientes al personal ingresado durante el día.\r\n- Realizar trabajos dejados por Isaac Pérez.'),
(251, 'Reporte General de Eventos - Noche - 18-06-2022', 'Noche', '2022-06-18 08:03:50', 'HBQP-RGE-N-251', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Abel Torres', 'Se trabajo en el manual de sistema BMS y también se realizo avance en linkeo de pantallas de tendencia y grafica de las manejadoras de aire del edificio.', '', '', 'No se presentaron inconvenientes durante el turno trabajado, al terminar la jornada los\r\nporcentajes en tanques de combustible son los siguientes:\r\n- Tanque 1: 95%\r\n- Tanque 2: 77%\r\nActualmente se encuentra en uso el Tanque 2.', 'Se reviso Portón N°2 en conjunto con Benjamín Vergara, técnico del departamento eléctrico, ya que este presentaba problemas en su apertura, emitía un pitido en todo momento mientras se realizaba su apertura y se llego a la decisión de dejarlo en estado manual para evitar dañar el equipo.', '', 'Continuar con Linkeo de tendencias y graficas en las pantallas de las manejadoras de aire.'),
(252, 'Reporte General de Eventos - Dia - 18-06-2022', 'Dia', '2022-06-18 18:32:52', 'HBQP-RGE-D-252', 'Eduardo Muñoz Vera', 'Claudio Cárcamo , Joaquín Vicencio , Benjamín Carvajal', 'Shai Santibañez', '-Durante la jornada se presentaron problemas en luminaria de medicina física, ya que estas luces se verían encendida desde control pero en terreno estas estarían apagadas aunque se forzara el circuito.', '-Se apaga Chiller por orden de Claudio Cárcamo, esta acción se realiza, ya que este estría con alarma de sobre calentamiento en compresor, se verifico la temperatura en terreno, marcando 58,1°C el compresor.\r\n-Empresa Monte Burgos realiza limpieza en torres de enfriamiento 1 y 4.', '-Se realiza mantención a los extintores en piso 2 y se colocan extintores en 3 piso', '', '-Durante la jornada de hoy se revisan portón 5 el cual le realizan terminaciones en cuanto a cemento y portón 2 ajuste de Sensor y reconfiguración.', '', '-Avanzar en trabajos dejados por Isaac Pérez.'),
(253, 'Reporte General de Eventos - Noche - 19-06-2022', 'Noche', '2022-06-19 07:53:09', 'HBQP-RGE-N-253', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Javier Arancibia', 'Eduardo Muñoz', '', 'Durante el turno se vuelve a registrar alarma 004 de compresor sobrecalentado en el chille N°1, producto a esto el sistema de frio quedo deshabilitado completamente a excepciones de las BAES que se mantuvieron encendidas durante unos lapsos de tiempo para recircular el agua y mantener las temperatura adecuada en los recintos críticos, cabe mencionar que también el sistema térmico (calderas de climatizacion) fue apagado completamente para así no seguir fabricando calor a los recintos críticos. Al terminar el turno tanto calderas de climatizacion como central frio se mantienen apagada.', 'Durante el turno el ascensor A12-1 empezó a presentar problemas de funcionamiento, debido a esto el técnico de industrial Javier Arancibia realizo el llamado correspondiente a la empresa tysen (N° de reporte 73095), al llegar el encargado de tysen verifico el problema del equipo y dijo que se encontraría con falla unos de los sensores de seguridad tanto de la puerta como del mismo ascensor, una de las reparaciones que se realizo fue en el sensor del ascensor, el sensor de la puerta se tiene que ajustar para su correcto funcionamiento durante la semana. Debido a esto el ascensor se tendrá que mantener en observación en caso de cualquier inconveniente que suceda.', 'Nivel de combustible al finalizar el turno.\r\nTanque 1: 95% en control centralizado y en terreno 10400 LTS\r\nTanque 2: 65% en control centralizado y en terreno 7600 LTS.', '', '', '- Avanzar con pendientes de Isaac Pérez.\r\n- Verificar temperaturas en recintos críticos.'),
(254, 'Reporte General de Eventos - Dia - 19-06-2022', 'Dia', '2022-06-19 19:44:03', 'HBQP-RGE-D-254', 'Luis Pérez Bernal', 'Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Abel Torres', 'Durante el turno de hoy, llaveras informan de funcionamiento anormal de puerta de la mampara B-1-1, ya que a esta no le funcionaba el biométrico ni botonera por lo que se le procedió a realizar un reinicio a la unidad de control de acceso (UCA) para de esta forma reestablecer el funcionamiento de la puerta.', 'Durante el turno de hoy, se llama a empresa Montes Burgos para realizar una reparación al chiller 3, ya que durante el turno anterior chiller 1 presento múltiples fallas por el sobre calentamiento del compresor. Al chiller 3 se le realizo un cambio a una nueva bornera ya que la anterior se habia quemado.\r\nChiller 3 operativo al momento de realizar la entrega de turno.', 'Durante el turno de hoy, el ascensor A6-1 se encontraba trabado en piso 1, este no cierra la puerta por lo que se deja fuera de servicio y se reporta a la empresa encargada de realizar la mantención.\r\n\r\nN° de reporte: 73113 \r\n\r\nAl revisar, técnico informa que problema se debió a la suciedad del riel de la puerta, ya que al limpiarla la puerta comenzó a funcionar de forma normal.', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 95% 10400lt nivel de combustible al entregar el turno. (tanque 1:10400 tanque 2:8000 nivel tomado al comienzo del turno)\r\n-tanque 2: 62% 7600lt                                                                                         \r\nGENERADORES:\r\n-tanque 4: 72%\r\n-tanque 3: 74%', '', 'Durante el turno de hoy, guardias informan de goteras de agua sanitaria en el subterráneo ubicadas; una frente a pilar C3 y la otra frente al pilar C16.', ''),
(255, 'Reporte General de Eventos - Noche - 20-06-2022', 'Noche', '2022-06-20 07:06:18', 'HBQP-RGE-N-255', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal', 'Luis Perez', 'Se realizan trabajos dejados por Isaac Pérez', 'Se realiza el encendido de Caldera 1 por orden de Claudio Cárcamo.', '', '', '', '', ''),
(256, 'Reporte General de Eventos - Dia - 20-06-2022', 'Dia', '2022-06-20 19:50:51', 'HBQP-RGE-D-256', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Eduardo Muñoz', '', 'Empresa Burgos realizo Mantención al Chiller N°2 el cual al finalizar el turno todavía no se encuentra operativo, ya que el mantenimiento aun no se finaliza.', '', 'No se presentaron inconvenientes durante el turno trabajado, al terminar la jornada los\r\nporcentajes en tanques de combustible son los siguientes:\r\n- Tanque 1: 94%\r\n- Tanque 2: 41%\r\nActualmente se encuentra en uso el Tanque 2.', '', '', 'Realizar trabajo de BMS dado por Isaac Pérez Profesional de apoyo de Control Centralizado.\r\nOtorgar accesos a las personas ingresadas durante la jornada del día.'),
(257, 'Reporte General de Eventos - Noche - 21-06-2022', 'Noche', '2022-06-21 07:41:32', 'HBQP-RGE-N-257', 'Luis Pérez Bernal', 'Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Shai Santibañez', '', '', '', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 94% 10400lt nivel de combustible al entregar el turno. (tanque 1:10400 tanque 2:5000 nivel tomado al comienzo del turno)\r\n-tanque 2: 33% 4400lt                                                                                         \r\nGENERADORES:\r\n-tanque 4: 72%\r\n-tanque 3: 74%', '', '', ''),
(258, 'Reporte General de Eventos - Dia - 21-06-2022', 'Dia', '2022-06-21 16:01:10', 'HBQP-RGE-D-258', 'Abel Torres Arancibia', 'Benjamín Toloza, Claudio Cárcamo, Javier Arancibia Y Alejandro Saavedra.', 'Luis Pérez', '', '', 'Durante el turno se presento un problema con el sistema de tratamiento en agua potable, lo que sucedió fue que, la manguera que esta conecta a la bomba de tratamiento se desacoplo del sistema, haciendo que el clorado que inyecta al estanque se esparciera por el piso, la cual el técnico del departamento industrial Javier Arancibia Junto al técnico del departamento de climatizacion Claudio Cárcamo soluciono el problema con dicha manguera siendo colocada nuevamente a la bomba de tratamiento y así el sistema funcionara como corresponde.', 'Combustible al finalizar el turno.\r\nTanque 1: 3000 Litros, Control Centralizado: 93%\r\nTanque 2: 10400 Litros, Control Centralizado: 26%.', 'El portón N°5 presento fallas tras su cerrarlo, el aviso habría sido dado por la supervisora de los guardias, al revisarlo junto a Benjamín Toloza técnico del departamento eléctrico, este no tomaría la señal de la botonera que se encuentra ubicada en  la caseta y tampoco tomaría la señal del control. A causa de este inconveniente se dejo en cerrado manualmente y el día de mañana se tendrá que hacer nuevamente la apertura en modo manual. Cabe mencionar que no se realizo mas manipulación en el sistema y Benjamín Toloza reportara el problema para su pronta revisión.', '', '- Realizar trabajos dado por Isaac Pérez.'),
(259, 'Reporte General de Eventos - Noche - 22-06-2022', 'Noche', '2022-06-22 07:44:37', 'HBQP-RGE-N-259', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett, Cristóbal Toro', 'Abel Torres', '', '', '', 'No se presentaron inconvenientes durante el turno trabajado, al terminar la jornada los\r\nporcentajes en tanques de combustible son los siguientes:\r\n- Tanque 1: 91%\r\n- Tanque 2: 17%\r\nActualmente se encuentra en uso el Tanque 1.', 'Benjamín Vergara técnico del departamento eléctrico, deshabilito el circuito que alimentan las balizas en el helipuerto debido a precipitaciones que se registraran durante la jornada.', '', 'Monitorear Temperaturas de Consultas medicas.\r\nMonitorear funcionamiento de bombas PEALL, ya que durante la jornada se presentaran precipitaciones.'),
(260, 'Reporte General de Eventos - Dia - 22-06-2022', 'Dia', '2022-06-22 09:19:12', 'HBQP-RGE-D-260', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal', 'Shai Santibañez', '', '-Se detiene equipo, ya que Montes Burgo repararía Chiller 2, viendo esto Claudio Cárcamo me daría la orden de encender Chiller 2 para comprobar su funcionamiento y darle movimiento para sus pruebas y su posterior uso.', '', '', '', '', ''),
(261, 'Reporte General de Eventos - Noche - 23-06-2022', 'Noche', '2022-06-23 08:38:37', 'HBQP-RGE-N-261', 'Abel Torres Arancibia', 'Benjamín Toloza, A, Alejandro Saavedra Y Javier Arancibia', 'Eduardo Muñoz', 'Se registro la caída de la cámara exterior E14, la cual al revisar en terreno se encontró gotas de agua entrando hacia la cámara, no se reviso mas a fondo debido a la situación climática. Lo que si para que no se continuara mojando la cámara se coloco un plástico para proteger el sistema y no se dañara mas en el caso que fuese agua, se desconocen los motivos especifico de su caída, pero lo más probable que sea que le entro agua.', '', 'El ascensor A4-1 se reporto por Javier Arancibia técnico del departamento industrial que se encontraría apagado en el piso 6 con sus puertas cerradas, la cual reviso y no se encontraba con una filtración de agua, el encargado dará el reporte al técnico de tysen para su reparación.\r\n\r\nDurante el turno estuvieron en funcionamiento las PEALL 2,3,4,5 y 6 por las lluvias ocurridas durante la noche, la cual la PEALL 2 y 4 continúan con sus bombas en funcionamiento, y la PEALL 4 se encuentra con el nivel 2 de estanque y sus 2 bombas en funcionamiento.', 'Combustible al terminar el turno.\r\nTanque 1: 80%\r\nTanque 2: 18%\r\nCabe mencionar que el día viernes se realizara la carga de combustible.', 'Benjamín Toloza reporto la caída de la protección diferencial del K9-AEX10, este pertenece a la iluminaria del exterior 2. Debido a esto el circuito se estaría bajando constantemente así que se tomo la decisión de dejarlo abajo y revisarlo cuando el mal tiempo pase.', '', 'Continuar con la toma de temperatura de las UMAS en los recinto que se esta trabajando.'),
(262, 'Reporte General de Eventos - Dia - 23-06-2022', 'Dia', '2022-06-23 20:15:37', 'HBQP-RGE-D-262', 'Luis Pérez Bernal', 'Matías Añazco, Dilhan Saavedra, Javier Bustamante', 'Abel Torres', '', '', 'Durante el turno de hoy, se realizan 2 reportes de ascensores ya que ambos quedaron fuera de servicio, siendo estos el A8-2 N° de reporte 73409 y el A1-2 N° de reporte 73410. \r\nEstos equipos se revisaran durante la noche por el técnico de ascensores según lo informado por Matías Gutiérrez, jefe de incendio', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 74% 7600lt nivel de combustible al entregar el turno\r\n-tanque 2: 17% 2400lt\r\nGENERADORES:\r\n-tanque 4: 72%\r\n-tanque 3: 77%', '', '', 'Realizar trabajos designados por profesional de apoyo Isaac Pérez.'),
(263, 'Reporte General de Eventos - Noche - 23-06-2022', 'Noche', '2022-06-23 21:35:34', 'HBQP-RGE-N-263', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal', 'Luis Perez', '-En entrega de turno se informa de un problema en peall 1, este problema seria el alarmado de sobre rebalse o Nivel 3, se realiza la revisión de dicha peall en terreno, pero el problema seria desde control, ya que esto se daría por un mal linckeo en la pantalla grafica, se realiza el linckeo como debería de ser y esta deja de mostrar fallas desde control.', '-Se realiza el encendido de Caldera 1 por orden de Claudio Cárcamo.', '-Se realiza extracción de extintores faltantes, Joaquín Vicencio realiza esta acción', '', '', '', ''),
(264, 'Reporte General de Eventos - Dia - 24-06-2022', 'Dia', '2022-06-24 19:45:09', 'HBQP-RGE-D-264', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett, Cristóbal Toro.', 'Eduardo Muñoz', '', '', 'Durante la jornada se informa sobre el ascensor A11-2 que se encuentra fuera de servicio a lo cual se llama a empresa Tyssen por parte de departamento industrial con N° de reporte 73464 y 73501, al cual acude Víctor Gonzales el cual informa mediante departamento industrial que ascensor queda bloqueado, hasta nuevo aviso ya que no contaba con los medios para desbloquearlo.\r\nTambién se informa problemas con el ascensor A4 por filtración de agua lluvias, esto ocasionó que caja con sistema eléctrico del elevador corriera riesgo de generar corto circuito. Por motivos de seguridad se mantiene inoperativo.', 'Se realizó carga de combustible a las 8:15AM, teniendo inicialmente los siguientes porcentajes en BMS:\r\n- Tanque 1: 67%\r\n- Tanque 2: 18%\r\nAl finalizar la carga se obtiene la siguiente información desde terreno corroborando porcentajes en Sala de Control:\r\n- Tanque 1: 95%, obteniendo 10.200[Lts].\r\n- Tanque 2: 75%, obteniendo 8.500[Lts].\r\nEn monitoreo de sistema BMS se encontró una alarma activada en combustible de generadores, correspondiente a Cámara Intersticial. Se da avisó a Don Guillermo, Jefe del Dpto. Industrial, ejecutando revisión en terreno, se indica que Cámara se encontraba sin agua en su interior,  información entregada por parte de Don Guillermo. Además se indica, mantener en observación cada 1 hora por motivos de posible fuga en el equipo.', '', '', '- Mantener en observación UMA´s de los recintos que se encuentran entregados para entregar temperaturas adecuadas a personal que trabaja en el lugar.\r\n- Otorgar accesos a personal ingresado durante turno de día.\r\n- Mantener en observación estanque N°4 de combustible-generadores cada 1 hora por motivos de posible fuga en el equipo. Orden entregada por Guillermo Hidalgo, Jefe de Dpto. Industrial y Jorge Cantillano, Jefe de Control Centralizado y Especialidades.'),
(265, 'Reporte General de Eventos - Noche - 25-06-2022', 'Noche', '2022-06-25 08:03:03', 'HBQP-RGE-N-265', 'Luis Pérez Bernal', 'Matías Añazco, Claudio Carcamo, Dilhan Saavedra, Javier Bustamante', 'Shai Santibañez', 'Durante turno de hoy, informan que vendrá empresa externa encargada de revisar el estado de los portones, a los cuales se les daño el motor luego de la lluvia.\r\nDurante el turno se acciono el funcionamiento de las bombas de riego de forma manual, ya que se corría el riesgo de rebalse debido al alto nivel del estanque de riego.', '', 'Durante el turno de hoy, empresa encargada de la mantención de los ascensores reporto que el problema del ascensor A11-2 se debió a que se soltó el fusible ultra rápido. Ascensor se encuentra actualmente operativo.', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 82% 8400lt nivel de combustible al entregar el turno. (tanque 1:9200 tanque\r\n2:8600 nivel tomado al comienzo del turno)\r\n-tanque 2: 75% 8600lt\r\nGENERADORES:\r\n-tanque 4: 72%\r\n-tanque 3: 73%', '', '', ''),
(266, 'Reporte General de Eventos - Dia - 25-06-2022', 'Dia', '2022-06-25 21:12:49', 'HBQP-RGE-D-266', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Javier Arancibia Y Oscar Villegas', 'Luis Perez', '', '', '', 'Se registro un alarma de incendio en el sector 2.8 específicamente pabellones, se trataría de un pabellón quirúrgico con PMA I-2-30, esta alarma se activo debido a que personal de aseo se encontraría trabajando en el lugar, a causa esto fue que el sensor de humo se activo. Guillermo Hidalgo confirmo que se trataría de una falsa alarma y se dio apoyo necesario para rearmar el sistema. Cabe mencionar para que no se activara constantemente la alarma esta fue deshabilitada por ordenes de Javier Arancibia.', 'Durante el turno se hizo presente la empresa a cargo de los portones, para así poder revisar la falla con el portón N°5, la cual el portón debe permanecer en modo manual a que este habría perdido la energía de su batería por que el cable que la alimentaba estaba desconectado. El día lunes se tiene que realizar pruebas para verificar el estado de la batería y así volver a dejar en funcionamiento automático todo el sistema.', 'Lukas Zamora profesional del departamento infraestructura, informo que se realizaran trabajos en los vestidores técnico de mujeres H-S1-41 y H-S1-30, los trabajos a realizar serian en una tubería de agua caliente potable que se encontraría con una fisura y será reparada por una empresa contratista. Cabe mencionar que Lukas Zamora se quedara durante la noche finalizando de despichar la linea de agua caliente para poder realizar la reparación de la fisura.', '- Realizar los trabajos pendientes por Isaac Pérez. \r\n- Continuar con los datos de combustible.'),
(267, 'Reporte General de Eventos - Noche - 26-06-2022', 'Noche', '2022-06-26 07:54:16', 'HBQP-RGE-N-267', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Nicolás Droguett, Cristóbal Toro.', 'Abel Torres', 'Se realizaron avances en el manual de usuario del BMS, también se crearon las alarmas de CO2.', 'En monitoreo del sistema BMS se visualiza alarma en la temperatura de agua de inyección del compresor del Chiller N°2 que estaría alrededor de los 60°C, lo cual se le da aviso a Nicolás Manríquez técnico de Climatización sobre la situación, a lo cual se llega a una decisión de precaución  de detener Chiller N°2 y encender Chiller N°3, se deja como instrucción monitorear temperatura de inyección de agua del compresor del Chiller N°3 para ver si alcanza las mismas temperaturas.', '', '', 'En monitoreo de BMS se encuentra alarma de descomunicación en la UPS 5 que corresponde a imagenología, se le da aviso a departamento eléctrico a lo cual se dirigen a terreno a verificar que le sucedió al equipo y este se encontraba arrojando una alarma de mantenimiento preventivo, Gustavo Loira, encargado del departamento eléctrico esta al tanto de la situación ya que Benjamín Vergara, técnico eléctrico le dio aviso.', '', '- Mantener en observación UMA\'s de recintos entregados.\r\n- Mantener en observación temperatura de compresor Chiller N°3.\r\n-Informar que Portón N°5 se mantendrá en estado manual hasta el día lunes.'),
(268, 'Reporte General de Eventos - Dia - 26-06-2022', 'Dia', '2022-06-26 14:37:24', 'HBQP-RGE-D-268', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia', 'Shai Santibañez', '', '-Claudio Cárcamo informa de un cable cortado en válvula con final de carreara 208, la cual correspondería a Retorno edificio boiler 6.', '-Se monitorean los 4 estanques de combustible en terreno, esto se hace ya que hay una sospecha de filtración (Sin novedades en el turno).  \r\n-Se monitorea estanque de regadío, ya que este tendría alarma de rebalse (Sin novedades en el turno).', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 60% 5200lt nivel de combustible al entregar el turno\r\n-tanque 2: 72% 8600lt desde terreno\r\nGENERADORES:\r\n-tanque 4: 72% 31000 desde terreno\r\n-tanque 3: 73% 32000 desde terreno', '', '', '-Continuar con trabajos dejados por Isaac Pérez.'),
(269, 'Reporte General de Eventos - Noche - 27-06-2022', 'Noche', '2022-06-27 08:18:21', 'HBQP-RGE-N-269', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Oscar Villegas Y Javier Arancibia', 'Eduardo Muñoz', '', 'Se repara la válvula 208 que el cable de su final de carrera se habría desconectado, esta fue vuelta a instalar por Benjamín Toloza técnico del departamento eléctrico y estaría funcionando, la opción que dio el técnico eléctrico fue colocarle terminales para que así tenga una función como corresponde sin tener problemas de desconexión', '', 'Combustible al terminar el turno.\r\nTanque 1: 48%\r\nTanque 2: 73%\r\nTanque 3: 72%\r\nTanque 4: 70%', '', '', '- Realizar pruebas con el portón N°5, esto es para verificar si su batería se encuentra cargada.\r\n- Avanzar con los pendiente de Isaac Pérez.\r\n- Seguir con los parámetros de combustible.'),
(270, 'Reporte General de Eventos - Dia - 27-06-2022', 'Dia', '2022-06-27 20:22:04', 'HBQP-RGE-D-270', 'Luis Pérez Bernal', 'Matías Añazco, Dilhan Saavedra, Javier Bustamante', 'Shai Santibañez', 'Durante el tuno de hoy, la señorita Beatriz mercado jefa de farmacia, se comunica con control centralizado debido a un problema con la sala de personal de aseo en su recinto, ya que esta se encontraba con las llaves corriendo probablemente desde el día viernes hasta la hora en la que se comunico siendo esta aproximadamente las 11:00am donde ella cerraría las llaves.', '', '', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 44% 3300lt nivel de combustible al entregar el turno. (tanque 1:4000 tanque\r\n2:8600 nivel tomado al comienzo del turno)\r\n-tanque 2: 72% 8600lt\r\nGENERADORES:\r\n-tanque 4: 70%\r\n-tanque 3: 68%', 'Durante el turno de hoy, personal del departamento eléctrico realizan pruebas de funcionamiento con el portón 5 para verificar su correcto funcionamiento, cabe señalar que dichas pruebas resultaron de forma satisfactoria y que el portón 5 se encuentra funcionando al 100%.', '', '- Avanzar con los pendiente de Isaac Pérez.\r\n- Seguir con los parámetros de combustible.'),
(271, 'Reporte General de Eventos - Noche - 28-06-2022', 'Noche', '2022-06-28 06:16:31', 'HBQP-RGE-N-271', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia', 'Luis Perez', '-Se realizan trabajos dejados por Isaac Pérez.', '-Se realiza revisión de los sectores en los cuales se estarían ocupando por el personal correspondiente.\r\n-Se realiza el encendido de Caldera 1 por orden de Claudio Cárcamo.', '-Se realizan revisiones de estanques durante el turno de noche.', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 60% 5200lt nivel de combustible al entregar el turno\r\n-tanque 2: 72% 8600lt desde terreno\r\nGENERADORES:\r\n-tanque 4: 72% 31000 desde terreno\r\n-tanque 3: 73% 32000 desde terreno', '', '', ''),
(272, 'Reporte General de Eventos - Dia - 28-06-2022', 'Dia', '2022-06-28 19:13:05', 'HBQP-RGE-D-272', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett, Cristóbal Toro', 'Eduardo Muñoz', '', 'Al rededor de las 15:30Hrs, luego de encender paneles solares, Víctor fierro, profesional de apoyo de Climatización se percata en terreno que acople tipo Y de bombas BSAP se encontraba suelto, provocando fugas en sala de bombas. Debido a esto, Nicolás Manríquez, Técnico del Dpto. de Climatización, ordena detenerla momentáneamente para volver a colocar el acople, actualmente se encuentran operativa ya que no fue de mayor dificultad.', '', 'Durante la Jornada de la mañana, Abraham Hidalgo, auxiliar del departamento industrial, resolvió momentáneamente la alarma del tanque N°3 de combustibles, la cual volvió horas después desconociendo el motivo, ya que se sacó al agua del sensor. \r\nTambién se activó una falsa alarma de incendio en el sector 2.3 debido a los trabajos que estaba realizando la empresa de incendio, la alarma no afecto en el funcionamiento del hospital.\r\n\r\nNiveles de combustible en BMS:\r\n- Tanque 1: 25%\r\n- Tanque 2: 70%\r\n- Tanque 3: 74%\r\n- Tanque 4: 71%', '', '', '- Informar que el Jueves 30 a las 08:00 habrá recarga de combustible.\r\n- Dar accesos a las personas de los correos enviados a sala de control.\r\n- Realizar trabajo en BMS dado por Isaac Pérez, Profesional de apoyo de Control centralizado.\r\n- Mantener en monitoreo UMA\'s que intervengan en los recintos entregados. Informar anomalías al turno siguiente.'),
(273, 'Reporte General de Eventos - Noche - 29-06-2022', 'Noche', '2022-06-29 09:06:09', 'HBQP-RGE-N-273', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Claudio Carcamo', 'Shai Santibañez', '', 'Durante el turno de hoy, en la revisión de UMAS, la UMA-3-14 presenta problemas al inyectar\r\ncalor al recinto, por lo que se realiza una revisión a la entrada de agua caliente y esta marcaba\r\nuna temperatura de 33°C. Cabe señalar que esta UMA es la primera en recibir agua caliente por lo que se piensa que el problema sea el mismo que aconteció a las UMAS del techo mecánico 6; es decir que tengan el serpentín tapado.', '', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 27% 1500lt nivel de combustible al entregar el turno.\r\n-tanque 2: 58% 7000lt\r\nGENERADORES:\r\n-tanque 4: 70%\r\n-tanque 3: 69%', '', '', ''),
(274, 'Reporte General de Eventos - Dia - 29-06-2022', 'Dia', '2022-06-29 18:37:43', 'HBQP-RGE-D-274', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Javier Arancibia Y Oscar Villegas', 'Luis Perez', '', 'Se realizaron pruebas con el equipo CHILER N°1, ya que la empresa montes realizo el cambio de modulo del CP1 al CP2 en modo de prueba, las acciones realizadas salieron sin ninguna novedad pero el equipo solo se dejara en caso de emergencia no se podrá utilizar rutinariamente.', 'Se presento una falla con el ascensor A1-2 y el técnico de tyssenKrupp Marcos Torres lo deja inhabilitado y  le hará la revisión el día de mañana ya que no cuenta con el computador para ver específicamente el problema', 'Se registra una alarma de incendio en el segundo piso sector 2.13 pasillo TH, esto seria una falsa alarma ya que la empresa esfe systems estaría realizando mantención a sus equipo de incendio. Javier Arancibia técnico industrial habría solucionado el problema sin ninguna novedad mayor.\r\n\r\nNiveles de combustible al finalizar el turno.\r\nTanque 1: 24%\r\nTanque 2: 50%\r\nTanque 3: 73%\r\nTanque 4: 71%\r\n\r\nCabe mencionar que la carga de combustible se realizara el día Jueves.', 'Durante el turno se realizo el corte de energía en el tablero del caseton 6, esto fue coordinado por Gustavo Loira jefe del departamento de climatizacion, esto fue debido a que la empresa arquimed estaría instalando un interruptor para uno extractores.', 'Alexis Jara técnico del departamento de climatizacion informo que en el deposito de residuos solidos (Laboratorio) C-2-17 habia una gotera de agua servida, infraestructura ya esta informado sobre la filtracion.', '- Dar accesos a personas ingresadas durante el día.\r\n- Dar acceso al estacionamiento en el VTO-08, a las personas que salió fallado su salida.\r\n- Dar aviso sobre la carga de combustible el día jueves.\r\n- Dar acceso a salas eléctricas, mamparas del edificio y salas de comunicaciones al personal de industrial.\r\n- Consultar sobre presencia de seremi a consultorio piso 3.'),
(275, 'Reporte General de Eventos - Noche - 30-06-2022', 'Noche', '2022-06-30 07:46:18', 'HBQP-RGE-N-275', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett, Cristóbal Toro', 'Abel Torres', 'Se realizaron las alarmas de los filtros de las UMAS del 7mo piso.\r\nSe realizo avance en el manual del sistema BMS.\r\nSe le otorgo los accesos a las personas ingresadas durante la jornada anterior.', '', '', 'Durante el turno trabaja no se presentaron acontecimientos en los estanques de combustible.\r\nNiveles de combustible en BMS:\r\n- Tanque 1: 23%\r\n- Tanque 2: 37%\r\n- Tanque 3: 73%\r\n- Tanque 4: 71%', '', '', 'Al termino de la jornada revisar personas que intentaron realizar salida por el VTO 08 e informar al turno entrante de noche, para que otorgue el acceso correspondiente.'),
(276, 'Reporte General de Eventos - Dia - 30-06-2022', 'Dia', '2022-06-30 09:13:02', 'HBQP-RGE-D-276', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia', 'Shai Santibañez', '', '- Se hace el cambio de correa en los siguientes equipos: VEX-S1-10, VEX-S1-3X, VEX-S1-4, VEX-3-23, VEX -3 -20, Vex -7- 54, Vex-7-53, Vex-7-50, Vex-7-22, Vex-7-25, Vex-7-38, Vex-7-49A, Vex-7-49C, Vex-7-26, Vex-7-52, Vex-7-51, Vex-7-59B, Vex-7-200, Vex-7-22B, Vex-7-22A, Vex-7-23.\r\n- Chiller 1 mostraría en BMS que estaría encendido, cuando este desde terreno estaría apagado, este problema  se da ya que se bajaría manualmente desde terreno sin antes esperar la detención de control y luego de terreno.', 'Marcos Torres realiza Mantención a los acensares A12 ascensor 2, A17, A13 y B16. Y arregla Fallas en A1 ascensor 2 y A9 ascensor 2.', 'Se realiza carga de combustible, el camión llega a las 11:00 am y se va a las 11:15am, esta carga fue de 10.000L (Tanque 1 y 2) en las que se dividieron en 5.000 por estanque, al momento de realizar la carga estos ya contaban con 1.400L(22% desde BMS) en tanque 1 y  4.400L (37% desde BMS) en tanque 2, estos quedarían con 6.600L (68% desde control)en tanque 1 y 9.400L(79% desde control) en tanque 2.', '', '', '-Avisar al turno de día sobre grabación pedida por Alejandro  Cantillano, esta seria Cam 57 Día 21 a las 18:38 hrs\r\n- Dar los mismos permisos que Benjamín Carvajal a Matías Gorigoitia Eléctrico.\r\n- Dar a todos los que tengan intercom el permiso de VTO 8.\r\n- Dar permisos a Eq. Industriales, dar MP todas incluida la del P7, SC, SE, CLIMA (BD NO)'),
(277, 'Reporte General de Eventos - Noche - 29-06-2022', 'Noche', '2022-07-01 07:15:18', 'HBQP-RGE-N-277', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, alejandro Saavedra, Oscar Villegas y javier arancibia', 'Eduardo Muñoz', 'Se le da solución a la mampara MP (C-1-36) ubicada a final de pasillo en la unidad de UCE Psiquiátrica, esta habría sido reportada el día 29/06 por Diana Romero Llavera de turno del piso N°1 la cual el magnético de la puerta no funcionaba como corresponde. Se le dio la solución con remaches para mejorar el acoplamiento del magnético.', '', '', 'Combustible al finalizar el turno.\r\nTanque 1: 52% Control centralizado y dese terreno 6500\r\nTanque 2: 64% Control centralizado y desde terreno 7700 \r\nTanque 3: 70% Control centralizado y desde terreno 32000\r\nTanque 4: 73% Control centralizado y desde terreno 31400\r\nCabe mencionar que la alarma cámara intersticial volvió a activarse se desconocen los motivos de su alarma, esta alarma se habría activado el día de ayer 30/06 a las 11:14 horas.', '', '', '- Estar pendiente con el funcionamiento de las peall.\r\n- Estar pendiente del sistema de iluminaria en el séptimo piso.\r\n- Monitorear temperaturas de las UMAS.'),
(278, 'Reporte General de Eventos - Dia - 01-07-2022', 'Dia', '2022-07-01 20:11:32', 'HBQP-RGE-D-278', 'Luis Pérez Bernal', 'Matías Añazco, Shai Santibáñez, Dilhan Saavedra, Javier Bustamante', 'Abel Torres', '', '', 'Durante el turno de hoy, Don Guillermo informa que dejaran las autoclave encendidas, ya que vendrá personal del San Martin a dejar equipo.\r\nMarcos torres técnico de ascensores, informa que el ascensor A1-2 quedara en observación y se verificara durante la próxima semana debido a problemas arrojados al revisar e equipo (actualmente se encuentra en funcionamiento normal).', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 51% 8500lt nivel de combustible al entregar el turno.\r\n-tanque 2: 53% 8400lt\r\nGENERADORES:\r\n-tanque 4: 72%\r\n-tanque 3: 77%', '', '', ''),
(279, 'Reporte General de Eventos - Noche - 02-07-2022', 'Noche', '2022-07-02 06:50:22', 'HBQP-RGE-N-279', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia', 'Luis Perez', '', '- Se realiza revisión de sectores en los cuales se trabajaran durante la jornada.', '', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 51% \r\n-tanque 2: 39%\r\nGENERADORES:\r\n-tanque 4: 72%\r\n-tanque 3: 77%', '', '- Chapa en mal estado, informado por los guardias, esta se ubicaría en residuos hospitalarios en una puerta que dice escaleras, los guardias no contarían con mas información que esta al momento de informarnos.', ''),
(280, 'Reporte General de Eventos - Noche - 02-07-2022', 'Dia', '2022-07-02 19:54:23', 'HBQP-RGE-D-280', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett, Cristóbal Toro', 'Eduardo Muñoz', '', '', '', 'Durante el turno trabaja no se presentaron acontecimientos en los estanques de combustible.\r\nNiveles de combustible en BMS:\r\n- Tanque 1: 51%\r\n- Tanque 2: 28%\r\n- Tanque 3: 73%\r\n- Tanque 4: 71%\r\nactualmente en  uso tanque N°2 de calderas.', '', '', 'Continuar con trabajo en BMS dado por Isaac Pérez, profesional de apoyo de control centralizado.'),
(281, 'Reporte General de Eventos - Noche - 03-07-2022', 'Noche', '2022-07-03 07:39:30', 'HBQP-RGE-N-281', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante', 'Shai Santibañez', '', '', '', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 54% 6600lt nivel de combustible al entregar el turno.\r\n-tanque 2: 17% 2600lt\r\nGENERADORES:\r\n-tanque 4: 70%\r\n-tanque 3: 72%', '', '', 'Se deja como pendiente el terminar el Excel de las rutas de los analizadores de red y crearles los mensajes de alarma.'),
(282, 'Reporte General de Eventos - Dia - 03-07-2022', 'Dia', '2022-07-03 19:57:06', 'HBQP-RGE-D-282', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Oscar Villegas Y Javier Arancibia', 'Luis Perez', '', '', 'Al revisar el sistema de agua lluvia se percato el funcionamiento de la bomba 2 en la PEALL 1, se le informo a Javier Arancibia técnico del departamento industrial y al revisar el tablero esta se encontraría detenida, pero estaría con alarma, el encargado del departamento dará a conocer el problema de dicha bomba.', 'Niveles de combustible al finalizar turno.\r\nTanque 1: 50%\r\nTanque 2: 9%\r\nTanque 3: 71%, cabe mencionar que este continua con la alarma de cámara intersticial.\r\nTanque 4: 70%', '', 'Diana Romero funcionaria de la unidad de logística (Llavera), da el aviso sobre una filtración en el subterráneo pasillo principal, al dirigirse al lugar se percato que la filtración venia de una cañería al parecer se trataría del sistema sanitario, también se encontraría con el techo abierto pero se desconocen los motivos de su apertura, Alejandro Saavedra se encuentra al tanto sobre lo acontecido.', '');
INSERT INTO `reportes_generales` (`idReporte`, `nomReporte`, `turnoReporte`, `fechaReporte`, `folioReporte`, `nomEncargadoTurno`, `nomFuncionariosTurno`, `nomEncargadoTurnoAnterior`, `tareasControlCentralizado`, `tareasInstalaciones`, `tareasEquiposIndustriales`, `tareasIncendiosCombustibles`, `tareasDeteccionElectrica`, `tareasInfraestructura`, `pendientesCoordinacion`) VALUES
(283, 'Reporte General de Eventos - Noche - 04-07-2022', 'Noche', '2022-07-04 07:30:59', 'HBQP-RGE-N-283', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett, Cristóbal Toro', 'Abel Torres', 'Durante el turno se reviso a que se debe la alarma del la capa intersticial del tanque N°3 correspondiente a BMS, departamento industrial informa que en terreno se encuentra alarmado el tanque N°4 en terreno siendo que en BMS se encuentra alarmado el tanque N°3, por lo cual se decide dejar para el turno de día para corroborar si departamento industrial realizo alguna modificación.', '', '', 'Niveles de combustible al finalizar turno.\r\nTanque 1: 38%\r\nTanque 2: 10%\r\nTanque 3: 71%, cabe mencionar que este continua con la alarma de cámara intersticial.\r\nTanque 4: 69% \r\nactualmente tanque de caldera N°1 en uso.', '', '', 'Se deja como pendiente:\r\nAveriguar motivo de alarma del tanque intersticial.'),
(284, 'Reporte General de Eventos - Dia - 04-07-2022', 'Dia', '2022-07-04 14:56:14', 'HBQP-RGE-D-284', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia', 'Shai Santibañez', '', '-En la jornada de hoy se realizaría la medición de PH de las 4 torres de enfriamiento, VEX\'s de sector SAMU y Piso -1 y mantención de VAV\'s de Piso 2 y 3, estas acciones son realizadas por la empresa Monte Burgos.', '', '- Guillermo Hidalgo (Encargado del departamento Industrial), realiza pruebas de gabinetes.', '', '-Durante la jornada de hoy se nos informa sobre una gotera en sector subterráneo, la cual seria de Sector estacionamiento D19 cañería desagüe goteando, se le informa a personal de infraestructura, los cuales acuden al lugar y nos informan que serian los baños a un costado de sector consultorio, este problema quedaría como hallazgo.', ''),
(285, 'Reporte General de Eventos - Noche - 05-07-2022', 'Noche', '2022-07-05 08:07:45', 'HBQP-RGE-N-285', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra , Oscar Villegas Y Javier Arancibia', 'Eduardo Muñoz', '', 'Se realizo el monitoreo de la UMA-3-14 debido a sus bajas temperaturas, según información entregada anteriormente habría una posibilidad de que su serpentín estuviera obstruido y a eso de debería las bajas temperaturas a pesar de mantener su válvula al 10%. Este equipo se tiene que mantener en monitoreo para verificar su funcionamiento de la temperatura.\r\n\r\nDurante el turno se encontró la alimentación de los VIN-2-1 y VEX-2-3, estos se encontrarían en la sala eléctrica detrás del ascensor A10, el tablero seria el H2AD.', '', 'Niveles de combustible al finalizar turno.\r\nTanque 1: 19%\r\nTanque 2: 10%\r\nTanque 3: 71%, cabe mencionar que este continua con la alarma de cámara intersticial.\r\nTanque 4: 70%', '', '', '- Continuar con el monitoreo de la UMA-3-14'),
(286, 'Reporte General de Eventos - Dia - 05-07-2022', 'Dia', '2022-07-05 20:09:41', 'HBQP-RGE-D-286', 'Luis Pérez Bernal', 'Matías Añazco, Nicolás Manrique, Dilhan Saavedra, Javier Bustamante', 'Abel Torres', '', '', 'Durante el turno de hoy, ascensor A1-2 en EP, este lo verifica Marcos Torres he informa que este se boqueo por un problema en la puerta y que quedara en observación.\r\nEl ascensor A6-1 estará fuera de servicio ya que lo están revisando debido a problemas.\r\nEl problema del ascensor fue que fallo la conexión del paso por lo que quedo bajo nivel, no deteniéndose a nivel del piso correspondiente y por ende se bloqueo.', 'Durante el turno de hoy, se realiza un llenado a los tanques de combustibles de 10.000 litros, repartiéndose esta cantidad en el tanque 1 quedando en 61% = 7600lt y el tanque 2 quedando en 55% 6800lt, finalizando la carga a las 8:31am.  \r\nNivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 55% 6600lt nivel de combustible al entregar el turno.\r\n-tanque 2: 54% 6600lt\r\nGENERADORES:\r\n-tanque 4: 69%\r\n-tanque 3: 71%', '', '', 'Realizar el trabajo dejado por el profesional  Isaac Pérez.'),
(287, 'Reporte General de Eventos - Noche - 06-07-2022', 'Noche', '2022-07-06 07:33:14', 'HBQP-RGE-N-287', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia', 'Luis Perez', '', '6:30 Se realiza el encendido de Caldera 1 por orden de Claudio Cárcamo.', '', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 43%\r\n-tanque 2: 55%\r\nGENERADORES:\r\n-tanque 4: 69%\r\n-tanque 3: 71%', '', '', ''),
(288, 'Reporte General de Eventos - Dia - 06-07-2022', 'Dia', '2022-07-06 19:13:05', 'HBQP-RGE-D-288', 'Nicolas Droguett Hormazabal', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales.', 'Eduardo Muñoz', 'Se realizó cambio de nombre en 3 puertas del piso 1 en Sistema de Control de Accesos, cuya finalidad es obtener una identificación más veloz.', '', '', 'Se activa módulo de Aspiración en piso 5 en portal de alarmas de incendio en BMS, sin embargo, no arroja advertencia en Central de Incendios. Módulos 2 y 3 permanecen activos. Personal de Industrial se comunica con personal de incendio e informa que empresa externa Montes Burgos estaba realizando trabajos en salas eléctricas y salas de comunicaciones en quinto piso y debido al polvillo que soltaron al efectuar los trabajos, se activó una falsa alarma en los módulos de aspiración.\r\nSe presentó alarma en cámara intersticial en tanque de combustible N°4 de Generadores debido a la situación climatológica del día. Dicha alarma reaparece por temas de filtración de agua por motivos de algún desperfecto en el tanque, personal de industrial revisó el problema e informa que alerta en el sistema se puede corregir interviniendo de manera invasiva, por ello, se mantendrá en observación cada vez que arroje alarma hasta que se dé una solución concreta.\r\nNiveles de combustible en BMS al término del turno se indican a continuación:\r\n- Tanque N°1: 29%\r\n- Tanque N°2: 53%\r\n- Tanque N°3: 73%\r\n- Tanque N°4: 70%\r\nActualmente se está utilizando el Tanque N°1 de combustible.', 'Se realizaron trabajos de adecuación eléctrica en subterráneo, cuyos trabajos finalizaron sin inconvenientes, normalizando el tablero intervenido el cual corresponde a \"H0F\".', '', '- Otorgar permisos a personal con su correspondiente formato que se encuentra en el correo de Control Centralizado.\r\n- Realizar actualización de permisos de estacionamiento a todo el personal del hospital, orden por Lizandro Varela, jefe del Dpto. de Climatización.\r\n- Realizar encendido de Caldera N°1 a las 6:30AM.'),
(289, 'Reporte General de Eventos - Noche - 07-07-2022', 'Noche', '2022-07-07 08:02:16', 'HBQP-RGE-N-289', 'Luis Pérez Bernal', 'Matías Añazco, Javier Bustamante', 'Nicolás Droguett', '', '', '', '', '', 'Durante el turno de hoy, guardias informan que aspersor de regadío ubicado entre el portón 2 y el paradero de la micro, se encuentra roto.', ''),
(290, 'Reporte General de Eventos - Dia - 07-07-2022', 'Dia', '2022-07-07 20:02:16', 'HBQP-RGE-D-290', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Oscar Villegas', 'Luis Perez', '', 'Durante el turno la empresa Montes Burgo realizo mantención en las manejadoras de aire 3-12A, 3-14A, 3-13, 3-14, 3-31, 3-28, 3-3A, 3-11, 3-12 y 3-2, estos trabajos realizados se tratarían de cambios de filtros al equipo, debido a esto se realizó el apagado del equipo por unos pares de minutos y luego nuevamente fueron encendido sin novedad, cabe mencionar que estos trabajos de mantención no afectaron el funcionamiento de hospital.\r\n\r\nComo información hay una alta probabilidad que la empresa Monte Burgo realice el cambio del variador de frecuencia en la UMA-S1-4A, esta información no es 100% concreta, pero se podría realizar el cambio y hay que estar atento para prestar el apoyo necesario.', 'Durante el turno Cynthia Latorre reporta sobre una persona atrapada en el ascensor A6-1, debido a esto se le da el reporte al técnico de ThyssenKrupp Marcos Torres y al jefe del departamento Industrial, debido a estos los encargados realizan la maniobra de rescate sin ninguna complicación mayor y las dos señoritas del servicio de pabellón lograron salir sin ningún problema, cabe mencionar que en todo momento se mantuvieron tranquila y no paso a mayores la situación.\r\n\r\nDebido al incidente con el ascensor A6-1 el técnico Marcos Torres informo que el elevador quedará fuera de servicio hasta el día 08/07, esto sería debido a la falla arrojada y el encargado tendrá que hacer una revisión mayor para encontrar la solución del problema causado el día de hoy.', 'Durante el turno se realizó el cambio de Tanque en combustible, en este momento se encuentra activo el N°2\r\nLos niveles al finalizar el turno son.\r\nTanque 1: 12%\r\nTanque 2: 52%\r\nTanque 3: 73%, cabe mencionar que este ya no se encontraría con su alarma activa en su cámara intersticial.\r\nTanque 4: 72%\r\nMatías Gutiérrez entrego la información por vía correo que el día de mañana se realizara carga de combustible a las 11:00 de la mañana.\r\n\r\nGuillermo Hidalgo informo que la empresa de mantención en incendio habría ido a reestablecer los tableros de las bombas en la sala de incendio.', 'Fabian Córdoba profesional de apoyo del departamento eléctrico, realizo pruebas en los 4 generadores que se encuentran disponible en el hospital, esta prueba se realizaría en vacío ya que solo es para verificar si se encuentran en óptimas condiciones para una emergencia mayor, las pruebas realizadas lograron funcionar sin ninguna novedad y por parte de control centralizado se pudo poner a prueba el correcto funcionamiento de la alarma.\r\n\r\nBenjamín Toloza informa sobre una caja eléctrica que alimenta a los focos de iluminaria, estos estarían ubicado entre la caseta principal de guardias y el portón N°2, lo que sucedió en esa caja eléctrica seria que se encontraba desconectado los cables que alimentaban el foco de iluminación, el reporte entregado se trataría que esta alimentación que se encuentra llegando hacia el foco de iluminación no estaría llegando hacia un tablero como corresponde la cual afecta el funcionamiento de dicho foco.\r\nCabe mencionar que el departamento eléctrico realizara un siguiente para dar la solución que corresponde.', '', '- Realizar pendientes dejado por Isaac Pérez.\r\n- Dar permisos a personas ingresada durante el turno.'),
(291, 'Reporte General de Eventos - Noche - 08-07-2022', 'Noche', '2022-07-08 07:49:59', 'HBQP-RGE-N-291', 'Nicolas Droguett Hormazabal', 'Benjamín Vergara, Oscar Gacitúa, Gabriel Morales.', 'Abel Torres', '', 'Al momento de encender Caldera 1, se requiere apoyo de Benjamín Vergara, Técnico del Dpto. Eléctrico, y al momento de llegar a sala de calderas, indica que Caldera 3 no se encuentra encendida siendo que en sistema BMS se encuentra operativa. Durante turno de día se revisará el problema.', '', 'Se realizará carga de combustible a las 11:00Hrs del dia 08/07/22. Niveles de combustible al término del turno en BMS:\r\n- Tanque 1: 14%\r\n- Tanque 2: 40%\r\n- Tanque 3: 73%\r\n- Tanque 4: 70%\r\nActualmente trabajando con tanque N°2 de calderas.\r\nSe presenta alarma en módulo de aspiración en subterráneo, frente a PMA (H-S1-32). Dicha alarma no se presenta en central de incendio y tampoco en portal de Alarmas en Control Centralizado, durante turno de día se revisará junto a personal de incendio correspondiente.', '', '', '- Mantener en monitoreo UMA\'s de recintos entregados.\r\n- Revisar Caldera 3, según el problema indicado.\r\n- Carga de combustible a las 11:00Hrs.'),
(292, 'Reporte General de Eventos - Dia - 08-07-2022', 'Dia', '2022-07-08 20:36:06', 'HBQP-RGE-D-292', 'Jaime Estay Jorquera', 'Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia', 'Nicolás Droguett', 'Al rededor de las 10:45 se produjo una caída de las cámaras pero se reestablecieron al poco tiempo. Se consulto con el departamento de tics y no se detecto el motivo de esta caída.', '17:51 Se detecta una alarma del flujo del evaporador del Chiller 3 , al revisar la pantalla BMS se detecta que el chiller 3 se encontraba detenido, se da aviso a Javier Beltrán (Encargado departamento de climatizacion) y este vuelve a colocar en funcionamiento el equipo.', '', 'Marco técnico de los ascensores realizo trabajos en el ascensor A6-1 como trabajo pendiente del día anterior dejando con aviso de observación del equipo.\r\nEn el trascurso del día realizo mantenimiento en el ascensor A7-2 Y A10-1 dejando operativo ambos sin observaciones.\r\nDejando todos los ascensores operativos del Hospital.\r\n\r\nEn el transcurso de la mañana se realizo la carga de combustible del tanque 1 y 2 de Calderas.\r\nNivel antes de la carga: Tanque 1 (1300 litros) Tanque 2 (3700 litros)\r\nNivel Después de la carga: Tanque 1 (6300 Litros ) Tanque 2 (7700 Litros)\r\n\r\nComo observación se deja registro de una gran diferencia de lectura con respecto a los valores medidos en terreno/BMS.\r\n\r\nSe entrega turno Con Tanque 2 de combustible en servicio y con los siguientes niveles TANQUE 1 (6300 litros) Tanque 2 (7100 litros).', 'Benjamín Carvajal (Técnico del departamento Eléctrico ) realiza trabajos en los tableros eléctricos costado de los pabellones, con fin de encontrar circuitos perteneciente al los dispensadores de jabón de los pabellones.\r\n\r\nComo observación al realizar las Pruebas se percatan que circuito esta tomado de las mismas puertas de los pabellones y estas se reiniciaron.\r\n\r\nUna vez detectado los circuitos se vuelve a normalizar el estado de los tablero y se verifica el correcto funcionamiento de las puertas.', '', 'Se deja pendiente dar los permisos Correspondientes de los usuarios ingresados en el sistema de control de acceso.\r\nAvanzar con trabajos pendientes dejados por isaac perez.'),
(293, 'Reporte General de Eventos - Noche - 09-07-2022', 'Noche', '2022-07-09 07:44:43', 'HBQP-RGE-N-293', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Oscar Gacitúa, Gabriel Morales Y Oscar Villegas', 'Jaime Estay', 'Durante el turno cámara E14 presenta problemas con la visualización de imagen, se revisa en terreno para verificar su funcionamiento y esta tendría energía, además se realizaron pruebas con la visión nocturna y esta se abría activado. Al finalizar el turno dicha cámara continua fuera de funcionamiento y se desconoce el real motivo de su problema.', 'En las visualizaciones del sistema de climatizacion, la UMA-3-36B se encontraba con bajos pascales de inyección entre 50 a 70 PA aproximadamente de 220 su set point, se le da el aviso al técnico del departamento de climatizacion Alexis Jara para su revisión en terreno, la información entregada fue que el variador de frecuencia del VIN se encontraría advirtiendo una alarma de limite de intensidad, se realizo su revisión para verificar que todo estuviera como corresponde y no se logro llegar a un motivo por su baja inyección. El departamento de climatizacion le comentara a la empresa contratista Montes Burgo para su observación.', '', 'Los niveles al finalizar el turno son.\r\nTanque 1: 63%\r\nTanque 2: 59%\r\nTanque 3: 75%\r\nTanque 4: 72%\r\nCabe mencionar que Matías Gutiérrez profesional de apoyo del departamento de incendio informa vía correo que el día martes 12 de julio, se realiza otra carga de combustible.', '', '', ''),
(294, 'Reporte General de Eventos - Dia - 09-07-2022', 'Dia', '2022-07-09 19:26:31', 'HBQP-RGE-D-294', 'Luis Pérez Bernal', 'Matías Añazco, Nicolás Manrique, Javier Bustamante', 'Abel Torres', 'Durante el turno de hoy, se presentaron problemas con el canal horario en las iluminarias del piso 4 y el sector G del piso 2, por lo que en estos recintos se forzaron a encendido las iluminarias hasta el termino del turno.', 'Durante el turno de hoy, empresa contratista Montes burgos realiza el cambio de los filtros de las siguientes UMAS: S1-15 / S1-10 / S1-27A / S1-4A y al VIN-3-1, todo esto con supervisión del técnico de climatizacion Nicolás Manrique.', 'Durante el turno de hoy, PEALL-4 estuvo constantemente en nivel 3 del estanque, por lo que se mantuvo constantemente monitoreado en caso de que el equipo presente algún problema.', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 63% 7700lt nivel de combustible tomado a las 8:30am\r\n-tanque 2: 58% 7200lt', '', '', 'Se deja como pendiente el otorgar los accesos solicitados en el correo por Dr. Pablo Gonzales, esto hablado y autorizado por jefatura Lizandro Varela.'),
(295, 'Reporte General de Eventos - Noche - 10-07-2022', 'Noche', '2022-07-10 07:10:38', 'HBQP-RGE-N-295', 'Jaime Estay Jorquera', 'Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia', 'Luis Perez', '', '', 'Durante la jornada se activo en la consola de alarma una falla térmica de la bomba 2 de la peall 2,se dio aviso a Joaquín Vicencio  (técnico del departamento Industrial), el cual verifico en terreno y volvió a poner en funcionamiento la bomba.\r\n\r\nComo observación la bomba durante el turno funciono con normalidad e igualmente se deja como pendiente de monitoreo.', 'Se finaliza el turno con los siguientes niveles de combustible:\r\nTanque 1 (6000 litros) : Tanque 2 (3600 litros) Calderas\r\nTanque 3 (7800 litros): Tanque 4 (6900 litros) Generadores\r\nComo observación estamos trabajando con el tanque 2 de calderas.', 'Se deja en funciona el canal horario de la zona G (Piso 2) ya que turno anterior presento problemas de encendido.', '', 'Se deja pendiente avanzar con la creación de alarmas(BMS).\r\nMonitorear funcionamiento de la peall 2 ya que en el transcurso de la noche salto el térmico.'),
(296, 'Reporte General de Eventos - Dia - 10-07-2022', 'Dia', '2022-07-10 19:27:34', 'HBQP-RGE-D-296', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Jaime Estay', '', 'Equipo UMA-S1-4A, presentó alarma por sobre corriente. Junto a Dpto. de Climatización, se decide mantener detenido el equipo por prevención.', 'En BMS se indica alarma por falla térmica en Bomba 2 de PEALL-2 durante turno anterior. Se mantuvo en monitoreo en conjunto con Dpto. Industrial sin presentar problemas.', 'No se presentaron inconvenientes durante el turno trabajado. Los niveles de combustibles en BMS al término de la jornada son:\r\n\r\nTanque 1: 65%\r\nTanque 2: 28%\r\nTanque 3: 68%\r\nTanque 4: 71%', '', 'Por hallazgos de Personal de Logística, informan que se presentan fugas menores de agua en los pisos 4, 5 y 6 ocasionadas por ventanas que se encontraban abiertas, se sospecha que lo ocurrido se debe a fuertes vientos ocurridos durante los últimos días.', '- Buscar punto NX0015 Sector J, Neonatología, piso 2. Por orden de Yorgo Casimis, Profesional de apoyo de Control Centralizado.\r\n- Continuar con trabajos en BMS, orden de Isaac Pérez, Profesional de Apoyo de Control Centralizado.'),
(297, 'Reporte General de Eventos - Noche - 11-07-2022', 'Noche', '2022-07-11 09:10:44', 'HBQP-RGE-N-297', 'Luis Pérez Bernal', 'Matías Añazco, Javier Bustamante', 'Shai Santibañez', 'Durante el turno de hoy, el sistema de BMS tuvo un problema con la lectura de los puntos de iluminaria del estacionamiento ya que no se permitían los cambios desde el BMS perdiendo la gobernanza remota de estos, cabe señalar que el problema con las iluminarias será solucionado por el turno entrante.', '', 'Importante señalar la poca capacidad que tiene la PEALL-4 para afrontar lluvias como la que aconteció este sábado 09, trabajando casi 24 horas y en su mayoría con el nivel 3 del estanque y con ambas bombas.', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 63% 7800lt nivel de combustible tomado a las 8:30am\r\n-tanque 2: 23% 3400lt', '', 'Se da a conocer, que durante el fin de semana hubieron múltiples fugas en los distintos pisos, además de una ventana rota en el piso 5 y algunas que se encontraron abiertas, cabe señalar que la información, reportes y demás los debiese tener el departamento de infraestructura.', ''),
(298, 'Reporte General de Eventos - Dia - 11-07-2022', 'Dia', '2022-07-11 21:13:41', 'HBQP-RGE-D-298', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Oscar Villegas', 'Luis Perez', '', 'Durante el turno se realizaron los cambios de filtro por parte de la empresa montes burgo estos equipos son los siguientes.\r\nUMA-1-4, UMA-7-52 y UMA-2-27, estos cambios de filtros no afectaron el funcionamiento del hospital y salió todo correctamente.', 'Durante el turno personal de logística (Llavera) informa, que el ascensor A1-2 se encontraba fuera de servicio, se le informo al departamento de industrial para que personal de Tyssen viniera a solucionar el problema del equipo.', 'Los niveles al finalizar el turno son.\r\nTanque 1: 66%\r\nTanque 2: 9%\r\nTanque 3: 76%\r\nTanque 4: 71%\r\n\r\nDurante el turno se reporto una alarma de incendio en el sector 2.4 piso 2, la cual junto al personal de climatizacion, eléctrico y jefaturas de control centralizado se distribuyeron para poder verificar si era una falsa alarma, se reviso todo los pasillos del servicio de laboratorio y solamente se encontró un modulo de aspiración activado, la cual se procedió a reiniciar el equipo y al mismo tiempo Lizandro Varela rearmaba el sistema desde la sala de seguridad, Yorgo Casimis informaba que la alarma continuaba activa, aproximadamente se alarmo 5 a 9 veces, se reviso contantemente los recinto pero no se pudo lograr con exactitud el problema de su activación, se deshabilitaron 2 a 3 módulos de aspiración y ahí se pudo solucionar momentáneamente. El departamento de industrial esta al tanto de la información y darán el aviso para que así la empresa de incendio pueda solucionar el problema.', '', '', 'Dar permisos a personas ingresada durante el día.\r\nPendiente dejado por Lizandro Varela jefe de control centralizado.\r\nRealizar trabajos dejados por Isaac Pérez.'),
(299, 'Reporte General de Eventos - Noche - 12-07-2022', 'Noche', '2022-07-12 07:36:29', 'HBQP-RGE-N-299', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett.', 'Abel Torres', '', '', 'Durante la jornada, se presento técnico de ascensor de empresa Thyssen, para solucionar problema del ascensor A1(2), el cual informa que el problema se debía a una señal eléctrica que no estaba llegando de manera correcta, a lo cual soluciona el problema y deja el ascensor totalmente operativo.', 'Los niveles al finalizar el turno son.\r\nTanque 1: 55%\r\nTanque 2: 8%\r\nTanque 3: 72%\r\nTanque 4: 69%\r\n\r\nDurante la jornada personal del departamento industrial se mantuvo monitoreando la zona afectada por la alarma de incendio en el turno anterior, la cual no se volvió a activar.', '', '', 'Monitorear temperaturas de recintos médicos.'),
(300, 'Reporte General de Eventos - Dia - 12-07-2022', 'Dia', '2022-07-12 16:41:31', 'HBQP-RGE-D-300', 'Jaime Estay Jorquera', 'Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia', 'Shai Santibañez', 'Durante la mañana, ocurrió una caída de UCAS siendo estas las 10, 9 y 11 las cuales se desconectaron por unos minutos para luego reestablecerse y permanecer en línea.', '', 'Durante la tarde noche de hoy hará ingreso técnico de thyssen a revisar ascensor A10-1 que se encuentra con manchas de aceite N° reporte 30001518.', 'Se Informa que se realizara carga de combustible mañana miércoles 13 de Julio alrededor de las 11:00\r\nDurante la mañana se realizo llenado de aire del tanque de expansión debido bajas presiones.', 'Durante el turno de hoy, se perdió energía en enchufes de comedor del piso 1  por sobre consumo en tablero H1K circuito F1, el cual fue restaurado a la brevedad. \r\n Durante el transcurso del día, ocurrió una caída del magnetotérmico de odontología, tablero H2V debido a trabajos.', '', 'Otorgar los accesos correspondientes al personal ingresado durante el turno de hoy'),
(301, 'Reporte General de Eventos - Noche - 13-07-2022', 'Noche', '2022-07-13 07:42:05', 'HBQP-RGE-N-301', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Oscar Villegas', 'Luis Perez', 'Durante el turno se le da una solución momentáneamente al magnético de la puerta MP (O-5-62), esta presentaría fallas al cerrar quedando abierta y dejando el libre transito sin mantener un registro de las personas que entraban. Cabe mencionar que esta solución fue momentánea y para que quede 100% arreglada tiene que ser un cambio mayor.', '', 'Durante el monitoreo de pantallas, se percato que se encontraba alarmado el estanque de riego con sobre nivel, Debido a esto se fue a revisar a terreno para verificar con exactitud el nivel de agua que habia en el estanque, el agua estaría cubriendo el ultimo peldaño de la escalera y faltaría pocos centímetros para su rebalse, la solución que se pudo dar fue cerrar la válvula de corte para no seguir llenando el tanque y dejarlo momentáneamente en ese estado. Cabe mencionar que el riego se mantiene apagado debido a que los jardines no necesitan mas agua de lo que corresponde ya que en los últimos días se han presentado lluvias.\r\n\r\nAdemás durante el turno no se hizo presente el técnico de thyssen para el arreglo del ascensor A10-1.', 'Los niveles al finalizar el turno son.\r\nTanque 1: 26%\r\nTanque 2: 8%\r\nTanque 3: 71%\r\nTanque 4: 73%\r\nCabe mencionar que Matías Gutiérrez profesional de apoyo del departamento de incendio\r\ninforma vía correo que el día miércoles 13 de julio se realizara carga de combustible a las 11:00 de la mañana.', '', '', ''),
(302, 'Reporte General de Eventos - Dia - 13-07-2022', 'Dia', '2022-07-13 19:33:00', 'HBQP-RGE-D-302', 'Luis Pérez Bernal', 'Matías Añazco, Diego Montoya, Dilhan Saavedra, Javier Bustamante', 'Abel Torres', '', '', 'Se realiza mantención al ascensor A10-1 el cual tenia filtración de aceite quedando operativo, también se realiza mantención al A1-2 el cual tenia problemas con sus baterías de respaldo arrojando falla y quedando fuera de servicio, señalar que ambos  ascensores están operativos.', 'Se realiza carga de combustible en tanque de calderas a las 11:00 am aproximadamente  y termina a las 11:50 am \r\ntanque 1 antes del llenado 3000 lts / 27%\r\ntanque 2 antes del llenado 1500 lts / 10%\r\n\r\ntanque 1 después del llenado  8400 lts / 70%\r\ntanque 2 después del llenado  6400 lts / 52%', '', 'Durante el turno de hoy, funcionario del hospital al realizar la maniobra de ingreso, choca pilar de descanso de barrera dejando este inutilizable y con un posible desprendimiento de este.', 'Dar accesos correspondientes a personal ingresado en el turno de hoy. \r\nVaciar tarros puestos en shaft de clima P4\r\nDar acceso a personal que no pudo pasar por la barrera habilitada para salida hacia sala cuna.'),
(303, 'Reporte General de Eventos - Noche - 14-07-2022', 'Noche', '2022-07-14 05:53:41', 'HBQP-RGE-N-303', 'Felipe Retamal Fuentes', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal', 'Luis Pérez', 'Caídas de Cámaras Durante el Transcurso de La noche \r\nCAM-E19\r\nCAM-PRK-03: Channel 1', '', 'PEALL 4, Se Mantiene En Nivel 3 Desde las 4:30 AM, Ya se dio Aviso a Técnicos de Turno.', 'Alarma de Incendio Sector 1.9, Urgencia Adulto; Se Detecto que era un Sensor de Humo, Sala Eléctrica Costado del Ascensor A6\r\nSe Verifico en Terreno Los Técnicos de Turno; Joaquín  Vicencio, Nilton Fonzecas\r\nNo se Encontró por que se inicio la Alarma.\r\nA las 3:25 AM Se detecta Alarma Cámara Intersticial. En Estanque 3', '', 'Múltiples Goteras en Piso 4, Piso 5\r\nGoteras en Sector Edificio Energéticos, Se le Dio Aviso a OHLA, Para trabajar en el Recinto\r\nSala de Calderas.', ''),
(304, 'Reporte General de Eventos - Dia - 14-07-2022', 'Dia', '2022-07-14 19:53:24', 'HBQP-RGE-D-304', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett, Cristóbal Toro', 'Felipe Retamal', '', '', 'Se presento personal atrapado en ascensor A8. Personal de Industrial revisó el problema, no teniendo situaciones de mayor complicación, se mantuvo deshabilitado para que empresa Thyssen se encargara de la respectiva revisión y mantención del ascensor. Se presentó fuga de agua en ascensor A15, personal de industrial revisó el problema en terreno.', 'Se presenta alarma en piso 5 en FM-200, personal de industrial revisó el equipo en terreno junto a empresa de incendio. Se normalizó la situación y se indica que conector del equipo se encontraba suelto, y por ello arrojó la falla. Al rededor de las 17:30Hrs empresa de incendios se encontraba realizando pruebas en piso 3 y piso 2, no se presentaron mayores dificultades a la hora del término de las pruebas.\r\nLos niveles de estanques de combustibles visualizados en BMS son:\r\n- Tanque 1: 46%\r\n- Tanque 2: 48%\r\n- Tanque 3: 65%\r\n- Tanque 4: 67%', 'Se registra en monitoreo de rutina, que Generador 3 se encontraba con el selector en Manual desde terreno, se verifica junto a Benjamín Vergara, Técnico del Dpto. de Electricidad y se normaliza el estado del selector en automático.', '', '- Mantener en monitoreo UMA\'s de recintos entregados.\r\n- Continuar con levantamiento de variadores de Frecuencia, rescatando información de su ficha técnica.\r\n- Otorgar Permisos a personal correspondiente.'),
(305, 'Reporte General de Eventos - Noche - 15-07-2022', 'Noche', '2022-07-15 08:17:56', 'HBQP-RGE-N-305', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Diego Montoya', 'Shai Santibañez', '', '', '', '', 'Durante el turno de hoy, Se realiza mantenimiento a tablero H4E lo cual termina sin contratiempos', 'Durante el turno de hoy, se encuentran filtraciones en el piso 5 y en comedor del piso 1, se pidió ayuda a personal de aseo industrial para realizar secado de los recintos.  \r\nGuardias informan de gotera en pilar H17 en el estacionamiento la cual al revisar, esta proviene de cañería con agua sanitaria.', ''),
(306, 'Reporte General de Eventos - Noche - 15-07-2022', 'Noche', '2022-07-15 18:18:08', 'HBQP-RGE-N-306', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Oscar Villegas', 'Luis Perez', '', 'Durante el turno empresa montes burgo realizo pruebas con las válvulas de frio en los FC ubicados en sector SAMU, la cual tras todas las pruebas no se presentaron problemas mayores.\r\nTambién  se dejo apagado el FC-S1-12 debido a que montes burgo retiro el filtro del equipo y lo dejo apagado del automático.\r\n\r\nTambién como información las calderas se mantendrá encendida todo el fin de semana incluyendo la caldera N°1, esto es por ahorro de combustible y se encuentra conversado con todas las jefaturas correspondientes.', 'Se reitero el aviso a equipos industriales sobre el sobre nivel que se encontraba el estanque de riego, la cual Matías Gutiérrez profesional de apoyo del departamento industrial, informo que el estanque habría sido vaciado para que ya la alarma no alertara.\r\n\r\nAdemás Guillermo Hidalgo jefe del departamento industrial informo que el técnico de thyssen abría dejado operativo el ascensor A1-2, además dio a conocer que los ascensores A15 y A14 se encontrarían fuera de servicio por filtración de agua y a estos deberán estar en evaluación, también el ascensor A8-2 se encontraría sin comunicación en el botón de llamado emergencia pero si con el botón de pánico.', 'Los niveles al finalizar el turno son.\r\nTanque 1: 29%\r\nTanque 2: 48%\r\nTanque 3: 69%\r\nTanque 4: 66%\r\nCabe mencionar que Matías Gutiérrez informo que la carga de combustible se realizara el día lunes 18 de julio.', 'Oscar Villegas técnico del departamento eléctrico informo que lo acontecido en el turno de ayer con gotera en iluminaria ubicada en caseta principal de guardias habría sido repara e instalada nuevamente, además el foco del baño habría presentado fallas mayores así que ese no quedo instalado por seguridad.\r\n\r\nTambién Benjamín Toloza técnico del departamento eléctrico dio a conocer que algunos tableros ubicado en los casetones del piso 3, se encontrarían con rastros de filtraciones de agua por la situación meteorológica ocurrida la noche anterior, el tablero mas afectado fue el del caseton 1 que este se encontraría con mayor rastros de agua, debido a esto se procedió a el apagado del tablero y así dar el secado correspondiente y una solución adecuada para así no se volviera a filtrar agua.', '', ''),
(307, 'Reporte General de Eventos - Noche - 16-07-2022', 'Noche', '2022-07-16 07:36:33', 'HBQP-RGE-N-307', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett, Cristóbal Toro.', 'Abel Torres', '', 'Se realiza cambio de Caldera N°4 a la N°2 por ordenes de Nicolás Manríquez, técnico de climatización, ya que la caldera n°4 estaba condensando demasiado en terreno.', '', '', '', '', 'Verificar tablero del casetón N°1 si se encuentra seco durante la jornada para volver a tener operativos los equipos de dicho casetón.\r\nMonitorear UMAS de los recintos entregados.'),
(308, 'Reporte General de Eventos - Dia - 16-07-2022', 'Dia', '2022-07-16 18:35:20', 'HBQP-RGE-D-308', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Nilthon Fonseca, Matías Gorigoitia', 'Shai Santibañez', '', '-Se verifica tablero del casetón N°1, este se encuentra seco durante la jornada y se ponen operativos los equipos de dicho casetón.', '', '-Se realiza el cambio de estanque N°1 a N°2, esto se realiza ya que estanque N°1 tendría 700L, estanque N°2 tendría 6.000L al momento de realizar el cambio.', '', '', ''),
(309, 'Reporte General de Eventos - Noche - 17-07-2022', 'Noche', '2022-07-17 06:30:18', 'HBQP-RGE-N-309', 'Shai Santibáñez Osses', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra Y Oscar Villegas', 'Eduardo Muñoz', 'Durante la madruga a las 02:00 AM se detecto una caída general del sistema de control de acceso en el apartado de ACCES, el sistema volvió al instante y no se vio reflejado en el apartado de DEVICES.', '', '', '', '', '', ''),
(310, 'Reporte General de Eventos - Dia - 17-07-2022', 'Dia', '2022-07-17 19:35:02', 'HBQP-RGE-D-310', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Diego Montoya', 'Shai Santibañez', '', 'Durante la mañana del turno de hoy, se produce una gotera de agua caliente sanitaria en servicios generales P-1 la cual se soluciona casi al instante.', '', '', '', '', ''),
(311, 'Reporte General de Eventos - Noche - 18-07-2022', 'Noche', '2022-07-18 07:22:25', 'HBQP-RGE-N-311', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Luis Perez', '', '', '', '- Se realizara carga a las 8:00am, lo cual se le informa a personal correspondiente para su descarga.\r\n- al entregar turno los porcentajes de estanques son:\r\ntanque 1 antes del llenado 600 lts / 9%\r\ntanque 2 antes del llenado 1600 lts / 10%', '', '', '- Realizar seguimiento de descarga de combustible.'),
(312, 'Reporte General de Eventos - Dia - 18-07-2022', 'Dia', '2022-07-18 19:59:31', 'HBQP-RGE-D-312', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett, Cristóbal Toro', 'Eduardo Muñoz', '', '', '', 'En la jornada de la mañana se realizo carga de combustible al finalizar la carga los tanques quedaron con lo siguientes niveles:\r\nTanque 1 : 6000 lt/ 61%\r\nTanque 2: 6200 lt/50%\r\nLos niveles al finalizar el turno son.\r\nTanque 1: 59%\r\nTanque 2: 42%\r\nTanque 3: 71%\r\nTanque 4: 72%', '', '', '- Realizar la carga de baterías de las radios, orden dada por Yorgo Casimis, profesional de apoyo de Control Centralizado.\r\n- Realizar trabajo de BMS  dado por Isaac Pérez, profesional de apoyo de Control Centralizado.\r\n- Dar los accesos correspondientes a las personas ingresadas durante el día.\r\n- Realizar estandarizado de permisos de personal de SDO que lleve trabajando más de 1 mes.'),
(313, 'Reporte General de Eventos - Noche - 19-07-2022', 'Noche', '2022-07-19 07:43:59', 'HBQP-RGE-N-313', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Diego Montoya', 'Shai Santibañez', '', '', '', '', '', '', ''),
(314, 'Reporte General de Eventos - Dia - 19-07-2022', 'Dia', '2022-07-19 19:37:04', 'HBQP-RGE-D-314', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Oscar Villegas Y Javier Arancibia', 'Luis Perez', '', 'Durante el turno se realizaron mantención en los equipos de climatizacion por parte de la empresa montes burgo supervisado por Alexis Jara técnico del departamento de climatizacion, los equipos que se realizo la mantención son.\r\nCentral Frio se realizo limpieza de la torre enfriamiento N°3, por parte de climatizacion se realizo los cambios de filtros en las UMAS-7-48, 7-49, 7-46, 7-39, 7-43, 7-41, 7-37, 7-45 y UMA-7-47, todo esto se realizo durante el día y se logro finalizar sin ninguna novedad.\r\n\r\nTambién durante el encendido de paneles solares se presento problemas con la BSAP, al encender una de las bomba en control centralizado estas encendería tanto la BSAP-1 como la BSAP-1R, debido a esto no se podía efectuar el apagado solamente de una, ya que al hacer la acción de apagado estas de detendrían las dos al mismo tiempo, se realizaron pruebas con Alexis Jara técnico del departamento de climatizacion, estas pruebas fueron cortar el automático que alimenta una de las bombas para que así no funcionaran las dos en simultaneo, estas pruebas no lograron salir como se esperaba ya que al cortar el automático y dejar el selector en 0 de la BSAP-1, no dejaría de funcionar.\r\nDebido a esto también se le reporto lo acontecido al departamento eléctrico para verificar el correcto funcionamiento de los circuito que alimentan a la bomba.\r\nTambién Alexis Jara técnico del departamento de climatizacion dejo tanto el automático como el selector en 0 de las dos BSAP por motivos de precaución para así no se vuelva activar nuevamente las dos.', '', 'Los niveles al finalizar el turno son.\r\nTanque 1: 20%\r\nTanque 2: 57%\r\nTanque 3: 75%\r\nTanque 4: 72%\r\nCabe mencionar que Matías Gutiérrez informo que la carga de combustible se realizara el día\r\nJueves de 21 de julio. \r\n\r\nTambién el día de hoy se realizaron pruebas de incendio al parecer se trataría verificar el funcionamiento en módulos, se desconoce específicamente lo que se realizo y a las 19:34 se termino las pruebas.\r\nCabe mencionar que la información que se obtuvo sobre la finalización de la pruebas, fue mediante lo que se escucho en la radio de comunicación general, pero específicamente no se recibió información directamente.', '', '', '- Dar acceso a personal ingresado.\r\n- Monitoreo del Chiller 2 que fue puesto en servicio el día de hoy.'),
(315, 'Reporte General de Eventos - Noche - 20-07-2022', 'Noche', '2022-07-20 06:05:13', 'HBQP-RGE-N-315', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Cristóbal Toro', 'Abel Torres', '', '', '', '', '', 'Nicolás Manríquez, técnico de climatización avisa de agua en el pasillo TH del piso 3 entre los ejes EG/13-14, la cual provenía de los ventanales del sector UPC, a lo que se empezó una revisión de los pisos superiores, se encontró que el shaft EF/14-15 de clima del piso 4 sector N, el cual al entrar se encontraba con una gran cantidad de agua proveniente del 7mo piso, personal de SDO fue a revisar a los ejes EF/14-15 en el séptimo piso, a lo cual se encontró con material de trabajo, una lata del shaft de clima doblada, agua estancada y un balde con agua estancada, personal se puso en contacto con Jorge Cantillano, Jefe de especialidades para solicitar los equipos correspondientes de logística( aspiradoras) para poder drenar el agua del cuarto y  séptimo piso. El drenado del cuarto piso no tuvo mayor complicación. \r\nEn el piso 7 el agua estancada, al drenarse con la aspiradora volvía a llenar el agujero en el cual se encontraba (se adjunta imagen).  Después de drenar más de 7 veces, se decidió crear unos tapones provisionales con unos tarugos y cinta americana, los cuales surtieron efecto en el tapado de la fuga. Cabe mencionar  que en la revisión del shaft del piso 4, se encuentra un trozo  de vulcanita dentro de este, provocando el efecto de romper el tarro que se tenia para contener el agua(se adjunta imagen).', 'Monitoreo de UMAS'),
(316, 'Reporte General de Eventos - Dia - 20-07-2022', 'Dia', '2022-07-20 19:50:34', 'HBQP-RGE-D-316', 'Jesús Silva Pellet', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Shai Santibañez', 'Por pruebas en corte de suministro eléctrico hubieron caídas de conexión en sistemas, tanto de UCAS, BMS, etc.\r\nAl terminar las pruebas esto se volvió a la normalidad.', 'Se realizó mantención y cambio de filtro por la empresa Monteburgos a las siguientes UMAS: 3-24, 3-25, 3-30, 3-8, 3-23, 3-22, 3-23A, 3-29, 3-26, 3-26A.\r\nLa mantención terminó sin complicaciones.', '', 'Se realizo prueba de sistema de incendios en piso 2, alarmando los sectores, 2.1, 2.6, 2.7, 2.9, 2.3, 2.13, 2.4, 2.14, 2.5, 2.12\r\nla prueba fue terminada sin complicaciones.\r\nAdemás la UMA-S1-15 fue forzada por SetPoint a 20° Por altas temperaturas por 4 horas.', 'Se realizó un corte de suministro eléctrico para pruebas a las 18:00 Hrs\r\nLa prueba fue terminada sin complicaciones.', '', 'Revisar y linkear graficas y tendencias del sector H-I-J en BMS.\r\nRevisar Graficas anotadas en pizarrón.\r\nDesforzar UMA 3-11 en la madrugada.'),
(317, 'Reporte General de Eventos - Noche - 21-07-2022', 'Noche', '2022-07-21 07:08:03', 'HBQP-RGE-N-317', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Oscar Villegas Y Javier Arancibia', 'Jesús Silva', '', '', '', 'Niveles tomados al inicio del turno.\r\nTerreno.                                              Control centralizado.\r\nTanque 1: 4600 LTS                         Tanque 1: 42%\r\nTanque 2: 2100 LTS                          Tanque 2: 12%\r\n\r\nAl finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 30%                         Tanque 3: 75%\r\nTanque 2: 12%                          Tanque 4: 72%\r\n\r\nCabe mencionar que el día de hoy se realizara la carga de combustible a las 11:00 AM.', '', '', ''),
(318, 'Reporte General de Eventos - Dia - 21-07-2022', 'Dia', '2022-07-21 18:33:45', 'HBQP-RGE-D-318', 'Jesús Silva Pellet', 'Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Javier Bustamante, Matías Añasco, Diego Montoya', 'Abel Torres', '', 'Se realizó la mantención y cambio de filtros a las siguientes UMAS:\r\n3-16A, 3-16B, 3-16C, 3-16D, 3-16E, 3-16F, 3-16G, 3-16H, 3-16I, 3-16J, 3-16A, 3-51, 3-1, 3-21, Imageniologia, 3-7.\r\nLa mantención se realizo durante el día sin novedades y sin inconvenientes.', '', 'El día de hoy se realizo la carga de combustible, 11:30 Hrs\r\nDejando un total de carga de: \r\nTanque 1: 7800 Lts.\r\nTanque 2: 6800 Lts.\r\nSe activa alarma de incendio en piso 1 sector urgencias (Sector 1.9), En estación de enfermería por trabajos que se estaban realizando en el sector, personal de incendios se dirigió al lugar, todo en normalidad.', 'Se realiza prueba de generadores a las 11:30 Hrs de la mañana.\r\nSe realizaron pruebas en terreno de los generadores numero 1, 2, 3 y 4.\r\nHora Encendido Generador 1: 11:30\r\nHora Encendido Generador 2: 11:35\r\nHora Encendido Generador 3: 11:40\r\nHora Encendido Generador 4: 11:50', '', 'Terminar de linkear graficas de sector H-I-J del piso 3\r\nDar permisos correspondientes, Consultorio de especialidades mampara, piso 3.'),
(319, 'Reporte General de Eventos - Noche - 22-07-2022', 'Noche', '2022-07-22 06:45:46', 'HBQP-RGE-N-319', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Jesús Silva', '', '', '', '', '', '', ''),
(320, 'Reporte General de Eventos - Dia - 22-07-2022', 'Dia', '2022-07-22 19:07:14', 'HBQP-RGE-D-320', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Cristóbal Toro', 'Eduardo Muñoz', '', 'Durante el turno trabajado Empresa Montes Burgos cambio los filtros de los siguientes equipos\r\nUMA-3-5\r\nUMA-3-20A\r\nUMA-3-5A\r\nUMA-3-23B\r\nUMA-S1-15A\r\nUMA-S1-31A\r\nUMA-S1-32\r\nUMA-S1-35\r\nUMA-S1-31C', '', 'Durante la jornada de la mañana Nicolás Manríquez, técnico de climatización informa que tanque de expansión de combustible de caldera, se rompió, a lo cual empezó un procedimiento para reparar el tanque, Javier Beltrán jefe del departamento climatización intento soldar el tanque sin tener mayor éxito, a lo cual Juan Burgos realiza llamado a Viña del Mar y consigue un tanque de expansión nuevo, se realiza el cambio del tanque y queda operativo sin mayor problema.\r\nlos niveles de combustible son los siguientes:\r\ntanque 1 : 44% en uso\r\ntanque 2: 53%\r\ntanque 3: 70%\r\ntanque 4: 68%', '', '', 'Realizar encendido de luces de casetones para la neblina de la mañana, el turno entrante realiza el apagado de las luces en la mañana.\r\nRealizar trabajo dado por Yorgo Casimis, profesional de apoyo del departamento de Control Centralizado.\r\nRealizar creación de Historiales, orden dada por Isaac Pérez, profesional de apoyo del departamento de Control Centralizado.\r\nRevisar y otorgar accesos de personal ingresado durante la jornada de hoy.\r\nAvisar al turno entrante de los trabajos que se van a realizar durante el fin de semana.\r\nCrear formato para la unidad de higiene y seguridad según el correo enviado el día Jueves.'),
(321, 'Reporte General de Eventos - Dia - 23-07-2022', 'Dia', '2022-07-23 08:05:23', 'HBQP-RGE-D-321', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Diego Montoya', 'Shai Santibañez', 'Durante el turno de hoy, aproximadamente a las 6:04 am, se encuentra a una persona en situación de calle en portón 4 con indicios de sufrir de hipotermia, esta persona seria atendida por personal de SAMU (Eri Moreno, Cherie Caballero, Andrés Canto y Gonzalo Soto), quienes le brindarían un abrigo, comida y un café caliente. Guardia Franco Verdejo llamaría a personal de la municipalidad quienes lo retirarían y lo llevarían a un albergue.\r\nSeñalar que habrían informado que persona abría ido a hospital San Martin al área de Urgencias para ayuda y no lo atenderían señalando que debería venir al Bi Provincial para atención.', '', '', '', '', 'Durante el turno de hoy, guardias informan de un sonido similar al de la caída de agua en entrada principal, esto se investiga hasta encontrar la fuente del sonido el cual vendría del piso 6 en un baño del cual el wáter no aria el corte de la caída de agua por lo que se cierra de la lave de paso (PMA: P-6-13 / P-6-49B).', ''),
(322, 'Reporte General de Eventos - Dia - 23-07-2022', 'Dia', '2022-07-23 20:15:56', 'HBQP-RGE-D-322', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Oscar Villegas Y Javier Arancibia', 'Luis Perez', '', '', '', 'Durante el día se produjeron varias alarmas de incendio, esto fue debido a que Javier Beltrán se encontraba realizando trabajos en el segundo piso sector C (Unidad de medicina transfusional), debido a esto el equipo de  industrial se encontraba pendiente sobre las alarma para realizar el rearme del sistema inmediatamente. Esto no causo problemas al funcionamiento del hospital.\r\nAl finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 23% Tanque 3: 70%\r\nTanque 2: 55% Tanque 4: 68%', '', '', '- Realizar pendientes de Isaac.'),
(323, 'Reporte General de Eventos - Noche - 24-07-2022', 'Noche', '2022-07-24 07:39:43', 'HBQP-RGE-N-323', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Cristóbal Toro', 'Abel Torres', '', 'Durante el turno trabajo, se produce una  alarma en el Chiller N°3, a lo cual se le notifica a Nicolás Manríquez, técnico de Climatización el cual va a verificar el estado del equipo en terreno, el cual se encontraba con alarma de flujo en el evaporador, al no encontrar nada anormal  decide volver a colocar el equipo en marcha.', '', 'Durante el turno trabajo se realizo cambio de tanque de combustible de caldera, del tanque N°1 al tanque N°2\r\nlos niveles de combustible son los siguientes:\r\ntanque 1: 15%\r\ntanque 2: 52% (en uso)\r\ntanque 3: 73%\r\ntanque 4: 71%', '', '', 'Monitoreo del Chiller N°3, ya que en terreno se encuentra funcionando normalmente, pero en BMS  aparece que sigue alarmado.\r\nContinuar con trabajo dado por Isaac Pérez, profesional de apoyo de control centralizado.'),
(324, 'Reporte General de Eventos - Dia - 24-07-2022', 'Dia', '2022-07-24 19:54:11', 'HBQP-RGE-D-324', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Shai Santibañez', '-Avance en trabajos dejados por Isaac Pérez.', '-Se nos informa sobre gotera en Caseton 5, Claudio Cárcamo informaría e iría a terreno a su respectiva revisión.', '', 'los niveles de combustible son los siguientes:\r\ntanque 1: 14%\r\ntanque 2: 42% (en uso)\r\ntanque 3: 73%\r\ntanque 4: 71%', '-Se realiza instalación de iluminaria en el baño de Caseta N°1.', '', '-Seguir con trabajos dejados por Isaac');
INSERT INTO `reportes_generales` (`idReporte`, `nomReporte`, `turnoReporte`, `fechaReporte`, `folioReporte`, `nomEncargadoTurno`, `nomFuncionariosTurno`, `nomEncargadoTurnoAnterior`, `tareasControlCentralizado`, `tareasInstalaciones`, `tareasEquiposIndustriales`, `tareasIncendiosCombustibles`, `tareasDeteccionElectrica`, `tareasInfraestructura`, `pendientesCoordinacion`) VALUES
(325, 'Reporte General de Eventos - Noche - 25-07-2022', 'Noche', '2022-07-25 07:23:44', 'HBQP-RGE-N-325', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Oscar Villegas Y Javier Arancibia', 'Eduardo Muñoz', '', '', '', 'Niveles de combustible al finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 13% Tanque 3: 71%\r\nTanque 2: 33% Tanque 4: 68%\r\nCabe mencionar que nuevamente se aprecia la alarma en la cámara intersticial del Tanque N°3 según control centralizado, pero el \r\n técnico en terreno confirmo que se trataría de Tanque N°4 quien estaría con la alarma activa. \r\nAdemás se realizara la carga de combustible a las 8:00 de la mañana.', '', 'Durante el turno se reportaron dos aspersores roto, la cual uno de estos se habría informado en la mañana del turno del día 24, el otro aspersor roto estaría ubicado frente al portón 3 cercana a la caseta de seguridad, esto fue informado al técnico de turno de infraestructura y se encuentra en conocimiento sobre lo sucedido. Cabe mencionar que el riego fue apagado debido a que el estanque ya no se encontraba con alarma de sobre nivel.', ''),
(326, 'Reporte General de Eventos - Dia - 25-07-2022', 'Dia', '2022-07-25 19:43:12', 'HBQP-RGE-D-326', 'Felipe Retamal Fuentes', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Diego Montoya', 'Abel Torres', 'Camaras E14, E19 y Parking(Cam-PRK-03=Channel 1) De nuevo En Funcionamiento Correctamente.', '', '', 'Hoy a las 8 AM Carga de Combustible\r\nTANQUE1: 7000; 73%\r\nTANQUE2: 8200; 67%\r\nY ahora \r\nTANQUE1: 70%\r\nTANQUE2: 61% (EN USO)', '', '', 'Dar Acceso Correspondientes a las Personas que el Dia de Hoy se Vinieron a Ingresar al Sistema; Seguir los Trabajos dejados por Isaac Pérez.'),
(327, 'Reporte General de Eventos - Noche - 26-07-2022', 'Noche', '2022-07-26 07:56:27', 'HBQP-RGE-N-327', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Felipe Retamal', '', '', '', '', '', '', ''),
(328, 'Reporte General de Eventos - Dia - 27-07-2022', 'Dia', '2022-07-27 07:58:23', 'HBQP-RGE-D-328', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Diego Montoya', 'Shai Santibañez', '', '', '', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 71% \r\n-tanque 2: 29%', '', '', ''),
(329, 'Reporte General de Eventos - Dia - 27-07-2022', 'Dia', '2022-07-27 20:10:53', 'HBQP-RGE-D-329', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Oscar Villegas Y Javier Arancibia', 'Luis Perez', '', '', '', 'Niveles de combustible al finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 67% Tanque 3: 72%\r\nTanque 2: 20% Tanque 4: 75%\r\nCabe mencionar que el día viernes se realizara carga de combustible a las 11:00 de la mañana.', '', '', '- Dar permisos a personas ingresada durante el día y pendientes anteriores.'),
(330, 'Reporte General de Eventos - Noche - 28-07-2022', 'Noche', '2022-07-28 07:41:54', 'HBQP-RGE-N-330', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett, Cristóbal Toro', 'Abel Torres', '- Se le otorgaron accesos a las personas correspondientes.\r\n- Se terminó el trabajo dado por Isaac Pérez, profesional de apoyo del departamento.', 'Durante la Noche se presentó que Caldera N°1 se detuvo, se le dio aviso a Nicolás Manríquez, Técnico de climatización el cual fue a revisar a terreno la causal de la detención del equipo. Se informa que el equipo se detuvo porque saltó su automático, Nicolás Manríquez revisa en terreno que todo este en orden tanto en equipo Caldera y Bombas y da el aviso de volver a encender el equipo ya reestablecido el magnético.', '', 'Durante el turno trabajado se realizó el cambio de tanque de combustible de Calderas del N°2 al N°1.\r\nLos porcentajes son los siguientes:\r\nTanque 1: 66%\r\nTanque 2: 12%\r\nTanque 3: 74%\r\nTanque 4: 68%', '', '', '- No manipular Valores de la UMA-3-20A, tanto de los CW y VAV como de la UMA, ya que departamento de climatización esta modificando valores constantemente para obtener las renovaciones de aire correspondiente.\r\n- Monitoreo de Caldera N°1 .\r\n- Revisión de UMA-3-6 y 3-21 ya que la 3-6 tiene apagado el VIN y la 3-21 el VEX y se desconoce el motivo.'),
(331, 'Reporte General de Eventos - Dia - 28-07-2022', 'Dia', '2022-07-28 11:16:07', 'HBQP-RGE-D-331', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Shai Santibañez', '', '', '', '', '-Se nos informa desde la sala G-1-27 que tendrían problemas eléctricos en algunos enchufes, se le realiza la entrega de información a los colegas de turno correspondientes, Benjamín Carvajal y Matías Gorigoitia, quienes se dirigen al lugar solucionando dicho problema, al realizar la reparación se nos informa que esta falla se habría producido por un sobre consumo.', '', '-Realizar reinicio de la Bodega I-1-26 esto es pedido por Yorgo Casimis, Personal de apoyo de Control Centralizado'),
(332, 'Reporte General de Eventos - Noche - 29-07-2022', 'Noche', '2022-07-29 07:14:15', 'HBQP-RGE-N-332', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Oscar Villegas Y Javier Arancibia', 'Eduardo Muñoz', '', '', '', 'Niveles de combustible al finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 42% Tanque 3: 72%\r\nTanque 2: 12% Tanque 4: 69%\r\nCabe mencionar que hoy se realizara carga de combustible a las 11:00 de la mañana.', '', '', ''),
(333, 'Reporte General de Eventos - Dia - 29-07-2022', 'Dia', '2022-07-29 19:46:00', 'HBQP-RGE-D-333', 'Jesús Silva Pellet', 'Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Matías Añasco, Diego Montoya', 'Abel Torres', '', 'Se realizaron pruebas en UMAS 3-28, 3-29 y 3-22, las pruebas finalizaron sin ningún inconveniente.\r\nCon hora de 12:10 PM se realizo el encendido de los paneles solares, poniendo en funcionamiento bsap1 y bcpss1r', '', 'Se realizo carga de combustible a las 11:26 Hrs, con una cantidad total en\r\nTanque 1: 9000 Lts\r\nTanque 2: 7900 Lts', '', 'Se encuentra puerta de J-2-4 con falla, por horario no se pudo avisar a Infraestructura, se visitó en terreno para posible arreglo el cual no fue posible.', '- Realizar graficas de Humedad en UMAS\r\n- Dar permisos a Yoana Bañados en PMA: H-2-4'),
(334, 'Reporte General de Eventos - Noche - 30-07-2022', 'Noche', '2022-07-30 07:56:28', 'HBQP-RGE-N-334', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Jesús Silva', '', '', '-Se realiza revisión de gases, aguas blandas, agua caliente y aire .', '', '-Se instalan enchufes de respaldo en los siguientes recintos: J-1-15, J-1-16', '', ''),
(335, 'Reporte General de Eventos - Dia - 30-07-2022', 'Dia', '2022-07-30 19:45:54', 'HBQP-RGE-D-335', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Gabriel Morales, Nicolás Droguett, Cristóbal Toro', 'Eduardo Muñoz', 'Jaime Estay, Técnico de Control Centralizado realizo durante el día trabajos en el control de acceso', '', '', 'No se presentaron acontecimientos durante el turno trabajado\r\nLos niveles de combustible son los siguientes:\r\ntanque 1: 50% ( en funcionamiento)\r\ntanque 2: 65%\r\ntanque 3: 73%\r\ntanque 4: 71%', '', 'Se presento una fuga en el recinto C-2-10  de laboratorio, a lo cual departamento de infraestructura llama gasfíter para poder reparar la fuga de dicho recinto, la cual queda reparada pero se debe mantener en monitoreo durante el turno de noche.', 'Trabajos en BMS  dado por Isaac Pérez, profesional de apoyo de control centralizado.\r\nMonitoreo de Sala C-2-10 para evitar fugas.\r\nActualización de las puertas del control de acceso.'),
(336, 'Reporte General de Eventos - Noche - 31-07-2022', 'Noche', '2022-07-31 07:37:43', 'HBQP-RGE-N-336', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Diego Montoya', 'Shai Santibañez', '', 'Durante el turno de hoy, se produce una filtración en el caseton 1, esta filtración ocurrió en la UMA-S1-15 en la tuerca del acople con el agua caliente, a esta se le realiza un apriete en la tuerca y se soluciona la pequeña fuga.', '', '', '', '', ''),
(337, 'Reporte General de Eventos - Dia - 31-07-2022', 'Dia', '2022-07-31 19:14:09', 'HBQP-RGE-D-337', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Oscar Villegas Y Javier Arancibia', 'Luis Perez', '', 'Durante el turno en conjunto con Alexis Jara técnico del departamento de climatizacion, se realizaron los ajustes de renovaciones de aire en los siguientes equipos.\r\nVAV-2-18(49% Forzado), VAV-2-20(15% Forzado), VAV-2-21(49% Forzada), VAV-2-22(55% Forzada), VAV-2-25(81% Forzada), VAV-2-25B(100% Forzado, VAV-2-25C(100% Forzado), VAV-2-26(75% Forzado), VAV-2-32( 100% Forzado) y VAV-2-35(100% Forzado).\r\nTodos estas apertura de dámper son las mas adecuadas para las renovaciones según lo que indica proyecto.\r\nAdemás la VAV-2-24 que se encuentra forzada a 100% de apertura en su dámper, no logro llegar a las renovaciones adecuadas.', 'Por parte del técnico de industrial Javier Arancibia, reviso los recinto de Urgencia Gineco-Obstetricia y Urgencia Infantil, la cual a estos recintos se realizo la toma de gases clínicos ( Oxígeno médico, aire medicinal y vacío), además se reviso el suministro de agua caliente en el sistema, suministro de agua blanda y osmótica.\r\nTambién se inspecciono nuevamente los recinto toma de muestra y ciertas áreas en donde se encuentran tomas de gases y suministro de agua caliente en procedimiento adulto-infantil.', '', '', '', ''),
(338, 'Reporte General de Eventos - Noche - 01-08-2022', 'Noche', '2022-08-01 07:28:08', 'HBQP-RGE-N-338', 'Nicolas Droguett Hormazabal', 'Nicolás Manríquez, Benjamín Vergara, Gabriel Morales, Nicolás Droguett, Cristóbal Toro.', 'Abel Torres', 'En conjunto con Nicolás Manríquez, Técnico del Dpto. de Climatización, se realizaron revisiones en los equipos correspondientes a la zona de Laboratorio. Durante la jornada se intervinieron las VAV\'s de las siguientes UMA\'s:\r\n- UMA-3-26A\r\n- UMA-3-2\r\n- FC-1-13 \r\nCabe mencionar que la revisión de las renovaciones de aire en el equipo VAV-2-23 perteneciente a la UMA-3-26A no se pudo regular debido a que equipos refrigerantes interrumpían con la realización del trabajo.', '', '', 'No se reportan problemas durante el turno trabajado. Los niveles de combustible visualizados en BMS al término de la jornada son:\r\n- Tanque 1: 19%\r\n- Tanque 2: 64%\r\n- Tanque 3: 72%\r\n- Tanque 4: 70%', '', 'Se reporta que soporte de puerta en subterráneo, que da a la salida de patio de camiones, se encuentra en mal estado.', '- Mantener en monitoreo UMA\'s de recintos entregados y Laboratorio, verificar que temperaturas se encuentren dentro de los parámetros establecidos.\r\n- No manipular UMA-3-20A, UMA-3-28, UMA-3-51, UMA-3-26, UMA-3-26A, UMA-3-30, UMA-3-31, UMA-S1-9, ni los equipos que estén relacionados a dichas UMA\'s. A menos que personal del Dpto. de Climatización solicite modificar algún parámetro.'),
(339, 'Reporte General de Eventos - Dia - 01-08-2022', 'Dia', '2022-08-01 08:37:05', 'HBQP-RGE-D-339', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Shai Santibañez', '', 'UMA-3-26 y UMA-3-26A: Se realiza cambio de banda muerta, ya que esta seria de 1,5°C lo cual según las temperaturas indicadas por proyecto (a la zona que alimentaria esta UMA) serian elevadas, por ende se le rebaja a 1°C, haciendo que estas sean o intenten ser las mas adecuadas por proyecto.', '', 'Se realiza cambio de estanque N°1 a N°2 por orden de Matías Gutiérrez', '', '', '-Realizar trabajos dejados por Isaac Pérez.'),
(340, 'Reporte General de Eventos - Noche - 02-08-2022', 'Noche', '2022-08-02 07:53:56', 'HBQP-RGE-N-340', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Oscar Villegas Y Javier Arancibia', 'Eduardo Muñoz', '', 'Durante el turno en conjunto con Alexis Jara técnico del departamento de climatizacion, se\r\nrealizaron los ajustes de renovaciones de aire en los siguientes equipos.\r\nVAV-1-81(35% Forzado), VAV-1-82(40% Forzado), VAV-1-83(83% Forzada), VAV-1-84(80%\r\nForzada), VAV-1-88(35% Forzada), VAV-1-89(38% Forzado, VAV-1-93(10% Forzado),\r\nVAV-1-95(36% Forzado), VAV-1-303(43% Forzado) y la CW-1-3(67% Forzado). Todos estos equipos pertenecen a la UMA-3-5 la cual se encuentra climatizando el sector de urgencia Gineco-Obstetricia.\r\nTodos estas apertura de dámper son las mas adecuadas para las renovaciones según lo que indica proyecto.', 'Por parte del técnico de industrial Javier Arancibia, se realizo una revisión final a los recinto de urgencia infantil y urgencia Gineco-Obstetricia, además se comenzó con la revisión de las tomas de gases clínicos (Oxígeno médico, aire medicinal y vacío) en urgencia adulto.', 'Niveles de combustible al finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 10% Tanque 3: 70%\r\nTanque 2: 53% Tanque 4: 72%', '', '', ''),
(341, 'Reporte General de Eventos - Dia - 02-08-2022', 'Dia', '2022-08-02 19:24:44', 'HBQP-RGE-D-341', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Diego Montoya', 'Abel Torres', '', '', '', 'Durante el turno de hoy, se activa alarma de incendio en piso 5 sector 5.3, esta activación se debió a que personal medico del lugar habría tirado la palanca de alarma de incendio. Se normaliza estado de la alarma luego de comprobar que efectivamente esta abría sido una falsa alarma.', '', '', ''),
(342, 'Reporte General de Eventos - Noche - 03-08-2022', 'Noche', '2022-08-03 03:10:01', 'HBQP-RGE-N-342', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Luis Perez', '-Se entregan permisos a las personas ingresadas durante el turno anterior.\r\n-Se terminan trabajos encomendados por Isaac Pérez.\r\n-Se realizan Indicaciones dejadas por don Lizandro Varela.', '-Durante el turno Claudio Cárcamo realiza revisiones en terreno, midiendo renovaciones de los recintos en los sectores H, I, J.\r\n-Se realiza revisión de sectores los cuales visitara seremi durante la jornada.', '', 'Niveles de combustible al finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 12% \r\nTanque 2: 34%', '-Se realizar revisiones de enchufes y luminarias en los recintos de los sectores H, I, J.', '-Durante la revisión de los recintos Benjamín Carvajal informaría sobre una gatera, la cual no cerraría de un costado y en las sala de urgencias faltaría una tapa en el cielo.', '-Coordinar carga de combustible con departamento industrial.'),
(343, 'Reporte General de Eventos - Dia - 03-08-2022', 'Dia', '2022-08-03 19:52:15', 'HBQP-RGE-D-343', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Gabriel Morales, Nicolás Droguett, Cristóbal Toro', 'Eduardo Muñoz', '', '', '', 'Durante la jornada se realizo recarga de combustible en los tanque de combustible de las calderas\r\nlos niveles al terminar la jornada son los siguientes:\r\ntanque 1:67%\r\ntanque 2:59% (en uso)\r\ntanque 3:71%\r\ntanque 4:71%', '', '', 'Dar los permisos correspondientes a las personas ingresadas durante la Jornada.'),
(344, 'Reporte General de Eventos - Noche - 04-08-2022', 'Noche', '2022-08-04 07:33:47', 'HBQP-RGE-N-344', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Diego Montoya', 'Shai Santibañez', '', '', '', 'Nivel de combustible al entregar turno\r\nCALDERA:\r\n-tanque 1: 67% \r\n-tanque 2: 48% EN USO.', '', '', ''),
(345, 'Reporte General de Eventos - Dia - 04-08-2022', 'Dia', '2022-08-04 15:35:07', 'HBQP-RGE-D-345', 'Jaime Estay Jorquera', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Javier Arancibia, Oscar Villegas Y Mauricio Maicheo', 'Luis Pérez', '', '', '', '', '', '', ''),
(346, 'Reporte General de Eventos - Dia - 04-08-2022', 'Dia', '2022-08-04 19:22:05', 'HBQP-RGE-D-346', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Javier Arancibia, Oscar Villegas Y Mauricio Maicheo', 'Luis Perez', '', '', 'Durante el turno personal de guardia le informa a Brian Páez Gaete personal de industrial, que una persona se encontraría atrapada en el ascensor piso 6 la cual no se especificaba exactamente cual era el elevador. Después de unos minutos el mismo guardia da aviso que la supuesta persona que se encontraba atrapada habría logrado salir, cabe señalar que en el monitor de ascensores ubicado en control centralizado no mostraba uno detenido. Matías Gutiérrez logra ubicar a la supuesta persona que quedo atrapada en el ascensor y se trataría Fabian Navarro personal de aseo que habría quedado atrapado entre el ascensor y la puerta que da hacia el pasillo principal del piso 6. Todo la información entregada era totalmente distinta.', 'Durante la tarde se reporto una alarma de incendio en el sector 1.2, la cual se le da aviso al personal de industrial y se dirigen al lugar, pero se trataría de una falsa alarma debido a que personal de incendio estaría trabajando y ellos habrían activado el sensor.\r\n\r\nLuego varios minutos después se volvería activar una alarma de incendio pero esta vez seria en el sector 6.2, la cual Javier Arancibia y Guillermo Hidalgo verificaron el problema, y se trataría de un detector que estaría con bastante suciedad y esto activaba constantemente el sensor, Guillermo Hidalgo da la orden de rearmar el sistema ya que seria una falsa alarma y además deshabilitar el modulo ya que el día de mañana la empresa de incendio solucionara el problema.', '', 'Durante el turno Benjamín Toloza técnico del departamento de climatizacion, informo que la sala de comunicación que pertenece a la UCA-17-P2/Puerta 3 frente a la sala trabajo sucio H-2-31, se encontraría con la manilla dañada la cual impedía su apertura como corresponde, Gabriel Chacón personal de infraestructura se acerco al lugar y logro solucionar el problema como corresponde.', ''),
(347, 'Reporte General de Eventos - Noche - 05-08-2022', 'Noche', '2022-08-05 07:53:03', 'HBQP-RGE-N-347', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Gabriel Morales, Nicolás Droguett, Cristóbal Toro', 'Abel Torres', 'Se realizo avance en trabajo dado por  Lizandro Varela, Jefe de Unidad de Control Centralizado.\r\nSe otorgaron los accesos a las personas ingresadas durante la jornada del día.', '', '', 'No se presentaron acontecimientos durante el turno trabajado\r\nLos niveles de combustible son los siguientes:\r\ntanque 1: 60% \r\ntanque 2: 23% ( en funcionamiento)\r\ntanque 3: 72%\r\ntanque 4: 69%', '', '', ''),
(348, 'Reporte General de Eventos - Dia - 05-08-2022', 'Dia', '2022-08-05 17:48:15', 'HBQP-RGE-D-348', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Shai Santibañez', '-Se ingresan a las distintas personas que vendrían a activar sus tarjetas durante la jornada.', '-Se realizan cambios en distintos equipos correspondientes al equipo de clima, estos son modificados ya que estarían viendo renovaciones de aire, Claudio Cárcamo en conjunto de Víctor Fierro y Javier Beltrán estarían viendo lo antes mencionado.\r\n-Javier Beltrán nos informa que el filtro G4 de la UMA-3-22; el filtro antes dicho estaría limpio desde terreno y en control se mostraría sucio.', '', '-Se registran diversas alarmas de incendio, una de estas seria por trabajos en bombas de flujo de agua, y las otras alarmas serian por trabajos en distintos sectores las cuales se activarían por polvo levantado por los trabajos realizados.\r\n-se nos informa que en la sala de espera de URGENCIA  se encuentra gabinete red de incendio con agua que esta goteando, esto se le informa a Matías Gutiérrez quien se dirige a dicho punto.\r\n\r\nLos niveles de combustible son los siguientes al termino de la jornada:\r\ntanque 1: 60%\r\ntanque 2: 18% ( en funcionamiento)\r\ntanque 3: 72%\r\ntanque 4: 71%', '', '-Se nos informa desde Box Matronas Aro-Gine de un baño el cual estaría con fugas, este baño tendría el PMA E-2-11, esta información se le entrega a personal de Infraestructura.\r\n-Lizandro Varela informa sobre fuga en pasillo TH P3 Zona B cerca de Control Centralizado.', '-Dar accesos a las personas ingresadas durante la jornada de hoy.\r\n-Realizar trabajos dejados por Lizandro Varela.'),
(349, 'Reporte General de Eventos - Noche - 06-08-2022', 'Noche', '2022-08-06 07:26:00', 'HBQP-RGE-N-349', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Javier Arancibia, Oscar Villegas Y Mauricio Maicheo', 'Eduardo Muñoz', '', 'Durante el turno se realizaron ajustes de renovaciones en los recintos de UPC, esto se hizo junto a Alexis Jara y Mauricio Maicheo técnicos del departamento de climatizacion, la cual lograron dejar los recintos con sus renovaciones adecuadas.', '', 'Los niveles al finalizar el turno son.\r\nTanque 1: 57%\r\nTanque 2: 12%\r\nTanque 3: 75%\r\nTanque 4: 71%\r\nCabe mencionar que el día lunes se realizara carga de combustible según el comunicado por parte de Matías Gutiérrez profesional del departamento de industrial.', '', '', ''),
(350, 'Reporte General de Eventos - Dia - 06-08-2022', 'Dia', '2022-08-06 19:53:03', 'HBQP-RGE-D-350', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Diego Montoya', 'Abel Torres', '', '', 'Durante el turno de hoy, bomba 2 de Peall 2 presento una alarma, al revisar el estado del equipo este presentaba paro por el térmico a lo cual este se normaliza rápidamente ya que Peall se encontraba trabajando en el momento.', 'Durante el turno de hoy, técnico Javier Bustamante encuentra una manilla caída en shaft de clima en piso 4 junto al ascensor ubicado en los ejes \"KL\" a lo que se informa a jefatura del área.', '', '', ''),
(351, 'Reporte General de Eventos - Noche - 07-08-2022', 'Noche', '2022-08-07 06:59:26', 'HBQP-RGE-N-351', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Luis Perez', '', '-Claudio Cárcamo realiza mediciones de renovaciones.', '-Equipo de Industrial realiza revisión de tapa de válvulas', 'Los niveles de combustible son los siguientes al termino de la jornada:\r\ntanque 1: 40% ( en funcionamiento)\r\ntanque 2: 9%\r\ntanque 3: 72%\r\ntanque 4: 71%', '-Equipo eléctrico realiza revisión de luminarias y enchufes en sector UPC.\r\n-Se desconecta luminaria de caseta 1 de los guardias, esto se realiza a raíz de que abría una gotera la cual caería en esta misma.', '-Se reporta gotera en caseton 1 de guardias.', ''),
(352, 'Reporte General de Eventos - Dia - 07-08-2022', 'Dia', '2022-08-07 19:42:49', 'HBQP-RGE-D-352', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Gabriel Morales, Nicolás Droguett, Cristóbal Toro', 'Eduardo Muñoz', 'En revisión de cámaras se encuentra que debido a las lluvias se encuentran caídas las siguientes cámaras:\r\nE14\r\nE19\r\nE35 (Helipuerto)\r\nSolamente se puedo volver a colocar en línea la cámara E14\r\nActualmente siguen caída las siguientes:\r\nE19\r\nE35 (Helipuerto)', 'En la revisión del sistema BMS de la mañana se presenta que se activo el automático de la BCAP-5, Nicolás Manríquez técnico de climatización verifica en terreno que todo se encuentre como corresponde y en conjunto con Benjamín Vergara, técnico eléctrico proceden a volver a colocar en marcha la bomba y junto con esta nuevamente la caldera N°1', '', 'No se presentaron acontecimientos durante el turno trabajado\r\nLos niveles de combustible son los siguientes:\r\ntanque 1: 31%  ( en funcionamiento)\r\ntanque 2: 11% \r\ntanque 3: 75%\r\ntanque 4: 72%', '', 'Durante la jornada Shaft de clima del piso 4 vuelve a filtrar, ya que reparaciones del Piso 7 no fueron optimas, al llegar al lugar se encuentra con silicona en los puntos de fuga  que no se encontraba solida y producto de esto volvió a filtrar, técnicos de turno implementan tapar  el punto de fuga nuevamente con cinta americana para poder contener la situación hasta que departamento de infraestructura pueda reparar la fuga.', 'Avisar al turno siguiente sobre la carga de combustible.\r\nContinuar con revisión de puertas.\r\nTener temperaturas de urgencia adulto e infantil optimas para visita de la seremi.'),
(353, 'Reporte General de Eventos - Noche - 08-08-2022', 'Noche', '2022-08-08 08:20:14', 'HBQP-RGE-N-353', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Diego Montoya', 'Shai Santibañez', '', '', '', '', '', '', ''),
(354, 'Reporte General de Eventos - Dia - 08-08-2022', 'Dia', '2022-08-08 19:40:15', 'HBQP-RGE-D-354', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Javier Arancibia, Oscar Villegas Y Mauricio Maicheo', 'Luis Perez', 'Durante la mañana se presento una des comunicación de cámaras en el piso 6 y UCAS, se le da aviso al departamento de tics para verificar la causa del problema, al parecer se trataría de que el rack RH6A y todo lo que se encuentra conectado a dicho equipo se habría quedado sin energía, esto es debido a que Fabian Córdova con la empresa MYK se encontraba realizando adecuaciones en el piso superior. Las únicas cámaras que se encontraron con comunicación son las 424, 425 y 432. Las UCAS que se vieron afectadas fueron las 01, 02, 03 y 04 del piso 6.', 'Durante el turno los técnicos y jefe del departamento de climatizacion realizaron una reparación en el sistema de agua caliente específicamente el FC-S1-53. Esta reparación se realizo debido a que se habría quebrado la llave de corte que tenia el sistema de agua caliente hacia el Fancoil, debido a esto se tuvo que realizar el apagado de toda la central termica para poder solucionar dicho  problema con llave de corte. \r\n\r\nAl finalizar el turno ya los trabajos en el FC-S1-53 se habrían terminado sin causar problemas mayores quedando en perfecto estado.', '', 'Durante el turno se realizo carga de combustible iniciando con 16% en el tanque 1 (1000 LTS en terreno) y 12% en el tanque 2 (1000 LTS en terreno), en total quedaron los dos tanque en 7000  litros.\r\nTanque 1: 52%\r\nTanque 2: 52%\r\nTanque 4: 70%\r\nTanque 3: 71%', '', '', ''),
(355, 'Reporte General de Eventos - Noche - 09-08-2022', 'Noche', '2022-08-09 07:29:01', 'HBQP-RGE-N-355', 'Nicolas Droguett Hormazabal', 'Nicolás Manríquez, Benjamín Vergara, Gabriel Morales, Nicolás Droguett, Cristóbal Toro', 'Abel Torres', '- Se otorgaron permisos correspondientes.\r\n- Se continuó con trabajo de control de acceso de puertas en piso 4, 5, 6 y 7.', 'Debido a la ruptura en una llave de corte de aguas calientes durante el turno pasado, se mantuvieron apagadas las calderas durante la jornada del día de ayer. A la entrega de turno se normalizó central térmica, Nicolás Manríquez, Técnico del Dpto. de Climatización, revisó en terreno las presiones de las bombas, normalizando el sistema de aguas calientes. Se realizó el encendido de Calderas 1, 2, 3 y 5. Caldera 3 presentó condensación a las 7:40Hrs., por lo cual se realizó cambio a caldera 4. A la finalización del turno calderas quedan operativas sin complicaciones.', 'Se detecta alarma por nivel alto en estanque de riego, se procedió a activar aspersores por un breve tiempo reduciendo el nivel del estanque y eliminando la alarma en sistema BMS.', 'No se presentaron problemas durante el turno trabajado. Los niveles de combustible en sistema BMS son:\r\n- Tanque 1: 38%\r\n- Tanque 2: 52%\r\n- Tanque 3: 75%\r\n- Tanque 4: 71%', '', '', '- Realizar monitoreo de UMA\'s en recintos entregados.\r\n- Monitoreo de presiones de sistema de aguas calientes.'),
(356, 'Reporte General de Eventos - Dia - 09-08-2022', 'Dia', '2022-08-09 20:10:39', 'HBQP-RGE-D-356', 'Joaquín Jorquera Gonzalez', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Shai Santibañez', 'Se fuerza encendido de las luminarias del piso 2 sector G. debido a apagones por presunto canal horario.', '-UMA S1-15: Se sube Set Point de INY a 200Pa.   Filtro de calor es dejado en AUTOMATICO.    Set Ret se sube a 23°C.\r\n-UMA S1-33: Se baja su Set INY a 19°C.   Se deja el VEX en AUTOMATICO.  Se deja válvula muerta en 1°C.\r\n-UMA 3-7: Se baja Set Ret a 19°C.\r\n-UMA 3-16A / 16E / 16J: Se apagan Humificadores por goteras,  luego  de que repararan las goteras se volvieron a poner en marcha.', '', '-Se activa alarma de incendio en el sector 1.9, donde se identifico que salto en alarma el detector de humo y luces.\r\nSe verifica en terreno y se notifica una falsa alarma, ya que se encontraban realizando trabajos en el sector y se activo un sensor de humo, por el levantamiento de polvo.\r\n-Se activa alarma de incendio en el sector 1.8 - aspiración 22, donde se identifico que salto en alarma LCS.\r\nSe verifica en terreno y se notifica una falsa alarma, ya que se encontraban realizando trabajos en el sector y se activo un sensor de humo, por el levantamiento de polvo.', '', 'Mantención de la puerta principal.', 'Dar permisos a Pre-quirúrgica.\r\nDar permisos de nuevo formato HD.\r\nSe deja apagado ascensor A6-2 hasta mañana.'),
(357, 'Reporte General de Eventos - Noche - 10-08-2022', 'Noche', '2022-08-10 07:54:49', 'HBQP-RGE-N-357', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Javier Arancibia, Oscar Villegas Y Mauricio Maicheo', 'Joaquín Jorquera', '', '', '', 'Salta alarma de cámara intersticial en el tanque 1 que suministra combustible a las calderas, Javier Arancibia técnico del departamento industrial se dirige a terreno y confirma la alarma en el tablero que se encuentra en patio de carga, al revisar el tanque el frasco se encontraría con un poco de agua el técnico intento quitar un poco de agua para que así no siguiera censando.\r\nAl finalizar el turno la alarma continua pero el encargado dará aviso para su revisión.\r\nNiveles de combustible al finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 19% Tanque 3: 73%\r\nTanque 2: 53% Tanque 4: 75%', '', 'Durante la mañana Neila Núñez personal de logística, reporto una posa de agua en el pasillo principal del piso 3, esta filtración que vine a por las orillas del ventanal seria debido a la cantidad de agua que se encentraba cayendo desde el piso 4 según lo informado por infraestructura. Se le dio aviso al departamento y harán una revisión para verificar la causa de la acumulación de agua en el pasillo.', ''),
(358, 'Reporte General de Eventos - Dia - 10-08-2022', 'Dia', '2022-08-10 20:21:13', 'HBQP-RGE-D-358', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Diego Montoya', 'Abel Torres', '', '', 'Realizar cambio de tanque de combustible de calderas. \r\nDar los accesos correspondientes', 'Durante el turno de hoy, ocurren 2 alarmas de incendio (falsa alarma) en área rayo osteopulmonar, piso 1 sector 1.19.\r\nSistema normalizado recinto se encontraba vacío y sin nada que alarmara el equipo se informa a empresa de incendio para que revise el equipo y la otra alarma de incendio en piso 1, sector 1.3 correspondiente a módulo de aspiración.', '', 'Durante el turno de hoy, empresa SACYR realiza trabajos de reapariciones de infraestructura en el piso 7 además de impermeabilizar techo mecánico 4 y 5.', ''),
(359, 'Reporte General de Eventos - Noche - 11-08-2022', 'Noche', '2022-08-11 07:45:06', 'HBQP-RGE-N-359', 'Abel Torres Arancibia', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Luis Pérez', '', '', '', 'Durante el turno se presento una alarma de incendio en el sector 1.4 unidad salud mental adulto zona C, tras revisar el recinto se trataría de una falsa alarma, el equipo la cual se encontraba alarmando seria un sensor de humo, este detector se alarmaba constantemente. Debido a esto el técnico de incendio procedió a dejar deshabilitado el modulo para su revisión al día siguiente por parte de la empresa.\r\nNiveles de combustible al finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 13% Tanque 3: 70%\r\nTanque 2: 44% Tanque 4: 69%', '', '', ''),
(360, 'Reporte General de Eventos - Dia - 11-08-2022', 'Dia', '2022-08-11 19:48:41', 'HBQP-RGE-D-360', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett, Cristóbal Toro', 'Abel Torres', '', 'Durante la jornada Chiller N°3 presente alarma de flujo evaporador, a lo que Nicolás Manríquez, técnico de climatización se dirige a terreno  a verificar que todo se encuentre en estado optimo, ya con todo verificado coloca el equipo nuevamente en marcha.', '', '', '', '', 'Dar los accesos correspondientes a las personas ingresadas durante la jornada de hoy.\r\nRevisar formatos enviados al correo de sala de control para dar los accesos correspondientes\r\ninformar al turno siguiente que la carga de combustible se realizara entre las 11:00 y 11:30 de la mañana.'),
(361, 'Reporte General de Eventos - Noche - 12-08-2022', 'Noche', '2022-08-12 08:12:01', 'HBQP-RGE-N-361', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Diego Montoya', 'Shai Santibañez', '', '', '', 'Niveles de combustible al finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 12% Tanque 3: 70%\r\nTanque 2: 21% Tanque 4: 72%', '', '', 'Terminar de dar accesos a H y S \r\nRevisar UCA-15-P3/P2'),
(362, 'Reporte General de Eventos - Dia - 12-08-2022', 'Dia', '2022-08-12 13:58:52', 'HBQP-RGE-D-362', 'Abel Torres Arancibia', 'Benjamín Toloza, Alejandro Saavedra, Javier Arancibia Y Oscar Villegas', 'Luis Perez', '', '', 'Durante el turno se realizo la reparación del ascensor A1-1 por el técnico Marcos Torres, esto fue debido a que se encontraba en el subterráneo con sus puerta constantemente apresurándose, además el ascensor A6 en sus dos nucleas han estado presentando fallas continuamente con sus puertas, el técnico encargado Marcos Torres se encuentra supervisando el funcionamiento de dicho elevador.', 'Durante el turno se realizo carga de combustible, el tanque 1 se encontraba con 12% en control centralizado y con 2000 litros desde terreno, el tanque 2 se encontraba con 20% en control centralizado. Al terminar la carga el Tanque 1 quedo con7100 litros de combustible y el tanque 2 quedo con 8000 litros.', '', '', '- Terminar de dar accesos a H y S\r\n- Dar nuevamente los permisos a Paulina Arriagada Inzunza de la unidad de hospitalización domiciliaria.'),
(363, 'Reporte General de Eventos - Dia - 12-08-2022', 'Dia', '2022-08-12 20:14:16', 'HBQP-RGE-D-363', 'Joaquín Jorquera Gonzalez', 'Javier Arancibia. Benjamin Toloza, Oscar Villega, Mauricio Maicheo, Alejandro Saavedra', 'Luis Perez', '-Se apaga rac: RH4A a peticion del equipo de tics por trabajos en las ucas-6-P4 / ucas-7-P4.', '', '', '-Se notifica alarma roja de incendio por parte de CCTV en el sector 2.1 en el piso 2 saltando DET, DPS, LCS, PTS. Se contempla como una falsa alarma y se procede a volver a armar el sector.\r\n-Guardia de CCTV informa la activación de una alarma de incendio,   el sector alarmado es el 1.1.\r\nSe verifica en terreno y se notifica una falsa alarma, ya que se encontraban realizando trabajos en el sector y se activo un sensor de humo, por el levantamiento de polvo.\r\n\r\n-T1: 12% = 57%\r\n-T2: 20% = 64%', '', '', ''),
(364, 'Reporte General de Eventos - Noche - 13-08-2022', 'Noche', '2022-08-13 07:44:54', 'HBQP-RGE-N-364', 'Shai Santibáñez Osses', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Nicolás Droguett, Cristóbal Toro', 'Joaquín Jorquera', 'Se otorgaron los accesos correspondientes a las personas ingresadas durante la jornada del día.', '', '', 'Niveles de combustible al finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 58% \r\nTanque 2: 43% \r\nTanque 3: 73%\r\nTanque 4: 71%', '', '', ''),
(365, 'Reporte General de Eventos - Dia - 13-08-2022', 'Dia', '2022-08-13 19:25:36', 'HBQP-RGE-D-365', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Shai Santibañez', 'Se realizan trabajos dejados por Isaac Pérez.\r\nYorgo en conjunto de Felipe Retamal trabajan en llamado a enfermería.', 'Como observación: se desmalla personal de aseo industrial, acude SAMU a los casetones para su auxilio además nos acercamos en caso de necesitar ayuda.', 'Durante el turno se encuentra ascensor A17 fuera de servicio.', 'Niveles de combustible al finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 59%\r\nTanque 2: 34%\r\nTanque 3: 73%\r\nTanque 4: 71%', '', '', ''),
(366, 'Reporte General de Eventos - Noche - 14-08-2022', 'Noche', '2022-08-14 08:11:51', 'HBQP-RGE-N-366', 'Abel Torres Arancibia', 'Alexis Jara, Alejandro Saavedra, Javier Arancibia, Oscar Villegas Y Mauricio Maicheo', 'Eduardo Muñoz', '', 'Durante el turno se noto que en los baños de personal ubicados en el tercer piso estaban sin extracción, Alexis Jara junto a Mauricio Maicheo revisaron el equipo en terreno y este estaría con su paco de seguridad deshabilitado, se desconocen los motivos que hubieron para deshabilitar el paco de seguridad del VEX-7-22B. Por lo tanto los técnico de climatizacion Alexis Jara junto con Mauricio Maicheo hicieron la revisión preventiva y al no encontrar nada fuera de lo normal, se volvió a dejar en funcionamiento el equipo sin ninguna novedad.', 'Javier Arancibia técnico del departamento industrial da aviso que el ascensor A17-1 quedo apagado desde el programa en CCTV y con sus automáticos deshabilitado desde terreno, esto fue debido a que el ascensor estaba presentando fallas y sus puertas no cerraban por completo, se dejo cartel de \"Equipo en mantención\" para advertir que el elevador no se debe utilizar.', 'Niveles de combustible al finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 58% Tanque 3: 72%\r\nTanque 2: 25% Tanque 4: 69%', '', '', ''),
(367, 'Reporte General de Eventos - Dia - 14-08-2022', 'Dia', '2022-08-14 19:59:01', 'HBQP-RGE-D-367', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Diego Montoya', 'Abel Torres', '', '', '', 'Niveles de combustible al finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 59% Tanque 3: 72%\r\nTanque 2: 17% Tanque 4: 71%', '', '', ''),
(368, 'Reporte General de Eventos - Noche - 15-08-2022', 'Noche', '2022-08-15 07:40:46', 'HBQP-RGE-N-368', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Luis Perez', '-Se nos informa de una persona la cual se estaría asomando por la pandereta que esta en sector Sala Cuna.', '-Se detiene Chiller 3 por alarma de supervisión, se le informa a Claudio Cárcamo de esto quien acude al lugar, viendo que ya no permanecería el problema se vuelve a colocar en funcionamiento.', '', 'Se realiza cambio de Combustible, de estanque 2 a estanque 1.\r\nNiveles de combustible al finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 52%\r\nTanque 2: 12%\r\nTanque 3: 73%\r\nTanque 4: 71%', '', '', ''),
(369, 'Reporte General de Eventos - Dia - 15-08-2022', 'Dia', '2022-08-15 19:32:08', 'HBQP-RGE-D-369', 'Nicolas Droguett Hormazabal', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Shai Santibáñez, Cristóbal Toro.', 'Eduardo Muñoz', 'Durante la jornada se identificó que una cámara del exterior, CAM-E35-H2 situada en el helipuerto, se encontraba desconectada. Se revisó en terreno y no se encontró el punto de red correspondiente en el rack RH6A, que según planos es P05-C117, sin embargo, en terreno solo llegaba hasta C107.', '', '', 'Se presentó alarma en la cámara intersticial del Tanque 1 de combustibles, personal de industrial identificó que se encontraba con agua, vaciaron el contenido normalizando el equipo. No se presentaron mayores inconvenientes durante el turno trabajado. Los niveles de combustibles al término del turno son:\r\n\r\n- Tanque 1: 40%\r\n- Tanque 2: 13%\r\n- Tanque 3: 78%\r\n- Tanque 4: 73%', '', '', '- Revisar UMA\'s de recintos entregados. Monitoreo de temperaturas.'),
(370, 'Reporte General de Eventos - Noche - 16-08-2022', 'Noche', '2022-08-16 07:53:47', 'HBQP-RGE-N-370', 'Luis Pérez Bernal', 'Matías Añazco, Cristopher Saavedra, Dilhan Saavedra, Javier Bustamante, Diego Montoya', 'Shai Santibañez', '', '', '', 'Niveles de combustible al finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 30% Tanque 3: 71%\r\nTanque 2: 12% Tanque 4: 68%', '', '', ''),
(371, 'Reporte General de Eventos - Dia - 16-08-2022', 'Dia', '2022-08-16 19:59:07', 'HBQP-RGE-D-371', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Javier Arancibia, Oscar Villegas Y Mauricio Maicheo', 'Luis Pérez', '', 'Durante el turno se realizo revisiones en el piso N°4 por parte de Alexis Jara técnico del departamento de climatizacion, lo que se reviso fueron recintos donde se hará la visita por parte de seremi. \r\nLos equipos que se revisaron fueron las VAV-4-52, VAV-4-97, VAV-4-105 y la CW-4-27. Estos recintos quedaron con las renovaciones adecuada según lo indicado por proyecto.', 'Durante el turno el ascensor A8-2 presento problemas de funcionamiento en el piso 1, la cual Marcos Torres técnico de la empresa thyssenKrupp le realizo las reparaciones y quedo totalmente operativo. Además Marcos Torres informo que el ascensor A17-1 quedara fuera de servicio debido a problemas mayores, la revision se realizara el día de mañana según lo informado por Marcos Torres técnico de la empresa thyssenKrupp.', 'Combustible al finalizar turno.\r\nTanque N°1: 25%\r\nTanque N°2: 11%\r\nTanque N°3: 75%\r\nTanque N°4:  73%\r\nCabe mencionar que Matías Gutiérrez informo que el día de mañana se realizara carga de combustible entre 11:00 y 11:30 de la mañana.', '', '', 'Actualizar Grupo de puertas SC TH P1\r\nDar permisos correspondientes a las personas ingresadas.'),
(372, 'Reporte General de Eventos - Noche - 17-08-2022', 'Noche', '2022-08-17 07:16:54', 'HBQP-RGE-N-372', 'Nicolas Droguett Hormazabal', 'Nicolás Manríquez, Benjamín Vergara, Oscar Gacitúa, Gabriel Morales, Shai Santibáñez, Cristóbal Toro', 'Abel Torres', '- Se otorgaron los permisos correspondientes al personal ingresado durante el turno anterior.\r\n- Se actualizaron Salas de Comunicación en el Sistema de Control de Acceso, debido a problemas presentados.', 'Nicolás Manríquez, Técnico del Dpto. de Climatización, realizó las revisiones de equipos de los recintos del 4to piso. En Conjunto con Control Centralizado se realizaron los ajustes de renovaciones de aire.', '', 'No se presentaron mayores dificultades durante el turno trabajado. Los niveles de combustible al término del turno visualizados en sistema BMS son:\r\n- Tanque 1: 14%\r\n- Tanque 2: 10%\r\n- Tanque 3: 75%\r\n- Tanque 4: 71%', '', '', '- Mantener el monitoreo de UMA\'s de recintos entregados.\r\n- Tener en observación equipos del 4to piso, lugar donde se presentará Seremi.'),
(373, 'Reporte General de Eventos - Dia - 17-08-2022', 'Dia', '2022-08-17 19:30:42', 'HBQP-RGE-D-373', 'Eduardo Muñoz Vera', 'Claudio Cárcamo, Joaquín Vicencio , Benjamín Carvajal, Matías Gorigoitia , Nilthon Fonseca', 'Shai Santibañez', 'Se realiza revisión de sectores utilizados por personal, además de revisión de piso 4 por visita de Seremi.', 'Se realizan distinta modificaciones en UMA\'s del piso 4, estas modificaciones están reflejadas en sistema.', 'Marcos Torres realiza mantención a los ascensores A7 2, A15, A17.', 'Se realiza recarga de combustible, la entrada del camión seria a las 11:20am y su retirada fue a las 11:43am.\r\nAntes de la recarga:\r\nT1 12% desde control 1800Lt desde terreno \r\nT2 12% desde control 2100Lt desde terreno \r\nDespués de la recarga:\r\nT1 51% desde control 6900Lt desde terreno \r\nT2 54% desde control 7100Lt desde terreno\r\nNiveles de combustible al finalizar turno.\r\nControl Centralizado.\r\nTanque 1: 52%\r\nTanque 2: 55%\r\nTanque 3: 73%\r\nTanque 4: 71%', 'Se nos informa sobre un olor a quemado desde sala ecomotografia 2, se le informa a personal eléctrico sobre esto, se dirigen a dicho recinto para revisar, personal eléctrico nos informaría que esta sala tendría un dimmer en falla y enchufe con terminales sueltos, dichos enchufes estarían achurrascados.', '', ''),
(374, 'Reporte General de Eventos - Noche - 18-08-2022', 'Noche', '2022-08-18 07:02:13', 'HBQP-RGE-N-374', 'Abel Torres Arancibia', 'Benjamín Toloza, Alexis Jara, Alejandro Saavedra, Javier Arancibia, Oscar Villegas Y Mauricio Maicheo', 'Eduardo Muñoz', '', 'Durante el turno se revisaron los recintos del 5to piso, Alexis Jara con Mauricio Maicheo técnicos del departamento de climatizacion, realizaron las renovaciones hora adecuadas según proyecto. Los equipos que se modificaron son los siguiente\r\nVAV-5-33, VAV-5-34, VAV-5-35, VAV-5-36, VAV-5-37, VAV-5-38, VAV-5-40, VAV-5-41, VAV-5-31, VAV-5-31, VAV-5-41B, VAV-5-46, VAV-5-23A, VAV-25, VAV-5-24, VAV-5-23B, VAV-5-28, VAV-5-61, CW-5-31, CW-5-35 y CW-5-36. Todo esto se realizo debido a la visita de seremi.', '', 'Combustible al finalizar turno.\r\nTanque N°1: 38%\r\nTanque N°2: 56%\r\nTanque N°3: 75%\r\nTanque N°4: 72%', '', '', '');
