INSERT INTO `solicitudes_soportes` (`idSolicitud`, `folioSolicitud`, `aleatorioSolicitud`, `nomSolicitante`, `rutSolicitante`, `deptoSolicitante`, `emailSolicitante`, `telefonoSolicitante`, `ubicacionSolicitud`, `deptoResponsable`, `tipoProblemaSolicitud`, `problemaSolicitud`, `conclusionSolicitud`, `tecnicoSolicitud`, `inicioSolicitud`, `terminoSolicitud`, `situacionSolicitud`, `canceladaSolicitud`, `finalizadaSolicitud`, `nuevaObservacion`) VALUES
(1, 'SS-1-132549', 132549, 'Jorge Cantillano', '161423181', 'ING. OPERACIONAL', 'jorge.cantillano@redsalud.gov.cl', '335011', 'P-5-21', 'Instrumentación', 'Otro (Especificar en Detalle)', 'Estimado.\r\n\r\nFavor de indicar a quien estimes conveniente, la siguiente información respecto a solicitud de adecuación estructurar 97-M, enviada y aprobada por  Pía Escobar que detalla:\r\n\r\n\"Se solicita en bodega de equipos P-5-21 desactivar y modificar puerta de acceso con huella a puerta libre acceso. Eliminar control de huella e imán, para que la puerta se pueda manipular sin problemas. Esto es necesario debido a que será adaptada a una sala de atención de recién nacidos.\"\r\n\r\nHago llegar por correo la adecuación. \r\n\r\n\r\n\r\n', 'Se realiza trabajo.', 'Lizandro Varela (Jefe del Departamento)', '2022-07-05 15:30:02', '2022-08-23 14:30:38', 'Solicitud Finalizada', 0, 1, 0);
